DROP TRIGGER IF EXISTS `tp_addone_2015`;
DELIMITER ;;
CREATE TRIGGER `tp_addone_2015` AFTER INSERT ON `tp_vote_2015` FOR EACH ROW UPDATE `tp_candidate_2015` SET `vote`=
