INSERT INTO `zqbb_candidate_2015` VALUES ('530', 'U201316856', '黎立铭', '法学院', '他是孩子们眼里有些严肃的大队长，总是在谈得欢天喜地的时候板着个脸；他是敢爱敢拼，用行动传达对家乡热爱的联合会会长。服务家乡，看上去简单微小，但却不知道凝聚了他多少的汗水和心血。开始总是不易的，不知道熬了多少次夜，放弃了多少喜欢的事情，花费了多少的口舌才组建起这个团队。发展总是艰辛的，不知道经历了多少次部门改革，遭受了多少次学校的拒绝，投入了多少时间和精力才塑造出团队的精魂。但努力也总是有回报的，看着宣讲受众人数一点点的增多，长江日报-最武汉项目公益活动拔得头筹，联合会慢慢地壮大，家乡，公益，这两个词从此紧紧相连，只因那些梦想，曾经也是支撑你我勇敢走下去的力量。', '2015-11-11 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('529', 'U201317220', '杨世林', '外国语学院', '1、  勇于尝试，发现自我： \na)         开学时，勇于担任排副、担任班级资委、竞选院系学工助理、托福考试助理等。\nb)         尝试做主持、参加演讲比赛、表演节目等自己不擅长的东西。\nc)         尝试街舞，吉他，球类等新鲜事物。\n2、  定位自身，努力追求： \na)         获得军训优秀学员称号，优秀助理称号。\nb)         获得中华日语演讲比赛华科赛场三等奖，日语系朗读比赛三等奖，主持院系活动4次以上。\nc)         获得校运会1500米乙组第八。\n3、 风雨不动，坚持自我： \na)         坚持东操夜跑一年半（一周四次以上，一次4公里）。\nb)         为外院义工体系努力奉献。（累计工时56，直接或间接带队14次义工活动）。\n不需要惊天动地的气势，不需要无人匹敌的震撼，只需要每天比自己优秀一点点。\n', '2011-11-15 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('527', 'U201317212', '肖潇瑶', '外国语学院', '家庭情况上，父母分别在镇子里和村子里教书，月收入均为一千余元。外公中风瘫痪在床，需人常年在旁照拂。现家中因为房子欠下三十多万债务，经济紧张。\n奖助学金、校外家教及勤工助学所得为主要的生活开支来源。\n成绩上，大一由第六名进步至第二，总排名第三，大二上学期为第三。通过英语四级、日语二级。获2014年度国家励志奖学金及学习进步奖学金。\n学生工作上，大二至今为日语1301班团支书，曾为我院新闻部部员，生活委员。\n获奖项有：第九届中华全国日语演讲比赛（邀请赛）并获第二名、2014年国家励志奖学金、学习进步奖学金、新生自强奖学金、日语朗读、片假名书写比赛二、三等奖等。\n志愿活动：湖北省爱心康复中心、大学开放日、我院素拓等的志愿者。\n', '2011-11-15 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('528', 'U201316856', '黎立铭', '法学院', '他是孩子们眼里有些严肃的大队长，总是在谈得欢天喜地的时候板着个脸；他是敢爱敢拼，用行动传达对家乡热爱的联合会会长。服务家乡，看上去简单微小，但却不知道凝聚了他多少的汗水和心血。开始总是不易的，不知道熬了多少次夜，放弃了多少喜欢的事情，花费了多少的口舌才组建起这个团队。发展总是艰辛的，不知道经历了多少次部门改革，遭受了多少次学校的拒绝，投入了多少时间和精力才塑造出团队的精魂。但努力也总是有回报的，看着宣讲受众人数一点点的增多，长江日报-最武汉项目公益活动拔得头筹，联合会慢慢地壮大，家乡，公益，这两个词从此紧紧相连，只因那些梦想，曾经也是支撑你我勇敢走下去的力量。', '2015-11-11 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('525', 'U201416889', '王嘉琪', '外国语学院', '古人云：“男儿当自强”，在当今大学生就业难的整体情况下，党和政府多次鼓励大学生自主创业。大学生创业，从微观上说，解决了大学生自己的就业问题；从宏观上来说，为国家税收做出了贡献，推动了行业的发展。而我，正是一个秉着自强精神，走在创业道路上的大学生。我和我的合伙人，创办了武汉勇川体育用品有限公司。我们是一家由大学生创办的专门从事户外产品营销的公司。勇川作为中国地质大学（武汉）登山队的赞助商之一，成功见证了地大登山队登顶“7+2”计划之一的南美第一高峰阿空加瓜峰（海拔6964m），成为中国首个挑战极限山峰的户外品牌。尽管创业之路，险阻重重，但我相信，只要我秉着自强的精神，一定能攀登上成功的顶峰！', '2011-11-15 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('526', 'U201317220', '杨世林', '外国语学院', '1、  勇于尝试，发现自我： \na)         开学时，勇于担任排副、担任班级资委、竞选院系学工助理、托福考试助理等。\nb)         尝试做主持、参加演讲比赛、表演节目等自己不擅长的东西。\nc)         尝试街舞，吉他，球类等新鲜事物。\n2、  定位自身，努力追求： \na)         获得军训优秀学员称号，优秀助理称号。\nb)         获得中华日语演讲比赛华科赛场三等奖，日语系朗读比赛三等奖，主持院系活动4次以上。\nc)         获得校运会1500米乙组第八。\n3、 风雨不动，坚持自我： \na)         坚持东操夜跑一年半（一周四次以上，一次4公里）。\nb)         为外院义工体系努力奉献。（累计工时56，直接或间接带队14次义工活动）。\n不需要惊天动地的气势，不需要无人匹敌的震撼，只需要每天比自己优秀一点点。\n', '2011-11-15 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('524', 'U201317212', '肖潇瑶', '外国语学院', '家庭情况上，父母分别在镇子里和村子里教书，月收入均为一千余元。外公中风瘫痪在床，需人常年在旁照拂。现家中因为房子欠下三十多万债务，经济紧张。\n奖助学金、校外家教及勤工助学所得为主要的生活开支来源。\n成绩上，大一由第六名进步至第二，总排名第三，大二上学期为第三。通过英语四级、日语二级。获2014年度国家励志奖学金及学习进步奖学金。\n学生工作上，大二至今为日语1301班团支书，曾为我院新闻部部员，生活委员。\n获奖项有：第九届中华全国日语演讲比赛（邀请赛）并获第二名、2014年国家励志奖学金、学习进步奖学金、新生自强奖学金、日语朗读、片假名书写比赛二、三等奖等。\n志愿活动：湖北省爱心康复中心、大学开放日、我院素拓等的志愿者。\n', '2011-11-15 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('523', 'U201416887', '顾一岳', '外国语学院', '作为语言专业的学生，我一直对汉字、字母的历史感兴趣，且自小对图形、设计方面敏感，故发展出字体设计这一特别的爱好。高三百忙之中我仍抽时间看字体设计的资料，练习仿宋体。开学前，我开始了英文书法的练习，这样便能把专业和爱好结合起来，且字体来自书法而现代字体设计又发轫于西方。由于西文书法在国内还算新兴事物，资源贫乏，我便自寻原版教程自学，圆体和罗马体同步练习。我还注意到教学楼的门牌用的是一种古朴的字体。我给这些门牌拍了照，好研究下它们，甚至做成电脑字体！我还加入了英协宣传部和团学联公关部，这样能学习更多，也能发挥自己的专长。日后我还想开办西文书法与字体设计社团，寻找知音也将这门艺术介绍给更多的人！', '2015-11-11 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('522', 'U201416889', '王嘉琪', '外国语学院', '古人云：“男儿当自强”，在当今大学生就业难的整体情况下，党和政府多次鼓励大学生自主创业。大学生创业，从微观上说，解决了大学生自己的就业问题；从宏观上来说，为国家税收做出了贡献，推动了行业的发展。而我，正是一个秉着自强精神，走在创业道路上的大学生。我和我的合伙人，创办了武汉勇川体育用品有限公司。我们是一家由大学生创办的专门从事户外产品营销的公司。勇川作为中国地质大学（武汉）登山队的赞助商之一，成功见证了地大登山队登顶“7+2”计划之一的南美第一高峰阿空加瓜峰（海拔6964m），成为中国首个挑战极限山峰的户外品牌。尽管创业之路，险阻重重，但我相信，只要我秉着自强的精神，一定能攀登上成功的顶峰！', '2011-11-15 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('521', 'U201415189', '李新强', '建规学院', '我叫李新强，来自河南省贫困县。从小学到高中，成绩一直不理想，经常挂科吊车尾，这样的成绩也让自已根本无缘县重高，对于农村学生来说这条唯一的出头之路也无望了，变得浑浑噩噩。后来经过热心的高中老师的指引与帮助，学习了绘画，一种自信和倔强的努力让自己克服种种困难，最终考上一所一本院校—石家庄铁道大学，但是倔强的自己发现还可以做得更好，找回信心的自己最终选择复读，弃理从文，独自一人远离家乡去郑州跨年校考，没有回家，三个月的玩命学习，成绩从开始的吊车尾到高考考过二本线，校考也考过了华科，吉大，武理工，南理工，东北师范等名校。高考后独自一人前往江苏电子厂做了两个月的暑假工。大学期间，加入学院资委宣传部和网络部。担任班级副班长，参加学院与部门各项活动，加入紫菘公寓岗，参加勤工俭学，发过传单，做过移动营销。怀着感恩与感谢，努力做自己最好的一面。', '2011-11-15 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('520', 'U201416887', '顾一岳', '外国语学院', '作为语言专业的学生，我一直对汉字、字母的历史感兴趣，且自小对图形、设计方面敏感，故发展出字体设计这一特别的爱好。高三百忙之中我仍抽时间看字体设计的资料，练习仿宋体。开学前，我开始了英文书法的练习，这样便能把专业和爱好结合起来，且字体来自书法而现代字体设计又发轫于西方。由于西文书法在国内还算新兴事物，资源贫乏，我便自寻原版教程自学，圆体和罗马体同步练习。我还注意到教学楼的门牌用的是一种古朴的字体。我给这些门牌拍了照，好研究下它们，甚至做成电脑字体！我还加入了英协宣传部和团学联公关部，这样能学习更多，也能发挥自己的专长。日后我还想开办西文书法与字体设计社团，寻找知音也将这门艺术介绍给更多的人！', '2015-11-11 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('519', 'U201315297', '李豪', '建规学院', '过去的这一年里，有四十多天，在路上。而这是华中科技大学假期的整整一半。火车坐了十余趟，自行车骑了五千里。从武汉到川西到藏区，从武汉到海南到海角到天涯。那是一些不一样到永远忘不了的日子。第一次在雅安看到校舍坍圮、无辜可爱的灾区孩子对于支教的自己带去书籍的喜爱，那是一种喜悦、一种心酸；第一次在康巴高原粮草全无、体力透支却不得已坚持骑行，那是一种孤独、一种无助。第一次在巴塘、理塘看到终年不化、巍峨壮丽的雪山，那是一种极度震撼的视觉体验。还有那一次，从海拔四千多米的垭口冲下却突然发现裹满泥沙的刹车失灵，那是一种从未感受过的对于活着的渴望……\n    什么是有价值的人生？亦或，什么是人生？\n    我并不知道。从海口一路到海南最北木兰头，再到最东铜鼓角，最后来到海南之南鹿回头。 一路南下，一路寻找。终于明白：生命的意义、年轻的意义不会只因祈求而平白降临。我希望：把自己扔在路上，路上去找寻经历，经历让生命充满惊喜，惊喜让生命更加精彩，精彩让生命更有意义。\n', '2011-11-15 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('517', 'U201215347', '张雷', '建规学院', '“授人玫瑰，手有余香。”这句话形容张雷再适合不过。在大学的近三年内，他参与了多种多样的志愿服务、学生工作。\n从院级的爱心义卖，迎新志愿者，建筑学评估布展，到校级的校庆方阵队，大学开放日志愿者，再到走出校园的三店一中支教，红旗小学支教，拿破仑文物展志愿者••••••他获得的不仅是一份经历，体验，更收获了心灵的满足与快乐。\n学生工作中也少不了他的身影，他身兼多职，启明读书会、校学生会新闻部、组织部•••并且都取得了不错的成绩。\n“我坚信，在志愿服务的道路上，我定会继续前行。”他的脚步不会停歇，梦想之火永不熄灭！\n', '2011-11-15 19:00:00', '0');
