INSERT INTO `zqbb_candidate_2015` VALUES ('515', 'U201114653', '袁怡欣', '建规学院', '本人系建筑与城市规划学院建筑1103班学生，来自祖国边陲小镇伊宁市，自小生长在新疆生产建设兵团，成长中深受“热爱祖国、无私奉献、艰苦创业、开拓进取”兵团精神的影响，直到如今的大学生活。大学里一直努力学习，成绩优秀；认真完成学生工作，曾任班级体育委员，班级学习委员，建规学院资委会宣传部部长，建规学院资委会资助主任。\n同时一直坚持自己的爱好—体育运动。我自幼练习体育，从05年起至今已有十年，上大学之后虽然有过不想继续的念头，但是也坚持过来未曾放弃，这一点则要感谢一起陪同的伙伴们。在体育运动的过程中，去寻找另一个自我，欣赏另一片天地，以及去经历不同于其它的欢乐悲喜。\n部分获奖情况：\n2012-2013校三好学生\n2012年校运动会800米第一名、1500米第二名\n2012年省大学生定向越野锦标赛积分赛第三名、团队赛第五名、百米赛第六名\n2013年全国学生定向越野锦标赛百米赛二等奖、短距离、接力赛、团队赛三等奖\n2014年省大学生定向越野锦标赛积分赛第一名、团队赛第二名\n2014年全国学生定向越野锦标赛积分赛第五名、优秀运动员\n\n', '2015-11-11 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('513', 'U201114653', '袁怡欣', '建规学院', '本人系建筑与城市规划学院建筑1103班学生，来自祖国边陲小镇伊宁市，自小生长在新疆生产建设兵团，成长中深受“热爱祖国、无私奉献、艰苦创业、开拓进取”兵团精神的影响，直到如今的大学生活。大学里一直努力学习，成绩优秀；认真完成学生工作，曾任班级体育委员，班级学习委员，建规学院资委会宣传部部长，建规学院资委会资助主任。\n同时一直坚持自己的爱好—体育运动。我自幼练习体育，从05年起至今已有十年，上大学之后虽然有过不想继续的念头，但是也坚持过来未曾放弃，这一点则要感谢一起陪同的伙伴们。在体育运动的过程中，去寻找另一个自我，欣赏另一片天地，以及去经历不同于其它的欢乐悲喜。\n部分获奖情况：\n2012-2013校三好学生\n2012年校运动会800米第一名、1500米第二名\n2012年省大学生定向越野锦标赛积分赛第三名、团队赛第五名、百米赛第六名\n2013年全国学生定向越野锦标赛百米赛二等奖、短距离、接力赛、团队赛三等奖\n2014年省大学生定向越野锦标赛积分赛第一名、团队赛第二名\n2014年全国学生定向越野锦标赛积分赛第五名、优秀运动员\n\n', '2015-11-11 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('514', 'U201215347', '张雷', '建规学院', '“授人玫瑰，手有余香。”这句话形容张雷再适合不过。在大学的近三年内，他参与了多种多样的志愿服务、学生工作。\n从院级的爱心义卖，迎新志愿者，建筑学评估布展，到校级的校庆方阵队，大学开放日志愿者，再到走出校园的三店一中支教，红旗小学支教，拿破仑文物展志愿者••••••他获得的不仅是一份经历，体验，更收获了心灵的满足与快乐。\n学生工作中也少不了他的身影，他身兼多职，启明读书会、校学生会新闻部、组织部•••并且都取得了不错的成绩。\n“我坚信，在志愿服务的道路上，我定会继续前行。”他的脚步不会停歇，梦想之火永不熄灭！\n', '2011-11-15 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('148', 'U201313093', '聂秀泉', '公共卫生学院', '我是一个能够坚持的人，举个例子：我从上大学以来，从来都是在7点以前起床，只有大一下学期刚开始一周因为感冒在七点以后起床；我还在大二上学期开始记账，一直坚持到现在；我坚持每个寒暑假健身，每天50个俯卧撑，200个仰卧起坐，10个引体向上，等等。坚持使我受益匪浅，早起使我每天精力充沛，有更多的时间去做更多的事情，毕竟一日之计在于晨，我的学习成绩也名列前茅；坚持锻炼使我有强健的体魄，有充足的体力做我想做的事，我是我们班的体育委员，在院足球队。坚持使我信心倍增，我相信，我想做的事，只要我坚持，就没有什么做不到！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('149', 'U201117275', '牛晓歌', '公共卫生学院', '大学期间，我学习勤奋，自立自强，乐观进取，积极参加各种公益活动，克服家庭困难，取得优秀成绩，并在各方面提升自我。\n我来自农村，父母以种地为生。父亲患有糖尿病，常年吃药。母亲患有心脏病二十余年，几乎没有劳动能力，两年前手术，费用几万元，身体仍未恢复。还有年迈残疾有精神疾病的外婆需要赡养，医药费开销很大，收入微薄，生活拮据。\n课余时间我坚持做各种兼职。大一时申请到公寓值班的勤工助学岗位，之后每学期都会做家教，最多同时兼职三份家教，赚取生活费。加上获得的各种奖学金，生活费已能自足，每年还有3000元剩余来补贴家用。\n学习方面，至大四上结束，总加权89.39，总排名专业第二。获得过三次“国家励志奖学金”，学习优秀奖学金，社会公益奖学金，上海复兴医药奖学金等。并通过了大学英语四六级，计算机四级等。\n我喜欢参加公益活动也积极参与科研活动。希望做一个全面发展的人。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('150', 'U201212684', '杨卫华', '公共卫生学院', '家庭情况：是少数民族，来自山区。爸妈均已60多岁，在家务农，无工作能力。妈妈有高血压，今年正月病倒过一次，不能做体力活。姐姐有三个孩子，也在读书。\n学生工作：从大一开始担任班上的资助委员，组织过很多义工，包括到森林公园种花，整理图书馆等。2014年参加院系毕业晚会“梦飞舞”的筹划并参与演出舞蹈剧“梦”和小人舞，以及负责拳击节目“搏击操”。在同济资助中心担任助理一年，为同学服务，最终获得“优秀中心助理”。加入院系资助委员会，从2014年下学期开始担任会长，和会员一起开创了辛亥革命纪念馆志愿者的义工，并获得“2014年华中科技大学优秀院系资助助理委员会”。\n生活：从大一开始学费是贷款，生活费大部分是自己做兼职赚的钱。与寝室和班上同学相处融洽\n兴趣爱好:在2014年加入街舞社，在街舞社里面学习爵士舞，虽然自己学的很慢，但是我从来没有放弃过，依然为了自己的爱好在努力，目前正在准备2015年“梦飞舞”的开场舞。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('151', 'U201213145', '肖芳', '护理学系', '我是一个来自湖北洪湖的农村姑娘。在学习生涯中，十分感谢能多次获得国家补助继续学业。从小，我就很热爱读书。大学期间，我也靠自己在暑假或有空时做兼职，比如，发传单、做家教，赚取学费和生活费。\n进入大学后，虽被确诊患有骨髓增殖性肿瘤，需要经常去医院就诊，但我依然时刻保持学习的劲头，专业成绩排名第一。因此，先后多次获得学习优秀进步奖、国家励志奖学金、曾宪梓奖学金等等。而且，在学习气氛的带动下，我们寝室所有成员班级排名均在前十。班级成员的挂科率也有所下降。这是我觉得很自豪的事情。\n另外，我还报读了双学位，积极参加各种校内校外的活动。我担任辅导员助理两年，并在第二年成为组长，帮助辅导员处理院系及班级事务。多次积极参加系里“化蝶飞”等重大活动。热爱运动，参加了体育舞蹈队，提升自己的综合素质。也多次跟着老师参加科研，在她们的带领下，了解到科研的重要性与科研的要求。另外，我参加过地铁义工，参加过爱心病房，校外探访过敬老院，与老人们聊天，其乐融融。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('152', 'U201210512', '陈冰鑫', ' 基础医学院', '我的父亲在我初二时患肝癌去世，之后我的母亲便扛起了家庭重担，供我读书。\n现在，我读大三，母亲在老家做保安维持生计。为了减轻母亲的负担，我在业余时间做兼职，比如说家教，学校公寓岗，联通营业厅帮忙等等。通过我兼职所得，我基本上不需要家里负担我的生活费。最让我开心的是，上个学期，我用我家教的工资，带母亲在十一假期去重庆旅游。全程的吃，住，路费，都是我来出。\n对于学业，我一直严格要求自己。我知道，给我们上课的都是特别优秀的老师，只有好好听课才对得起他们的辛勤讲课。上课时，我认真听，仔细想；课后，我认真完成作业，主动去思考老师留下的问题，去查阅资料。我很感谢同济浓厚的学风，鞭策我在知识的海洋里面遨游，享受。\n对于学生工作。大一大二，我在主校区参加了红十字队，不管是爱心募捐还是急救培训，我总是活跃在第一线。大三，我加入了基础医学院学生会，成为了学生会的副主席，准备春华秋实，筹备游园会，我在这些工作中尽情挥洒，满满收获。\n我最喜欢一句话：未来的你一定感谢现在努力自强的自己。所以我相信，现在我在跑，未来我在笑！\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('153', 'U201210534', '胡紫薇', ' 基础医学院', '  我的性格就像我的名字——紫薇一样，自强不息、蓬勃向上。\n   学习方面：有追求、有目标，大二加权90+，获学习优秀奖学金，辅修德语。\n   社会服务方面：乐于奉献，积极参加各类公益活动，爱心病房志愿者、植物园义工、寒假返校宣传活动宣讲人、挪威交换生生活志愿者、万松园社区关爱老人志愿者…\n   学生工作方面：担任八年制医学生协会对外交流部IFMSA-SCOPE负责人，在每年暑假接待外国交换生的同时也送出去一批学长学姐去国外交流；加入艺术团艺美队\n勇于挑战的我积极参加各种活动：作为同济代表参加了在湘雅举办的第四届全国八年制医学生论坛；作为中国代表参加IFMSA在日本东京举办的Sub Regional Training;参加北协和超级课程，参会费都是自己通过办补习班，家教挣来的。\n    在我看来，自强就是在挑战自我的过程中活出人生价值的过程。愿我的自强能给更多的人带来正能量！\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('154', 'U201312907', '金瑾', ' 基础医学院', '“小草也能折射太阳的光辉”一直作为自己的座右铭。不断追求，不断完善，提升自我，在大学让每一天都过得充实而有意义。自己勤奋学习，刻苦努力，大一及大二上学期加权一直在90以上。英语四级和六级一次通过。现阶段正在做校级大创项目的实验。在班上担任学习委员一职。在华科参加了生科院辩论赛获得第一名。在同济也参与了许多学生工作，在社联行政监察部，连同其它社联小伙伴举办社团文化节，在校学生会学术科创中心，举办了万圣节嘉年华，双学位交流会，以及新年游园会的筹备。除了学习与学生工作，自己对生活也充满热情，积极向上，参加了艺术团爵士舞队，每周三次队训，在生命之光中长期义务做家教，以及是青协爱心导医长期义工的一员。周末也会抽出两个半天在外兼职做家教，能够解决自己的生活开销而不给父母增添负担。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('155', 'U201210459', '宋安妮', ' 基础医学院', '我来自湖北省咸宁市的一个农村，一家四口人，有一个妹妹正在读高中，虽然家境并不富裕，入学初就办理了助学贷款并一直接受国家的资助，但我一直保持着一颗乐观积极向上的心，进入大学后，我一直尝试着锻炼自己，申请担任班级团支书，并和同学们在特色团日活动中取得了校20佳的成绩，同时我积极向党组织靠拢，于2014年11月28日成为一名党员，进入医学院后，我担任了基础医学院的资助助理负责人和班级的资助委员，感同身受地为身边有需要的同学服务，大一大二在课余时间我做过多份兼职，家教、推销奶茶，并连续两年暑假打工挣钱，通过自己的实际行动减轻家庭负担，同时我也积极参与课余活动，参加过院系举办的征文比赛，2014年秋季参加了50公里毅走活动，并成功了坚持下来。在学习方面，我也没有放松，去年一年取得了较大进步，加权达到90+，上个学期很幸运地加权取得了班级第一的成绩，并获得过新生自强奖学金、优秀学生干部称号、国家励志奖学金，通过了英语四六级考试，并且六级成绩从第一次的487进步到600，同时现在我也在慢慢接触科研活动，生活虽然忙碌，但是很充实，我一直希望这样的我能够给大家带来正能量，而我也会一直坚持这么做。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('156', 'U201313325', '汤航', ' 基础医学院', '我人生的座右铭是：“选择不了起点，就努力改变终点。”\n因高考失利，我与口腔医学擦肩而过，被调剂至护理专业。但我没有错过转专业的契机，而是独自搜集转专业信息和动态，努力学习。最终以优异成绩通过笔试和面试。\n同时，我学习丝毫不放松，大一是护理班第一名，在口腔班位列第二。获得国家励志奖学金，新生优秀奖学金，新生自强奖学金等奖项。\n义工活动是我最大的爱好。大一，我是义务家教小老师和地铁指路小能手，每周六我都会坐一个小时公车为一个男孩家教两小时，然后再赶去做两个半小时的地铁义工。大二，我是革命博物馆的解说员。因为我的勤勉，我获得了“武汉市优秀地铁义工”，“优秀教员”等荣誉称号。\n纵然父亲每月800元的工资是唯一经济来源，爷爷重病，弟弟与我上高校使我家经济窘迫，我也曾自卑过，但最终还是战胜了自己的心魔，努力朝远方风雨兼程。因为我终于明白:最可怕的不是物质的贫瘠，而是精神的荒凉。\n因此，在我的世界里，逆风也能高高飞翔！\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('157', 'U201313258', '王佩佩', ' 基础医学院', '我是从农村走出来的大学生，也是我们村考得最好来上大学的。我们家有八口人，曾祖母九十高龄。我深知家人供我上大学的艰辛，所以从不敢懈怠。为了减轻家人的负担，大一时我申请了学校的勤工助学岗位，大二一直兼职做家教。知识改变命运对于我这样的农村孩子来说确实是真理，所以我一直努力学习，加权排名专业第二。通过普通话考试及英语四六级考试，在王小川老师的实验室参加科研活动。大二获得校三好和国励奖学金。我坚持做志愿者活动。大一在生命之光做了一年义务家教并被评为优秀教员。大二加入青协导医部，负责同济医院协和医院和第一医院的导医活动。为了锻炼自己，大一暑假到山西石楼的山区里做了题为“教育之殇：贫困山村“撤点并校”之痛——以“山西省吕梁市石楼县”为例”这一暑期社会实践并获得校优。大二参加五十公里毅走活动，寒假参加西安生存大挑战。我一直努力做好每一件事，克服学习和生活上一个个困难，一直期待做最好的自己！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('158', 'U201312937', '王珊珊', ' 基础医学院', '在过去快两个学年里，我一直积极参加学校里各种公益活动，一直以来的坚持不懈换来了我现在工时超过了100个。其中，我一直坚持参加地铁义工活动，已经坚持了一年，在活动中我不仅收获了丰富的工时，也认识了更多品行优良的同学，从他们身上以及我参与的活动中，我学到了很多。另外，我上学期也是校史馆阳光解说员的一员，为八方来客介绍我校的光辉岁月和历史沿革，我自己也在解说过程中越发对自己身为华科以及同济的一员骄傲和自豪。本学期我参加了青协的爱心导医部，希望为广大病患提供自己力所能及的帮助。除上述活动外，我还参加了大学生开放日的接待工作和毕业典礼的志愿者，人车分流的志愿者等等。\n当然，在积极参加公益活动的同时，我也没有忘记学习和专业研究。我的学习成绩一直保持在前列，虽然目前还不算拔尖，但我会一直努力下去的。另外，我这学期还参加了组织学与胚胎学的周琳老师带的科研小组，积极进行科研工作，希望能取得一定成果，为大学添上灿烂的一页。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('159', 'U201313252', '蔡磊', '药学院', '由于家贫学优，上高中时我成为了一名珍珠生，通过浙江新华爱心教育基金会，我接受了来自各界爱心人士的关心和帮助，理事长张爷爷曾多次告诫我们，在自己有能力的时候尽己所能帮助他人。而现在，我正在用行动践行着珍珠生的承诺。\n首先，我积极参加各种校内外义工活动。如图书馆义工、宿舍楼栋义工、爱心导医、爱心病房、献血车服务、“一站到底”火车站志愿服务等，目前总工时69小时。\n其次，我也积极参加社会实践，大一暑假参加了学院“合理用药”社会实践，带领3名组员到武汉八大高校实地调查采访，完成了暑期社会实践。\n另外，作为珍珠生，我们也开展了自己的志愿服务。如汉口江滩环保活动、武汉爱乐音乐学校志愿服务。还有很多珍珠生互助的活动，如新生配对帮扶、杉树计划、导师计划等。课余时间还参加过爱心募捐、无偿献血。\n最后，从大一下学期开始，我就坚持每天推送武汉天气，争取给同学们带来便利。长期的坚持得到了大家的肯定和鼓励，我也会继续下去。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('160', 'U201313224', '崔世豪', '药学院', '我的家乡在农村，家里经济情况很不好，父亲长期在外打工，母亲在家照顾我们兄妹俩。母亲经常告诉我“我们家里穷，你爹妈没本事，在村子里面抬不起头，以后就指望你了。”我从小也就很体谅父母，比同龄的孩子多了份责任心，更早的学会了自强。我从小就立志要考上一个好大学，将来做出一番成就报答父母，回报养育我的家乡。我也不断的为之付出努力。人穷但不能志短是我初中的座右铭，在中学我把学习作为第一任务，把勤俭作为第一要求，凡事都要追求最好。终于天道酬勤我实现了儿时的梦想，考上了一个好大学。然而大学的学费也增加了好多，在上大学之前的那个暑假里我选择了去打工，因为自己只是一个学生，没什么技术，我只能干一些体力活，帮别人装修房子，几天工作下来，手上磨出了好多泡子，我不但没有感觉到痛苦反而感觉自己非常的幸福。因为我这是在为自己努力，为自己的梦想而努力。这么多年来，我切切实实的感觉到了自己通过努力，真的帮到了自己，帮到了这个虽贫困但是很幸福的家庭，经过这些经历，让我相信，不管有什么困难，只要努力就一定能克服，不管梦想多么遥远，只要坚持不懈，就一定能实现。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('161', 'U201313170', '康双清', '药学院', '爸爸在我小时候就去世了，妈妈抚养我们姐妹四个妈妈吃了很多苦但也很勤劳，不过她最后还是因为疾病在2013年离开了我，她走之前一直对我说，要好好读书，她走了，我也确实好伤心，可是我也没多少天就要高考了，就冲着她一直想送我上大学的梦想，我也得好好读书啊，高考过后的三个月，我就留在学校给学校做招生老师，到了大学后，我也做家教和一些兼职，并且2014年暑假，我回家之后和两个同学一起被应聘去做暑假补课的老师，大一的寒假我没有回家就留在学校兼职，大二寒假是回家到县城里做了兼职，而且我的学费也是减免的，所以上大学以来，我基本上也可以自给自足，我的三个姐姐两个都已结婚并有孩子，他们也都是靠务农为生，家里也很拮据，所以我读大学也并没有给他们增加多少负担。并且从这些工作中我学会了很多东西，在学校里的时候我的室友也对我很好，我觉得我的生活虽然没有了一些人的陪伴，但是他也教会了我接受现实，快乐生活，所以我们班上的同学总被我嘻嘻哈哈的表情逗乐，觉得我是一个没有烦心事的小孩，其实正是因为你们，我才觉得快乐。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('162', 'U201313246', '田成', '药学院', '我叫田成，来自河南的一个农村。家里有五口人，爷爷、奶奶、妈妈、弟弟和我。爸爸于农历2014年2月11日去世，让本来就经济状况一般的家庭更加贫困。家里主要靠妈妈一个打工赚钱。爷奶都已年迈，弟弟还在读初中。但是自己并没有因此而消极处世，依然以一种阳光乐观的态度对待生活。生活中总是充满了欢笑。而且积极参加学校和院系组织的活动，如校运动会、十月华章、院运动会、青春颂等。班级的一些活动也积极参与。\n平常有时间也喜欢做义工，在主校区曾坚持过一学期爱心培智、现在做爱心助学的幼儿园的义工以及艾协的爱心病房的义工，爱心病房已坚持一学期。\n现在学费是靠国家贷款，自己也在做兼职，经济上基本实现独立。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('163', 'U201213336', '贺哲', '医药卫生管理', '1） 学习 大三上加权 4/38 。英语四级532，六级485。所在团队在医药卫生管理学院本科生学术论坛上获“最佳选题奖”；参与大创并跟随学院导师做课题，已在论文发表阶段\n2） 学生工作 2014年3月至今为医药卫生管理学院分团委副书记，为本院团干的第一人；2013年9月-2014年3月为院系资助助理，2014年3月至今为班级资助助理；2014年5月至今，为华中科技大学同济医学院就业办助理。\n3） 志愿服务 曾做过爱心病房，汉口火车站，爱心导演，大学开放日，毕业典礼等志愿者，大二至大三上，工时近90个；2013年6月至2014年6月为武汉革命博物馆志愿者，负责解说工作；获“同济医学院十大杰出青年志愿者”称号\n4） 文体活动 第十三届春之约八大院系辩论赛上,获”单场最佳辩手”称号；2014年度同济医学院5.4演讲比赛中,荣获同济医学院第一名；医药卫生管理学院第三届师生赛歌会上，荣获二等奖；文章“梦中夜话，写给母亲”被华中科技大学校报征用；连续两年在学院晚会春之约晚会上出演,在第十二届社团文化节(医科)演出\n5） 社会实践 2013年度暑期社会实践获校级优秀团队；2014年度暑假社会实践获“华中科技大学暑期社会实践优秀个人称号；大二暑假在第四军医大学西京医院人力资源部实习一个半月，并受到老师好评。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('164', 'U201313383', '灵芝', '医药卫生管理', '大一期间我加入了“生命之光”爱心探访队，每周日到“星达敬老院”为孤寡老人送去温暖，为ta们做力所能及的事。我曾两度负责爱心卖报活动，第一次是为患病学姐募捐，活动期间偶遇一位好心人，经过近两周交涉，拉到了20000元善款。生科院大一新生是一个特殊群体，这里的大多数人大二之后便搬到同济校区，所以会有一些非专业书籍，同学们会选择留给学弟学妹。如何才能更好的收集这些书，我们付出了很多脑力和体力劳动，最终募得图书2356本。\n“一站到底”汉口火车站志愿服务团队共有49名长期志愿者，分三组，我们每周末都会到汉口火车站进行志愿服务，工作时间从08:00至16:00，三个小组循环往复，小组长主要负责当天志愿工作，组内自由协调在岗服务时间，有效调动了同学积极性！半年的实验阶段取得了良好的成绩，我的下一步计划是扩招志愿者，让我们的志愿服务覆盖到武汉另外两个火车站，使“一站到底”成为我科特色团队，帮助到更多的人。\n我还参加了“飞航杯”环保创意演讲比赛 “国旗仪仗队”到“石门峰”扫烈士墓 “在路上”人车分流、世界艾滋病日宣传楚天学子 “树”立新“锋”及“hustfound”失物招领平台的创建及宣传等一系列活动。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('165', 'u201212765', ' 黄筱頔', '第一临床学院', '我自幼父母离异，由母亲独自抚养长大，父亲从未提供过任何帮助。母亲原属于河南省豫南监狱工人，于1999年下岗，一直靠打工维持生计。外祖母五年前骨折，加之老年痴呆至今生活不能自理，也要靠母亲赡养。\n我大一全年的加权排名为专业第三，大二全年的加权排名为专业第一。\n我获得过新生社会公益奖学金、国家励志奖学金、校三好以及优秀共青团员称号，英语六级，计算机三级，参加了入党积极分子培训班（24期）并结业，大二被评为2013~2015年度学习特优生并参加了大创项目。我大二在同济青协阳光医学生部门工作一年，校学生会工作一年，大二暑期参加了赴平遥社会实践小组，还担任班级组织委员。\n我大一曾参加勤工俭学，平时空闲时间及寒暑假也会找兼职，努力减轻家庭负担。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('166', 'u201212850', '李舒心', '第一临床学院', '从上大学以来追求音乐艺术至今，大一加入笛箫协会，坚持练习从中级水平到演出10级曲目，进入演出队，后又承担授课任务，被评为优秀指导。参演机械学院“风华竹韵”音乐会节目《灞柳情》，“武汉笛箫峰会晚会“节目《侗乡之夜》，及各种小型演出，路演等。\n大二担任笛箫协会副会长，葫芦丝队队长，财务负责人，从零开始用一年时间带出一支有一定技术水平演出能力的表演队伍，付出很多心血，解决各种人员，资源，技术困难，负责并参演“风华竹韵“葫芦丝节目《多情的巴乌》，“笛箫峰会”节目《情醉》，“新年游园会“节目《瑶族舞曲》。同时加入了艺术团民舞队，并学习钢琴，坚持每周练习，取的还不错的进步。加入学生会文艺中心，为游园会等活动出谋划策并参与负责《凤凰于飞》等节目。负责并表演“爱心病房”演出。被社联评为优秀社团干部。\n    大三参加“春华秋实“表演《民乐合奏》，”社团文化节”表演《玉生烟》，“三月美”表演《咏春》。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('167', 'u201212776', '李天冶', '第一临床学院', '我是华中科技大学同济医学院的一名大三学生，儿时父亲下岗，母亲没有固定工作，不久就因为家庭矛盾而使得这个不幸的家庭解体，而我与母亲相依为命。我的母亲十分的要强，虽然患有严重的心脏病仍然坚持供养我上学。起初来大学，就带着一种强烈的自卑感，但是阴差阳错的一次杨叔子院士的赠书仪式，以及学生报名处的接待老师的热情帮助，更是历任的各个辅导员的理解与帮助，使我认识到这个学校的爱与关怀。于是我立下决心一定要走出低谷，于是每每都在其他人都在休息时，在自习室拼搏，一直都会很努力的学习医学知识。在家乡政府的宣传下，我获得了政协委员们的资助，而且我也在坚持参加不论是学校安排还是自己寻找的社会兼职活动。在大一时虽然通过了中德班的笔试而且在前三十之列，但是面试没有通过，成为我的一个遗憾，所以在大学，我自学了德语，在同学的帮助下，能够达到a1水平以上。而且也顺利的通过了英语四六级考试。我没有什么惊天动地的可歌可泣的优秀事迹。我希望我会更加强大，能够用自己的力量回报掘井之人。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('168', 'u201212830', '彭春锦', '第一临床学院', '本人长期坚持志愿服务，大学期间曾参与多项志愿服务活动，包括图书馆服务、教学楼清洁、爱心卖报、九峰山烈士陵园扫墓、“旧书圆新梦”、爱心导医，武汉血液中心义工、地铁义工、爱心病房等。\n大二坚持中山公园站地铁义工一年，大三开始坚持同济医院爱心病房义工至今。\n大二期间参加广东省东莞市第一届莞曦公益策划大赛，本人作为大学生导师指导高中生团队进行公益项目策划并付诸实施。团队已与台湾新北市二重中学校长取得联系并获得技术支持，并获得了东莞市环保组织的项目资金。\n本人在2014年获得“同济十佳青年志愿者”称号，在coursera学习霍普金斯大学课程《Health for All Through Primary Health Care》并通过考试获得完成证书。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('169', 'u201212764', '王楠', '第一临床学院', ' 有一个女孩，从有了记忆她就明白她要为改变自己的命运而奋斗，她要把自己破碎的家支撑，她要背着她的爸爸妈妈还有弟弟妹妹走出大山的贫苦。她没有别的办法，妈妈告诉她要好好学习，出人头地。于是她就踏上了这条路，但是路程却坎坎坷坷。一间漏雨的土屋，两本教科书，就这样的知识能改变命运吗？她不知道，但她要尝试。和她一起入学的同学们一个个都走了别的路，只有她还在走最开始的路。她靠自己的奋斗把自己送进众人瞩目的名校，靠自己的努力把自己从被抛弃的角落转换到人人称赞，她也支起了一个不幸的家。\n   艰难走进大学，却又一个人与疾病的战斗，可她不得不坚持。如果她倒下了，她的家就要碎了，她也要永远轮到艰苦的命运中。在医院与学校之间奔跑，在教室与寝室之间拼搏，在学习与主席团工作之间焦头烂额，一切都走过了，她要为自己的命运而奋斗，要为维护自己的完整的家而奋斗。\n   大学里的她又顺利走过了三年，三年里成绩名列前茅，积极参加各种大学生的活动，完善自己，闯过学生会，从小小部员直到学生会副主席；担着班干，副班，学委不在话下；干过假期兼职，发传单，扫楼，做推销；做过初中，高中家教，和他们一起进步。。。不是最优秀的生活，但是丰富的成长经历。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('170', 'U201212848', '谢晓红', '第一临床学院', '在舞蹈方面执着追求，从高三暑假开始至今坚持学习拉丁舞，大一开始加入由学校艺术团与学校体育部合办的拉丁舞队，曾在2014-2015年担任一年队长，每周至少有两个晚上的常规队训，队里接到表演任务时甚至每天晚上负责训练，回到寝室自己再继续练习，寒暑假回家或在当地舞蹈机构培训或自己找视频练习；2014-2015年曾参加过2次同济医院的暖心病房活动，参加2014年、2015年共2场新年游园会，受协和口腔科邀请参加2014.11.8第四届湖北省口腔学术会议晚宴表演，和万圣节艺术团与学生会合办的晚会表演以及社团文化节的演出。现在准备2015中国湖北国际体育舞蹈公开赛；\n  大二上学期机缘巧合之下加入校越剧队，刻苦训练，2014年代表学校参加湖北省大学生艺术节，其中一个节目获一等奖，并在之后参加优秀节目汇演，2014.10参加华科金秋音乐节越剧专场演出；\n  和舍友志趣相投，平时会找各类舞蹈视频一起练习，我们报名参加了2015三月美，节目《咏春》获得好评，给领导留下较深刻印象，并希望我们可以在青年节的晚会上再表演一次。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('171', 'u201112806', '熊之勇', '第一临床学院', '医学是我的理想，数十年来为了这一理想我不断奋斗着，终于高考让我的医学之梦成为了现实。大一是充满诱惑的一年，自由的气息使人沉醉，面对这一切我毫不动摇，终取得年级第一的好成绩，并获得国家奖学金以及三好学生和特优生的称号。大二学年，在面对繁重的医学基础课的同时，为了提升自我，自己又参加了基础科研活动，为了做到科研及课程两不误自己常常挑灯夜战到深夜，并通过努力再一次获得了三好学生的称号。大三大四可谓是忙碌的两年，自己真正的进入了临床的学习，深刻的体会到了临床环境的复杂，内外妇儿的课程压力更是把人压得吐不过气，与此同时自己还肩负着大班学委的责任，抱怨过，动摇过，但最终还是坚持着，每天往返同济与协和只为将理论和临床结合的更紧密，自己也曾上台参加了长达七个半小时的手术，与此同时忙碌的同时自己还参加了纸艺协会，为的就是让自己的学医之路变得更精彩。因为爱着临床，所以想不断提升，前不久自己又参加了同济医学院临床技能大赛并取得二等奖的好成绩。我深知自己未来的路还有很长，但我想我会执着的坚持下去。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('172', 'u201112794', '钟绍平', '第一临床学院', '立志科研，砥砺笃行\n我从小对自然科学具有浓厚兴趣，学医期间，我深感我国基础学科还远落后于国外，生物医学领域内几乎所有突破性的发现都是在国外完成的。因此，我有志于从事神经系统疾病的基础研究，希望将来能结合自己的医学背景将基础研究与临床应用更好地衔接起来。从2013年开始，我就在病生系朱铃强教授组随研究生参与Tau蛋白对Dynamin家族调控机制课题，学习Western Blot、PCR等实验技术。2014年5月，我作为负责人，在神经内科副教授徐岩的指导下申报了大创项目“BDNF/TrKB 信号途径在左旋多巴诱导异动症发生中的作用”，尽管面临着克服经费不足、实验条件简陋等种种困难，依然不言放弃，寒假期间也在学校做实验，终于独立地造出了帕金森病异动症大鼠模型，成功完成预实验，目前还在进一步的实验中。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('173', 'U201315153', '郭雪华', '计算机学院', '来自农村的我初进大学时很自卑，因为很多时候我看到自己和别人却有很大差距，自己进入的计算机专业是被调剂的，自己却对计算机专业一窍不通，甚至连打字都不会。面对着那么多的学霸，无处不在的大神，我也一度很失落，对未来很迷茫。但是我不是轻言放弃的人，既然来到了这里，我就要做到最好。明确自己的方向，对未来的一切充满了动力，我开始从大一下自学PHP，更是在大二加入餐谋网。对于基础尚浅的我，无疑压力是很大的，但是我克服困难，成功的完成了任务。大二下我又开始制作另一款智能牙刷APP程序。现在的我不似刚进大学的时候那么羞涩自卑，相反我很开朗活泼。我时常告诉自己，自己想要的东西就应该努力争取，怨天尤人于事无补。怨天尤人于事无补，只有自己看清了和别人的差距，不断地努力才能赶上甚至超过别人。父母为我们做了很多，我们要做到就是减轻父母的负担，成为父母而骄傲。希望我的故事能让大家有些收获。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('174', 'U201315137', '李若愚', '计算机学院', '企业家精神的公益创业项目，使受众在产业链中能真正受益。先后参与了“幸福虫”、“艺纸深情”等公益项目，其中“幸福虫”获得了“创青春”大赛公益赛金奖。目前带领团队运营了“Fitnow”、“落叶工艺坊”等四个项目，其中“Fitnow”通过打造O2O闭环使校内学生得到定制性、志愿性的私人教练服务，努力提高学生身体素质；“落叶工艺坊”致力于再利用华科落叶的价值，打造第一个高校“树文化”工艺坊。目前正负责承办校团委“求是杯”公益创业大赛（创青春校内赛），分管组委会培训组，希望能为校内热爱公益的团队提供比赛的平台，更希望为提升华科校内公益创业的氛围，培养出有社会责任感的新一代青年而努力。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('175', 'U201414950', '李智炜', '计算机学院', '我是一位身残志坚自强标兵。在2014年高考结束的夏天，当我满怀期望准备成为一名华科学子时，不幸遭遇车祸，左膝受到了重创，诊断为前后交叉韧带断裂。我在医院中度过了一段令人煎熬的时光，本该拥抱大学生活美好的我，却只能一动不动地待在床上。然而抱怨终归于事无补，我决定选择笑对一切，赶走消极情绪，不让陪伴的父母担忧，还通过网络了解大学同学的生活并和他们积极交流。当我知道了大一上应该学习的科目后，便拜托同学将课本寄回，希望可以在治疗的闲暇时间了解一下大学科目，发挥自己现有阶段的能力尽量自学一些内容，这样回校后就不会落后太多。刚回校一周后我就面临微积分的期中测验，所幸顺利通过了哈哈，证明了自己当初的努力。恢复走路能力的过程伴随着痛苦与喜悦，虽然艰辛无比，但是心想能够快点来学校咬咬牙还是坚持。现在我仍然没有放弃锻炼，早上坚持慢跑来加快恢复，期望不久后能像其他同学一样奔跑，跳跃，进行正常的体育活动，也希望自己的经历能鼓舞一样有过受创的朋友不要放弃，自强不息。乐观坚强是我的自强精神，化解遭遇带来的痛苦的最好办法就是时刻保持明朗的心情，笑一笑没什么大不了的！生活中不可能永远阳光明媚，当黑暗的日子降临，你要做自己的太阳~', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('176', 'U201414577', '谷永普', '计算机学院', '1.军训期间主动无偿献血，回报社会，以帮助更多的在病痛中需要血液的人恢复健康\n2.参加大学生社会时间中心志愿者服务指导中心，积极参加志愿者活动，服务同学，在外联部中，经常出去拉外联寻找商家赞助，为社会实践中心的志愿服务工作筹集资金，以便中心开展更多有益的志愿活动\n3.参加学院资委会勤工部，经常利用空闲时间和小伙伴们一起去华科附中做家教宣传，向外界推广我们学院的家教信息平台，收集家教信息，为学院想做家教勤工俭学的同学免费提供家教信息，给大家一个安全放心的家教平台\n4. 服务同学，节日送贺卡，生日送祝福，圣诞送苹果\n5.参加机械学院的盲校支教活动，每周末去武汉盲校无偿对盲人孩子周末进行一对一辅导教学，献出自己的一份力量，克服无法直接用文字交流的障碍，探索教学方法，帮助盲校的的孩子积极乐观地面对生活，并帮助他们实现大学梦，并与那些孩子建立了浓厚的友谊\n6.参加思源社，时常做回报社会的志愿服务工作\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('177', 'U201414640', '吾拉木•图尔贡', '计算机学院', '      到了大学，我的想法就是让我的大学生活过得比较有意义，多接触周围的实物，社会环境等。所以我已开始就找一些机会让我去实现这些想法。\n     后来了解到义工的信息后，我就去参加义工，做了一些有意义的志愿服务。\n     第一次参加义工活动“马路天使”时，甚至连自己都会搞错什么时候可以过，什么时候不能过。第一次的时候，总免不了紧张，犯错，受别人误解。但我并没有放弃，一次次的参与，慢慢的变好，不再紧张。我做到了“天使”的职责，它也使我超越了自我。\n     刚来到学校，当听到校外也有类似的志愿服务时，我决定去参加那些服务。\n     去过一次“圣景老年公寓”之后，我才知道那里的人确实需要我们的关心和帮助；哪怕是跟他们聊聊天，打打牌，或者唱唱歌都能给他们带来很多快乐。我以后还会坚持去那里多陪陪他们，给他们多带去一些关心与快乐。\n     在“武汉科技馆”时，给小朋友们解说一些东西，陪他们玩耍，听他们聊天，也使我感到十分的开心。\n     参加义工，不仅可以让我们学到自己在学校学不到的东西，而且更重要的是我们可以帮助别人，给他们带来快乐，也让他们的生活过的同样更有意义、更加精彩！ \n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('178', 'U201414974', '王海瑞', '计算机学院', '     出生于河北的农村家庭，父母以务农为生，无其他收入来源。后来因为长期辛苦劳作，母亲患上了腰椎间盘突出，从此不能做重体力劳动。我深刻地感受到处在中国社会最底层的农民生活的艰辛和钱生活来源的来之不易。所以对于父母，对于我所拥有的一切，我都会格外珍惜。\n初三时候，我被全省重点高中提前录取。高三毕业后顺利进入大学。我在这里学会了坚强乐观，遇到挫折勇往直前，竞争意识与团队意识，严守纪律等品质。\n在班级我积极参加班级活动，融入班级这个大群体。我是班级的义委，帮助同学们解决关于奖助学金等方面的问题。对于同学们不懂的问题，我耐心解答。\n因为一直都得到很多人的帮助，所以我也希望自己可以帮助别人。进入义工部，就是希望自己能够通过做义工来服务于社会，回报社会。当然作为一项义工的负责人，也锻炼了我的管理能力。与每周报名的义工进行沟通，还要与图书馆那里的负责人进行联系。\n积极的充实自我。我加入了学生会的新闻部，负责摄影。曾经拍摄过迎新晚会和校运动会。\n为了减轻父母的负担，我自己通过家教赚取自己的生活费，我所辅导的小朋友在年终考试时成绩取得很大进步，成为班级第二。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('179', 'U201412631', '杨柳', '生命学院', '     她来自农村，家中的开销全靠父亲一个人从土地里一寸寸种出来。母亲病重，身体虚弱，右手行动不便，各种医疗费用再加上两个孩子的学费使家里入不敷出。贫穷给她带来了物质上的匮乏同时也培养了她吃苦耐劳的精神和坚韧不拔的品质。她从小就希望成为一名优秀的医生，能够医治病人医治一个个因疾病而受伤的家庭。\n为了实现这个梦想，她一直奋斗着。中学时，她获得过校学习标兵，校励志标兵等荣誉称号，成绩优异时她得到了全校唯一一个北大自招的校荐名额。可高考失利使她无缘进入理想的大学。亲戚朋友们都劝她放弃读书，像哥哥姐姐们那样南下打工为家里分担。可是她不甘心就这样放弃梦想。父母亲了解她的心思，顶着压力全力支持她选择自己的道路。\n到大学后，学习上，她勤奋刻苦，努力丰富自己的科学文化知识；生活上，勤俭节约，并且做了兼职来减轻家里的负担；她还参加了手语协会和笛萧协会以及各种集体活动，使自己更好地融入团体。在大学的第一个学期里，她成长了很多，向着目标又迈进了一步。虽然明白未来还会有很多艰难险阻，但她一定会坚持到底，永不放弃，始终铭记最初的梦想。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('180', 'U201212546', '李永帅', '生命学院', '    他学习成绩优异，在过去的5个学期中，他有2个学期以加权90+的成绩排名专业第一，曾获得“学习优秀奖学金”、“国家励志奖学金”、“校三好学生”等荣誉。他热爱科研，从大二就进入实验室，将近2年时间内，他周末、假期经常在实验室一泡就是一天，读文章、查资料、做分析，经过不断的积淀，他也取得了科研道路上的第一批成果。现在他参与了一项院级大创——基于FPGA的农业航拍飞行器设计，负责了一项校级大创——基于DSP的非局部FIR数字信号滤波器设计，申请到了一项国家受理专利——一种心电信号滤波方法，并且投中了一篇名为Adaptive nonlocal means method for electrocardiogram signal denoising的论文。此外，他所参与的项目“微伏级”心电信号采集系统设计在第五届“求实杯”上拿到了二等奖，目前在备战“挑战杯”比赛。他还是一个足球迷，担任学院新生杯的教练和足球队队长。从新生杯到生命杯，再到华工杯，足球赛场上总能看到他的身影。训练的汗水，赢球的兴奋，输球的沮丧，他享受着足球运动带来的乐趣。“爱拼才会赢”是他人生的座右铭，希望全面发展的他能够在科研的道路上一直拼搏下去。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('181', 'U201413014', '黄婷', '生命学院', '   她性格开朗，执着专注，成绩优异。她在经济上接受过国家助学金的帮助，感恩的种子就此埋在心底，成长为热爱公益的满满激情。她的身影活跃于各种志愿服务活动中，她希望以自己微薄的力量回馈社会。高中时期的她就曾作为班级学雷锋志愿者队队长，每月开展志愿活动，并取得良好的反响。受助者的笑容是她做志愿活动的无穷动力，而留下的汗水则是发自内心的满足感。大学给了她一个更加自由的平台，在这个平台上她有更大的空间去追逐自己所热爱的事物。别人眼中的轻松玩乐的大学生活并没有腐蚀她内心的追求。也许，你不能理解为什么在周末还要给难以进行顺畅沟通的印度留学生上汉语课，为什么在晚上还去社区做志愿者，为什么带领并不熟识的外国志愿者去华科附中和华师一附中上课……然而，你并不知道的是—一个多学期的磨合让她能够无阻碍地教印度留学生中文并使他在中文上有了长足的进步；社区老人的活力让她感受到志愿活动的意义；和外国志愿者的合作让她意识到自己的不足并努力朝着更好的方向前进。她一直坚信正能量的传递，用爱心播撒阳光，高尚践行平凡，在服务他人的同时深刻感受到“赠人玫瑰，手有余香”的快乐与满足。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('182', 'U201212264', '李想', '生命学院', '“天道酬勤”，这是他常用来激励自己的一句话。生活中，身为班长的他是一个 恪尽职守的班级领导者。为了同学们能在班级中感受到家的温暖，他随时随地都在尽力履行班长的使命。优良学风班和三次优秀学生干部的荣誉无疑是对他工作的最大肯定，也是他沥尽心血的回报。与此同时，他还是一个热爱科研的工作狂。课业的压力、攻关的辛劳都未能成为他追梦的阻碍。两项院级、两项校级和一项国家级大创项目只是他筑梦之路的开始，“求是杯”的二等奖、实验室的“十二五”项目也未能成为他科研道路的终点。\n历经重重磨难终于苦尽甘来，他以第一作者身份投稿了一篇SCI论文和一篇A类期刊Plos One论文，同时申请了一项国家发明专利。他的路，因为梦想而不轻言放弃，因为执着而不害怕明天。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('183', 'U201312725', '李欣', '生命学院', '   她立志成为一名优秀的医生，所以选择医学，在“启明学院”临床中德实验班里她努力学习，重视每一科的学习，早上7点15到教室读书，晚上10点半下自习。大一总加权92.26，大二上加权92.29。德语4级“优秀”（85分以上为“优秀”），英语4级611。获得新生自强奖学金，新生学习优秀奖学金，国家励志奖学金。\n追梦德国医学教育。大一一年，她将市场上德福相关书籍刷遍，以总分18（满分20）成功通过德福考试，有资格申请德国大学。\n   她注重修德。积极参加党校，并顺利获得结业证书，成为入党积极分子。担任班级团支书，认真做好在班上的相关工作，参加“成为有坚定理想的青年”团校学习并顺利结业。参加组织全班同学每个月开展团会，开展特色团日，写成5万字总结书。特团进入校30佳；开展“雷锋月”活动。获得了“优秀共青团员”的称号。\n   她热心义工活动，如关爱拾荒老人，义务发报纸，爱心宿舍等，还定期去东图整理图书，工时达39个。积极带领留学生参观校园。参加生命之光，为其中各种相关活动制作展板，去校外为部门的“爱心家教”活动贴海报，参加“志愿者日”路演 。加入学校资助中心助理委员会。制作部门“阳光解说员”招新海报，“校史馆阳光解说员”文化衫，参加“2014年自强标兵”路演活动。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('184', 'U201413207', '刘柯', '生命学院', ' 她阳光开朗、热爱社会公益，她希望能通过自己的绵薄之力为社会做出自己的贡献。也许是受生活环境的影响，也许是发自内心的本真，在大学伊始，她就始终行走在社会公益的道路上，不论工作有多繁忙，她总能有条不紊的安排好时间，不论风吹日晒始终坚持每周去地铁站疏导交通，坚持每周去给家庭困难的孩子做家教，在工作中积极热情、认真负责，在上一阶段的工作中获得”优秀地铁义工”和”优秀教员”的称号，从创青春志愿者到爱心宿舍志愿者，不论活动的大小总能看见她默默付出的身影，短短一个学期工时就多达40多个，这个暑假她还将踏上支教之路去偏远山区支教。除此之外，从班级到学院再到学校的各种学生工作，总也少不了她忙碌的身影，作为班长以及院系助理更让她懂了什么是责任，尽职尽责、全心全意的为同学服务，与此同时她也荣获了多项荣誉称号。一辆单车，一个背包，一颗爱心，她就这样奔走在武汉的大街小巷，她说只要心中有信念就会有明天，她会在公益的道路上坚定不移地走下去，她要用自己的阳光去温暖身边的每一个人。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('185', 'U201372254', '黄本燊', '船海', ' 进入大学之后，我充分利用这些时间。在大一上学期的时候我自学了Photoshop，那个时候还没有电脑，每天我都会在自习室自习两个小时后去东校区的机房，自学ps技术，那段时间常常我是最后一个离开机房的人。大一的这份努力使我从一个ps的小白，一步一步进阶成为一个熟练的使用者。在大一下的工图课上，老师曾近要求过大家学习AutoCAD，但那只是基础中的基础，仅仅只是直线，圆形的简单组接。这远没有满足我，我在图书自学了一整本AutoCAD教程，并在假期进一步强化。在这半年里我从一个对工程制图一无所知的少年，到了解整个软件的功能和使用方法。并整理出了一本属于自己的笔记。\n    大学期间我加入了船海阳光俱乐部，组织并参与了俱乐部的多项活动。我领头组织了喻家山“阳光密码”定向越野比赛。同时每个月的“爱心宿舍”活动也没有缺席。多次参加汽标社区清洁活动，东九桌面清洁，问候离休职工等活动。义工活动不仅丰富了我的课余生活，更让我知道了自强的另一面。作为一个大学生我们所应该承担的责任。我们不再是小孩子已经步入成年的我们应该为这个社会奉献自己的力量。心中常常有他人，为别人服务，在点滴之中提升自己。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('186', 'U201412016', '冯璐璐', '船海', '我是14级冯璐璐，一个地道的东北姑娘，性格直爽。\n上学期加入了援之缘支教协会，到小梅花艺术学校做志愿者，虽然只做了2周，但收获到很多实践经验。这学期在爱乐音乐学校负责六年级，到现在已经是第5周了，并且效果很好，可发展为长期项目。\n现在在协会做基地助理，也会有路演，招募，培训等工作。目前正协助做“武汉市Yuan来有爱—高校学子暑期志愿家教活动”，会在武汉六所高校进行招募志愿者进行一对一家教。\n曾2次去湖南基地回访，暑期也要到湖南做21天的支教。\n会将支教作为一项事业，并长期做下去。同时也希望有更多的人投入到支教中。\n就像我最喜欢的一句话:路上无名，脚下有路。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('187', 'U201312291', '任仕美', '船海', '     “不经一番彻骨寒，哪得梅花扑鼻香”，这是我一直坚持和捍守的信念，来到大学我一直坚持参加各种志愿活动，爱心病房里我曾多次耐心陪伴患了白血病的孩子们，给他们带去欢乐的同时也带去了暖暖的爱；武汉科技馆里留下了我细心给孩子们解答的身影，“创青春”比赛时我积极接待来自各地参赛的老师和同学，也曾连续几天到机场接待来参加“高新船舶”科技论坛的中科院院士；武汉盲校里我曾给孩子们进行一对一辅导，让他们更好地沐浴在知识的海洋……我热爱志愿者的工作，喜欢志愿者的称号，更享受无私为他人服务的过程。以后我会一直坚持我的志愿者之路，无私为他人服务，回报社会，为这个社会奉献出自己的一点小小力量，让自己的生命变得更有意义。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('188', 'U201412151', '田宇', '船海', '    宝剑锋从磨砺出，梅花香自苦寒来。我是来自船海1404的田宇。从高考结束后，我便深知父母以后的负担会更重，所以从那时起，我便开始兼职，努力赚取自己的一部分生活费，到大学后，也做过许许多多的事情，酒店兼职，快递分拣员。特别是第一次做快递分拣员的时候，尽管只工作一晚拿了一百块，但是我却十分劳累，在一辆辆货车之间跑来跑去，现在做家教，能够赚取自己的大部分生活费，同时也在勤工助学工作。尽管如此，但是大一上加权86.85.\n拮据的生活并没有让我自暴自弃，而是更加努力。为回报学校、社会对我的关怀，我积极参加了创青春志愿服务。面对困难，我选择了不卑不亢，决定用自己的劳动与智慧创造一份天空 。                                                                                              \n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('189', 'U201412158', '易玉坤', '船海', '     我出生还不到八个月，母亲就走了。爸爸很坚强，又当爹又当妈的照顾我和两个姐姐，并靠种地最终把我们送进了大学校园。\n     小学一年级，我们三个都在镇上读书，为了不影响高年级的姐姐们的学习，每次洗衣做饭都是我抢着干，当时我还没有灶台高，垫着椅子煮饭。我炒了几乎六年最便宜的咸菜。\n     初中的时候，三个人学费的突然增长，尽管三人都特别特别省，家里还是入不敷出并且开始负债，甚至一度我差点被逼退学了，是父亲坚持我才有今天。我成了家里的二号劳动力帮父亲干农活，晚上就在煤油灯下面写作业。如果是在农闲时候，我还要采山药、捡废品换一些资料费。\n高中时在学校，我早上买三块钱的小包子或方便面，中饭晚饭就都有了，然后一天除了上厕所就呆在教室学习，可以说最终我能以优异的成绩毕业，不是平白无故的。\n上了大学兼职做的很多，带了三份家教，周末节假日也去酒店做服务生，去商场做促销，去校园发传单。现在我不仅不用向家里要钱，还每月给家里寄钱，希望能回报父亲恩情值万一。在大学我一直致力于志愿者活动，创青春我报名很积极，要准备的事情既多且繁，我和组长一直忙到凌晨，后来几天更是忙的连饭都顾不上吃。我在校外也做公益项目，阳光义卖时晒了一上午才募到30块。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('190', 'U201115012', '张生倩', '机械学院', '我曾经迷茫，看不到未来的希望，患抑郁症休学半年。对梦想的渴望让我走出迷茫，重拾自信。未了不负青春、不负梦想，我选择转专业一切重新开始。设计专业要求具备扎实的美术功底，零基础的我和其他同学有很大的差距，暑假我留在武汉进行专业的绘画学习，为了不给父母经济负担，我一边打工一边学习画画；每天早上六点起床去画室，晚上十点才回到学校。经过两个月的辛苦和努力我的水平有了很大提高，顺利转入产品设计专业。转专业的第一个学期，我同时修完了大一大二两个学期的所有课程，忙碌压力是必然的，困难挫折也在所难免，但梦想的力量让我坚持不懈，并付出了比别人更多的努力。加权成绩90.56，排名年级第一，四分之三的课程在九十分以上，这也让我更加坚信只要付出艰苦的努力，梦想就一定会实现。我团结同学，乐于助人，热心公益，并通过勤工助学和做兼职解决了我经济困难的问题，我的努力得到了老师和同学们的认可，并获得了三一重工奖学金。我的梦想之路才刚刚起航，前方还将会有更多挑战，我将一如既往地全力以赴、坚持不懈。期待着未来，能够在更大的舞台上，为这世界带来多一份温暖，为这时代创造多一份希望。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('191', 'U201210580', '赵叔吉', '机械学院', '首先，在学习方面，专业排名比较靠前，这与我的刻苦学习离不开关系，几乎每天晚上，我都是十点下自习。我不是聪明的人，但我要成为很努力的人。\n其次在科创方面，我大二时参加了全国大学生机械创新设计大赛，克服了重重困难，顶着巨大的心理压力和繁重的工作量，最终取得了全国第一名的成绩，并且和组员之间结下了深厚的友谊。\n在生活方面，我也是一个勤俭节约的人，并且争取做到对人坦诚，热心帮助他人。还喜欢看书，努力提升自己的素养。\n短简介：\n努力成长，自强不息，超越平凡，追求卓越\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('192', 'U201210802', '张斯佳', '机械学院', '大一那年，我在不经意之间接触了校勤工助学工作，成为一名普通协管员，把一份责任放在心里，认真踏实工作；大二那年我成为了校勤工助学部的一名主管，顶着学习压力，默默服务自己的协管员团队，风雨无阻我查班的道路；半年后我荣幸的成为了整个东校区公寓岗位仅此一位的岗位负责人，每月会接手上万的工资表以及处理将近400人的学生管理工作，双学位剥夺了我的周末，越来越繁重的学习压力压垮了我的身躯，即便如此，我从未放弃这份寒暑假仍不歇息的工作。除此之外，学校分配给我们的“爱心传递联盟”工作我们一直积极响应，每月按时资助贫困的中学生们，从未停歇。秉承我工作的宗旨：绝不让任何一位学子因家庭贫困而辍学！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('193', 'U201310644', '马昕', '机械学院', '我是马昕，来自机制1303班。现任班长，成绩在年级前20%，曾任13年飞航杯总裁判，负责13,14年两届赛题的编订工作，曾任笛箫协会表演队笛队队长。科研方面，从大一暑假开始在1022团队做项目，已有一定实践经验。在我看来，自强不仅意味着内心的坚定与对理想的执着追求，更是从逆境中奋起的那放手一搏。我曾经由于家庭的原因沉沦过、苦恼过，有过报复社会的行为，到最后甚至有过轻生的行为。幸运的是，我愚蠢的行为没有成功，在亲人和老师的帮助下，我获得了新生。我希望的只是把我从抑郁症到阳光开朗的心路分享给那些需要帮助的同学，告诉他们身边的重要的人和事是值得我们用真心去对待。\n人生格言：没有无价值的人，只有没有追求的人；没有打不开的锁，只有自己封闭的心门。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('194', 'U201310814', '周建', '机械学院', '自小体弱多病，但是却有一颗对舞蹈热爱的心。显而易见，舞蹈是一门艺术，而在现在，艺术却需要高昂的经济基础，我来自农村，家庭经济基础不好。因此，只能把舞蹈放在心中。到了大学，我了解到了自强自助。于是，我开始去发发传单，挣点外快。趁着假期的漫长时光，做了两个月的销售，虽然天气酷热，需要顶着大太阳去发传单，更要忍受顾客的谩骂与咄咄逼人的态度。但是拿着工资去交舞蹈学习费用的时候，还是毫不犹豫，觉得蛮值得。后来开学了，意外介绍之下，我开启了家教征程。趁着每个周六周末晚上，都会做1个多小时的车跑到户部巷给小朋友补习，晚上9点多又坐车回来。因为这份工作，舞蹈学习才得以继续。日复一日年复一年，前不久，终于拿到了舞蹈的第一份回报，经介绍帮人排了个舞获得了一笔回报。舞蹈需要的是持续，不管多累，我都会持续下去。有一句名言，舞蹈是上帝赐予人最美的苦差事。我坚持，我快乐！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('195', 'U201310924', '杨仕雷', '机械学院', '我来自农村一个比较贫困的家庭，我是我家第一个大学生，所以对于“学习改变命运”这句话有很深的理解，因此我希望能够去帮助那些家庭贫困的孩子，给他们力所能及的帮助。因此我在大一上学期加入了生命学院的“生命之光”团队，给青山区一个家庭贫困的孩子做了一年的义务家教。大二由于课程增多，班级事务也比较多，所以就换成了另外的人。\n我希望能够带动更多的人去帮助上不起学的孩子，或许我们不能给他们很多资金方面的支持，但是我想通过自己的努力，带动更多的爱心人士给那些孩子们送去一点关怀和物质帮助，因此我现在正在做一个针对支教地区贫困学生的帮扶项目，致力于让我们的支教活动更具有实际意义，而不仅仅是支教过后就没有然后了。\n在大二上学期我组织策划并参与了帮助留学生学汉语以及更好适应在中国的生活的win—win项目，这个项目给参与的双方都带来了很大的帮助，让他们从彼此身上学到了很有用的东西，真正实现了合作共赢。。\n在平时我更注重的是带动更多的人来参与公益活动，随手捡起地上的垃圾，在生活中热心帮助他人等等，我从不认为做公益一定要多么的轰轰烈烈，公益就是“不以恶小而为之，不以善小而不为”。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('196', 'U201111220', '聂小佳', '材料科学与工程', '2012年8月至今，三个年头了。寒冬清晨，我身着单衣却大汗淋漓，东西操场、喻家山和森林公园都留下了我的身影，我见证着月亮落下、朝阳升起；酷暑烈日，我们在东湖上桨叶翻飞，划了数不清的桨数，黝黑的皮肤和衣服背后的盐花是我们的印迹；暴雨滂沱，我们风雨无阻，鼓声震天，脸上的汗水和雨水交织在一起；面对冰冷的杠铃片，机械地重复动作。黝黑的皮肤、满手的老茧、强健的身体就是我们龙舟人的标志。艰苦的训练、顽强的拼搏，龙舟之花终绽放。泪水化为力量，当付出在不断地接近目标，原来的痛苦也变成了快乐，从“同城双星”混合组500米冠军到中华龙舟大赛总决赛全国亚军，付出终得回报，激动的泪水在比赛结束的那一刻夺眶而出，终于扛起了身后“华中科技大学龙舟队”这九个字，为校争光，义不容辞。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('197', 'U201216075', '万坦', '材料科学与工程', '我叫万坦，来自武汉市新洲区。两岁那年父母离异，从此踏上了与父亲相依为命的漫长路途。父亲是一名乡村小学教师，靠微薄的收入支撑起整个家庭。12岁那年，母亲因病去世。\n大学以来，我先后参加了福利院爱心家教活动”、“武钢三中励志演讲”等公益活动；同时为减轻家庭负担，我长期坚持在外做家教、辅导员等各种勤工助学活动；学习方面我努力求知，成绩始终稳定在年级前10%，拿过两次国家励志奖学金，并被评为“校三好学生”。\n学习之余我积极参加科技创新活动，2013-2014学年通过努力获得了湖北省机械创新设计大赛一等奖、全国机械创新设计大赛一等奖； 2013-2014学年作课题为“LED灯透明氧化铝陶瓷基片的制备”的研究。因此被评为“校科技创新优秀个人”，并取得了2014-2015材料学院太平洋精锻（科技类）奖学金。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('198', 'U201311146', '魏俊杰', '材料科学与工程', '\n很幸运，刚上大一，我便找到了我的兴趣所在——控制。下面我将以时间轴的方式简介我的自强事迹。\n大一上：我参加了智能车比赛，认识了很多控制上很棒的学长和伙伴，激起了对控制的浓厚的兴趣，一有空闲时间便去图书馆看书，或在寝室敲写代码，使自己在控制上的能力有了很大提高。\n大一下：积累了一定的控制经验，有幸加入了学校的3D打印团队，并担任控制组组长。大一暑假都待在了学校里进行研发，终于在暑假接近尾声时，成功将一台普通打印机改装成了一台3D打印机。\n大二上：在对控制的热爱的带领下，参加了科技光环比赛并有幸荣获二等奖，报了院里的大创项目，并超前完成且比预期的完成得更好。大二寒假，继续留在了学校，专为提高打印机的效率设计了一套控制方案。实现了打印机平均效率提升7倍。并专为该控制方案，正在生产新的3DP设备供团队使用。\n大二下：有幸去广东一3D工厂调试设备，并开始进行熔融沉积型和激光烧结型3D打印设备的优化与智能化研发，团队专利的撰写，及用打印机做实验，研究材料力学性能。\n目标：在本科期间敲出一整套智能好用的3D打印机控制系统。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('199', 'U201311193', '张建明', '材料科学与工程', '  我来自内蒙古的一个农村，2011年春节，适逢高一寒假，父亲出了车祸，当场去世，家中失去了主要动力，经济瞬间濒临崩溃。2012年，母亲改嫁，后离家出走，并带走家中绝大部分积蓄。至今联系不到。\n大学期间经济依靠各种奖学金，助学金，国家贷款和自己做兼职维持。先后做过市场调查员，电话测评员，家教，三早助理，卫生检查员。去年暑假留在学校做兼职，至今所有假期均在打工中度过。\n积极参加社会工作和学校社团，如晴川阁支教，电商协会等。同时参加了工程实训竞赛。\n加权排名年级前25%。\n英语四六级已通过，计算机二级已通过。\n曾获国家励志奖学金，太平洋精锻奖学金，勤奋励志助学金，国家助学金，自强奖学金等。\n曾获2014年度院自强标兵称号。\n曾获“飞航杯”科技节校赛一等奖。\n目前正在申请一项专利，已受审。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('200', 'U201211171', '张财源', '材料科学与工程', '家里经济的困难并没有改变我积极乐观的心态，高考的失利更加坚定了我对梦想的执着追求。幸福不仅仅是吃饱穿暖，而是勇敢地去战胜困难，生活费不够我就省吃俭用，不乱花一分钱。两年半来一直坚持兼职和勤工俭学，为自己挣生活费，虽不能做到完全经济独立，却也为父母省了不少心，虽都是小钱，自己却不曾放弃自立自强的精神，生活中时刻践行着自强的本质，以自己的行为传递着正能量。学习上勤奋努力，在陷入迷茫时能够通过自己的努力、别人的劝说很快走上正轨，做到知错就改。但行善事，莫问前程，常怀感恩之心，积极参与志愿服务和义工活动。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('201', 'U201311036', '李尚仁', '材料科学与工程', '我们每个人的能力有限，但再微弱的力量也有其存在的意义。\n大一时便加入校学生会权益部及学院义工部，多次发起并参与各类义工活动。任义工部副部长期间，作为材料学院旧书圆新梦活动唯一负责人，为材料学院2014级领取生源地贷款本科生募集了约700本书籍；2014年暑假报名加入材院纳雍支教队，前往纳雍县进行为期半个月的支教活动，并在返校之后和队员们一起募捐到约4000元善款；2014年11月成为创青春大赛志愿者，并被评为优秀志愿者；2015年1月，组织高中同学参加母校回访实践活动；目前我担任材料学院社委会兼资助委员会副会长，学生工作处助理服务于学校同学。\n不管是涓涓细流还是汹涌大海总有其存在的意义，而我这股细流正是抱着这样虔诚的态度为志愿服务事业而努力着。一句话：以梦为马，随处可栖。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('202', 'U201315781', '王琛', '土木工程与力学学院', '    大家好。我是交运1301的王琛，也是一枚龙舟队的桨手。龙舟队训练很苦，一般坚持下来很难。去年院龙舟队有7个人，现在就剩俩。我们一周七训，不同的时间、地点。龙舟队从不主动踢人，坚持不下去就主动离开，所谓的自强精神，就是全凭自己的坚持，不息的奋斗。\n     龙舟队队员全部不存在体育生，但我们要竞争的是体育院校或职业的龙舟队，所以，我们把自己当体育生一样每天坚持刻苦训练。今年我们以更大的勇气，报名参加职业组的比赛，我们或许实力没办法问鼎，但我们执着的向更高的水准的比赛进发，向更优秀的对手发起挑战。纵使前途暗淡也要勇敢拼到最后，这或许就是自强精神吧，全靠自己的坚持，不止的追求。\n     而我，作为龙舟队一名普通的一员，入队前1000米跑3分半，现在只要3分07，或许还可以再快一些。我代表学院参加过学校的Nike杯接力赛，取得第三，我也自费去跑过厦门马拉松。我参加过新生篮球队，取得第三名，我们班也是去年追日杯的第四名。在龙舟队这种竞争环境中，都是大神，但我在去年的冬季大比武中综合排名第一.每次去参加比赛都要好几天的时间，这意味着学业的压力，自强精神，意味着牺牲，但也要勇敢的走下去。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('203', 'U201315848', '王凡', '土木工程与力学学院', '    我叫王凡，来自工程管理1301班。我对体育非常执着。刚一入校我就加入了校龙舟队，龙舟训非常辛苦。每周一、三、五的早操，从入队到现在从未间断。每天晚上9点晚训，到勤也做到了9成以上。每周一次，现在有时候是两次的下湖训练。在大冬天寒冷的湖水浸泡下我也坚持了下来。\n    经过了两年的艰苦训练，在各方面有了很大的提升。以前1000米最高记录是3分30秒，现在我的最好成绩是3分06秒。以前400米最好成绩是1分10秒，现在是58秒。以前200米最好成绩是27秒，现在最好成绩是23秒。我参加了中华龙舟大赛，东湖大战，同城双星的比赛，并且取得了不错的成绩\n    同时，校运会中取得了很不错的成绩。200米第四名、1500米第八名、110米栏第八名、4×400米接力第二、第三名。定向越野大赛季军，参赛队伍150支，湖北省第一届大学生跆拳道大赛63Kg级季军。代表学院参加Nike杯高校精英挑战接力赛，取得了学院第三个人成绩第二的好成绩。5月份将代表华科参加在北大举办的高校精英挑战赛。完成了厦门马拉松比赛，木兰湖25Km徒步大赛，阳光晨跑等活动。\n    我会在我的体育道路上继续坚持，继续绽放我的光彩。我将会用我的一生去诠释体育的魅力。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('204', 'U201315525', '胡婧', '土木工程与力学学院', '   我叫胡婧，来自土木学院土木工程1301班。\n   从初中起我就跟着父亲相依住在不足十平方米的租住房里，而母亲于几年后正式与父亲离婚。家里一直没有积蓄，现在我和父亲每月只有一千多元的低保作为家里的主要经济来源。父亲已经57岁了，由于早年公司倒闭早已下岗，因为三年前的手臂重伤无法进行繁重的体力活，在2014年年初又被诊出患有肝硬化，肝衰竭和胃炎等重病。虽然家里条件并不好，但是这并没阻碍我成为一名优秀独立的女孩。即使初中由于经济情况选择了一所并不好的学校，可是我凭借自身的努力，考上了武汉一中，并于重点班学习。为了不离开父亲，我并没有考去外省，我选择了华中科技大学，方便照顾父亲。高中毕业后，我就开始在外做兼职，放假就做长线项目，开学了就周末打短工，同时也加入了学校的勤工俭学岗。2015年年初正值期末，父亲大出血危及生命，我立即对期末的学习任务和考试安排做出调整，最大可能的将精力投向家里。出于实际的需要，我必须向同学家借钱给父亲做手术，并每日去医院照看父亲，在许多好心人帮忙下，我们最终度过了难关。虽然就外人看来对于年轻的我，生活可能十分艰难，可是我相信没有过不去的坎，只要活着就有希望，生活是美好的，毕竟阳光总在风雨后。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('205', 'U201415562', '陈明君', '土木工程与力学学院', '    我是陈明君，虽然目前还是大一，但我的自强之路早已开始！\n        磨砺：一个人的自强\n    初一便假期练泰拳，踢轮胎，跳铁绳等，只有我坚持到最后；初三，高三毕业，分别在餐馆，家教中心找到工作，虽然苦累，但我踏实认真干了下去！\n        公益：一伙人的自强\n    大一上，参加“爱在夕阳”长期义工关爱老人，带领组员无一次缺席或迟到（无论东边涨洪水，或考试周），并且自发准备魔术，歌曲，小礼物以带给老人温暖。\n    参加“爱心崇阳行”关爱贫困生，远赴崇阳一整天，给予孩子指导与温暖！\n一学期工时合计31个。\n    寒假，参加公益组织发起的“寒假励志演讲”，辗转两地为上千高三学子演讲！途中，吃在食堂，两人共张单人床，回家的路费还是自己负担。\n    现已加入该公益组织外联部。\n    暑假会去山区支教，奉献更多的爱！以后必将爱进行到底，我要自强！\n        追求：永不止步的自强\n    大一刚入学参与多个社团组织面试其中三个在最后一面失败、竞选失败、演讲超时、普通话被嘲笑，但我不放弃。\n    参加大创的“市场嘉年华”，摆摊一天，净赚110元。\n    一学期，从只会打字，到Word,Excel,PPT都基本会用，还自学了PS，视频，音乐剪辑。\n    但时间会证明一切，我将永不止步！\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('206', 'U201215564', '余倩雯', '土木工程与力学学院', '    我是土木与工程力学学院的余倩雯，可以叫我蓝胖子或是小叮当。\n    现任华小科团队负责人。正在创业阶段，目前产品【咩咩】已在iOS与安卓市场成功上线。曾先后在腾讯教育（北京）和碧桂园实习。策划的微博话题，转发量达万；微信图文最高达16w。目前已拿到阿里、搜狐、途牛实习生offer。\n    一句话总结自己：爱笑爱吃、敢想敢做的蓝胖子。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('207', 'U201215471', '李志斌', '土木工程与力学学院', '    我是土木1203班的李志斌，来自云南楚雄彝族自治州南华县，通过少数民族预科生计划进入华中科技大学。\n    2012年入学以来在学校认真学习，刻苦努力，积极参与班级活动及院内、校内组织的文体活动，同时也积极投身于学生工作事业，为我院的学生工作贡献了自己的力量。\n课余时间我热爱体育活动，在受伤的情况下坚持体育运动，参加篮球队，并努力坚持，在校内、院内的各项大小赛事中取得了不错的成绩，为班级和学院争得了荣誉。\n    与此同时，我还积极参与校内外的一些与专业相关的比赛，在其中磨练自己，也多次获得了荣誉。\n    曾获校优秀共青团员，“飞航杯”架构模型大赛三等奖，强生商界精英挑战赛二等奖，2012 级华科新生杯篮球赛亚军，连续两年追日杯冠军，连续两年年级赛冠军，2014年华工杯男子甲组季军，土木学院2015年度自强标兵。\n    曾任土木学院团学联副主席，金地华中俱乐部活动中心主任，华中科技大学职业发展研究会（ACDR）主席助理\n    曾在云南冲宇建筑有限公司项目部土建岗实习生，中国建筑国际集团、佳兆业房地产、招商地产校园招聘团队成员，金地集团校园大使。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('208', 'U201316172', '黄晏渲 ', '水电学院', '作为一名来自四川切身经历过汶川地震的孩子，在云南鲁甸发生强震的消息传来的第一时间我义无反顾地选择前往灾区参与人道救援工作。在营地以及重灾区待的十天里我学会了救援帐篷和行军床的搭建，我了解了物资发放的流程及注意事项，体会了大灾面前大家的众志成城。当我穿上人道救援制服负责灾区救灾物资调配和发放工作的时候，我从灾民眼中看出了他们对我的肯定，也许这也是我最值得骄傲的吧！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('209', 'U201316186', '李粮 ', '水电学院', ' 我是来自江西省革命老区——莲花县的一名学生。父亲在我七岁的时候患上胃溃疡住进医院。全家欠下一大笔外债才把父亲从鬼门关拉了回来。此后，父亲的身体便一落千丈，长年在家休养，加上年老体虚，不能从事较重的体力活。我的母亲，在家务农照应着整个家，她用十年的时间还清了所有的债，还供养了我们姐弟俩上学。我十三岁就开始包揽了家里所有的粗活重活。上大学之后，我在课余时间从事了大量兼职，在烈日下发过传单贴过海报；也在零下几度的晚上做过家教；参加学校的勤工助学活动，服务同学的同时，也补贴了家用。我所做的一切，只是为了减轻家里的负担。成绩方面，由于大一刚进来没有找到兼职和学习的平衡点，我成绩很差，但后来逐渐适应，成绩从最初的年纪倒数到现在的年级前20%左右。其他方面，我代表学院打过篮球新生杯，在班里篮球足球队都是主力，我还积极参与院校组织的活动，在13年校运会1500米项目拿过银牌，学生工作方面，我是学院团学联网新部执行部长。分管着学院的微信公众号。如果命运注定让我出身贫寒，那我要感谢这份贫苦，他没有成为我的负担，而是推动我不断前行的发动机。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('210', 'U201415882', '唐国钦 ', '水电学院', '我出生于国家级贫困县重庆市石柱县。从小家庭贫困，父亲身体多处遭受伤害，失业多年。这对于一直贫困的家庭无疑是雪上加霜。从5岁开始我就患上严重的疾病，去了多家医院都没有治好，花了家里大量积蓄。后来病情越来越重。进入大学后，也有过一段颓靡的时光，但逐渐地我明白贫困与残疾只是我逃避生活的一个借口。于是积极参加各种活动，努力学习，变得更加坚强，阳光。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('211', 'U201316128', '许立武 ', '水电学院', '一直坚持把每一门课学透，一年多来获得了校三好学生，国家奖学金，启明学院特优生等荣誉。担任班级学习委员，尽我所能做好自己的本分工作。从爱心卖报到旧书圆新梦，从爱心宿舍到志愿看包，我一直怀揣志愿服务的愿望。积极参与学生工作，担任院团学联科创部副部长。坚持勤工助学和社会实践，做过车棚岗，超市岗和其他社会兼职。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('212', 'U201316618', '王丛聪', '艺术团', '一、学习情况：\n学习上认真，刻苦努力，成绩在前1/3，获得学习优秀奖学金。在2014年12月中行电子银行知识竞赛中获得三等奖。2015年3月作为负责人申请学校创新训练项目，已在院里立项，目前已开展工作。平时的排练，积极主动。在交响队参加了大学生艺术节。连续两年在“金秋音乐季”上进行了演奏。\n二、社会实践、活动情况： \n大一一年任班级中班级资助委员，在 2014年四月校“我是策划人”义工活动中，带领班级参赛，进入前八名；大一成为艺术团编辑部的一员，大二任编辑部副部长，协助部长做好编辑部文稿的撰写，并带领部员推出自己的栏目，对艺术团的演出活动进行及时的报道。\n三、生活情况：\n   平时的生活中，自强自立，面对困难不退缩。集体主义感强烈，愿意为大家服务。生活中节俭，希望能通过自己的努力，追逐梦想。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('213', 'U201216212', '张嘉妮', '艺术团', '1. 在艺术的道路上执着追求。不管身上的伤痛有多少，平日的学习任务有多重，从来都秉着对舞蹈的热爱，坚持日复一日的舞蹈训练。从大一的8月中旬就入校训练，到每年的暑训，再到平日的训练近乎全勤。每台晚会，都倾注着无数的心血和汗水，但都咬牙挺过。\n2. 在学生工作上兢兢业业，努力不断提升自己的能力。从办公室的一员，到资助助理，再到办公室执行部长，舞蹈队团支书，以及今日的艺术团团学联学生会主席。整理材料直至凌晨，开会至深夜，每一件有关艺术团的事我都认真仔细，不敢有一丝懈怠。并且从不无故缺席各种会议，滋滋不断的汲取着来自各方面的优秀力量。\n在学习上坚持对自己的严格要求，因为基础差，所以一直以来很吃力，但我从未萌生过放弃的念头，因为我知道，路是对的，努力就是应该的。在班上的成绩不说十分优秀，但也良好。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('214', 'U201311927', '范雯宇', '艺术团', '    我是一名来自艺术团民乐队的艺术特长生，也是一名电气工程及其自动化1305班的学生。\n　　大一上，我报名参加了“聆听心声音，走进心世界 关爱精神疾病患者志愿者服务行动”，这次志愿者活动持续一个月，每个星期我与其他志愿者一起往返在学校和位于汉口的优抚医院，陪伴患有精神疾病的特殊的朋友。\n    大一下，报名了“创青春”复赛C类“一对一”志愿者，多轮考核后正式成为一名“一对一”志愿者。大一暑假，我参加培训和素质拓展活动。在十月份的决赛志愿者活动中，我接待了来自辽宁省团委的代表团。\n　　从进入大学至今担任艺术团学生会网络部部长、电气学院13级级会宣传部长、校资委会阳光俱乐部外事部副部长、民乐队团支书、班级宣传委员、艺术团办公室部员、电气学院文艺部部员。\n在校资委会阳光俱乐部，成功筹办“阳光励志演讲”“阳光新生演讲”等公益演讲，担任武汉革命博物馆志愿者讲解员负责人。\n    我愿意以自己微小的力量，给他人带去阳光，借用一位学姐的话：“愿，成为一个如向日葵般温暖的人。”\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('215', 'U201313824', '彭浩通', '光学与电子信息学院', '谁要游戏人生？谁不能主宰自己？养成自强性格，命运才会在自己手中！大学是让用来经历和体验的，也是为有想法的人准备的。\n大一时，他决定和室友一起在圣诞节卖苹果。可是生活往往就是这么的出乎意料，接连不断的失败给了他们不小打击。几天的努力，成果又是少之又少。准备也不充分，最后只卖出去一半的苹果，刚刚未亏本。升到大二，临近圣诞节。想着去年的失败经历，并不甘心，找了三个院里的好友。吸取上次的经验，这次提前半个月开备，收集全校所有大一班长的电话，预订了30箱苹果。在距离圣诞节还有一个星期的时候，依次打电话，接到许多订单。进了40箱苹果，找阿姨借了一个房间放苹果l，四个人从晚上七八点包装到早上五点，六点半又起来送货，借了电动车、三轮车，甚至租校车送货，发现苹果不够又去商店买了五箱，送到下午五六点才完全送完，一共卖出三千多个苹果，七千多新生，一半吃到了他们卖的苹果！\n周末对于大多数人来说是轻松的，但对于他来说，周末代表着忙碌，周日一天的三份家教，一天的奔波几乎横穿了整个武汉。发过传单、当过服务员、做过保安、做过电话营销员、做过代理等等，体验过很多不同的职业，他在这些经历中逐渐成长、自强。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('216', 'U201413636', '赵志壮', '光学与电子信息学院', '【逆境使坚韧铸进性格，他自己挣钱上学】\n父母只能靠打工和务农维持家庭。从六岁开始就每天独自走几公里的山路去上学，然而困难并没有阻挡他前行，他以优秀的成绩成为当地第一个来到华中大的人。\n因为来自穷苦家庭，所以更懂得关心帮助其他人。父亲车祸，家里的负担更加沉重，他除了学习，还要做家里的农活。他是大山里走出来的农民的儿子，他也像万千贫困家庭孩子一样，但他不自卑也害怕，逆风的方向更适合飞翔！\n没钱上大学，他便自己挣钱上大学。高考后一直在外面打工，商场、工地、家教，他都做过。去工地最幸苦，工地很累，但他还是坚持了下来。寒假他也一直没回家而在外面做家教。上学期间空闲时间去校外超市收银。经济独立自给自足，困难总可以克服，他清楚地知道自己担负着怎样的责任。\n【灾难面前更加彰显坚强，他身先士卒】\n2014年8月3日，云南昭通发生6.5级地震，家里房屋受到损坏。当时他在城里做家教，得知消息后，就立即赶往震中，不顾余震危险，走了五六个小时才走进去。时间就是生命，他跟着帮忙救人和搬运物资，未满18的他也“强迫”医生让自己献了血……\n那段时间他常常流泪，亲眼见证了生命的脆弱，更加懂得了坚强的意义。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('217', 'U201314368', '陈家田', '光学与电子信息学院', '从小讲话很慢，吐词不清晰。小时候因此被同龄人嘲笑，也因为这个缺陷，变得内向。到了大学，意识到了必须正视这一缺陷，从未担任过学生干部的自己也大胆去竞选班长，最后担任了光电1311班的班长。在各种场合勇于发言，并请同学们教自己普通话，慢慢地自己没有了以前拘束，没有了以前的胆怯，在KTV也敢用着五音不全的音律去唱自己喜欢的歌曲。\n初二下的时候，父亲因车祸不幸离世，无心学习，沉溺于网游不能自拔,最终沦为了一个放学之后通宵打游戏，从不做作业的网瘾少年。没办法上二本的他意识到不能堕落下去，为了理想，为了哺育自己多年的父母，为了在天之灵的父亲。下定决心发奋苦读，一步步往上赶，最后以湘1600名来到了华中大。\n在担任学生工作期间，经验欠缺，工作时不能很好地兼顾学业，大一的加权仅只有79。但自强的王子，从各种方面找出自己的原因，努力去改正，到了大二，适应了自己的工作。在不忘工作和学习的前提下，还参加勤工助学，并用其他时间努力学习，大二上的成绩达到了90+。\n他有着一颗乐观向上的心，在人生的路上，自己从来不会向困难低头，相信再大的困难对于自己只是磨练，目的是锤炼出更强大的自己。始终相信凭着自己的坚持和毅力能够做到一切看似不可能的事。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('218', 'U201313917', '瞿鑫', '光学与电子信息学院', '他来自祖国西部秦巴山间一个风景秀美但经济极不发达的地方。十年寒窗终于来到华中大，本就贫困的家庭由于08年大地震负债累累，求学路艰辛。\n快进入大学时，他便决定在经济上一定要减少对家里的依赖。于是大学伊始，他便在国庆假期选择了兼职，十月烈日炙烤下，他忙碌于街头发单。此后只要他周末一有时间就去做兼职。寒假时每天骑车往返两个半小时去县城做家教。大一暑假以及大二寒假，他也坚持在勤工岗位。回家后，他在一个高铁制梁场找了一个杂活岗位，要在烈日炙烤下铁皮房里搬着令人窒息的水泥灰，他选择坚持。\n贫寒塑造人节俭的品质。在生活上，他严控每一笔花销，无特殊情况每餐平均控制在3元以下。在他看来，学生的第一要务是学习，好的成绩才是对父母的最好回报，才是克服贫困的最好方式。从大一开始他便刻苦学习，他便走向了自习室。大二时他参加了智能车大赛，前后一个月奔波于启明楼和工程实训中心。平时他过着三点一线的生活，早上早早地去到教学楼，晚上十点以后才回宿舍，这些努力让他取得92+的加权。他还致力科学研究，进行着大创项目。\n“宝剑锋自磨砺出，梅花香自苦寒来。哪怕今天是痛苦的，明天也是痛苦的，但我相信只要我坚持不懈，后天一定是幸福的。”', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('219', 'U201314033', '苏畅', '光学与电子信息学院', '高考过后的他，看到爸妈每天辛苦劳累却收入微薄，他知道是该有一定担当了。便许下诺言：大学不向家里要一分钱。高考暑假开始便找了一个家教，凑足了大学的第一笔生活费。大学里做过不计其数的兼职：发传单，卖汉堡，拣快递…大学暑假里，在一个小金属制品厂里做流水线员工，脏乱的寝室环境，惨淡的饮食条件，恶劣的工作环境都没有使他退却！大二上做了一份家教，晚上要骑车经过森林公园，一次回来的时候骑车把脸严重摔伤，但是出于对孩子的责任感，仍然坚持做完了那一个学期的家教。77号公路，武汉到家乡的距离，两个100多公里的旅途，他证明了自己的毅力！\n大学做了很多义工，从最初的义卖报纸活动的参与者，到后来在义工部做着各种义工活动的策划者，童心伴夕阳活动，探访老年公寓活动，我是策划人义工策划大赛一等奖，现在仍在坚持做的地铁义工，以及正准备着的未来爱心支教。在传播爱心之路上，永不止步！\n每周的兼职和义工，没让他忘了学习。大一学年荣获国家励志奖学金，近90的加权，他懂得如何把握好自己想做的事和该做的事，不失生活重心的努力着。\n大学对于每个人来说都是一个自由的象牙塔，他有自己的大学旋律，想给自己一个展示的机会，让别人看到每个人的大学生活都可以按照自己的意愿过的精彩，活出自己的旋律！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('220', 'U201413946', '段昳晖', '光学与电子信息学院', '不知道是否有人注意过，游泳池晚上传来的阵阵鼓声；清晨和夜晚，华科校园里整齐的跑步队伍。你们也许听说过华中科技大学校龙舟队的名号，但是却不知道，那就是我和我的队友们。我不温婉，也不恬静，有的只是一份武汉女孩的泼辣和干练，也许，你会觉得我女汉子，但，事实如此。我并不是一个安静的女孩，心中也涌动着一股倔强的拼劲，流淌着不服输的热血。在龙舟队，这股拼劲和热血，似乎找到了最适合的舞台。\n在训练中，我逐渐爱上了这个队伍：爱上了自己划出的每一桨；爱上晚上力量房里挥洒的汗水；爱上游泳池边激荡的水花；爱上清晨森林公园清新的空气；爱上周末东湖绯红的夕阳。每周超过10小时高强度的训练，让不少女孩退却，大浪淘沙，留下的更为弥足珍贵。四肢酸痛，脚腕扭伤、手指划伤，伤痛并不能阻止坚持的脚步，正相反，面对逆境，更当自强不息，锐意进取；迎难而上，执着前行！守护前人的荣耀，开创新的辉煌，正是我执着追求的目标。\n执着与追求，也让我成长为一名合格的龙舟队队员。当代表华中大踏上全国级别的龙舟大赛的赛场，捧回奖杯的时候，我明白，正是长期的坚持训练，让我有能力去守护荣耀，也在队里收获友谊，挥洒汗水，青春无憾。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('221', 'U201413882', '谢祥芝', '光学与电子信息学院', '“我还年轻，未来会有无限的可能性，我始终相信微笑面对生活，奋斗成就人生。”\n家庭微薄不稳定的收入，爸妈积劳成疾。家就一直这样飘摇搁浅，却一直扬着前进的风帆。从小就学会独立自强。小学时就习惯了早上六点起床制作简易的早餐，步行三公里去上学；初中时习惯了将眼泪埋在心底，对父母始终保持微笑；高中时因不愿意看的父母整日围生计四处奔波的疲态，曾申请退学，但最后又回到了教室，踏入华中大。 \n梦开始的地方，他知道大学的自由不是肆意妄为的放纵。在班级中，担任班长着力于班级凝聚力和学习氛围，组织班级聚餐、班级间联谊……带头并劝勉同学努力学习，自己加权近90。参加校会，锻炼自己，不断成长，逐渐具备独当一面的能力。\n在学习之余，他还利用自己的空闲时间参加勤工助学活动。将一些小任务在碎片化的时间去完成，留出大块的空闲时间供勤工助学的活动安排。每周都会去韵苑公寓岗值班，去光电信息学院社区服务中心做助理。\n“不断努力，让我的肩膀更加坚强，可以勇敢的扛起自己的一份责任。这是这些支持这我，让我在求学的道路上可以走得更远。”自助者，天助之！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('222', 'U201314395', '何恒达', '光学与电子信息学院', '用梦想诠释生命，执着追求的是梦想也是存在的意义。在大学一年半的时间里，他挤出每分每秒奔跑在梦想路上，一点一滴，执着汇聚。\n小学混游戏厅混网吧，初中打游戏，高中成绩差。没有优人的天资，只有更多的付出，上课永远第一排，在光电信息公共项目实验室、DMET国重Focus团队，光弦项目组、国光学习团队课程，自学相关知识，做项目，学习Java、Javascript、Android、51单片机、蓝牙4.0开发、图像处理、地震波模拟、光纤传感、AD电路设计、VTK,每天看80-100篇论文调研，看遍TI论坛关于蓝牙开发的几百个帖子。执着追求的他是专业第六，获国奖，特优生，校三好，校科创优秀个人，全国生物医学电子设计大赛三等奖、中国数字家庭创意与应用大赛决赛优秀入围奖、“求是杯”大学生课外学术科技作品竞赛二等奖、“航空飞豹杯”电子智能大赛二等奖、“东莞工研院杯”创新创业大赛二等奖……他奔波于各个项目之间，作为启德创新创业孵化项目光弦项目组“宝宝守护神”核心组员，获全球创业周武汉站一等奖项目，获300万预融资，3000万估值；公共项目实验室“耦合谐振子”作品参加科学模拟展；作为组长组建One团队，主持光电公共实验室单项目，获得MOOC奖学金；在国家光电实验室国家支持计划子课题中国数字人小组实习，研究图像处理与三维可视化。\n梦想可能很简单，每个人的大学生活，不管是哪条路，一路折腾，一路感受，最后能无悔就好。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('223', 'U201313729', '陈健', '电子信息与通信学院', '大一上学期加入电信系小红帽志愿服务队，并于2014年6月起担任队长职务。 克服种种苦难，参与、组织电器义务维修活动20余次；挤出个人时间，帮助同学老师解决各种电脑、电器故障。\n担任小红帽队长期间加强团队建设，策划改革，为小红帽的发展竭尽全力。\n奉献知识，服务社会，我是光荣的小红帽！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('224', 'U201313635', '陈梦婷', '电子信息与通信学院', '从前，我是一个生活比较简单的人，因为当初的目标只有一个，那就是考一所好大学。所以从步入大学的那一刻起，我就告诉自己，我必须做一个全面发展的大学生。我必须拥有一个丰富的大学生活，这就是我一直以来执着追求的目标。学生工作上，我是班级助理，一直以来管理着班级的各种事务，被班级同学评选为优秀学生干部，还作为班级助理代表在年度资助大会上发言。志愿服务上，我从大一开始就一直随着小红帽这一组织四处进行志愿服务，成为我大学生活中难得的一笔财富。兴趣爱好上，我在辩论队投入了大量的时间和经历，看着辩论队一点一点的成长，是我最开心的事情。在专业学习上，我也非常重视，一旦发现有退步就会尽力赶上。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('225', 'U201313720', '代璐', '电子信息与通信学院', '我是一名来自河南农村的学生，父母工资不高，却既要供用我上大学又要养育年幼的弟弟以及赡养年迈多病的老人。而我为了减轻家里的经济负担，一方面好好学习，并于大二上学期获得了国家奖学金以及作为负责人申请到了大创项目，另一方面利用闲暇时间做一些校内外兼职，比如检查食堂，发传单来补贴自己的生活费。除此之外，我平常还会去做一些志愿服务，比如爱心卖报，清明节扫墓等等。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('226', 'U201313476', '李小雨', '电子信息与通信学院', '自从踏入这菁菁校园之际，我便立志要在这四年荏苒年华中锻造出一个优秀的自己。我坚信天道酬勤，对知识的执着追求是我学习的动力。大二上加权91.12 分，总加权年纪第三是对我汗水的回报。对数学的执着与狂热让我获得了概率论100、微积分上98、线代96……以及全国大学生数学竞赛省三等奖的成绩。然 而这都来之不易，需要辛勤付出、耐住寂寞、抵制诱惑、顶住压力。除了学习，常任班里学委、纸桥比赛、演讲沙龙、校十佳主题团会答辩、义工活动、创青春志愿 活动都有我忙碌的身影以及被认可的成绩。假期的家教以及各类奖助学金已经能让我在经济上独立，不给父母增添负担。而最后我想说生命不死，奋斗不止。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('227', 'U201413492', '汪畅', '电子信息与通信学院', '我热爱生活，我做事认真负责。\n作为学生，我在上学期取得87.64的加权分，专业排名第5；作为志愿者，我积极参加各种志愿服务，目前获得工时46个。\n我关爱•流浪动物——我坚持了一个多学期流浪狗救助活动，给小狗带去温暖，给社会传播爱心\n我参与•文明创建——我在昙华林参加社区卫生服务，两次投身于文明创建宣传工作，为武汉争创文明城市献力\n我助力•骨髓入库——我参加中华骨髓库培训会，普及骨髓库知识，帮助志愿者骨髓入库\n志愿服务虽会劳累奔波，但这些冲淡不了我心中乐于奉献的热情，我勇于承担社会赋予我的责任，也梦想着在志愿者的路上不断前行，成为一名公益达人！\n我奉献！我快乐！\n我热爱生活，我做事认真负责。\n作为学生，我在上学期取得87.64的加权分，专业排名第5；作为志愿者，我积极参加各种志愿服务，目前获得工时46个。\n我关爱•流浪动物——我坚持了一个多学期流浪狗救助活动，给小狗带去温暖，给社会传播爱心\n我参与•文明创建——我在昙华林参加社区卫生服务，两次投身于文明创建宣传工作，为武汉争创文明城市献力\n我助力•骨髓入库——我参加中华骨髓库培训会，普及骨髓库知识，帮助志愿者骨髓入库\n志愿服务虽会劳累奔波，但这些冲淡不了我心中乐于奉献的热情，我勇于承担社会赋予我的责任，也梦想着在志愿者的路上不断前行，成为一名公益达人！\n我奉献！我快乐！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('228', 'U201313614', '王艺帆', '电子信息与通信学院', '我喜欢技术，喜欢钻研，喜欢不断挑战自我。\n首先，作为学生，我的总加权成绩专业第二，英语四级614，六级548。大二上期拿到计算机三级证书。大一积极参加学生工作，协助组织了院十大歌手比赛、迎新晚会等活动。\n学有余力的同时，加入联创团队，与人合作开发了两款应用，一个在中国银 行的比赛中获奖，一个发布在百度应用市场中；另有一个网站正在内测，技术方面由我全权负责。加入校网研中心，目前正在参与学校部分网络系统的构建。掌握Java, Python, C, C++, JavaScript.....\n 生活方面，热爱运动，篮球台球乒乓球，虽不是样样精通，但也并不逊色。院系篮球赛每次必参加，迎新晚会也可以登台高歌。我总是乐于尝试新的体验。\n这就是我，执着追求着的，不仅仅是技术，也不仅仅是挑战本身，而是在挑战中不断成长的自己。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('229', 'U201316341', '阮泽慧', '管理学院', '一个不太成熟但却一直执着追求着的女孩人生，由一个个挑战组成，执着于塑造更优秀自己。希望与大家一同前行！\n学习：保持专业前30%左右的成绩，上学期加权88.11分，班上第2；\n学工：校团委组织部人力资源部主任；营销班副班长，成功争取“优良学风班”等称号；市场营销协会策划部部长；英协“荣誉之星”；大创部长助理；托业校园代理；\n专业：获得强生商业精英挑战赛团队第2名，600多人脱颖而出获得最佳个人；拿到强生5个实习绿色通道之一；\n英语：启明3C团队英文演讲组、模联组；校广播台英文播音组；IDEA英文辩论赛省三等奖等比赛；\n演讲：“院十大演说家”冠军；\n政素：首批入党积极分子结业证书；2014年“优秀共青团员“；“回访母校”团队；\n志愿：“创青春”海南大学志愿者、图书馆义工、启明特教看望自闭症儿童；\n思辨：院辩论队主力，多次成为如校园文化节“喻晓之巅”辩论赛“最佳辩手”、“优秀辩手”；\n艺术：8年舞蹈，精通中国舞；6年小提琴；1年钢琴；1年美声；连续两次“文体奖学金”；校艺术团合唱团；全国第四届大学生艺术展演合唱组一等奖；”校园好声音“省第2；\n主持：院主持人队；艺术团表演队；主持经验达十几场等。\n\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('230', 'U201216298', '王小雪', '管理学院', '为“她”执着——学习：从大一到大二，一年时间，加权上涨十分，大三学期加权升至专业第三；为“她”执着——组织竞赛：从商业公益团队副主席，到互联网团队产品经理；从求是杯创业竞赛，联合利华营销大赛，再到手机APP大赛，微信公众号运营，我都全力为之，力求做到极致。为“她”执着——公益实践：开展多个公益项目，积极参加社会实践，并坚持长期义工；为“她”执着——产品项目：从大学生求职系统，到校园图书馆查询系统，从“HUST奶茶时间”到一个个节日游戏，我都沉溺其中。我热衷书法，十年不曾间断；也喜欢跑步，从不及格，到第一名。但行好事，莫问前程。Dream！ Action！Persistance！是谓自强！我是王小雪 故事未完，精彩待续…', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('231', 'U201316418', '文雅茜', '管理学院', '从来不曾忘记，作为志愿者得到的那份最简单的快乐、最纯粹的感动。也从来不曾放弃，作为志愿者所拥有的那份坚韧、那份执着。中华骨髓库入库志愿者，寄托着延续生命的希冀。地铁义工，是将近一年每两周一次的坚持。中国市场营销国际学术年会志愿者，激发着一个人拼搏的劲头。创青春志愿者，是参赛队伍的指南针，让他们在偌大的华科校园绝不迷路。湖北省图书馆义工，是安静地穿梭于书架间的精灵，让所有书籍变得井井有条。献血志愿者，是对生命的热爱，是满怀一腔热血的注解。这些都是我，在平凡的生活中用一个接一个的志愿者活动延续着属于我自己的精彩人生。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('232', 'U201416071', '周小又', '管理学院', '我是来自一个山区热爱生活，积极向上的女孩。从小，爸妈为了生活外出打工，家里只有我和弟弟以及年迈的爷爷奶奶!才上三年级的我不得不学会自己照顾自己和年幼的弟弟!学着帮爷爷奶奶做家务!后来爸爸因为一个意外成了残疾人，家里的房屋又不幸的在地震中被毁，面对这些，我一边认真学习!力图使家里燃起希望，一边趁着每天放学的时间，回家帮忙背砖重新修建房屋，做一些力所能及的事来减轻家里的负担!面对家里拮据的生活，未住校时，只要一放学，我就去茶园帮忙采茶赚钱，上了高中后又利用假期在爸爸的工地上打工，现在的我积极参加学校的勤工俭学!虽然有点辛苦，但我我从未抱怨，只因为我相信，生活中的坎坷从来不可避免，只因为我相信，人虽然无法绝定自己的出生，但是却可以选择凭借自己的努力，改变命运!', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('233', 'U201415989', '邹兴', '管理学院', '他叫邹兴，一个以周星驰为偶像并对生活充满希望的人。他来自贵州一个偏远贫穷但却十分美丽的地方。从小的经历造就了他直接而又现实的梦想：“成为有钱人，并且帮助那些像他一样需要帮助的人。” \n他从高一时妈妈离家出走的巨大阴影里走了出来。也就是从那时起，他通过做兼职赚取生活费，以减轻爸爸肩上的重担。四年来他做过牛奶促销，影楼促销，在工厂打工，天马驾校校园代理等15多种兼职，虽然很累，但他从没放弃。\n他现在是校团委组织部助理，校资助中心实习助理，管理学院14级年级学生会副主席和工商班的班长。他热衷于公益活动，曾参加“吾爱吴泗行”支教，并且担当创青春志愿者。\n虽然至今家里已欠债5万多元但他一直在坚持。永不放弃，邹兴，雄起！\n他是一个讲故事的人，期待与你一起分享他的故事。\n\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('234', 'U201415673', '白玛曲宗', '环境学院', '她牢牢地记住了父亲的话“知识可以改变命运”。于是，12岁，小小年纪的她便背起行囊，远离故乡西藏，来到内地求学。但漫漫求学路，注定不会是一帆风顺的。在外读书期间，奶奶去世，母亲病重，父亲靠微薄的收入维持着这个家。面对种种打击，她没有一蹶不振，没有自甘堕落，而是选择了坚韧，选择了乐观，选择了正视眼前的困境。在高消费的上海，她只用500元便可维持一个学期的开销，并且偶尔还会寄钱给在北京上大学的哥哥。面对拮据困乏的物质生活，她执着地追求精神世界的富有，慢慢地从一个听不懂普通话的孩子成长为一名高校大学生。\n毁灭，还是生存？选择的权利在我们自己的手中。白玛曲宗，她用自己的选择诠释着什么是自强不息，什么是百折不挠。命运的不公压不垮她，生活的磨难打不倒她。相反，正是这些苦难成就了今日的她，让她的意志更加坚定，目标更加明确。她就是雪原里不畏严寒，傲雪挺立的一枝莲花，幽幽暗香飘来，那样清淡，那样高雅，又那样激励人心。\n\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('235', 'U201415975', '曹智', '环境学院', '家境贫寒并没有让他产生自卑，相反，在人生路上，他是一个勇敢的逐梦者。\n从班级到年级再到校级的各个组织中，都能看到他活跃的身影。作为班级团支书，他精心策划团会活动，团结班级同学。作为年级组织部部长，他尽心组织双旦舞会，并成功为环球争霸篮球赛拉得赞助，解决了资金问题。作为学校社联、大创的一份子，他用心完成每一项任务，获得了优秀个人的称号。\n丰富的阅历让他极具商业头脑。加入了wedo创业团队成为一名精英销售员同时为一家留学机构做代理，周六日还会去一家留学公司做实习生。凭借这些固定的工作，他不再向父母索要一分钱，成为一个真正独立的人。目前，他在为成立一家奶茶店而筹划。这是他的梦想，也是他们一个团队的梦想。他相信只要精心浇注，梦想定会开花。\n一路风雨，披荆斩棘，他如一位骑士，在逐梦之旅上一路向前。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('236', 'U201415696', '何长峰', '环境学院', '生活中总有许多坎坷和不平，但只有勇于搏击的人，才是生命的强者。何长峰，一个阳光般的大男孩，在遭到生活的嘲弄时，依旧向人们展现出乐观与自信。他用自己的实际行动，做出无畏的反击。\n母亲被检测出患有重病，高额的医疗费用让原本拮据的家庭雪上加霜。生活以痛吻我，要我回报以歌。正是这份积极向上的心态，让他的意志更加坚定，奋起读书，以最好的状态生活每一天。他参加实验室勤工助学活动，希望用自己的一份力量，来减轻家中的负担。他坚持武汉育校高中辅导班义务行志愿者活动，希望通过自己不辞辛苦的努力，能帮助更多需要帮助的人。天行健，君子以自强不息，对他来说，苦难不会打到一个人，反而会让人变得更坚强。\n自强者恒强，坚强的他在生命的舞台上演绎出一部雄壮的命运交响曲。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('237', 'U201216033', '李冬丽', '环境学院', '一家六口人挤过一间只有二十多平米的小房间，有时屋顶会漏雨，有时吃不上早饭，更有几次差点因为交不起学费而辍学。生活的贫困，不曾阻拦她追求知识的脚步，不曾浇灭她励志上大学的决心。她把苦难当成人生路上的垫脚石，永不轻言放弃。\n在最深的绝望里，总能遇见最美的风景。每一次险些辍学，都是周围好心人的热情帮助才得以延续十几年的求学梦。人只有经历了，才会晓得机会来之不易，才会懂得要倍加珍惜。同样也是大家的热心帮助让她由一个内向的小姑娘，变得外向，变得活泼，变得开朗，增加了对生活的热爱。从导游到义务解说员，从班长到民族部部长，她积极参加社会活动，尽心做好学生工作。如今的她在用自己的切实行动，回报社会，将爱的暖流传递。\n经过一次次与命运不屈的抗争，她用最美的微笑告诉大家，努力、坚韧、自信、自强，即使逆风飞翔，依旧可以飞的高远。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('238', 'U201316091', '毛鹏', '环境学院', '“没有过人之处，只好出过人之力。”刚刚进入大学时候的毛鹏，看着身边的人一个个如此优秀，而自己甚至连普通话都说不好，这样对自己说。\n为了弥补自身的不足，实现自我的超越，从此，他在学习上毫不懈怠，为自己制定学习规划，认真阅读各种课外书籍拓展自己的视野，网上学习名校公开课、百家讲坛，读书笔记足足做了六个笔记本；从此，他在学生工作上积极参与，加入团学联、资委会，成立华科杉树社，学校里的各种活动似乎都留下了他的身影；从此，他致力于社会实践，参加“青春创业行”、“青年马克思主义培训班”，参加“爱我中国，修我长城”千名学子保护宣传大型志愿者活动，在“创青春”中担任接待组的志愿者，奔赴江夏高中为备考学生做考前经验学习交流，两度回家乡做高中回访交流等等。\n他的努力没有白费，他的汗水收获了成果，国奖、校三好、2014年华中科技大学科创积极分子等等一项项荣誉光彩夺目。对此，他只是淡然一笑，不自傲，不自满，笃行于“心有所愿，行而成立”的逐梦之旅，怡然自乐。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('239', 'U201317341', '蓝婧', '新闻学院', '我是蓝婧，来自新闻与信息传播学院广告1301班。\n我的座右铭是“生如夏花之绚烂，死如秋叶之静美”，这不仅是我的精神追求，也是我为人处事的准则。我善于交际，常在各种活动中调动气氛带去欢乐；我自立自强，能靠自己的双手挣取大学生活的费用；我敢想敢为，会竭尽全力地做着我认为有意义的事情……我还有一颗真挚的爱心，长久以来积极地投入社会公益事业，尤其在关怀弱势群体和特殊人群方面做了不少贡献。\n从小学开始，我就参与了各种形式的志愿服务活动，比如学校迎宾使者、福利院演出等。印象深刻的还有加入我们市里面的“南康义工”组织，常进行园林清扫等活动。上了大学，我对社会公益和志愿服务更加充满热情和能量。我做过创青春活动志愿者、运动会志愿者、武汉创建全国文明城市督察员，也卖过义报等等。最让我感到骄傲的，是从微梦社工协会的会员到会长，矢志不渝地坚持着社工事业。我坚守“助人自助”，且深信要真正地帮助弱势群体和特殊人群，就应该努力让他们自己帮助自己，让他们找回自信和勇气，让他们拥有与正常人一样的生活。我会一直坚持社工和志愿服务，希望更多人加入这个行列，也希望我们的社会变得更加美好！\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('240', 'U201317345', '梁雅文', '新闻学院', '我是来自新闻学院广告1301班的梁雅文，目前是新闻学院资助委员会主任以及院系资助助理。我属于很外向的女生，而且时常不定期犯二，但是做事情还是比较靠谱的。作为一名资助委员，在来到华科的这将近两年里，我几乎组织并且参加过所有的义工活动。也许在很多人看来，这只是资助委员分内的工作。我和很多资委小伙伴一样，也觉得这些都是些小事。但是这一路走来，我真的不觉得有大家想的那么容易。腿摔伤了冒雨带着同学去省图做义工，清早去东大门领取报纸，冒着炎热去收集旧书，我相信这是每个资助委员都体会过的艰辛。这是我的工作，也是我的公益理想，尽管它没有那么的神秘和伟大，但是至少，这两年里，我一直在坚持，而且还将继续坚持下去。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('241', 'U201317347', '刘雅珺', '新闻学院', '我是华科新闻学院广告学专业的同学，来自河南省驻马店市西平县师灵镇的一个小村庄里。自强对于我来说是一件必须所以就自然而然的事情，因为条件不好，所以我热爱生活，渴望自强。从小学一个人步行到别的村子上学，到初中便开始了离家一个人生活，直到今天，从独立生活中收获了很多。家庭无法选择，我就只有自己努力，好好学习，所以我走出了小村子，我为自己骄傲。初中高中的奖助学金给了我很多帮助，来到大学，我为家庭分担的想法有增无减，我做了许多兼职，戴尔课戴表，一年的优秀表现换来了实习证明的肯定，发传单，饮料查核员，在学校超市勤工助学，西瓜帮兼职，做家教，这些带给我的不仅仅是经济上的满足，更多的是一种充实多彩的感觉，丰富的经历，我有能力靠自己。可是兼职并不可以成为大学生活全部，院会宣传部有我的足迹，跆拳道协会有我的表演，做过志愿者，马路义工发报纸昙华林义工都有我的身影，回访母校很成功，同时我的成绩在班里也不错，四六级已经通过但仍然要努力刷分，还报了双学位。所有的这些都是我热爱生活的结晶。我喜欢接受我们不能改变的，改变我们可以掌握的。平凡而不平庸，自强而不息，努力而积极，热爱生活，这就是我。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('242', 'U201317302', '张晓娜', '新闻学院', '从初二开始，就立志成为一名记者，第一年高考没有被自己喜欢的学校录取，顶着各种压力去复习，后来如愿进入了我校新闻专业。当时学新闻，爸妈是不支持的，他们希望我可以学会计或者财务类的，以后就业工作会更合适，但一心想读新闻的我最后还是说服了他们。进入大学后，加入记者团，成为了我目前做的最正确的事情，一年来，累计发稿40多篇，并在楚天都市报，楚天金报等平台多次发稿。\n充分利用寒暑假时间去媒体单位实习。大一暑假在石家庄日报文体部实习一个月，发稿量11篇，其中《铁嘴钢喉为戏狂——访京剧名角康万生》在单位评为了好稿二等奖。得到了指导老师的好评。大二寒假，离校后第二天就去石家庄电视台新闻综合频道实习，为期3周的实习让短暂的假期充实了很多，去地铁工地、爆炸现场等地的采访经历让我对新闻工作的了解更加深入，更加坚定了自己成为一名新闻工作者的决心。\n这个职业固然免不了奔波劳累，但是每天都有新鲜内容，见不同的人，见各种各样的事情。今天所见所闻所写下新闻就是明天的历史，这份神圣感足以使我满足。 ', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('243', 'U201214534', '谭资昌', '自动化学院\n', '我来自湖南株洲茶陵县的一个小乡村，家庭贫困，父母自我两岁的时候便到西藏打工，常年在外，记得最长的一次父母5年才回家一次。父母不在，爷爷奶奶年迈，从小我就成了家里的顶梁柱，自立自强。不到10岁，我就开始下田忙活，种地种菜，上山砍柴。虽然父母常年不在家，但是在学习上，我从小就十分自觉，从小就上进努力。从一个不知名的乡村小学以全乡第一进入县城中学学习，中考时再次以中学年级第一考入县重点中学，不放弃的我一直没有松气，最终以全县第三的成绩考入华中科技大学。由于高中教育水平落后，在大学，经过不懈努力，我将综合成绩由倒数第二变为正数第二。最后拿到了国家奖学金，启明学院特优生，校三好学生等等。数模竞赛零起步，自学MATLAB，lingo，数学模型相关知识，所用数模的资料达到几个G，基本上80%的论文我都看了至少两遍，一个暑假，两次练习赛，一次正式比赛，我和我的队友最后那两天都不会寝室，累了就睡在启明12楼的地板，醒了就继续干活。最后我们队伍拿了全国大学生数学建模竞赛的国家一等奖。我认为自强，是一种自我超越的气质，它来自于你内心想要变得更加优秀的那种强烈的渴望，这种渴望，让你在逆境中从不放弃，在顺境中从不止步，让你不断的超越自我，越变越强！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('244', 'U201214418', '张梦颖', '自动化学院\n', '在大学伊始，我就加入了援之缘支教协会，想要为山里的孩子们做些什么。因为喜欢孩子，我积极参加协会举办的周末课堂活动，利用周五下午的时间，给武汉周边小学的孩子们带去英语趣味课堂的教学。往返的路程比上课的时间还长，但觉得很值得。看着孩子们的天真笑脸，让我觉得放松。在2014年3月，我报名参加了援之缘支教协会暑期志愿者。经过4选1的残酷的两轮面试，再到长达三个月的培训，我来到甘肃古浪酸茨沟村在大山深处，睡在教室的桌子上，吃着半生不熟的饭，每天在烈日下走两个小时送孩子们回家，中暑吐得站都站不起来，没有手机，没有电视，没有网络，我坚持了下来，换来的是孩子们一句“张老师你一定要回来……”；在上学期间，我也一直坚持我们学院的无工时活动——养老院之行，并获得自动化学院“优秀志愿者”称号。每个周日的早上,在别人还在睡梦中的时候,我已经在走在去养老院的路上。印象最深的就是给老人洗脚，老奶奶的脚又干又瘦，因为长时间没有清洗已经有可以看见的污垢，脚趾甲有着厚厚的增生，连看护人员都不愿意为她清洗，在我们为老奶奶洗脚的时候，她一直在说：“好舒服，好舒服，谢谢你们，谢谢你们。”我在“创青春”全国大学生创业大赛中作为会务组志愿者，任第三组组长，起早贪黑活又多，没有固定的时间，工作地点，更需要随叫随到。做志愿者，只因为双眼曾经看见过苦难，就再也不能视而不见，我相信，再微小的职位，也会因为你的用心而出彩。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('245', 'U201214551', '陈东东', '自动化学院\n', '我是一个臭小子，对于一件事，如果我觉得有价值，便会尽全力。工作上，我全力以赴，去年，我和一群\n好朋友一起到汉口小天鹅酒店的社会人聚会现场，去为一个小学的图书角拉赞助，我们和他们素不相识，\n就凭我们做过的事，真诚的心，诚恳的态度，最后获得了4500元的赞助。学习上，我全力以赴，大二上，\n我是班级10多名，加权只有85，大二下一学期，我疯狂努力，加权92.69，提升了将近8个加权，最后才有\n机会参评国奖。生活上，我全力以赴，朋友来找我玩，我白天陪他玩，晚上在电工基地刷夜做课设。我喜\n欢全力以赴的感觉，我喜欢年轻人身上具有的热血与激情，我要实现我的“价值青春”。全力以赴，它是一种态度，更是一种行动，认定了，我就一定全力以赴，否则，我就不叫臭小子。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('246', 'U201314734', '龚桂良', '自动化学院\n', '我出生于农村家庭，四岁母故。现家里还有三姐妹，父亲已入花甲之年，下岗务农。两人读书。为尽量减轻父亲的负担，不负父亲的期望，一直刻苦学习，积极争取奖助学金，并利用课余时间和寒暑假做兼职。\n大一上身兼三份兼职，白天作为学风督察员课间查课，晚上作为楼栋协管员守楼，周末在街道口坐咨询台。大二为学风督查组组长，并参与华科小麦公社物流团队的创建。大学以来靠自己的双手买了手机电脑，交大二的学费和支付大学一切生活费用。与此同时我合理安排好学习时间，大一上获得了加权88.67，专业第三及大二上加权90.5的成绩，通过了CET4和CET6。获得过“新生学习优秀奖学金”、“自强奖学金”、“自强之星”以及“国家励志奖学金”。大学以前对电脑的认识仅限于高一每两周一节的计算机课。甚至于大学刚开始连基本的复制粘贴都不会，找电脑电源键要找半天，更何况下载东西。与电脑有关的课都让我很焦虑。但是我没有自弃，通过认真听讲、自学和实践，不光熟练掌握了基本办公软件的使用，对于AUTOCAD、PCB、PS等都有了一定的应用技能。C课设虽然很难，但是我没有退缩，通过多问常优化，以个人近4000的代码量获得了A的成绩，在C语言课程设计大赛中获得了“三等奖”，通过了国家计算机等级考试二级。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('247', 'U201214415', '周 杰', '自动化学院\n', '我出生在西部的农村里，从小家庭经济就开始走下坡路，小时候因为没钱看病与死神擦肩而过，从小体弱多病，因为没有钱，营养跟不上，缺钙导致了现在的“罗圈腿”，但是贫困的家境不仅没有磨灭我的意志，反而让我更加坚定了奋斗不止，自强不息的信念，后来跟随在浙江务工的爸妈，进入到了当地初中读书，随后以优异的成绩考入省级重点高中，就在对自己的前途充满期待时，被告知无法在浙江当地参加高考，无奈之下只有辗转回到四川，面对教材不同，时间紧迫的双重挑战，最终顶住压力，以优异的成绩考上华科大。上大学后更加严格的要求自己，不断提升自己的综合素质，然后又一次意外来袭，14年末父亲因突发脑溢血去世，家里的重担突然一下子几乎全部落到了我的身上，但是勇敢的去面对了这个事实，一方面要照顾和关心家里的妈妈和爷爷，另一方面是自己的学业，学习之余还会去兼职赚钱，但我相信，唯有勇敢的面对，自强不息得奋斗，才能真正的走过这个坎儿，走向更美好的生活。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('248', 'U201112923', '陈雪慧', '第二临床学院', '热爱挑战，执着追求。暑期组织参与“徒步滇藏线”，香格里拉到拉萨， 40余天， 1000余公里。这种经历在许多人看来疯狂也值得羡慕的，但荣耀背后是辛勤的汗水。整整6个月的筹备，辛苦却不曾放弃！滇藏之行共计花费的8000余元，也均是我课余做家教和奖学金所得，不曾向父母索要丝毫。自己的梦想要靠自己支撑。\n勤工俭学，生活上勤俭节约，从大二至今坚持做家教，进入大学以来的学费生活费均来自奖学金和课余收入。\n热爱公益，坚持参加各项义工活动，仅大三上学期义工工时数40余\n学习优异，通过计算机二、三级考试，英语四六级，大二全年加权95.44分，位列专业第一名。\n奖项：2013——2014年度国家奖学金，校三好\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('249', 'U201213021', '丁帅', '第二临床学院', '我服务，我快乐\n   出生在一个贫寒的家庭，从小父母亲就教育我要坚强而有爱地生活，而我也将自己的大学生活定格在志愿服务与努力学习中。我积极参与尝试各种不同的志愿服务，希望自己的微薄之力能让这个世界充满更多笑脸，阳光大学生卖报，艾滋病宣教协会，武汉血液中心，阳光医学生，图书馆管理，宿舍楼栋守岗，爱心导医，爱心病房，“小废品，大爱心”，“一站到底”汉口火车站志愿服务……每一次服务都让我感到真心愉快。我用自己的学习经验去帮助那些仍在为高考奋斗的学生：大一寒假，在回访母校的活动中志愿为母校的学生补习功课；大一暑假，在家乡创办补习班，为家乡学生补课，学生的成绩有了明显的进步；在校期间也会坚持每周做家教，服务他人并减轻家里负担。大三参加艾滋病宣教协会，走进社区宣传“关艾”知识。平均每个学年义工工时超过80。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('250', 'U201112923', '康雪慧', '第二临床学院', '2002年父母下岗，一直在外面打零工，工作很辛苦但收入微薄，仅能维持基本的生活开销，家境贫寒，十几年来一家人都过着艰苦朴素的生活。高考后到现在我坚持做兼职赚取生活费，减轻家里的负担，我做过酒店的服务生、促销员、给干洗店送衣服，家教等，生活上自立自强，用乐观感恩的心态面对每一天，对同学乐于助人真诚热心，对学习踏实认真、刻苦专研，按照自己定下的目标努力着，和同学们相处融洽，在学习上也取得了较好的成绩。生活中难免会遇到各种各样的困难或挫折，但是我都能调整好自己的心态，绝不自暴自弃，而是积极想办法解决，我的父母也是这样这样教育我的，去年的时候我生病的事情对我的打击很大，身体的不适和治疗的花费让我觉得非常辛苦，那段时间有点消极，学习成绩也受到影响，很庆幸最终还是战胜了苦难又有所成长。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('251', 'U201211287', '徐声铭', '第二临床学院', '于我而言，自强者的人生没有选择题，只有证明题。回望近三年的大学生活，我可以很骄傲地说，在追求自我完善的道路上，我始终是执着而又坚定地。\n大一时，自己从材料学院转入医学院，两种不同的学习模式带来的差异是巨大的，然而我始终默默坚持。大一暑假，我报名外国语学院暑期夏令营助教，从英语刚过四级到能与外教熟练沟通，其中的困难是巨大的，然而收获也是巨大的。\n大二下学期，我选修了双学位。每周一次，从汉口到武昌，来回都要花去三个多小时，无论严寒酷暑但我没有逃过一天课。大二下学期，我报名了雅思考试。每天早上六点半雷打不动去广场早读，学期末各种考试的压力迎面而来，咬咬牙坚持过了熬过了最痛苦的日子，最终获得了回报，通过了雅思考试。\n每天除了学习，我始终不忘坚持锻炼，跑步一跑就是半个小时，并在汗水中感到快乐。就这样坚持一年多，从原来的一百八十斤的大胖子瘦到了现在的一百四。\n越痛苦的日子才约有坚持的意义。自强，始终是我不断追求一个更优秀的自己的支柱。我相信，以后的日子，我会变得更加优秀。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('252', 'U201010534', '徐滔', '第二临床学院', '在我看来，做人做学生一定要自强自立，奋发图强，虽然你有可能不是最优秀的，但在某一方面，你一定是出色的。我觉得在大学这几年，自己也慢慢的在努力成长着。\n在学习上，自己一直没有放松过，成绩始终位于中等偏上的水平，成功的考过四六级，计算机四级，还有英语口语等级考试。工作上，在大一到大三期间担任了三年的班长，与其他班干部一起组织各项活动，团结同学，并且班级连续评上优良学风班，自己也多次被评上校优秀学生干部。生活中，自己也是个充满正能量的人，周末会和专业同学一起打球，会坚持去健身房锻炼身体，每周也会坚持晚上去操场跑步，努力做到学习锻炼两不误，并多次代表学院参加校运动会。在课余时间，自己也还会去做家教，以减轻家里负担，自己的付出也得到了家长的肯定\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('253', 'U201313286', '陈岚', '法医系', '从小学第一次踏入养老院的大门，成为带给孤独老人们阳光的开心果时，义工就在我的心中扎了根。进入理想的学府深造，我依旧没有忘记象牙塔的坚持，担任资助助理的工作更是让我有了新的体悟。大一坚持了一整年的地铁义工，以及在学校社区普及急救常识，还常常组织班里一起爱心卖报，去省图、校图书馆、宠物救助站等做义工。班级其乐融融一起以做义工的形式出游，不仅让我们更加凝聚，更让我班同学感受到志愿服务的魅力，期末时受到肯定被评为“优秀义工班级”。大二来到课业负担明显重了不少的医学院这边，这颗热爱公益的心仍然在不停地跳动，继续作为急救队的助教四处宣讲的同时，还参与了爱心导医、爱心培智、献血车、小废品大爱心等义工。同时我也励志通过学生工作服务同校甚至全城的同学，社联、社实、资助中心、青协、强生TLS、系学生会，两届社团文化节、一届新年游园会、武汉高校商业精英挑战赛、法医面对面等活动的幕前幕后都能看到我忙碌的身影。希望我对公益的坚持可以感染到更多的人！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('254', 'U201313294', '黄芳', '法医系', '从小，我就希望自己是一个德智体美全面发展的学生——只有这样我才能成为一个全方位的人才，适应时代的需求，更好实现自己的社会价值。在我的成长线里，我一路上都执着追求着自己的全方面成长。\n  德：我多次参与献血义工活动，积极献血，长期主动坚持地铁义工工作。在班级，我担任学习委员，态度认真负责。\n  智：我的总加权成绩位列专业第二，一次性通过四六级考试。\n  体：我作为生科院拉拉队的队长，带领着我们的队员经历了多场篮球赛，经历了多了舞台；我也作为一个运动员，在校运会上取得过第一名、第四名的好成绩。\n  美：我积极参加了社团活动，参加了校内外的嘉年华演出；参加英语协会的三行诗比赛，并获得终极优胜。我是社联宣传部的一员，一年半的时间里，我积极参与宣传设计制作，为社团嘉年华增色添彩。我还是艺术团艺美队的成员，让舞台更多彩。在本学期，我还开始了建筑双学位的学习。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('255', 'U201117250', '高君玫', '公共卫生学院', '大学期间，我自立自强，乐观进取，积极加入各种学生组织并努力做到最好，参加各种公益活动，克服家庭困难，在各方面提升自我。\n在学生工作上，我不仅担任我们院的院系资助负责人，还曾担任校团委直属报社社长、院系资助委员会会长，小班团支书。平时工作认真负责，资助工作一丝不苟，从大一担任院系助理以来，带领全年级做义工和勤工，资助会议积极参与，资助工作认真落实，连续两年带领院系获得优秀资助助理委员会的称号，自己也获得了校优秀院系资助助理。\n大二大三的课余时间我会通过各种渠道找寻家教来补贴生活费，在繁重的学业以及生活压力下仍然选择修武汉大学经济学双学位来充实自己，在两个看似不不搭界的学科找到平衡，大四进入专业课学习异常辛苦，所以放弃家教而选择将生活费节省下来的部分投入股市，因为了解了经济学的基本原理多以少了一点盲目，多了一点理性，投资并不投机，能稍微补贴生活。\n此外，我还积极参与科研活动，跟随跟着姚平老师做大创，并且跟过公卫吕美霞老师也一段时间，科研的课外学分远超规定要求。\n看过去的成绩或许我并不优秀，但是我相信我正在不断进步。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('256', 'U201313093', '聂秀泉', '公共卫生学院', '我是一个能够坚持的人，举个例子：我从上大学以来，从来都是在7点以前起床，只有大一下学期刚开始一周因为感冒在七点以后起床；我还在大二上学期开始记账，一直坚持到现在；我坚持每个寒暑假健身，每天50个俯卧撑，200个仰卧起坐，10个引体向上，等等。坚持使我受益匪浅，早起使我每天精力充沛，有更多的时间去做更多的事情，毕竟一日之计在于晨，我的学习成绩也名列前茅；坚持锻炼使我有强健的体魄，有充足的体力做我想做的事，我是我们班的体育委员，在院足球队。坚持使我信心倍增，我相信，我想做的事，只要我坚持，就没有什么做不到！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('257', 'U201117275', '牛晓歌', '公共卫生学院', '大学期间，我学习勤奋，自立自强，乐观进取，积极参加各种公益活动，克服家庭困难，取得优秀成绩，并在各方面提升自我。\n我来自农村，父母以种地为生。父亲患有糖尿病，常年吃药。母亲患有心脏病二十余年，几乎没有劳动能力，两年前手术，费用几万元，身体仍未恢复。还有年迈残疾有精神疾病的外婆需要赡养，医药费开销很大，收入微薄，生活拮据。\n课余时间我坚持做各种兼职。大一时申请到公寓值班的勤工助学岗位，之后每学期都会做家教，最多同时兼职三份家教，赚取生活费。加上获得的各种奖学金，生活费已能自足，每年还有3000元剩余来补贴家用。\n学习方面，至大四上结束，总加权89.39，总排名专业第二。获得过三次“国家励志奖学金”，学习优秀奖学金，社会公益奖学金，上海复兴医药奖学金等。并通过了大学英语四六级，计算机四级等。\n我喜欢参加公益活动也积极参与科研活动。希望做一个全面发展的人。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('258', 'U201212684', '杨卫华', '公共卫生学院', '家庭情况：是少数民族，来自山区。爸妈均已60多岁，在家务农，无工作能力。妈妈有高血压，今年正月病倒过一次，不能做体力活。姐姐有三个孩子，也在读书。\n学生工作：从大一开始担任班上的资助委员，组织过很多义工，包括到森林公园种花，整理图书馆等。2014年参加院系毕业晚会“梦飞舞”的筹划并参与演出舞蹈剧“梦”和小人舞，以及负责拳击节目“搏击操”。在同济资助中心担任助理一年，为同学服务，最终获得“优秀中心助理”。加入院系资助委员会，从2014年下学期开始担任会长，和会员一起开创了辛亥革命纪念馆志愿者的义工，并获得“2014年华中科技大学优秀院系资助助理委员会”。\n生活：从大一开始学费是贷款，生活费大部分是自己做兼职赚的钱。与寝室和班上同学相处融洽\n兴趣爱好:在2014年加入街舞社，在街舞社里面学习爵士舞，虽然自己学的很慢，但是我从来没有放弃过，依然为了自己的爱好在努力，目前正在准备2015年“梦飞舞”的开场舞。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('259', 'U201213145', '肖芳', '护理学系', '我是一个来自湖北洪湖的农村姑娘。在学习生涯中，十分感谢能多次获得国家补助继续学业。从小，我就很热爱读书。大学期间，我也靠自己在暑假或有空时做兼职，比如，发传单、做家教，赚取学费和生活费。\n进入大学后，虽被确诊患有骨髓增殖性肿瘤，需要经常去医院就诊，但我依然时刻保持学习的劲头，专业成绩排名第一。因此，先后多次获得学习优秀进步奖、国家励志奖学金、曾宪梓奖学金等等。而且，在学习气氛的带动下，我们寝室所有成员班级排名均在前十。班级成员的挂科率也有所下降。这是我觉得很自豪的事情。\n另外，我还报读了双学位，积极参加各种校内校外的活动。我担任辅导员助理两年，并在第二年成为组长，帮助辅导员处理院系及班级事务。多次积极参加系里“化蝶飞”等重大活动。热爱运动，参加了体育舞蹈队，提升自己的综合素质。也多次跟着老师参加科研，在她们的带领下，了解到科研的重要性与科研的要求。另外，我参加过地铁义工，参加过爱心病房，校外探访过敬老院，与老人们聊天，其乐融融。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('260', 'U201210512', '陈冰鑫', ' 基础医学院', '我的父亲在我初二时患肝癌去世，之后我的母亲便扛起了家庭重担，供我读书。\n现在，我读大三，母亲在老家做保安维持生计。为了减轻母亲的负担，我在业余时间做兼职，比如说家教，学校公寓岗，联通营业厅帮忙等等。通过我兼职所得，我基本上不需要家里负担我的生活费。最让我开心的是，上个学期，我用我家教的工资，带母亲在十一假期去重庆旅游。全程的吃，住，路费，都是我来出。\n对于学业，我一直严格要求自己。我知道，给我们上课的都是特别优秀的老师，只有好好听课才对得起他们的辛勤讲课。上课时，我认真听，仔细想；课后，我认真完成作业，主动去思考老师留下的问题，去查阅资料。我很感谢同济浓厚的学风，鞭策我在知识的海洋里面遨游，享受。\n对于学生工作。大一大二，我在主校区参加了红十字队，不管是爱心募捐还是急救培训，我总是活跃在第一线。大三，我加入了基础医学院学生会，成为了学生会的副主席，准备春华秋实，筹备游园会，我在这些工作中尽情挥洒，满满收获。\n我最喜欢一句话：未来的你一定感谢现在努力自强的自己。所以我相信，现在我在跑，未来我在笑！\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('261', 'U201210534', '胡紫薇', ' 基础医学院', '  我的性格就像我的名字——紫薇一样，自强不息、蓬勃向上。\n   学习方面：有追求、有目标，大二加权90+，获学习优秀奖学金，辅修德语。\n   社会服务方面：乐于奉献，积极参加各类公益活动，爱心病房志愿者、植物园义工、寒假返校宣传活动宣讲人、挪威交换生生活志愿者、万松园社区关爱老人志愿者…\n   学生工作方面：担任八年制医学生协会对外交流部IFMSA-SCOPE负责人，在每年暑假接待外国交换生的同时也送出去一批学长学姐去国外交流；加入艺术团艺美队\n勇于挑战的我积极参加各种活动：作为同济代表参加了在湘雅举办的第四届全国八年制医学生论坛；作为中国代表参加IFMSA在日本东京举办的Sub Regional Training;参加北协和超级课程，参会费都是自己通过办补习班，家教挣来的。\n    在我看来，自强就是在挑战自我的过程中活出人生价值的过程。愿我的自强能给更多的人带来正能量！\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('262', 'U201312907', '金瑾', ' 基础医学院', '“小草也能折射太阳的光辉”一直作为自己的座右铭。不断追求，不断完善，提升自我，在大学让每一天都过得充实而有意义。自己勤奋学习，刻苦努力，大一及大二上学期加权一直在90以上。英语四级和六级一次通过。现阶段正在做校级大创项目的实验。在班上担任学习委员一职。在华科参加了生科院辩论赛获得第一名。在同济也参与了许多学生工作，在社联行政监察部，连同其它社联小伙伴举办社团文化节，在校学生会学术科创中心，举办了万圣节嘉年华，双学位交流会，以及新年游园会的筹备。除了学习与学生工作，自己对生活也充满热情，积极向上，参加了艺术团爵士舞队，每周三次队训，在生命之光中长期义务做家教，以及是青协爱心导医长期义工的一员。周末也会抽出两个半天在外兼职做家教，能够解决自己的生活开销而不给父母增添负担。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('263', 'U201210459', '宋安妮', ' 基础医学院', '我来自湖北省咸宁市的一个农村，一家四口人，有一个妹妹正在读高中，虽然家境并不富裕，入学初就办理了助学贷款并一直接受国家的资助，但我一直保持着一颗乐观积极向上的心，进入大学后，我一直尝试着锻炼自己，申请担任班级团支书，并和同学们在特色团日活动中取得了校20佳的成绩，同时我积极向党组织靠拢，于2014年11月28日成为一名党员，进入医学院后，我担任了基础医学院的资助助理负责人和班级的资助委员，感同身受地为身边有需要的同学服务，大一大二在课余时间我做过多份兼职，家教、推销奶茶，并连续两年暑假打工挣钱，通过自己的实际行动减轻家庭负担，同时我也积极参与课余活动，参加过院系举办的征文比赛，2014年秋季参加了50公里毅走活动，并成功了坚持下来。在学习方面，我也没有放松，去年一年取得了较大进步，加权达到90+，上个学期很幸运地加权取得了班级第一的成绩，并获得过新生自强奖学金、优秀学生干部称号、国家励志奖学金，通过了英语四六级考试，并且六级成绩从第一次的487进步到600，同时现在我也在慢慢接触科研活动，生活虽然忙碌，但是很充实，我一直希望这样的我能够给大家带来正能量，而我也会一直坚持这么做。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('264', 'U201313325', '汤航', ' 基础医学院', '我人生的座右铭是：“选择不了起点，就努力改变终点。”\n因高考失利，我与口腔医学擦肩而过，被调剂至护理专业。但我没有错过转专业的契机，而是独自搜集转专业信息和动态，努力学习。最终以优异成绩通过笔试和面试。\n同时，我学习丝毫不放松，大一是护理班第一名，在口腔班位列第二。获得国家励志奖学金，新生优秀奖学金，新生自强奖学金等奖项。\n义工活动是我最大的爱好。大一，我是义务家教小老师和地铁指路小能手，每周六我都会坐一个小时公车为一个男孩家教两小时，然后再赶去做两个半小时的地铁义工。大二，我是革命博物馆的解说员。因为我的勤勉，我获得了“武汉市优秀地铁义工”，“优秀教员”等荣誉称号。\n纵然父亲每月800元的工资是唯一经济来源，爷爷重病，弟弟与我上高校使我家经济窘迫，我也曾自卑过，但最终还是战胜了自己的心魔，努力朝远方风雨兼程。因为我终于明白:最可怕的不是物质的贫瘠，而是精神的荒凉。\n因此，在我的世界里，逆风也能高高飞翔！\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('265', 'U201313258', '王佩佩', ' 基础医学院', '我是从农村走出来的大学生，也是我们村考得最好来上大学的。我们家有八口人，曾祖母九十高龄。我深知家人供我上大学的艰辛，所以从不敢懈怠。为了减轻家人的负担，大一时我申请了学校的勤工助学岗位，大二一直兼职做家教。知识改变命运对于我这样的农村孩子来说确实是真理，所以我一直努力学习，加权排名专业第二。通过普通话考试及英语四六级考试，在王小川老师的实验室参加科研活动。大二获得校三好和国励奖学金。我坚持做志愿者活动。大一在生命之光做了一年义务家教并被评为优秀教员。大二加入青协导医部，负责同济医院协和医院和第一医院的导医活动。为了锻炼自己，大一暑假到山西石楼的山区里做了题为“教育之殇：贫困山村“撤点并校”之痛——以“山西省吕梁市石楼县”为例”这一暑期社会实践并获得校优。大二参加五十公里毅走活动，寒假参加西安生存大挑战。我一直努力做好每一件事，克服学习和生活上一个个困难，一直期待做最好的自己！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('266', 'U201312937', '王珊珊', ' 基础医学院', '在过去快两个学年里，我一直积极参加学校里各种公益活动，一直以来的坚持不懈换来了我现在工时超过了100个。其中，我一直坚持参加地铁义工活动，已经坚持了一年，在活动中我不仅收获了丰富的工时，也认识了更多品行优良的同学，从他们身上以及我参与的活动中，我学到了很多。另外，我上学期也是校史馆阳光解说员的一员，为八方来客介绍我校的光辉岁月和历史沿革，我自己也在解说过程中越发对自己身为华科以及同济的一员骄傲和自豪。本学期我参加了青协的爱心导医部，希望为广大病患提供自己力所能及的帮助。除上述活动外，我还参加了大学生开放日的接待工作和毕业典礼的志愿者，人车分流的志愿者等等。\n当然，在积极参加公益活动的同时，我也没有忘记学习和专业研究。我的学习成绩一直保持在前列，虽然目前还不算拔尖，但我会一直努力下去的。另外，我这学期还参加了组织学与胚胎学的周琳老师带的科研小组，积极进行科研工作，希望能取得一定成果，为大学添上灿烂的一页。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('267', 'U201313252', '蔡磊', '药学院', '由于家贫学优，上高中时我成为了一名珍珠生，通过浙江新华爱心教育基金会，我接受了来自各界爱心人士的关心和帮助，理事长张爷爷曾多次告诫我们，在自己有能力的时候尽己所能帮助他人。而现在，我正在用行动践行着珍珠生的承诺。\n首先，我积极参加各种校内外义工活动。如图书馆义工、宿舍楼栋义工、爱心导医、爱心病房、献血车服务、“一站到底”火车站志愿服务等，目前总工时69小时。\n其次，我也积极参加社会实践，大一暑假参加了学院“合理用药”社会实践，带领3名组员到武汉八大高校实地调查采访，完成了暑期社会实践。\n另外，作为珍珠生，我们也开展了自己的志愿服务。如汉口江滩环保活动、武汉爱乐音乐学校志愿服务。还有很多珍珠生互助的活动，如新生配对帮扶、杉树计划、导师计划等。课余时间还参加过爱心募捐、无偿献血。\n最后，从大一下学期开始，我就坚持每天推送武汉天气，争取给同学们带来便利。长期的坚持得到了大家的肯定和鼓励，我也会继续下去。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('268', 'U201313224', '崔世豪', '药学院', '我的家乡在农村，家里经济情况很不好，父亲长期在外打工，母亲在家照顾我们兄妹俩。母亲经常告诉我“我们家里穷，你爹妈没本事，在村子里面抬不起头，以后就指望你了。”我从小也就很体谅父母，比同龄的孩子多了份责任心，更早的学会了自强。我从小就立志要考上一个好大学，将来做出一番成就报答父母，回报养育我的家乡。我也不断的为之付出努力。人穷但不能志短是我初中的座右铭，在中学我把学习作为第一任务，把勤俭作为第一要求，凡事都要追求最好。终于天道酬勤我实现了儿时的梦想，考上了一个好大学。然而大学的学费也增加了好多，在上大学之前的那个暑假里我选择了去打工，因为自己只是一个学生，没什么技术，我只能干一些体力活，帮别人装修房子，几天工作下来，手上磨出了好多泡子，我不但没有感觉到痛苦反而感觉自己非常的幸福。因为我这是在为自己努力，为自己的梦想而努力。这么多年来，我切切实实的感觉到了自己通过努力，真的帮到了自己，帮到了这个虽贫困但是很幸福的家庭，经过这些经历，让我相信，不管有什么困难，只要努力就一定能克服，不管梦想多么遥远，只要坚持不懈，就一定能实现。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('269', 'U201313170', '康双清', '药学院', '爸爸在我小时候就去世了，妈妈抚养我们姐妹四个妈妈吃了很多苦但也很勤劳，不过她最后还是因为疾病在2013年离开了我，她走之前一直对我说，要好好读书，她走了，我也确实好伤心，可是我也没多少天就要高考了，就冲着她一直想送我上大学的梦想，我也得好好读书啊，高考过后的三个月，我就留在学校给学校做招生老师，到了大学后，我也做家教和一些兼职，并且2014年暑假，我回家之后和两个同学一起被应聘去做暑假补课的老师，大一的寒假我没有回家就留在学校兼职，大二寒假是回家到县城里做了兼职，而且我的学费也是减免的，所以上大学以来，我基本上也可以自给自足，我的三个姐姐两个都已结婚并有孩子，他们也都是靠务农为生，家里也很拮据，所以我读大学也并没有给他们增加多少负担。并且从这些工作中我学会了很多东西，在学校里的时候我的室友也对我很好，我觉得我的生活虽然没有了一些人的陪伴，但是他也教会了我接受现实，快乐生活，所以我们班上的同学总被我嘻嘻哈哈的表情逗乐，觉得我是一个没有烦心事的小孩，其实正是因为你们，我才觉得快乐。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('270', 'U201313246', '田成', '药学院', '我叫田成，来自河南的一个农村。家里有五口人，爷爷、奶奶、妈妈、弟弟和我。爸爸于农历2014年2月11日去世，让本来就经济状况一般的家庭更加贫困。家里主要靠妈妈一个打工赚钱。爷奶都已年迈，弟弟还在读初中。但是自己并没有因此而消极处世，依然以一种阳光乐观的态度对待生活。生活中总是充满了欢笑。而且积极参加学校和院系组织的活动，如校运动会、十月华章、院运动会、青春颂等。班级的一些活动也积极参与。\n平常有时间也喜欢做义工，在主校区曾坚持过一学期爱心培智、现在做爱心助学的幼儿园的义工以及艾协的爱心病房的义工，爱心病房已坚持一学期。\n现在学费是靠国家贷款，自己也在做兼职，经济上基本实现独立。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('271', 'U201213336', '贺哲', '医药卫生管理', '1） 学习 大三上加权 4/38 。英语四级532，六级485。所在团队在医药卫生管理学院本科生学术论坛上获“最佳选题奖”；参与大创并跟随学院导师做课题，已在论文发表阶段\n2） 学生工作 2014年3月至今为医药卫生管理学院分团委副书记，为本院团干的第一人；2013年9月-2014年3月为院系资助助理，2014年3月至今为班级资助助理；2014年5月至今，为华中科技大学同济医学院就业办助理。\n3） 志愿服务 曾做过爱心病房，汉口火车站，爱心导演，大学开放日，毕业典礼等志愿者，大二至大三上，工时近90个；2013年6月至2014年6月为武汉革命博物馆志愿者，负责解说工作；获“同济医学院十大杰出青年志愿者”称号\n4） 文体活动 第十三届春之约八大院系辩论赛上,获”单场最佳辩手”称号；2014年度同济医学院5.4演讲比赛中,荣获同济医学院第一名；医药卫生管理学院第三届师生赛歌会上，荣获二等奖；文章“梦中夜话，写给母亲”被华中科技大学校报征用；连续两年在学院晚会春之约晚会上出演,在第十二届社团文化节(医科)演出\n5） 社会实践 2013年度暑期社会实践获校级优秀团队；2014年度暑假社会实践获“华中科技大学暑期社会实践优秀个人称号；大二暑假在第四军医大学西京医院人力资源部实习一个半月，并受到老师好评。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('272', 'U201313383', '灵芝', '医药卫生管理', '大一期间我加入了“生命之光”爱心探访队，每周日到“星达敬老院”为孤寡老人送去温暖，为ta们做力所能及的事。我曾两度负责爱心卖报活动，第一次是为患病学姐募捐，活动期间偶遇一位好心人，经过近两周交涉，拉到了20000元善款。生科院大一新生是一个特殊群体，这里的大多数人大二之后便搬到同济校区，所以会有一些非专业书籍，同学们会选择留给学弟学妹。如何才能更好的收集这些书，我们付出了很多脑力和体力劳动，最终募得图书2356本。\n“一站到底”汉口火车站志愿服务团队共有49名长期志愿者，分三组，我们每周末都会到汉口火车站进行志愿服务，工作时间从08:00至16:00，三个小组循环往复，小组长主要负责当天志愿工作，组内自由协调在岗服务时间，有效调动了同学积极性！半年的实验阶段取得了良好的成绩，我的下一步计划是扩招志愿者，让我们的志愿服务覆盖到武汉另外两个火车站，使“一站到底”成为我科特色团队，帮助到更多的人。\n我还参加了“飞航杯”环保创意演讲比赛 “国旗仪仗队”到“石门峰”扫烈士墓 “在路上”人车分流、世界艾滋病日宣传楚天学子 “树”立新“锋”及“hustfound”失物招领平台的创建及宣传等一系列活动。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('273', 'u201212765', ' 黄筱頔', '第一临床学院', '我自幼父母离异，由母亲独自抚养长大，父亲从未提供过任何帮助。母亲原属于河南省豫南监狱工人，于1999年下岗，一直靠打工维持生计。外祖母五年前骨折，加之老年痴呆至今生活不能自理，也要靠母亲赡养。\n我大一全年的加权排名为专业第三，大二全年的加权排名为专业第一。\n我获得过新生社会公益奖学金、国家励志奖学金、校三好以及优秀共青团员称号，英语六级，计算机三级，参加了入党积极分子培训班（24期）并结业，大二被评为2013~2015年度学习特优生并参加了大创项目。我大二在同济青协阳光医学生部门工作一年，校学生会工作一年，大二暑期参加了赴平遥社会实践小组，还担任班级组织委员。\n我大一曾参加勤工俭学，平时空闲时间及寒暑假也会找兼职，努力减轻家庭负担。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('274', 'u201212850', '李舒心', '第一临床学院', '从上大学以来追求音乐艺术至今，大一加入笛箫协会，坚持练习从中级水平到演出10级曲目，进入演出队，后又承担授课任务，被评为优秀指导。参演机械学院“风华竹韵”音乐会节目《灞柳情》，“武汉笛箫峰会晚会“节目《侗乡之夜》，及各种小型演出，路演等。\n大二担任笛箫协会副会长，葫芦丝队队长，财务负责人，从零开始用一年时间带出一支有一定技术水平演出能力的表演队伍，付出很多心血，解决各种人员，资源，技术困难，负责并参演“风华竹韵“葫芦丝节目《多情的巴乌》，“笛箫峰会”节目《情醉》，“新年游园会“节目《瑶族舞曲》。同时加入了艺术团民舞队，并学习钢琴，坚持每周练习，取的还不错的进步。加入学生会文艺中心，为游园会等活动出谋划策并参与负责《凤凰于飞》等节目。负责并表演“爱心病房”演出。被社联评为优秀社团干部。\n    大三参加“春华秋实“表演《民乐合奏》，”社团文化节”表演《玉生烟》，“三月美”表演《咏春》。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('275', 'u201212776', '李天冶', '第一临床学院', '我是华中科技大学同济医学院的一名大三学生，儿时父亲下岗，母亲没有固定工作，不久就因为家庭矛盾而使得这个不幸的家庭解体，而我与母亲相依为命。我的母亲十分的要强，虽然患有严重的心脏病仍然坚持供养我上学。起初来大学，就带着一种强烈的自卑感，但是阴差阳错的一次杨叔子院士的赠书仪式，以及学生报名处的接待老师的热情帮助，更是历任的各个辅导员的理解与帮助，使我认识到这个学校的爱与关怀。于是我立下决心一定要走出低谷，于是每每都在其他人都在休息时，在自习室拼搏，一直都会很努力的学习医学知识。在家乡政府的宣传下，我获得了政协委员们的资助，而且我也在坚持参加不论是学校安排还是自己寻找的社会兼职活动。在大一时虽然通过了中德班的笔试而且在前三十之列，但是面试没有通过，成为我的一个遗憾，所以在大学，我自学了德语，在同学的帮助下，能够达到a1水平以上。而且也顺利的通过了英语四六级考试。我没有什么惊天动地的可歌可泣的优秀事迹。我希望我会更加强大，能够用自己的力量回报掘井之人。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('276', 'u201212830', '彭春锦', '第一临床学院', '本人长期坚持志愿服务，大学期间曾参与多项志愿服务活动，包括图书馆服务、教学楼清洁、爱心卖报、九峰山烈士陵园扫墓、“旧书圆新梦”、爱心导医，武汉血液中心义工、地铁义工、爱心病房等。\n大二坚持中山公园站地铁义工一年，大三开始坚持同济医院爱心病房义工至今。\n大二期间参加广东省东莞市第一届莞曦公益策划大赛，本人作为大学生导师指导高中生团队进行公益项目策划并付诸实施。团队已与台湾新北市二重中学校长取得联系并获得技术支持，并获得了东莞市环保组织的项目资金。\n本人在2014年获得“同济十佳青年志愿者”称号，在coursera学习霍普金斯大学课程《Health for All Through Primary Health Care》并通过考试获得完成证书。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('277', 'u201212764', '王楠', '第一临床学院', ' 有一个女孩，从有了记忆她就明白她要为改变自己的命运而奋斗，她要把自己破碎的家支撑，她要背着她的爸爸妈妈还有弟弟妹妹走出大山的贫苦。她没有别的办法，妈妈告诉她要好好学习，出人头地。于是她就踏上了这条路，但是路程却坎坎坷坷。一间漏雨的土屋，两本教科书，就这样的知识能改变命运吗？她不知道，但她要尝试。和她一起入学的同学们一个个都走了别的路，只有她还在走最开始的路。她靠自己的奋斗把自己送进众人瞩目的名校，靠自己的努力把自己从被抛弃的角落转换到人人称赞，她也支起了一个不幸的家。\n   艰难走进大学，却又一个人与疾病的战斗，可她不得不坚持。如果她倒下了，她的家就要碎了，她也要永远轮到艰苦的命运中。在医院与学校之间奔跑，在教室与寝室之间拼搏，在学习与主席团工作之间焦头烂额，一切都走过了，她要为自己的命运而奋斗，要为维护自己的完整的家而奋斗。\n   大学里的她又顺利走过了三年，三年里成绩名列前茅，积极参加各种大学生的活动，完善自己，闯过学生会，从小小部员直到学生会副主席；担着班干，副班，学委不在话下；干过假期兼职，发传单，扫楼，做推销；做过初中，高中家教，和他们一起进步。。。不是最优秀的生活，但是丰富的成长经历。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('278', 'U201212848', '谢晓红', '第一临床学院', '在舞蹈方面执着追求，从高三暑假开始至今坚持学习拉丁舞，大一开始加入由学校艺术团与学校体育部合办的拉丁舞队，曾在2014-2015年担任一年队长，每周至少有两个晚上的常规队训，队里接到表演任务时甚至每天晚上负责训练，回到寝室自己再继续练习，寒暑假回家或在当地舞蹈机构培训或自己找视频练习；2014-2015年曾参加过2次同济医院的暖心病房活动，参加2014年、2015年共2场新年游园会，受协和口腔科邀请参加2014.11.8第四届湖北省口腔学术会议晚宴表演，和万圣节艺术团与学生会合办的晚会表演以及社团文化节的演出。现在准备2015中国湖北国际体育舞蹈公开赛；\n  大二上学期机缘巧合之下加入校越剧队，刻苦训练，2014年代表学校参加湖北省大学生艺术节，其中一个节目获一等奖，并在之后参加优秀节目汇演，2014.10参加华科金秋音乐节越剧专场演出；\n  和舍友志趣相投，平时会找各类舞蹈视频一起练习，我们报名参加了2015三月美，节目《咏春》获得好评，给领导留下较深刻印象，并希望我们可以在青年节的晚会上再表演一次。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('279', 'u201112806', '熊之勇', '第一临床学院', '医学是我的理想，数十年来为了这一理想我不断奋斗着，终于高考让我的医学之梦成为了现实。大一是充满诱惑的一年，自由的气息使人沉醉，面对这一切我毫不动摇，终取得年级第一的好成绩，并获得国家奖学金以及三好学生和特优生的称号。大二学年，在面对繁重的医学基础课的同时，为了提升自我，自己又参加了基础科研活动，为了做到科研及课程两不误自己常常挑灯夜战到深夜，并通过努力再一次获得了三好学生的称号。大三大四可谓是忙碌的两年，自己真正的进入了临床的学习，深刻的体会到了临床环境的复杂，内外妇儿的课程压力更是把人压得吐不过气，与此同时自己还肩负着大班学委的责任，抱怨过，动摇过，但最终还是坚持着，每天往返同济与协和只为将理论和临床结合的更紧密，自己也曾上台参加了长达七个半小时的手术，与此同时忙碌的同时自己还参加了纸艺协会，为的就是让自己的学医之路变得更精彩。因为爱着临床，所以想不断提升，前不久自己又参加了同济医学院临床技能大赛并取得二等奖的好成绩。我深知自己未来的路还有很长，但我想我会执着的坚持下去。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('280', 'u201112794', '钟绍平', '第一临床学院', '立志科研，砥砺笃行\n我从小对自然科学具有浓厚兴趣，学医期间，我深感我国基础学科还远落后于国外，生物医学领域内几乎所有突破性的发现都是在国外完成的。因此，我有志于从事神经系统疾病的基础研究，希望将来能结合自己的医学背景将基础研究与临床应用更好地衔接起来。从2013年开始，我就在病生系朱铃强教授组随研究生参与Tau蛋白对Dynamin家族调控机制课题，学习Western Blot、PCR等实验技术。2014年5月，我作为负责人，在神经内科副教授徐岩的指导下申报了大创项目“BDNF/TrKB 信号途径在左旋多巴诱导异动症发生中的作用”，尽管面临着克服经费不足、实验条件简陋等种种困难，依然不言放弃，寒假期间也在学校做实验，终于独立地造出了帕金森病异动症大鼠模型，成功完成预实验，目前还在进一步的实验中。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('281', 'U201315153', '郭雪华', '计算机学院', '来自农村的我初进大学时很自卑，因为很多时候我看到自己和别人却有很大差距，自己进入的计算机专业是被调剂的，自己却对计算机专业一窍不通，甚至连打字都不会。面对着那么多的学霸，无处不在的大神，我也一度很失落，对未来很迷茫。但是我不是轻言放弃的人，既然来到了这里，我就要做到最好。明确自己的方向，对未来的一切充满了动力，我开始从大一下自学PHP，更是在大二加入餐谋网。对于基础尚浅的我，无疑压力是很大的，但是我克服困难，成功的完成了任务。大二下我又开始制作另一款智能牙刷APP程序。现在的我不似刚进大学的时候那么羞涩自卑，相反我很开朗活泼。我时常告诉自己，自己想要的东西就应该努力争取，怨天尤人于事无补。怨天尤人于事无补，只有自己看清了和别人的差距，不断地努力才能赶上甚至超过别人。父母为我们做了很多，我们要做到就是减轻父母的负担，成为父母而骄傲。希望我的故事能让大家有些收获。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('282', 'U201315137', '李若愚', '计算机学院', '企业家精神的公益创业项目，使受众在产业链中能真正受益。先后参与了“幸福虫”、“艺纸深情”等公益项目，其中“幸福虫”获得了“创青春”大赛公益赛金奖。目前带领团队运营了“Fitnow”、“落叶工艺坊”等四个项目，其中“Fitnow”通过打造O2O闭环使校内学生得到定制性、志愿性的私人教练服务，努力提高学生身体素质；“落叶工艺坊”致力于再利用华科落叶的价值，打造第一个高校“树文化”工艺坊。目前正负责承办校团委“求是杯”公益创业大赛（创青春校内赛），分管组委会培训组，希望能为校内热爱公益的团队提供比赛的平台，更希望为提升华科校内公益创业的氛围，培养出有社会责任感的新一代青年而努力。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('283', 'U201414950', '李智炜', '计算机学院', '我是一位身残志坚自强标兵。在2014年高考结束的夏天，当我满怀期望准备成为一名华科学子时，不幸遭遇车祸，左膝受到了重创，诊断为前后交叉韧带断裂。我在医院中度过了一段令人煎熬的时光，本该拥抱大学生活美好的我，却只能一动不动地待在床上。然而抱怨终归于事无补，我决定选择笑对一切，赶走消极情绪，不让陪伴的父母担忧，还通过网络了解大学同学的生活并和他们积极交流。当我知道了大一上应该学习的科目后，便拜托同学将课本寄回，希望可以在治疗的闲暇时间了解一下大学科目，发挥自己现有阶段的能力尽量自学一些内容，这样回校后就不会落后太多。刚回校一周后我就面临微积分的期中测验，所幸顺利通过了哈哈，证明了自己当初的努力。恢复走路能力的过程伴随着痛苦与喜悦，虽然艰辛无比，但是心想能够快点来学校咬咬牙还是坚持。现在我仍然没有放弃锻炼，早上坚持慢跑来加快恢复，期望不久后能像其他同学一样奔跑，跳跃，进行正常的体育活动，也希望自己的经历能鼓舞一样有过受创的朋友不要放弃，自强不息。乐观坚强是我的自强精神，化解遭遇带来的痛苦的最好办法就是时刻保持明朗的心情，笑一笑没什么大不了的！生活中不可能永远阳光明媚，当黑暗的日子降临，你要做自己的太阳~', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('284', 'U201414577', '谷永普', '计算机学院', '1.军训期间主动无偿献血，回报社会，以帮助更多的在病痛中需要血液的人恢复健康\n2.参加大学生社会时间中心志愿者服务指导中心，积极参加志愿者活动，服务同学，在外联部中，经常出去拉外联寻找商家赞助，为社会实践中心的志愿服务工作筹集资金，以便中心开展更多有益的志愿活动\n3.参加学院资委会勤工部，经常利用空闲时间和小伙伴们一起去华科附中做家教宣传，向外界推广我们学院的家教信息平台，收集家教信息，为学院想做家教勤工俭学的同学免费提供家教信息，给大家一个安全放心的家教平台\n4. 服务同学，节日送贺卡，生日送祝福，圣诞送苹果\n5.参加机械学院的盲校支教活动，每周末去武汉盲校无偿对盲人孩子周末进行一对一辅导教学，献出自己的一份力量，克服无法直接用文字交流的障碍，探索教学方法，帮助盲校的的孩子积极乐观地面对生活，并帮助他们实现大学梦，并与那些孩子建立了浓厚的友谊\n6.参加思源社，时常做回报社会的志愿服务工作\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('285', 'U201414640', '吾拉木•图尔贡', '计算机学院', '      到了大学，我的想法就是让我的大学生活过得比较有意义，多接触周围的实物，社会环境等。所以我已开始就找一些机会让我去实现这些想法。\n     后来了解到义工的信息后，我就去参加义工，做了一些有意义的志愿服务。\n     第一次参加义工活动“马路天使”时，甚至连自己都会搞错什么时候可以过，什么时候不能过。第一次的时候，总免不了紧张，犯错，受别人误解。但我并没有放弃，一次次的参与，慢慢的变好，不再紧张。我做到了“天使”的职责，它也使我超越了自我。\n     刚来到学校，当听到校外也有类似的志愿服务时，我决定去参加那些服务。\n     去过一次“圣景老年公寓”之后，我才知道那里的人确实需要我们的关心和帮助；哪怕是跟他们聊聊天，打打牌，或者唱唱歌都能给他们带来很多快乐。我以后还会坚持去那里多陪陪他们，给他们多带去一些关心与快乐。\n     在“武汉科技馆”时，给小朋友们解说一些东西，陪他们玩耍，听他们聊天，也使我感到十分的开心。\n     参加义工，不仅可以让我们学到自己在学校学不到的东西，而且更重要的是我们可以帮助别人，给他们带来快乐，也让他们的生活过的同样更有意义、更加精彩！ \n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('286', 'U201414974', '王海瑞', '计算机学院', '     出生于河北的农村家庭，父母以务农为生，无其他收入来源。后来因为长期辛苦劳作，母亲患上了腰椎间盘突出，从此不能做重体力劳动。我深刻地感受到处在中国社会最底层的农民生活的艰辛和钱生活来源的来之不易。所以对于父母，对于我所拥有的一切，我都会格外珍惜。\n初三时候，我被全省重点高中提前录取。高三毕业后顺利进入大学。我在这里学会了坚强乐观，遇到挫折勇往直前，竞争意识与团队意识，严守纪律等品质。\n在班级我积极参加班级活动，融入班级这个大群体。我是班级的义委，帮助同学们解决关于奖助学金等方面的问题。对于同学们不懂的问题，我耐心解答。\n因为一直都得到很多人的帮助，所以我也希望自己可以帮助别人。进入义工部，就是希望自己能够通过做义工来服务于社会，回报社会。当然作为一项义工的负责人，也锻炼了我的管理能力。与每周报名的义工进行沟通，还要与图书馆那里的负责人进行联系。\n积极的充实自我。我加入了学生会的新闻部，负责摄影。曾经拍摄过迎新晚会和校运动会。\n为了减轻父母的负担，我自己通过家教赚取自己的生活费，我所辅导的小朋友在年终考试时成绩取得很大进步，成为班级第二。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('287', 'U201412631', '杨柳', '生命学院', '     她来自农村，家中的开销全靠父亲一个人从土地里一寸寸种出来。母亲病重，身体虚弱，右手行动不便，各种医疗费用再加上两个孩子的学费使家里入不敷出。贫穷给她带来了物质上的匮乏同时也培养了她吃苦耐劳的精神和坚韧不拔的品质。她从小就希望成为一名优秀的医生，能够医治病人医治一个个因疾病而受伤的家庭。\n为了实现这个梦想，她一直奋斗着。中学时，她获得过校学习标兵，校励志标兵等荣誉称号，成绩优异时她得到了全校唯一一个北大自招的校荐名额。可高考失利使她无缘进入理想的大学。亲戚朋友们都劝她放弃读书，像哥哥姐姐们那样南下打工为家里分担。可是她不甘心就这样放弃梦想。父母亲了解她的心思，顶着压力全力支持她选择自己的道路。\n到大学后，学习上，她勤奋刻苦，努力丰富自己的科学文化知识；生活上，勤俭节约，并且做了兼职来减轻家里的负担；她还参加了手语协会和笛萧协会以及各种集体活动，使自己更好地融入团体。在大学的第一个学期里，她成长了很多，向着目标又迈进了一步。虽然明白未来还会有很多艰难险阻，但她一定会坚持到底，永不放弃，始终铭记最初的梦想。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('288', 'U201212546', '李永帅', '生命学院', '    他学习成绩优异，在过去的5个学期中，他有2个学期以加权90+的成绩排名专业第一，曾获得“学习优秀奖学金”、“国家励志奖学金”、“校三好学生”等荣誉。他热爱科研，从大二就进入实验室，将近2年时间内，他周末、假期经常在实验室一泡就是一天，读文章、查资料、做分析，经过不断的积淀，他也取得了科研道路上的第一批成果。现在他参与了一项院级大创——基于FPGA的农业航拍飞行器设计，负责了一项校级大创——基于DSP的非局部FIR数字信号滤波器设计，申请到了一项国家受理专利——一种心电信号滤波方法，并且投中了一篇名为Adaptive nonlocal means method for electrocardiogram signal denoising的论文。此外，他所参与的项目“微伏级”心电信号采集系统设计在第五届“求实杯”上拿到了二等奖，目前在备战“挑战杯”比赛。他还是一个足球迷，担任学院新生杯的教练和足球队队长。从新生杯到生命杯，再到华工杯，足球赛场上总能看到他的身影。训练的汗水，赢球的兴奋，输球的沮丧，他享受着足球运动带来的乐趣。“爱拼才会赢”是他人生的座右铭，希望全面发展的他能够在科研的道路上一直拼搏下去。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('289', 'U201413014', '黄婷', '生命学院', '   她性格开朗，执着专注，成绩优异。她在经济上接受过国家助学金的帮助，感恩的种子就此埋在心底，成长为热爱公益的满满激情。她的身影活跃于各种志愿服务活动中，她希望以自己微薄的力量回馈社会。高中时期的她就曾作为班级学雷锋志愿者队队长，每月开展志愿活动，并取得良好的反响。受助者的笑容是她做志愿活动的无穷动力，而留下的汗水则是发自内心的满足感。大学给了她一个更加自由的平台，在这个平台上她有更大的空间去追逐自己所热爱的事物。别人眼中的轻松玩乐的大学生活并没有腐蚀她内心的追求。也许，你不能理解为什么在周末还要给难以进行顺畅沟通的印度留学生上汉语课，为什么在晚上还去社区做志愿者，为什么带领并不熟识的外国志愿者去华科附中和华师一附中上课……然而，你并不知道的是—一个多学期的磨合让她能够无阻碍地教印度留学生中文并使他在中文上有了长足的进步；社区老人的活力让她感受到志愿活动的意义；和外国志愿者的合作让她意识到自己的不足并努力朝着更好的方向前进。她一直坚信正能量的传递，用爱心播撒阳光，高尚践行平凡，在服务他人的同时深刻感受到“赠人玫瑰，手有余香”的快乐与满足。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('290', 'U201212264', '李想', '生命学院', '“天道酬勤”，这是他常用来激励自己的一句话。生活中，身为班长的他是一个 恪尽职守的班级领导者。为了同学们能在班级中感受到家的温暖，他随时随地都在尽力履行班长的使命。优良学风班和三次优秀学生干部的荣誉无疑是对他工作的最大肯定，也是他沥尽心血的回报。与此同时，他还是一个热爱科研的工作狂。课业的压力、攻关的辛劳都未能成为他追梦的阻碍。两项院级、两项校级和一项国家级大创项目只是他筑梦之路的开始，“求是杯”的二等奖、实验室的“十二五”项目也未能成为他科研道路的终点。\n历经重重磨难终于苦尽甘来，他以第一作者身份投稿了一篇SCI论文和一篇A类期刊Plos One论文，同时申请了一项国家发明专利。他的路，因为梦想而不轻言放弃，因为执着而不害怕明天。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('291', 'U201312725', '李欣', '生命学院', '   她立志成为一名优秀的医生，所以选择医学，在“启明学院”临床中德实验班里她努力学习，重视每一科的学习，早上7点15到教室读书，晚上10点半下自习。大一总加权92.26，大二上加权92.29。德语4级“优秀”（85分以上为“优秀”），英语4级611。获得新生自强奖学金，新生学习优秀奖学金，国家励志奖学金。\n追梦德国医学教育。大一一年，她将市场上德福相关书籍刷遍，以总分18（满分20）成功通过德福考试，有资格申请德国大学。\n   她注重修德。积极参加党校，并顺利获得结业证书，成为入党积极分子。担任班级团支书，认真做好在班上的相关工作，参加“成为有坚定理想的青年”团校学习并顺利结业。参加组织全班同学每个月开展团会，开展特色团日，写成5万字总结书。特团进入校30佳；开展“雷锋月”活动。获得了“优秀共青团员”的称号。\n   她热心义工活动，如关爱拾荒老人，义务发报纸，爱心宿舍等，还定期去东图整理图书，工时达39个。积极带领留学生参观校园。参加生命之光，为其中各种相关活动制作展板，去校外为部门的“爱心家教”活动贴海报，参加“志愿者日”路演 。加入学校资助中心助理委员会。制作部门“阳光解说员”招新海报，“校史馆阳光解说员”文化衫，参加“2014年自强标兵”路演活动。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('292', 'U201413207', '刘柯', '生命学院', ' 她阳光开朗、热爱社会公益，她希望能通过自己的绵薄之力为社会做出自己的贡献。也许是受生活环境的影响，也许是发自内心的本真，在大学伊始，她就始终行走在社会公益的道路上，不论工作有多繁忙，她总能有条不紊的安排好时间，不论风吹日晒始终坚持每周去地铁站疏导交通，坚持每周去给家庭困难的孩子做家教，在工作中积极热情、认真负责，在上一阶段的工作中获得”优秀地铁义工”和”优秀教员”的称号，从创青春志愿者到爱心宿舍志愿者，不论活动的大小总能看见她默默付出的身影，短短一个学期工时就多达40多个，这个暑假她还将踏上支教之路去偏远山区支教。除此之外，从班级到学院再到学校的各种学生工作，总也少不了她忙碌的身影，作为班长以及院系助理更让她懂了什么是责任，尽职尽责、全心全意的为同学服务，与此同时她也荣获了多项荣誉称号。一辆单车，一个背包，一颗爱心，她就这样奔走在武汉的大街小巷，她说只要心中有信念就会有明天，她会在公益的道路上坚定不移地走下去，她要用自己的阳光去温暖身边的每一个人。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('293', 'U201372254', '黄本燊', '船海', ' 进入大学之后，我充分利用这些时间。在大一上学期的时候我自学了Photoshop，那个时候还没有电脑，每天我都会在自习室自习两个小时后去东校区的机房，自学ps技术，那段时间常常我是最后一个离开机房的人。大一的这份努力使我从一个ps的小白，一步一步进阶成为一个熟练的使用者。在大一下的工图课上，老师曾近要求过大家学习AutoCAD，但那只是基础中的基础，仅仅只是直线，圆形的简单组接。这远没有满足我，我在图书自学了一整本AutoCAD教程，并在假期进一步强化。在这半年里我从一个对工程制图一无所知的少年，到了解整个软件的功能和使用方法。并整理出了一本属于自己的笔记。\n    大学期间我加入了船海阳光俱乐部，组织并参与了俱乐部的多项活动。我领头组织了喻家山“阳光密码”定向越野比赛。同时每个月的“爱心宿舍”活动也没有缺席。多次参加汽标社区清洁活动，东九桌面清洁，问候离休职工等活动。义工活动不仅丰富了我的课余生活，更让我知道了自强的另一面。作为一个大学生我们所应该承担的责任。我们不再是小孩子已经步入成年的我们应该为这个社会奉献自己的力量。心中常常有他人，为别人服务，在点滴之中提升自己。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('294', 'U201412016', '冯璐璐', '船海', '我是14级冯璐璐，一个地道的东北姑娘，性格直爽。\n上学期加入了援之缘支教协会，到小梅花艺术学校做志愿者，虽然只做了2周，但收获到很多实践经验。这学期在爱乐音乐学校负责六年级，到现在已经是第5周了，并且效果很好，可发展为长期项目。\n现在在协会做基地助理，也会有路演，招募，培训等工作。目前正协助做“武汉市Yuan来有爱—高校学子暑期志愿家教活动”，会在武汉六所高校进行招募志愿者进行一对一家教。\n曾2次去湖南基地回访，暑期也要到湖南做21天的支教。\n会将支教作为一项事业，并长期做下去。同时也希望有更多的人投入到支教中。\n就像我最喜欢的一句话:路上无名，脚下有路。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('295', 'U201312291', '任仕美', '船海', '     “不经一番彻骨寒，哪得梅花扑鼻香”，这是我一直坚持和捍守的信念，来到大学我一直坚持参加各种志愿活动，爱心病房里我曾多次耐心陪伴患了白血病的孩子们，给他们带去欢乐的同时也带去了暖暖的爱；武汉科技馆里留下了我细心给孩子们解答的身影，“创青春”比赛时我积极接待来自各地参赛的老师和同学，也曾连续几天到机场接待来参加“高新船舶”科技论坛的中科院院士；武汉盲校里我曾给孩子们进行一对一辅导，让他们更好地沐浴在知识的海洋……我热爱志愿者的工作，喜欢志愿者的称号，更享受无私为他人服务的过程。以后我会一直坚持我的志愿者之路，无私为他人服务，回报社会，为这个社会奉献出自己的一点小小力量，让自己的生命变得更有意义。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('296', 'U201412151', '田宇', '船海', '    宝剑锋从磨砺出，梅花香自苦寒来。我是来自船海1404的田宇。从高考结束后，我便深知父母以后的负担会更重，所以从那时起，我便开始兼职，努力赚取自己的一部分生活费，到大学后，也做过许许多多的事情，酒店兼职，快递分拣员。特别是第一次做快递分拣员的时候，尽管只工作一晚拿了一百块，但是我却十分劳累，在一辆辆货车之间跑来跑去，现在做家教，能够赚取自己的大部分生活费，同时也在勤工助学工作。尽管如此，但是大一上加权86.85.\n拮据的生活并没有让我自暴自弃，而是更加努力。为回报学校、社会对我的关怀，我积极参加了创青春志愿服务。面对困难，我选择了不卑不亢，决定用自己的劳动与智慧创造一份天空 。                                                                                              \n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('297', 'U201412158', '易玉坤', '船海', '     我出生还不到八个月，母亲就走了。爸爸很坚强，又当爹又当妈的照顾我和两个姐姐，并靠种地最终把我们送进了大学校园。\n     小学一年级，我们三个都在镇上读书，为了不影响高年级的姐姐们的学习，每次洗衣做饭都是我抢着干，当时我还没有灶台高，垫着椅子煮饭。我炒了几乎六年最便宜的咸菜。\n     初中的时候，三个人学费的突然增长，尽管三人都特别特别省，家里还是入不敷出并且开始负债，甚至一度我差点被逼退学了，是父亲坚持我才有今天。我成了家里的二号劳动力帮父亲干农活，晚上就在煤油灯下面写作业。如果是在农闲时候，我还要采山药、捡废品换一些资料费。\n高中时在学校，我早上买三块钱的小包子或方便面，中饭晚饭就都有了，然后一天除了上厕所就呆在教室学习，可以说最终我能以优异的成绩毕业，不是平白无故的。\n上了大学兼职做的很多，带了三份家教，周末节假日也去酒店做服务生，去商场做促销，去校园发传单。现在我不仅不用向家里要钱，还每月给家里寄钱，希望能回报父亲恩情值万一。在大学我一直致力于志愿者活动，创青春我报名很积极，要准备的事情既多且繁，我和组长一直忙到凌晨，后来几天更是忙的连饭都顾不上吃。我在校外也做公益项目，阳光义卖时晒了一上午才募到30块。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('298', 'U201115012', '张生倩', '机械学院', '我曾经迷茫，看不到未来的希望，患抑郁症休学半年。对梦想的渴望让我走出迷茫，重拾自信。未了不负青春、不负梦想，我选择转专业一切重新开始。设计专业要求具备扎实的美术功底，零基础的我和其他同学有很大的差距，暑假我留在武汉进行专业的绘画学习，为了不给父母经济负担，我一边打工一边学习画画；每天早上六点起床去画室，晚上十点才回到学校。经过两个月的辛苦和努力我的水平有了很大提高，顺利转入产品设计专业。转专业的第一个学期，我同时修完了大一大二两个学期的所有课程，忙碌压力是必然的，困难挫折也在所难免，但梦想的力量让我坚持不懈，并付出了比别人更多的努力。加权成绩90.56，排名年级第一，四分之三的课程在九十分以上，这也让我更加坚信只要付出艰苦的努力，梦想就一定会实现。我团结同学，乐于助人，热心公益，并通过勤工助学和做兼职解决了我经济困难的问题，我的努力得到了老师和同学们的认可，并获得了三一重工奖学金。我的梦想之路才刚刚起航，前方还将会有更多挑战，我将一如既往地全力以赴、坚持不懈。期待着未来，能够在更大的舞台上，为这世界带来多一份温暖，为这时代创造多一份希望。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('299', 'U201210580', '赵叔吉', '机械学院', '首先，在学习方面，专业排名比较靠前，这与我的刻苦学习离不开关系，几乎每天晚上，我都是十点下自习。我不是聪明的人，但我要成为很努力的人。\n其次在科创方面，我大二时参加了全国大学生机械创新设计大赛，克服了重重困难，顶着巨大的心理压力和繁重的工作量，最终取得了全国第一名的成绩，并且和组员之间结下了深厚的友谊。\n在生活方面，我也是一个勤俭节约的人，并且争取做到对人坦诚，热心帮助他人。还喜欢看书，努力提升自己的素养。\n短简介：\n努力成长，自强不息，超越平凡，追求卓越\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('300', 'U201210802', '张斯佳', '机械学院', '大一那年，我在不经意之间接触了校勤工助学工作，成为一名普通协管员，把一份责任放在心里，认真踏实工作；大二那年我成为了校勤工助学部的一名主管，顶着学习压力，默默服务自己的协管员团队，风雨无阻我查班的道路；半年后我荣幸的成为了整个东校区公寓岗位仅此一位的岗位负责人，每月会接手上万的工资表以及处理将近400人的学生管理工作，双学位剥夺了我的周末，越来越繁重的学习压力压垮了我的身躯，即便如此，我从未放弃这份寒暑假仍不歇息的工作。除此之外，学校分配给我们的“爱心传递联盟”工作我们一直积极响应，每月按时资助贫困的中学生们，从未停歇。秉承我工作的宗旨：绝不让任何一位学子因家庭贫困而辍学！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('301', 'U201310644', '马昕', '机械学院', '我是马昕，来自机制1303班。现任班长，成绩在年级前20%，曾任13年飞航杯总裁判，负责13,14年两届赛题的编订工作，曾任笛箫协会表演队笛队队长。科研方面，从大一暑假开始在1022团队做项目，已有一定实践经验。在我看来，自强不仅意味着内心的坚定与对理想的执着追求，更是从逆境中奋起的那放手一搏。我曾经由于家庭的原因沉沦过、苦恼过，有过报复社会的行为，到最后甚至有过轻生的行为。幸运的是，我愚蠢的行为没有成功，在亲人和老师的帮助下，我获得了新生。我希望的只是把我从抑郁症到阳光开朗的心路分享给那些需要帮助的同学，告诉他们身边的重要的人和事是值得我们用真心去对待。\n人生格言：没有无价值的人，只有没有追求的人；没有打不开的锁，只有自己封闭的心门。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('302', 'U201310814', '周建', '机械学院', '自小体弱多病，但是却有一颗对舞蹈热爱的心。显而易见，舞蹈是一门艺术，而在现在，艺术却需要高昂的经济基础，我来自农村，家庭经济基础不好。因此，只能把舞蹈放在心中。到了大学，我了解到了自强自助。于是，我开始去发发传单，挣点外快。趁着假期的漫长时光，做了两个月的销售，虽然天气酷热，需要顶着大太阳去发传单，更要忍受顾客的谩骂与咄咄逼人的态度。但是拿着工资去交舞蹈学习费用的时候，还是毫不犹豫，觉得蛮值得。后来开学了，意外介绍之下，我开启了家教征程。趁着每个周六周末晚上，都会做1个多小时的车跑到户部巷给小朋友补习，晚上9点多又坐车回来。因为这份工作，舞蹈学习才得以继续。日复一日年复一年，前不久，终于拿到了舞蹈的第一份回报，经介绍帮人排了个舞获得了一笔回报。舞蹈需要的是持续，不管多累，我都会持续下去。有一句名言，舞蹈是上帝赐予人最美的苦差事。我坚持，我快乐！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('303', 'U201310924', '杨仕雷', '机械学院', '我来自农村一个比较贫困的家庭，我是我家第一个大学生，所以对于“学习改变命运”这句话有很深的理解，因此我希望能够去帮助那些家庭贫困的孩子，给他们力所能及的帮助。因此我在大一上学期加入了生命学院的“生命之光”团队，给青山区一个家庭贫困的孩子做了一年的义务家教。大二由于课程增多，班级事务也比较多，所以就换成了另外的人。\n我希望能够带动更多的人去帮助上不起学的孩子，或许我们不能给他们很多资金方面的支持，但是我想通过自己的努力，带动更多的爱心人士给那些孩子们送去一点关怀和物质帮助，因此我现在正在做一个针对支教地区贫困学生的帮扶项目，致力于让我们的支教活动更具有实际意义，而不仅仅是支教过后就没有然后了。\n在大二上学期我组织策划并参与了帮助留学生学汉语以及更好适应在中国的生活的win—win项目，这个项目给参与的双方都带来了很大的帮助，让他们从彼此身上学到了很有用的东西，真正实现了合作共赢。。\n在平时我更注重的是带动更多的人来参与公益活动，随手捡起地上的垃圾，在生活中热心帮助他人等等，我从不认为做公益一定要多么的轰轰烈烈，公益就是“不以恶小而为之，不以善小而不为”。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('304', 'U201111220', '聂小佳', '材料科学与工程', '2012年8月至今，三个年头了。寒冬清晨，我身着单衣却大汗淋漓，东西操场、喻家山和森林公园都留下了我的身影，我见证着月亮落下、朝阳升起；酷暑烈日，我们在东湖上桨叶翻飞，划了数不清的桨数，黝黑的皮肤和衣服背后的盐花是我们的印迹；暴雨滂沱，我们风雨无阻，鼓声震天，脸上的汗水和雨水交织在一起；面对冰冷的杠铃片，机械地重复动作。黝黑的皮肤、满手的老茧、强健的身体就是我们龙舟人的标志。艰苦的训练、顽强的拼搏，龙舟之花终绽放。泪水化为力量，当付出在不断地接近目标，原来的痛苦也变成了快乐，从“同城双星”混合组500米冠军到中华龙舟大赛总决赛全国亚军，付出终得回报，激动的泪水在比赛结束的那一刻夺眶而出，终于扛起了身后“华中科技大学龙舟队”这九个字，为校争光，义不容辞。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('305', 'U201216075', '万坦', '材料科学与工程', '我叫万坦，来自武汉市新洲区。两岁那年父母离异，从此踏上了与父亲相依为命的漫长路途。父亲是一名乡村小学教师，靠微薄的收入支撑起整个家庭。12岁那年，母亲因病去世。\n大学以来，我先后参加了福利院爱心家教活动”、“武钢三中励志演讲”等公益活动；同时为减轻家庭负担，我长期坚持在外做家教、辅导员等各种勤工助学活动；学习方面我努力求知，成绩始终稳定在年级前10%，拿过两次国家励志奖学金，并被评为“校三好学生”。\n学习之余我积极参加科技创新活动，2013-2014学年通过努力获得了湖北省机械创新设计大赛一等奖、全国机械创新设计大赛一等奖； 2013-2014学年作课题为“LED灯透明氧化铝陶瓷基片的制备”的研究。因此被评为“校科技创新优秀个人”，并取得了2014-2015材料学院太平洋精锻（科技类）奖学金。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('306', 'U201311146', '魏俊杰', '材料科学与工程', '\n很幸运，刚上大一，我便找到了我的兴趣所在——控制。下面我将以时间轴的方式简介我的自强事迹。\n大一上：我参加了智能车比赛，认识了很多控制上很棒的学长和伙伴，激起了对控制的浓厚的兴趣，一有空闲时间便去图书馆看书，或在寝室敲写代码，使自己在控制上的能力有了很大提高。\n大一下：积累了一定的控制经验，有幸加入了学校的3D打印团队，并担任控制组组长。大一暑假都待在了学校里进行研发，终于在暑假接近尾声时，成功将一台普通打印机改装成了一台3D打印机。\n大二上：在对控制的热爱的带领下，参加了科技光环比赛并有幸荣获二等奖，报了院里的大创项目，并超前完成且比预期的完成得更好。大二寒假，继续留在了学校，专为提高打印机的效率设计了一套控制方案。实现了打印机平均效率提升7倍。并专为该控制方案，正在生产新的3DP设备供团队使用。\n大二下：有幸去广东一3D工厂调试设备，并开始进行熔融沉积型和激光烧结型3D打印设备的优化与智能化研发，团队专利的撰写，及用打印机做实验，研究材料力学性能。\n目标：在本科期间敲出一整套智能好用的3D打印机控制系统。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('307', 'U201311193', '张建明', '材料科学与工程', '  我来自内蒙古的一个农村，2011年春节，适逢高一寒假，父亲出了车祸，当场去世，家中失去了主要动力，经济瞬间濒临崩溃。2012年，母亲改嫁，后离家出走，并带走家中绝大部分积蓄。至今联系不到。\n大学期间经济依靠各种奖学金，助学金，国家贷款和自己做兼职维持。先后做过市场调查员，电话测评员，家教，三早助理，卫生检查员。去年暑假留在学校做兼职，至今所有假期均在打工中度过。\n积极参加社会工作和学校社团，如晴川阁支教，电商协会等。同时参加了工程实训竞赛。\n加权排名年级前25%。\n英语四六级已通过，计算机二级已通过。\n曾获国家励志奖学金，太平洋精锻奖学金，勤奋励志助学金，国家助学金，自强奖学金等。\n曾获2014年度院自强标兵称号。\n曾获“飞航杯”科技节校赛一等奖。\n目前正在申请一项专利，已受审。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('308', 'U201211171', '张财源', '材料科学与工程', '家里经济的困难并没有改变我积极乐观的心态，高考的失利更加坚定了我对梦想的执着追求。幸福不仅仅是吃饱穿暖，而是勇敢地去战胜困难，生活费不够我就省吃俭用，不乱花一分钱。两年半来一直坚持兼职和勤工俭学，为自己挣生活费，虽不能做到完全经济独立，却也为父母省了不少心，虽都是小钱，自己却不曾放弃自立自强的精神，生活中时刻践行着自强的本质，以自己的行为传递着正能量。学习上勤奋努力，在陷入迷茫时能够通过自己的努力、别人的劝说很快走上正轨，做到知错就改。但行善事，莫问前程，常怀感恩之心，积极参与志愿服务和义工活动。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('309', 'U201311036', '李尚仁', '材料科学与工程', '我们每个人的能力有限，但再微弱的力量也有其存在的意义。\n大一时便加入校学生会权益部及学院义工部，多次发起并参与各类义工活动。任义工部副部长期间，作为材料学院旧书圆新梦活动唯一负责人，为材料学院2014级领取生源地贷款本科生募集了约700本书籍；2014年暑假报名加入材院纳雍支教队，前往纳雍县进行为期半个月的支教活动，并在返校之后和队员们一起募捐到约4000元善款；2014年11月成为创青春大赛志愿者，并被评为优秀志愿者；2015年1月，组织高中同学参加母校回访实践活动；目前我担任材料学院社委会兼资助委员会副会长，学生工作处助理服务于学校同学。\n不管是涓涓细流还是汹涌大海总有其存在的意义，而我这股细流正是抱着这样虔诚的态度为志愿服务事业而努力着。一句话：以梦为马，随处可栖。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('310', 'U201315781', '王琛', '土木工程与力学学院', '    大家好。我是交运1301的王琛，也是一枚龙舟队的桨手。龙舟队训练很苦，一般坚持下来很难。去年院龙舟队有7个人，现在就剩俩。我们一周七训，不同的时间、地点。龙舟队从不主动踢人，坚持不下去就主动离开，所谓的自强精神，就是全凭自己的坚持，不息的奋斗。\n     龙舟队队员全部不存在体育生，但我们要竞争的是体育院校或职业的龙舟队，所以，我们把自己当体育生一样每天坚持刻苦训练。今年我们以更大的勇气，报名参加职业组的比赛，我们或许实力没办法问鼎，但我们执着的向更高的水准的比赛进发，向更优秀的对手发起挑战。纵使前途暗淡也要勇敢拼到最后，这或许就是自强精神吧，全靠自己的坚持，不止的追求。\n     而我，作为龙舟队一名普通的一员，入队前1000米跑3分半，现在只要3分07，或许还可以再快一些。我代表学院参加过学校的Nike杯接力赛，取得第三，我也自费去跑过厦门马拉松。我参加过新生篮球队，取得第三名，我们班也是去年追日杯的第四名。在龙舟队这种竞争环境中，都是大神，但我在去年的冬季大比武中综合排名第一.每次去参加比赛都要好几天的时间，这意味着学业的压力，自强精神，意味着牺牲，但也要勇敢的走下去。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('311', 'U201315848', '王凡', '土木工程与力学学院', '    我叫王凡，来自工程管理1301班。我对体育非常执着。刚一入校我就加入了校龙舟队，龙舟训非常辛苦。每周一、三、五的早操，从入队到现在从未间断。每天晚上9点晚训，到勤也做到了9成以上。每周一次，现在有时候是两次的下湖训练。在大冬天寒冷的湖水浸泡下我也坚持了下来。\n    经过了两年的艰苦训练，在各方面有了很大的提升。以前1000米最高记录是3分30秒，现在我的最好成绩是3分06秒。以前400米最好成绩是1分10秒，现在是58秒。以前200米最好成绩是27秒，现在最好成绩是23秒。我参加了中华龙舟大赛，东湖大战，同城双星的比赛，并且取得了不错的成绩\n    同时，校运会中取得了很不错的成绩。200米第四名、1500米第八名、110米栏第八名、4×400米接力第二、第三名。定向越野大赛季军，参赛队伍150支，湖北省第一届大学生跆拳道大赛63Kg级季军。代表学院参加Nike杯高校精英挑战接力赛，取得了学院第三个人成绩第二的好成绩。5月份将代表华科参加在北大举办的高校精英挑战赛。完成了厦门马拉松比赛，木兰湖25Km徒步大赛，阳光晨跑等活动。\n    我会在我的体育道路上继续坚持，继续绽放我的光彩。我将会用我的一生去诠释体育的魅力。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('312', 'U201315525', '胡婧', '土木工程与力学学院', '   我叫胡婧，来自土木学院土木工程1301班。\n   从初中起我就跟着父亲相依住在不足十平方米的租住房里，而母亲于几年后正式与父亲离婚。家里一直没有积蓄，现在我和父亲每月只有一千多元的低保作为家里的主要经济来源。父亲已经57岁了，由于早年公司倒闭早已下岗，因为三年前的手臂重伤无法进行繁重的体力活，在2014年年初又被诊出患有肝硬化，肝衰竭和胃炎等重病。虽然家里条件并不好，但是这并没阻碍我成为一名优秀独立的女孩。即使初中由于经济情况选择了一所并不好的学校，可是我凭借自身的努力，考上了武汉一中，并于重点班学习。为了不离开父亲，我并没有考去外省，我选择了华中科技大学，方便照顾父亲。高中毕业后，我就开始在外做兼职，放假就做长线项目，开学了就周末打短工，同时也加入了学校的勤工俭学岗。2015年年初正值期末，父亲大出血危及生命，我立即对期末的学习任务和考试安排做出调整，最大可能的将精力投向家里。出于实际的需要，我必须向同学家借钱给父亲做手术，并每日去医院照看父亲，在许多好心人帮忙下，我们最终度过了难关。虽然就外人看来对于年轻的我，生活可能十分艰难，可是我相信没有过不去的坎，只要活着就有希望，生活是美好的，毕竟阳光总在风雨后。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('313', 'U201415562', '陈明君', '土木工程与力学学院', '    我是陈明君，虽然目前还是大一，但我的自强之路早已开始！\n        磨砺：一个人的自强\n    初一便假期练泰拳，踢轮胎，跳铁绳等，只有我坚持到最后；初三，高三毕业，分别在餐馆，家教中心找到工作，虽然苦累，但我踏实认真干了下去！\n        公益：一伙人的自强\n    大一上，参加“爱在夕阳”长期义工关爱老人，带领组员无一次缺席或迟到（无论东边涨洪水，或考试周），并且自发准备魔术，歌曲，小礼物以带给老人温暖。\n    参加“爱心崇阳行”关爱贫困生，远赴崇阳一整天，给予孩子指导与温暖！\n一学期工时合计31个。\n    寒假，参加公益组织发起的“寒假励志演讲”，辗转两地为上千高三学子演讲！途中，吃在食堂，两人共张单人床，回家的路费还是自己负担。\n    现已加入该公益组织外联部。\n    暑假会去山区支教，奉献更多的爱！以后必将爱进行到底，我要自强！\n        追求：永不止步的自强\n    大一刚入学参与多个社团组织面试其中三个在最后一面失败、竞选失败、演讲超时、普通话被嘲笑，但我不放弃。\n    参加大创的“市场嘉年华”，摆摊一天，净赚110元。\n    一学期，从只会打字，到Word,Excel,PPT都基本会用，还自学了PS，视频，音乐剪辑。\n    但时间会证明一切，我将永不止步！\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('314', 'U201215564', '余倩雯', '土木工程与力学学院', '    我是土木与工程力学学院的余倩雯，可以叫我蓝胖子或是小叮当。\n    现任华小科团队负责人。正在创业阶段，目前产品【咩咩】已在iOS与安卓市场成功上线。曾先后在腾讯教育（北京）和碧桂园实习。策划的微博话题，转发量达万；微信图文最高达16w。目前已拿到阿里、搜狐、途牛实习生offer。\n    一句话总结自己：爱笑爱吃、敢想敢做的蓝胖子。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('315', 'U201215471', '李志斌', '土木工程与力学学院', '    我是土木1203班的李志斌，来自云南楚雄彝族自治州南华县，通过少数民族预科生计划进入华中科技大学。\n    2012年入学以来在学校认真学习，刻苦努力，积极参与班级活动及院内、校内组织的文体活动，同时也积极投身于学生工作事业，为我院的学生工作贡献了自己的力量。\n课余时间我热爱体育活动，在受伤的情况下坚持体育运动，参加篮球队，并努力坚持，在校内、院内的各项大小赛事中取得了不错的成绩，为班级和学院争得了荣誉。\n    与此同时，我还积极参与校内外的一些与专业相关的比赛，在其中磨练自己，也多次获得了荣誉。\n    曾获校优秀共青团员，“飞航杯”架构模型大赛三等奖，强生商界精英挑战赛二等奖，2012 级华科新生杯篮球赛亚军，连续两年追日杯冠军，连续两年年级赛冠军，2014年华工杯男子甲组季军，土木学院2015年度自强标兵。\n    曾任土木学院团学联副主席，金地华中俱乐部活动中心主任，华中科技大学职业发展研究会（ACDR）主席助理\n    曾在云南冲宇建筑有限公司项目部土建岗实习生，中国建筑国际集团、佳兆业房地产、招商地产校园招聘团队成员，金地集团校园大使。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('316', 'U201316172', '黄晏渲 ', '水电学院', '作为一名来自四川切身经历过汶川地震的孩子，在云南鲁甸发生强震的消息传来的第一时间我义无反顾地选择前往灾区参与人道救援工作。在营地以及重灾区待的十天里我学会了救援帐篷和行军床的搭建，我了解了物资发放的流程及注意事项，体会了大灾面前大家的众志成城。当我穿上人道救援制服负责灾区救灾物资调配和发放工作的时候，我从灾民眼中看出了他们对我的肯定，也许这也是我最值得骄傲的吧！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('317', 'U201316186', '李粮 ', '水电学院', ' 我是来自江西省革命老区——莲花县的一名学生。父亲在我七岁的时候患上胃溃疡住进医院。全家欠下一大笔外债才把父亲从鬼门关拉了回来。此后，父亲的身体便一落千丈，长年在家休养，加上年老体虚，不能从事较重的体力活。我的母亲，在家务农照应着整个家，她用十年的时间还清了所有的债，还供养了我们姐弟俩上学。我十三岁就开始包揽了家里所有的粗活重活。上大学之后，我在课余时间从事了大量兼职，在烈日下发过传单贴过海报；也在零下几度的晚上做过家教；参加学校的勤工助学活动，服务同学的同时，也补贴了家用。我所做的一切，只是为了减轻家里的负担。成绩方面，由于大一刚进来没有找到兼职和学习的平衡点，我成绩很差，但后来逐渐适应，成绩从最初的年纪倒数到现在的年级前20%左右。其他方面，我代表学院打过篮球新生杯，在班里篮球足球队都是主力，我还积极参与院校组织的活动，在13年校运会1500米项目拿过银牌，学生工作方面，我是学院团学联网新部执行部长。分管着学院的微信公众号。如果命运注定让我出身贫寒，那我要感谢这份贫苦，他没有成为我的负担，而是推动我不断前行的发动机。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('318', 'U201415882', '唐国钦 ', '水电学院', '我出生于国家级贫困县重庆市石柱县。从小家庭贫困，父亲身体多处遭受伤害，失业多年。这对于一直贫困的家庭无疑是雪上加霜。从5岁开始我就患上严重的疾病，去了多家医院都没有治好，花了家里大量积蓄。后来病情越来越重。进入大学后，也有过一段颓靡的时光，但逐渐地我明白贫困与残疾只是我逃避生活的一个借口。于是积极参加各种活动，努力学习，变得更加坚强，阳光。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('319', 'U201316128', '许立武 ', '水电学院', '一直坚持把每一门课学透，一年多来获得了校三好学生，国家奖学金，启明学院特优生等荣誉。担任班级学习委员，尽我所能做好自己的本分工作。从爱心卖报到旧书圆新梦，从爱心宿舍到志愿看包，我一直怀揣志愿服务的愿望。积极参与学生工作，担任院团学联科创部副部长。坚持勤工助学和社会实践，做过车棚岗，超市岗和其他社会兼职。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('320', 'U201316618', '王丛聪', '艺术团', '一、学习情况：\n学习上认真，刻苦努力，成绩在前1/3，获得学习优秀奖学金。在2014年12月中行电子银行知识竞赛中获得三等奖。2015年3月作为负责人申请学校创新训练项目，已在院里立项，目前已开展工作。平时的排练，积极主动。在交响队参加了大学生艺术节。连续两年在“金秋音乐季”上进行了演奏。\n二、社会实践、活动情况： \n大一一年任班级中班级资助委员，在 2014年四月校“我是策划人”义工活动中，带领班级参赛，进入前八名；大一成为艺术团编辑部的一员，大二任编辑部副部长，协助部长做好编辑部文稿的撰写，并带领部员推出自己的栏目，对艺术团的演出活动进行及时的报道。\n三、生活情况：\n   平时的生活中，自强自立，面对困难不退缩。集体主义感强烈，愿意为大家服务。生活中节俭，希望能通过自己的努力，追逐梦想。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('321', 'U201216212', '张嘉妮', '艺术团', '1. 在艺术的道路上执着追求。不管身上的伤痛有多少，平日的学习任务有多重，从来都秉着对舞蹈的热爱，坚持日复一日的舞蹈训练。从大一的8月中旬就入校训练，到每年的暑训，再到平日的训练近乎全勤。每台晚会，都倾注着无数的心血和汗水，但都咬牙挺过。\n2. 在学生工作上兢兢业业，努力不断提升自己的能力。从办公室的一员，到资助助理，再到办公室执行部长，舞蹈队团支书，以及今日的艺术团团学联学生会主席。整理材料直至凌晨，开会至深夜，每一件有关艺术团的事我都认真仔细，不敢有一丝懈怠。并且从不无故缺席各种会议，滋滋不断的汲取着来自各方面的优秀力量。\n在学习上坚持对自己的严格要求，因为基础差，所以一直以来很吃力，但我从未萌生过放弃的念头，因为我知道，路是对的，努力就是应该的。在班上的成绩不说十分优秀，但也良好。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('322', 'U201311927', '范雯宇', '艺术团', '    我是一名来自艺术团民乐队的艺术特长生，也是一名电气工程及其自动化1305班的学生。\n　　大一上，我报名参加了“聆听心声音，走进心世界 关爱精神疾病患者志愿者服务行动”，这次志愿者活动持续一个月，每个星期我与其他志愿者一起往返在学校和位于汉口的优抚医院，陪伴患有精神疾病的特殊的朋友。\n    大一下，报名了“创青春”复赛C类“一对一”志愿者，多轮考核后正式成为一名“一对一”志愿者。大一暑假，我参加培训和素质拓展活动。在十月份的决赛志愿者活动中，我接待了来自辽宁省团委的代表团。\n　　从进入大学至今担任艺术团学生会网络部部长、电气学院13级级会宣传部长、校资委会阳光俱乐部外事部副部长、民乐队团支书、班级宣传委员、艺术团办公室部员、电气学院文艺部部员。\n在校资委会阳光俱乐部，成功筹办“阳光励志演讲”“阳光新生演讲”等公益演讲，担任武汉革命博物馆志愿者讲解员负责人。\n    我愿意以自己微小的力量，给他人带去阳光，借用一位学姐的话：“愿，成为一个如向日葵般温暖的人。”\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('323', 'U201313824', '彭浩通', '光学与电子信息学院', '谁要游戏人生？谁不能主宰自己？养成自强性格，命运才会在自己手中！大学是让用来经历和体验的，也是为有想法的人准备的。\n大一时，他决定和室友一起在圣诞节卖苹果。可是生活往往就是这么的出乎意料，接连不断的失败给了他们不小打击。几天的努力，成果又是少之又少。准备也不充分，最后只卖出去一半的苹果，刚刚未亏本。升到大二，临近圣诞节。想着去年的失败经历，并不甘心，找了三个院里的好友。吸取上次的经验，这次提前半个月开备，收集全校所有大一班长的电话，预订了30箱苹果。在距离圣诞节还有一个星期的时候，依次打电话，接到许多订单。进了40箱苹果，找阿姨借了一个房间放苹果l，四个人从晚上七八点包装到早上五点，六点半又起来送货，借了电动车、三轮车，甚至租校车送货，发现苹果不够又去商店买了五箱，送到下午五六点才完全送完，一共卖出三千多个苹果，七千多新生，一半吃到了他们卖的苹果！\n周末对于大多数人来说是轻松的，但对于他来说，周末代表着忙碌，周日一天的三份家教，一天的奔波几乎横穿了整个武汉。发过传单、当过服务员、做过保安、做过电话营销员、做过代理等等，体验过很多不同的职业，他在这些经历中逐渐成长、自强。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('324', 'U201413636', '赵志壮', '光学与电子信息学院', '【逆境使坚韧铸进性格，他自己挣钱上学】\n父母只能靠打工和务农维持家庭。从六岁开始就每天独自走几公里的山路去上学，然而困难并没有阻挡他前行，他以优秀的成绩成为当地第一个来到华中大的人。\n因为来自穷苦家庭，所以更懂得关心帮助其他人。父亲车祸，家里的负担更加沉重，他除了学习，还要做家里的农活。他是大山里走出来的农民的儿子，他也像万千贫困家庭孩子一样，但他不自卑也害怕，逆风的方向更适合飞翔！\n没钱上大学，他便自己挣钱上大学。高考后一直在外面打工，商场、工地、家教，他都做过。去工地最幸苦，工地很累，但他还是坚持了下来。寒假他也一直没回家而在外面做家教。上学期间空闲时间去校外超市收银。经济独立自给自足，困难总可以克服，他清楚地知道自己担负着怎样的责任。\n【灾难面前更加彰显坚强，他身先士卒】\n2014年8月3日，云南昭通发生6.5级地震，家里房屋受到损坏。当时他在城里做家教，得知消息后，就立即赶往震中，不顾余震危险，走了五六个小时才走进去。时间就是生命，他跟着帮忙救人和搬运物资，未满18的他也“强迫”医生让自己献了血……\n那段时间他常常流泪，亲眼见证了生命的脆弱，更加懂得了坚强的意义。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('325', 'U201314368', '陈家田', '光学与电子信息学院', '从小讲话很慢，吐词不清晰。小时候因此被同龄人嘲笑，也因为这个缺陷，变得内向。到了大学，意识到了必须正视这一缺陷，从未担任过学生干部的自己也大胆去竞选班长，最后担任了光电1311班的班长。在各种场合勇于发言，并请同学们教自己普通话，慢慢地自己没有了以前拘束，没有了以前的胆怯，在KTV也敢用着五音不全的音律去唱自己喜欢的歌曲。\n初二下的时候，父亲因车祸不幸离世，无心学习，沉溺于网游不能自拔,最终沦为了一个放学之后通宵打游戏，从不做作业的网瘾少年。没办法上二本的他意识到不能堕落下去，为了理想，为了哺育自己多年的父母，为了在天之灵的父亲。下定决心发奋苦读，一步步往上赶，最后以湘1600名来到了华中大。\n在担任学生工作期间，经验欠缺，工作时不能很好地兼顾学业，大一的加权仅只有79。但自强的王子，从各种方面找出自己的原因，努力去改正，到了大二，适应了自己的工作。在不忘工作和学习的前提下，还参加勤工助学，并用其他时间努力学习，大二上的成绩达到了90+。\n他有着一颗乐观向上的心，在人生的路上，自己从来不会向困难低头，相信再大的困难对于自己只是磨练，目的是锤炼出更强大的自己。始终相信凭着自己的坚持和毅力能够做到一切看似不可能的事。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('326', 'U201313917', '瞿鑫', '光学与电子信息学院', '他来自祖国西部秦巴山间一个风景秀美但经济极不发达的地方。十年寒窗终于来到华中大，本就贫困的家庭由于08年大地震负债累累，求学路艰辛。\n快进入大学时，他便决定在经济上一定要减少对家里的依赖。于是大学伊始，他便在国庆假期选择了兼职，十月烈日炙烤下，他忙碌于街头发单。此后只要他周末一有时间就去做兼职。寒假时每天骑车往返两个半小时去县城做家教。大一暑假以及大二寒假，他也坚持在勤工岗位。回家后，他在一个高铁制梁场找了一个杂活岗位，要在烈日炙烤下铁皮房里搬着令人窒息的水泥灰，他选择坚持。\n贫寒塑造人节俭的品质。在生活上，他严控每一笔花销，无特殊情况每餐平均控制在3元以下。在他看来，学生的第一要务是学习，好的成绩才是对父母的最好回报，才是克服贫困的最好方式。从大一开始他便刻苦学习，他便走向了自习室。大二时他参加了智能车大赛，前后一个月奔波于启明楼和工程实训中心。平时他过着三点一线的生活，早上早早地去到教学楼，晚上十点以后才回宿舍，这些努力让他取得92+的加权。他还致力科学研究，进行着大创项目。\n“宝剑锋自磨砺出，梅花香自苦寒来。哪怕今天是痛苦的，明天也是痛苦的，但我相信只要我坚持不懈，后天一定是幸福的。”', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('327', 'U201314033', '苏畅', '光学与电子信息学院', '高考过后的他，看到爸妈每天辛苦劳累却收入微薄，他知道是该有一定担当了。便许下诺言：大学不向家里要一分钱。高考暑假开始便找了一个家教，凑足了大学的第一笔生活费。大学里做过不计其数的兼职：发传单，卖汉堡，拣快递…大学暑假里，在一个小金属制品厂里做流水线员工，脏乱的寝室环境，惨淡的饮食条件，恶劣的工作环境都没有使他退却！大二上做了一份家教，晚上要骑车经过森林公园，一次回来的时候骑车把脸严重摔伤，但是出于对孩子的责任感，仍然坚持做完了那一个学期的家教。77号公路，武汉到家乡的距离，两个100多公里的旅途，他证明了自己的毅力！\n大学做了很多义工，从最初的义卖报纸活动的参与者，到后来在义工部做着各种义工活动的策划者，童心伴夕阳活动，探访老年公寓活动，我是策划人义工策划大赛一等奖，现在仍在坚持做的地铁义工，以及正准备着的未来爱心支教。在传播爱心之路上，永不止步！\n每周的兼职和义工，没让他忘了学习。大一学年荣获国家励志奖学金，近90的加权，他懂得如何把握好自己想做的事和该做的事，不失生活重心的努力着。\n大学对于每个人来说都是一个自由的象牙塔，他有自己的大学旋律，想给自己一个展示的机会，让别人看到每个人的大学生活都可以按照自己的意愿过的精彩，活出自己的旋律！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('328', 'U201413946', '段昳晖', '光学与电子信息学院', '不知道是否有人注意过，游泳池晚上传来的阵阵鼓声；清晨和夜晚，华科校园里整齐的跑步队伍。你们也许听说过华中科技大学校龙舟队的名号，但是却不知道，那就是我和我的队友们。我不温婉，也不恬静，有的只是一份武汉女孩的泼辣和干练，也许，你会觉得我女汉子，但，事实如此。我并不是一个安静的女孩，心中也涌动着一股倔强的拼劲，流淌着不服输的热血。在龙舟队，这股拼劲和热血，似乎找到了最适合的舞台。\n在训练中，我逐渐爱上了这个队伍：爱上了自己划出的每一桨；爱上晚上力量房里挥洒的汗水；爱上游泳池边激荡的水花；爱上清晨森林公园清新的空气；爱上周末东湖绯红的夕阳。每周超过10小时高强度的训练，让不少女孩退却，大浪淘沙，留下的更为弥足珍贵。四肢酸痛，脚腕扭伤、手指划伤，伤痛并不能阻止坚持的脚步，正相反，面对逆境，更当自强不息，锐意进取；迎难而上，执着前行！守护前人的荣耀，开创新的辉煌，正是我执着追求的目标。\n执着与追求，也让我成长为一名合格的龙舟队队员。当代表华中大踏上全国级别的龙舟大赛的赛场，捧回奖杯的时候，我明白，正是长期的坚持训练，让我有能力去守护荣耀，也在队里收获友谊，挥洒汗水，青春无憾。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('329', 'U201413882', '谢祥芝', '光学与电子信息学院', '“我还年轻，未来会有无限的可能性，我始终相信微笑面对生活，奋斗成就人生。”\n家庭微薄不稳定的收入，爸妈积劳成疾。家就一直这样飘摇搁浅，却一直扬着前进的风帆。从小就学会独立自强。小学时就习惯了早上六点起床制作简易的早餐，步行三公里去上学；初中时习惯了将眼泪埋在心底，对父母始终保持微笑；高中时因不愿意看的父母整日围生计四处奔波的疲态，曾申请退学，但最后又回到了教室，踏入华中大。 \n梦开始的地方，他知道大学的自由不是肆意妄为的放纵。在班级中，担任班长着力于班级凝聚力和学习氛围，组织班级聚餐、班级间联谊……带头并劝勉同学努力学习，自己加权近90。参加校会，锻炼自己，不断成长，逐渐具备独当一面的能力。\n在学习之余，他还利用自己的空闲时间参加勤工助学活动。将一些小任务在碎片化的时间去完成，留出大块的空闲时间供勤工助学的活动安排。每周都会去韵苑公寓岗值班，去光电信息学院社区服务中心做助理。\n“不断努力，让我的肩膀更加坚强，可以勇敢的扛起自己的一份责任。这是这些支持这我，让我在求学的道路上可以走得更远。”自助者，天助之！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('330', 'U201314395', '何恒达', '光学与电子信息学院', '用梦想诠释生命，执着追求的是梦想也是存在的意义。在大学一年半的时间里，他挤出每分每秒奔跑在梦想路上，一点一滴，执着汇聚。\n小学混游戏厅混网吧，初中打游戏，高中成绩差。没有优人的天资，只有更多的付出，上课永远第一排，在光电信息公共项目实验室、DMET国重Focus团队，光弦项目组、国光学习团队课程，自学相关知识，做项目，学习Java、Javascript、Android、51单片机、蓝牙4.0开发、图像处理、地震波模拟、光纤传感、AD电路设计、VTK,每天看80-100篇论文调研，看遍TI论坛关于蓝牙开发的几百个帖子。执着追求的他是专业第六，获国奖，特优生，校三好，校科创优秀个人，全国生物医学电子设计大赛三等奖、中国数字家庭创意与应用大赛决赛优秀入围奖、“求是杯”大学生课外学术科技作品竞赛二等奖、“航空飞豹杯”电子智能大赛二等奖、“东莞工研院杯”创新创业大赛二等奖……他奔波于各个项目之间，作为启德创新创业孵化项目光弦项目组“宝宝守护神”核心组员，获全球创业周武汉站一等奖项目，获300万预融资，3000万估值；公共项目实验室“耦合谐振子”作品参加科学模拟展；作为组长组建One团队，主持光电公共实验室单项目，获得MOOC奖学金；在国家光电实验室国家支持计划子课题中国数字人小组实习，研究图像处理与三维可视化。\n梦想可能很简单，每个人的大学生活，不管是哪条路，一路折腾，一路感受，最后能无悔就好。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('331', 'U201313729', '陈健', '电子信息与通信学院', '大一上学期加入电信系小红帽志愿服务队，并于2014年6月起担任队长职务。 克服种种苦难，参与、组织电器义务维修活动20余次；挤出个人时间，帮助同学老师解决各种电脑、电器故障。\n担任小红帽队长期间加强团队建设，策划改革，为小红帽的发展竭尽全力。\n奉献知识，服务社会，我是光荣的小红帽！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('332', 'U201313635', '陈梦婷', '电子信息与通信学院', '从前，我是一个生活比较简单的人，因为当初的目标只有一个，那就是考一所好大学。所以从步入大学的那一刻起，我就告诉自己，我必须做一个全面发展的大学生。我必须拥有一个丰富的大学生活，这就是我一直以来执着追求的目标。学生工作上，我是班级助理，一直以来管理着班级的各种事务，被班级同学评选为优秀学生干部，还作为班级助理代表在年度资助大会上发言。志愿服务上，我从大一开始就一直随着小红帽这一组织四处进行志愿服务，成为我大学生活中难得的一笔财富。兴趣爱好上，我在辩论队投入了大量的时间和经历，看着辩论队一点一点的成长，是我最开心的事情。在专业学习上，我也非常重视，一旦发现有退步就会尽力赶上。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('333', 'U201313720', '代璐', '电子信息与通信学院', '我是一名来自河南农村的学生，父母工资不高，却既要供用我上大学又要养育年幼的弟弟以及赡养年迈多病的老人。而我为了减轻家里的经济负担，一方面好好学习，并于大二上学期获得了国家奖学金以及作为负责人申请到了大创项目，另一方面利用闲暇时间做一些校内外兼职，比如检查食堂，发传单来补贴自己的生活费。除此之外，我平常还会去做一些志愿服务，比如爱心卖报，清明节扫墓等等。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('334', 'U201313476', '李小雨', '电子信息与通信学院', '自从踏入这菁菁校园之际，我便立志要在这四年荏苒年华中锻造出一个优秀的自己。我坚信天道酬勤，对知识的执着追求是我学习的动力。大二上加权91.12 分，总加权年纪第三是对我汗水的回报。对数学的执着与狂热让我获得了概率论100、微积分上98、线代96……以及全国大学生数学竞赛省三等奖的成绩。然 而这都来之不易，需要辛勤付出、耐住寂寞、抵制诱惑、顶住压力。除了学习，常任班里学委、纸桥比赛、演讲沙龙、校十佳主题团会答辩、义工活动、创青春志愿 活动都有我忙碌的身影以及被认可的成绩。假期的家教以及各类奖助学金已经能让我在经济上独立，不给父母增添负担。而最后我想说生命不死，奋斗不止。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('335', 'U201413492', '汪畅', '电子信息与通信学院', '我热爱生活，我做事认真负责。\n作为学生，我在上学期取得87.64的加权分，专业排名第5；作为志愿者，我积极参加各种志愿服务，目前获得工时46个。\n我关爱•流浪动物——我坚持了一个多学期流浪狗救助活动，给小狗带去温暖，给社会传播爱心\n我参与•文明创建——我在昙华林参加社区卫生服务，两次投身于文明创建宣传工作，为武汉争创文明城市献力\n我助力•骨髓入库——我参加中华骨髓库培训会，普及骨髓库知识，帮助志愿者骨髓入库\n志愿服务虽会劳累奔波，但这些冲淡不了我心中乐于奉献的热情，我勇于承担社会赋予我的责任，也梦想着在志愿者的路上不断前行，成为一名公益达人！\n我奉献！我快乐！\n我热爱生活，我做事认真负责。\n作为学生，我在上学期取得87.64的加权分，专业排名第5；作为志愿者，我积极参加各种志愿服务，目前获得工时46个。\n我关爱•流浪动物——我坚持了一个多学期流浪狗救助活动，给小狗带去温暖，给社会传播爱心\n我参与•文明创建——我在昙华林参加社区卫生服务，两次投身于文明创建宣传工作，为武汉争创文明城市献力\n我助力•骨髓入库——我参加中华骨髓库培训会，普及骨髓库知识，帮助志愿者骨髓入库\n志愿服务虽会劳累奔波，但这些冲淡不了我心中乐于奉献的热情，我勇于承担社会赋予我的责任，也梦想着在志愿者的路上不断前行，成为一名公益达人！\n我奉献！我快乐！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('336', 'U201313614', '王艺帆', '电子信息与通信学院', '我喜欢技术，喜欢钻研，喜欢不断挑战自我。\n首先，作为学生，我的总加权成绩专业第二，英语四级614，六级548。大二上期拿到计算机三级证书。大一积极参加学生工作，协助组织了院十大歌手比赛、迎新晚会等活动。\n学有余力的同时，加入联创团队，与人合作开发了两款应用，一个在中国银 行的比赛中获奖，一个发布在百度应用市场中；另有一个网站正在内测，技术方面由我全权负责。加入校网研中心，目前正在参与学校部分网络系统的构建。掌握Java, Python, C, C++, JavaScript.....\n 生活方面，热爱运动，篮球台球乒乓球，虽不是样样精通，但也并不逊色。院系篮球赛每次必参加，迎新晚会也可以登台高歌。我总是乐于尝试新的体验。\n这就是我，执着追求着的，不仅仅是技术，也不仅仅是挑战本身，而是在挑战中不断成长的自己。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('337', 'U201316341', '阮泽慧', '管理学院', '一个不太成熟但却一直执着追求着的女孩人生，由一个个挑战组成，执着于塑造更优秀自己。希望与大家一同前行！\n学习：保持专业前30%左右的成绩，上学期加权88.11分，班上第2；\n学工：校团委组织部人力资源部主任；营销班副班长，成功争取“优良学风班”等称号；市场营销协会策划部部长；英协“荣誉之星”；大创部长助理；托业校园代理；\n专业：获得强生商业精英挑战赛团队第2名，600多人脱颖而出获得最佳个人；拿到强生5个实习绿色通道之一；\n英语：启明3C团队英文演讲组、模联组；校广播台英文播音组；IDEA英文辩论赛省三等奖等比赛；\n演讲：“院十大演说家”冠军；\n政素：首批入党积极分子结业证书；2014年“优秀共青团员“；“回访母校”团队；\n志愿：“创青春”海南大学志愿者、图书馆义工、启明特教看望自闭症儿童；\n思辨：院辩论队主力，多次成为如校园文化节“喻晓之巅”辩论赛“最佳辩手”、“优秀辩手”；\n艺术：8年舞蹈，精通中国舞；6年小提琴；1年钢琴；1年美声；连续两次“文体奖学金”；校艺术团合唱团；全国第四届大学生艺术展演合唱组一等奖；”校园好声音“省第2；\n主持：院主持人队；艺术团表演队；主持经验达十几场等。\n\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('338', 'U201216298', '王小雪', '管理学院', '为“她”执着——学习：从大一到大二，一年时间，加权上涨十分，大三学期加权升至专业第三；为“她”执着——组织竞赛：从商业公益团队副主席，到互联网团队产品经理；从求是杯创业竞赛，联合利华营销大赛，再到手机APP大赛，微信公众号运营，我都全力为之，力求做到极致。为“她”执着——公益实践：开展多个公益项目，积极参加社会实践，并坚持长期义工；为“她”执着——产品项目：从大学生求职系统，到校园图书馆查询系统，从“HUST奶茶时间”到一个个节日游戏，我都沉溺其中。我热衷书法，十年不曾间断；也喜欢跑步，从不及格，到第一名。但行好事，莫问前程。Dream！ Action！Persistance！是谓自强！我是王小雪 故事未完，精彩待续…', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('339', 'U201316418', '文雅茜', '管理学院', '从来不曾忘记，作为志愿者得到的那份最简单的快乐、最纯粹的感动。也从来不曾放弃，作为志愿者所拥有的那份坚韧、那份执着。中华骨髓库入库志愿者，寄托着延续生命的希冀。地铁义工，是将近一年每两周一次的坚持。中国市场营销国际学术年会志愿者，激发着一个人拼搏的劲头。创青春志愿者，是参赛队伍的指南针，让他们在偌大的华科校园绝不迷路。湖北省图书馆义工，是安静地穿梭于书架间的精灵，让所有书籍变得井井有条。献血志愿者，是对生命的热爱，是满怀一腔热血的注解。这些都是我，在平凡的生活中用一个接一个的志愿者活动延续着属于我自己的精彩人生。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('340', 'U201416071', '周小又', '管理学院', '我是来自一个山区热爱生活，积极向上的女孩。从小，爸妈为了生活外出打工，家里只有我和弟弟以及年迈的爷爷奶奶!才上三年级的我不得不学会自己照顾自己和年幼的弟弟!学着帮爷爷奶奶做家务!后来爸爸因为一个意外成了残疾人，家里的房屋又不幸的在地震中被毁，面对这些，我一边认真学习!力图使家里燃起希望，一边趁着每天放学的时间，回家帮忙背砖重新修建房屋，做一些力所能及的事来减轻家里的负担!面对家里拮据的生活，未住校时，只要一放学，我就去茶园帮忙采茶赚钱，上了高中后又利用假期在爸爸的工地上打工，现在的我积极参加学校的勤工俭学!虽然有点辛苦，但我我从未抱怨，只因为我相信，生活中的坎坷从来不可避免，只因为我相信，人虽然无法绝定自己的出生，但是却可以选择凭借自己的努力，改变命运!', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('341', 'U201415989', '邹兴', '管理学院', '他叫邹兴，一个以周星驰为偶像并对生活充满希望的人。他来自贵州一个偏远贫穷但却十分美丽的地方。从小的经历造就了他直接而又现实的梦想：“成为有钱人，并且帮助那些像他一样需要帮助的人。” \n他从高一时妈妈离家出走的巨大阴影里走了出来。也就是从那时起，他通过做兼职赚取生活费，以减轻爸爸肩上的重担。四年来他做过牛奶促销，影楼促销，在工厂打工，天马驾校校园代理等15多种兼职，虽然很累，但他从没放弃。\n他现在是校团委组织部助理，校资助中心实习助理，管理学院14级年级学生会副主席和工商班的班长。他热衷于公益活动，曾参加“吾爱吴泗行”支教，并且担当创青春志愿者。\n虽然至今家里已欠债5万多元但他一直在坚持。永不放弃，邹兴，雄起！\n他是一个讲故事的人，期待与你一起分享他的故事。\n\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('342', 'U201415673', '白玛曲宗', '环境学院', '她牢牢地记住了父亲的话“知识可以改变命运”。于是，12岁，小小年纪的她便背起行囊，远离故乡西藏，来到内地求学。但漫漫求学路，注定不会是一帆风顺的。在外读书期间，奶奶去世，母亲病重，父亲靠微薄的收入维持着这个家。面对种种打击，她没有一蹶不振，没有自甘堕落，而是选择了坚韧，选择了乐观，选择了正视眼前的困境。在高消费的上海，她只用500元便可维持一个学期的开销，并且偶尔还会寄钱给在北京上大学的哥哥。面对拮据困乏的物质生活，她执着地追求精神世界的富有，慢慢地从一个听不懂普通话的孩子成长为一名高校大学生。\n毁灭，还是生存？选择的权利在我们自己的手中。白玛曲宗，她用自己的选择诠释着什么是自强不息，什么是百折不挠。命运的不公压不垮她，生活的磨难打不倒她。相反，正是这些苦难成就了今日的她，让她的意志更加坚定，目标更加明确。她就是雪原里不畏严寒，傲雪挺立的一枝莲花，幽幽暗香飘来，那样清淡，那样高雅，又那样激励人心。\n\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('343', 'U201415975', '曹智', '环境学院', '家境贫寒并没有让他产生自卑，相反，在人生路上，他是一个勇敢的逐梦者。\n从班级到年级再到校级的各个组织中，都能看到他活跃的身影。作为班级团支书，他精心策划团会活动，团结班级同学。作为年级组织部部长，他尽心组织双旦舞会，并成功为环球争霸篮球赛拉得赞助，解决了资金问题。作为学校社联、大创的一份子，他用心完成每一项任务，获得了优秀个人的称号。\n丰富的阅历让他极具商业头脑。加入了wedo创业团队成为一名精英销售员同时为一家留学机构做代理，周六日还会去一家留学公司做实习生。凭借这些固定的工作，他不再向父母索要一分钱，成为一个真正独立的人。目前，他在为成立一家奶茶店而筹划。这是他的梦想，也是他们一个团队的梦想。他相信只要精心浇注，梦想定会开花。\n一路风雨，披荆斩棘，他如一位骑士，在逐梦之旅上一路向前。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('344', 'U201415696', '何长峰', '环境学院', '生活中总有许多坎坷和不平，但只有勇于搏击的人，才是生命的强者。何长峰，一个阳光般的大男孩，在遭到生活的嘲弄时，依旧向人们展现出乐观与自信。他用自己的实际行动，做出无畏的反击。\n母亲被检测出患有重病，高额的医疗费用让原本拮据的家庭雪上加霜。生活以痛吻我，要我回报以歌。正是这份积极向上的心态，让他的意志更加坚定，奋起读书，以最好的状态生活每一天。他参加实验室勤工助学活动，希望用自己的一份力量，来减轻家中的负担。他坚持武汉育校高中辅导班义务行志愿者活动，希望通过自己不辞辛苦的努力，能帮助更多需要帮助的人。天行健，君子以自强不息，对他来说，苦难不会打到一个人，反而会让人变得更坚强。\n自强者恒强，坚强的他在生命的舞台上演绎出一部雄壮的命运交响曲。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('345', 'U201216033', '李冬丽', '环境学院', '一家六口人挤过一间只有二十多平米的小房间，有时屋顶会漏雨，有时吃不上早饭，更有几次差点因为交不起学费而辍学。生活的贫困，不曾阻拦她追求知识的脚步，不曾浇灭她励志上大学的决心。她把苦难当成人生路上的垫脚石，永不轻言放弃。\n在最深的绝望里，总能遇见最美的风景。每一次险些辍学，都是周围好心人的热情帮助才得以延续十几年的求学梦。人只有经历了，才会晓得机会来之不易，才会懂得要倍加珍惜。同样也是大家的热心帮助让她由一个内向的小姑娘，变得外向，变得活泼，变得开朗，增加了对生活的热爱。从导游到义务解说员，从班长到民族部部长，她积极参加社会活动，尽心做好学生工作。如今的她在用自己的切实行动，回报社会，将爱的暖流传递。\n经过一次次与命运不屈的抗争，她用最美的微笑告诉大家，努力、坚韧、自信、自强，即使逆风飞翔，依旧可以飞的高远。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('346', 'U201316091', '毛鹏', '环境学院', '“没有过人之处，只好出过人之力。”刚刚进入大学时候的毛鹏，看着身边的人一个个如此优秀，而自己甚至连普通话都说不好，这样对自己说。\n为了弥补自身的不足，实现自我的超越，从此，他在学习上毫不懈怠，为自己制定学习规划，认真阅读各种课外书籍拓展自己的视野，网上学习名校公开课、百家讲坛，读书笔记足足做了六个笔记本；从此，他在学生工作上积极参与，加入团学联、资委会，成立华科杉树社，学校里的各种活动似乎都留下了他的身影；从此，他致力于社会实践，参加“青春创业行”、“青年马克思主义培训班”，参加“爱我中国，修我长城”千名学子保护宣传大型志愿者活动，在“创青春”中担任接待组的志愿者，奔赴江夏高中为备考学生做考前经验学习交流，两度回家乡做高中回访交流等等。\n他的努力没有白费，他的汗水收获了成果，国奖、校三好、2014年华中科技大学科创积极分子等等一项项荣誉光彩夺目。对此，他只是淡然一笑，不自傲，不自满，笃行于“心有所愿，行而成立”的逐梦之旅，怡然自乐。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('347', 'U201317341', '蓝婧', '新闻学院', '我是蓝婧，来自新闻与信息传播学院广告1301班。\n我的座右铭是“生如夏花之绚烂，死如秋叶之静美”，这不仅是我的精神追求，也是我为人处事的准则。我善于交际，常在各种活动中调动气氛带去欢乐；我自立自强，能靠自己的双手挣取大学生活的费用；我敢想敢为，会竭尽全力地做着我认为有意义的事情……我还有一颗真挚的爱心，长久以来积极地投入社会公益事业，尤其在关怀弱势群体和特殊人群方面做了不少贡献。\n从小学开始，我就参与了各种形式的志愿服务活动，比如学校迎宾使者、福利院演出等。印象深刻的还有加入我们市里面的“南康义工”组织，常进行园林清扫等活动。上了大学，我对社会公益和志愿服务更加充满热情和能量。我做过创青春活动志愿者、运动会志愿者、武汉创建全国文明城市督察员，也卖过义报等等。最让我感到骄傲的，是从微梦社工协会的会员到会长，矢志不渝地坚持着社工事业。我坚守“助人自助”，且深信要真正地帮助弱势群体和特殊人群，就应该努力让他们自己帮助自己，让他们找回自信和勇气，让他们拥有与正常人一样的生活。我会一直坚持社工和志愿服务，希望更多人加入这个行列，也希望我们的社会变得更加美好！\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('348', 'U201317345', '梁雅文', '新闻学院', '我是来自新闻学院广告1301班的梁雅文，目前是新闻学院资助委员会主任以及院系资助助理。我属于很外向的女生，而且时常不定期犯二，但是做事情还是比较靠谱的。作为一名资助委员，在来到华科的这将近两年里，我几乎组织并且参加过所有的义工活动。也许在很多人看来，这只是资助委员分内的工作。我和很多资委小伙伴一样，也觉得这些都是些小事。但是这一路走来，我真的不觉得有大家想的那么容易。腿摔伤了冒雨带着同学去省图做义工，清早去东大门领取报纸，冒着炎热去收集旧书，我相信这是每个资助委员都体会过的艰辛。这是我的工作，也是我的公益理想，尽管它没有那么的神秘和伟大，但是至少，这两年里，我一直在坚持，而且还将继续坚持下去。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('349', 'U201317347', '刘雅珺', '新闻学院', '我是华科新闻学院广告学专业的同学，来自河南省驻马店市西平县师灵镇的一个小村庄里。自强对于我来说是一件必须所以就自然而然的事情，因为条件不好，所以我热爱生活，渴望自强。从小学一个人步行到别的村子上学，到初中便开始了离家一个人生活，直到今天，从独立生活中收获了很多。家庭无法选择，我就只有自己努力，好好学习，所以我走出了小村子，我为自己骄傲。初中高中的奖助学金给了我很多帮助，来到大学，我为家庭分担的想法有增无减，我做了许多兼职，戴尔课戴表，一年的优秀表现换来了实习证明的肯定，发传单，饮料查核员，在学校超市勤工助学，西瓜帮兼职，做家教，这些带给我的不仅仅是经济上的满足，更多的是一种充实多彩的感觉，丰富的经历，我有能力靠自己。可是兼职并不可以成为大学生活全部，院会宣传部有我的足迹，跆拳道协会有我的表演，做过志愿者，马路义工发报纸昙华林义工都有我的身影，回访母校很成功，同时我的成绩在班里也不错，四六级已经通过但仍然要努力刷分，还报了双学位。所有的这些都是我热爱生活的结晶。我喜欢接受我们不能改变的，改变我们可以掌握的。平凡而不平庸，自强而不息，努力而积极，热爱生活，这就是我。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('350', 'U201317302', '张晓娜', '新闻学院', '从初二开始，就立志成为一名记者，第一年高考没有被自己喜欢的学校录取，顶着各种压力去复习，后来如愿进入了我校新闻专业。当时学新闻，爸妈是不支持的，他们希望我可以学会计或者财务类的，以后就业工作会更合适，但一心想读新闻的我最后还是说服了他们。进入大学后，加入记者团，成为了我目前做的最正确的事情，一年来，累计发稿40多篇，并在楚天都市报，楚天金报等平台多次发稿。\n充分利用寒暑假时间去媒体单位实习。大一暑假在石家庄日报文体部实习一个月，发稿量11篇，其中《铁嘴钢喉为戏狂——访京剧名角康万生》在单位评为了好稿二等奖。得到了指导老师的好评。大二寒假，离校后第二天就去石家庄电视台新闻综合频道实习，为期3周的实习让短暂的假期充实了很多，去地铁工地、爆炸现场等地的采访经历让我对新闻工作的了解更加深入，更加坚定了自己成为一名新闻工作者的决心。\n这个职业固然免不了奔波劳累，但是每天都有新鲜内容，见不同的人，见各种各样的事情。今天所见所闻所写下新闻就是明天的历史，这份神圣感足以使我满足。 ', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('351', 'U201214534', '谭资昌', '自动化学院\n', '我来自湖南株洲茶陵县的一个小乡村，家庭贫困，父母自我两岁的时候便到西藏打工，常年在外，记得最长的一次父母5年才回家一次。父母不在，爷爷奶奶年迈，从小我就成了家里的顶梁柱，自立自强。不到10岁，我就开始下田忙活，种地种菜，上山砍柴。虽然父母常年不在家，但是在学习上，我从小就十分自觉，从小就上进努力。从一个不知名的乡村小学以全乡第一进入县城中学学习，中考时再次以中学年级第一考入县重点中学，不放弃的我一直没有松气，最终以全县第三的成绩考入华中科技大学。由于高中教育水平落后，在大学，经过不懈努力，我将综合成绩由倒数第二变为正数第二。最后拿到了国家奖学金，启明学院特优生，校三好学生等等。数模竞赛零起步，自学MATLAB，lingo，数学模型相关知识，所用数模的资料达到几个G，基本上80%的论文我都看了至少两遍，一个暑假，两次练习赛，一次正式比赛，我和我的队友最后那两天都不会寝室，累了就睡在启明12楼的地板，醒了就继续干活。最后我们队伍拿了全国大学生数学建模竞赛的国家一等奖。我认为自强，是一种自我超越的气质，它来自于你内心想要变得更加优秀的那种强烈的渴望，这种渴望，让你在逆境中从不放弃，在顺境中从不止步，让你不断的超越自我，越变越强！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('352', 'U201214418', '张梦颖', '自动化学院\n', '在大学伊始，我就加入了援之缘支教协会，想要为山里的孩子们做些什么。因为喜欢孩子，我积极参加协会举办的周末课堂活动，利用周五下午的时间，给武汉周边小学的孩子们带去英语趣味课堂的教学。往返的路程比上课的时间还长，但觉得很值得。看着孩子们的天真笑脸，让我觉得放松。在2014年3月，我报名参加了援之缘支教协会暑期志愿者。经过4选1的残酷的两轮面试，再到长达三个月的培训，我来到甘肃古浪酸茨沟村在大山深处，睡在教室的桌子上，吃着半生不熟的饭，每天在烈日下走两个小时送孩子们回家，中暑吐得站都站不起来，没有手机，没有电视，没有网络，我坚持了下来，换来的是孩子们一句“张老师你一定要回来……”；在上学期间，我也一直坚持我们学院的无工时活动——养老院之行，并获得自动化学院“优秀志愿者”称号。每个周日的早上,在别人还在睡梦中的时候,我已经在走在去养老院的路上。印象最深的就是给老人洗脚，老奶奶的脚又干又瘦，因为长时间没有清洗已经有可以看见的污垢，脚趾甲有着厚厚的增生，连看护人员都不愿意为她清洗，在我们为老奶奶洗脚的时候，她一直在说：“好舒服，好舒服，谢谢你们，谢谢你们。”我在“创青春”全国大学生创业大赛中作为会务组志愿者，任第三组组长，起早贪黑活又多，没有固定的时间，工作地点，更需要随叫随到。做志愿者，只因为双眼曾经看见过苦难，就再也不能视而不见，我相信，再微小的职位，也会因为你的用心而出彩。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('353', 'U201214551', '陈东东', '自动化学院\n', '我是一个臭小子，对于一件事，如果我觉得有价值，便会尽全力。工作上，我全力以赴，去年，我和一群\n好朋友一起到汉口小天鹅酒店的社会人聚会现场，去为一个小学的图书角拉赞助，我们和他们素不相识，\n就凭我们做过的事，真诚的心，诚恳的态度，最后获得了4500元的赞助。学习上，我全力以赴，大二上，\n我是班级10多名，加权只有85，大二下一学期，我疯狂努力，加权92.69，提升了将近8个加权，最后才有\n机会参评国奖。生活上，我全力以赴，朋友来找我玩，我白天陪他玩，晚上在电工基地刷夜做课设。我喜\n欢全力以赴的感觉，我喜欢年轻人身上具有的热血与激情，我要实现我的“价值青春”。全力以赴，它是一种态度，更是一种行动，认定了，我就一定全力以赴，否则，我就不叫臭小子。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('354', 'U201314734', '龚桂良', '自动化学院\n', '我出生于农村家庭，四岁母故。现家里还有三姐妹，父亲已入花甲之年，下岗务农。两人读书。为尽量减轻父亲的负担，不负父亲的期望，一直刻苦学习，积极争取奖助学金，并利用课余时间和寒暑假做兼职。\n大一上身兼三份兼职，白天作为学风督察员课间查课，晚上作为楼栋协管员守楼，周末在街道口坐咨询台。大二为学风督查组组长，并参与华科小麦公社物流团队的创建。大学以来靠自己的双手买了手机电脑，交大二的学费和支付大学一切生活费用。与此同时我合理安排好学习时间，大一上获得了加权88.67，专业第三及大二上加权90.5的成绩，通过了CET4和CET6。获得过“新生学习优秀奖学金”、“自强奖学金”、“自强之星”以及“国家励志奖学金”。大学以前对电脑的认识仅限于高一每两周一节的计算机课。甚至于大学刚开始连基本的复制粘贴都不会，找电脑电源键要找半天，更何况下载东西。与电脑有关的课都让我很焦虑。但是我没有自弃，通过认真听讲、自学和实践，不光熟练掌握了基本办公软件的使用，对于AUTOCAD、PCB、PS等都有了一定的应用技能。C课设虽然很难，但是我没有退缩，通过多问常优化，以个人近4000的代码量获得了A的成绩，在C语言课程设计大赛中获得了“三等奖”，通过了国家计算机等级考试二级。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('355', 'U201214415', '周 杰', '自动化学院\n', '我出生在西部的农村里，从小家庭经济就开始走下坡路，小时候因为没钱看病与死神擦肩而过，从小体弱多病，因为没有钱，营养跟不上，缺钙导致了现在的“罗圈腿”，但是贫困的家境不仅没有磨灭我的意志，反而让我更加坚定了奋斗不止，自强不息的信念，后来跟随在浙江务工的爸妈，进入到了当地初中读书，随后以优异的成绩考入省级重点高中，就在对自己的前途充满期待时，被告知无法在浙江当地参加高考，无奈之下只有辗转回到四川，面对教材不同，时间紧迫的双重挑战，最终顶住压力，以优异的成绩考上华科大。上大学后更加严格的要求自己，不断提升自己的综合素质，然后又一次意外来袭，14年末父亲因突发脑溢血去世，家里的重担突然一下子几乎全部落到了我的身上，但是勇敢的去面对了这个事实，一方面要照顾和关心家里的妈妈和爷爷，另一方面是自己的学业，学习之余还会去兼职赚钱，但我相信，唯有勇敢的面对，自强不息得奋斗，才能真正的走过这个坎儿，走向更美好的生活。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('356', 'U201112923', '陈雪慧', '第二临床学院', '热爱挑战，执着追求。暑期组织参与“徒步滇藏线”，香格里拉到拉萨， 40余天， 1000余公里。这种经历在许多人看来疯狂也值得羡慕的，但荣耀背后是辛勤的汗水。整整6个月的筹备，辛苦却不曾放弃！滇藏之行共计花费的8000余元，也均是我课余做家教和奖学金所得，不曾向父母索要丝毫。自己的梦想要靠自己支撑。\n勤工俭学，生活上勤俭节约，从大二至今坚持做家教，进入大学以来的学费生活费均来自奖学金和课余收入。\n热爱公益，坚持参加各项义工活动，仅大三上学期义工工时数40余\n学习优异，通过计算机二、三级考试，英语四六级，大二全年加权95.44分，位列专业第一名。\n奖项：2013——2014年度国家奖学金，校三好\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('357', 'U201213021', '丁帅', '第二临床学院', '我服务，我快乐\n   出生在一个贫寒的家庭，从小父母亲就教育我要坚强而有爱地生活，而我也将自己的大学生活定格在志愿服务与努力学习中。我积极参与尝试各种不同的志愿服务，希望自己的微薄之力能让这个世界充满更多笑脸，阳光大学生卖报，艾滋病宣教协会，武汉血液中心，阳光医学生，图书馆管理，宿舍楼栋守岗，爱心导医，爱心病房，“小废品，大爱心”，“一站到底”汉口火车站志愿服务……每一次服务都让我感到真心愉快。我用自己的学习经验去帮助那些仍在为高考奋斗的学生：大一寒假，在回访母校的活动中志愿为母校的学生补习功课；大一暑假，在家乡创办补习班，为家乡学生补课，学生的成绩有了明显的进步；在校期间也会坚持每周做家教，服务他人并减轻家里负担。大三参加艾滋病宣教协会，走进社区宣传“关艾”知识。平均每个学年义工工时超过80。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('358', 'U201112923', '康雪慧', '第二临床学院', '2002年父母下岗，一直在外面打零工，工作很辛苦但收入微薄，仅能维持基本的生活开销，家境贫寒，十几年来一家人都过着艰苦朴素的生活。高考后到现在我坚持做兼职赚取生活费，减轻家里的负担，我做过酒店的服务生、促销员、给干洗店送衣服，家教等，生活上自立自强，用乐观感恩的心态面对每一天，对同学乐于助人真诚热心，对学习踏实认真、刻苦专研，按照自己定下的目标努力着，和同学们相处融洽，在学习上也取得了较好的成绩。生活中难免会遇到各种各样的困难或挫折，但是我都能调整好自己的心态，绝不自暴自弃，而是积极想办法解决，我的父母也是这样这样教育我的，去年的时候我生病的事情对我的打击很大，身体的不适和治疗的花费让我觉得非常辛苦，那段时间有点消极，学习成绩也受到影响，很庆幸最终还是战胜了苦难又有所成长。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('359', 'U201211287', '徐声铭', '第二临床学院', '于我而言，自强者的人生没有选择题，只有证明题。回望近三年的大学生活，我可以很骄傲地说，在追求自我完善的道路上，我始终是执着而又坚定地。\n大一时，自己从材料学院转入医学院，两种不同的学习模式带来的差异是巨大的，然而我始终默默坚持。大一暑假，我报名外国语学院暑期夏令营助教，从英语刚过四级到能与外教熟练沟通，其中的困难是巨大的，然而收获也是巨大的。\n大二下学期，我选修了双学位。每周一次，从汉口到武昌，来回都要花去三个多小时，无论严寒酷暑但我没有逃过一天课。大二下学期，我报名了雅思考试。每天早上六点半雷打不动去广场早读，学期末各种考试的压力迎面而来，咬咬牙坚持过了熬过了最痛苦的日子，最终获得了回报，通过了雅思考试。\n每天除了学习，我始终不忘坚持锻炼，跑步一跑就是半个小时，并在汗水中感到快乐。就这样坚持一年多，从原来的一百八十斤的大胖子瘦到了现在的一百四。\n越痛苦的日子才约有坚持的意义。自强，始终是我不断追求一个更优秀的自己的支柱。我相信，以后的日子，我会变得更加优秀。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('360', 'U201010534', '徐滔', '第二临床学院', '在我看来，做人做学生一定要自强自立，奋发图强，虽然你有可能不是最优秀的，但在某一方面，你一定是出色的。我觉得在大学这几年，自己也慢慢的在努力成长着。\n在学习上，自己一直没有放松过，成绩始终位于中等偏上的水平，成功的考过四六级，计算机四级，还有英语口语等级考试。工作上，在大一到大三期间担任了三年的班长，与其他班干部一起组织各项活动，团结同学，并且班级连续评上优良学风班，自己也多次被评上校优秀学生干部。生活中，自己也是个充满正能量的人，周末会和专业同学一起打球，会坚持去健身房锻炼身体，每周也会坚持晚上去操场跑步，努力做到学习锻炼两不误，并多次代表学院参加校运动会。在课余时间，自己也还会去做家教，以减轻家里负担，自己的付出也得到了家长的肯定\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('361', 'U201313286', '陈岚', '法医系', '从小学第一次踏入养老院的大门，成为带给孤独老人们阳光的开心果时，义工就在我的心中扎了根。进入理想的学府深造，我依旧没有忘记象牙塔的坚持，担任资助助理的工作更是让我有了新的体悟。大一坚持了一整年的地铁义工，以及在学校社区普及急救常识，还常常组织班里一起爱心卖报，去省图、校图书馆、宠物救助站等做义工。班级其乐融融一起以做义工的形式出游，不仅让我们更加凝聚，更让我班同学感受到志愿服务的魅力，期末时受到肯定被评为“优秀义工班级”。大二来到课业负担明显重了不少的医学院这边，这颗热爱公益的心仍然在不停地跳动，继续作为急救队的助教四处宣讲的同时，还参与了爱心导医、爱心培智、献血车、小废品大爱心等义工。同时我也励志通过学生工作服务同校甚至全城的同学，社联、社实、资助中心、青协、强生TLS、系学生会，两届社团文化节、一届新年游园会、武汉高校商业精英挑战赛、法医面对面等活动的幕前幕后都能看到我忙碌的身影。希望我对公益的坚持可以感染到更多的人！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('362', 'U201313294', '黄芳', '法医系', '从小，我就希望自己是一个德智体美全面发展的学生——只有这样我才能成为一个全方位的人才，适应时代的需求，更好实现自己的社会价值。在我的成长线里，我一路上都执着追求着自己的全方面成长。\n  德：我多次参与献血义工活动，积极献血，长期主动坚持地铁义工工作。在班级，我担任学习委员，态度认真负责。\n  智：我的总加权成绩位列专业第二，一次性通过四六级考试。\n  体：我作为生科院拉拉队的队长，带领着我们的队员经历了多场篮球赛，经历了多了舞台；我也作为一个运动员，在校运会上取得过第一名、第四名的好成绩。\n  美：我积极参加了社团活动，参加了校内外的嘉年华演出；参加英语协会的三行诗比赛，并获得终极优胜。我是社联宣传部的一员，一年半的时间里，我积极参与宣传设计制作，为社团嘉年华增色添彩。我还是艺术团艺美队的成员，让舞台更多彩。在本学期，我还开始了建筑双学位的学习。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('363', 'U201117250', '高君玫', '公共卫生学院', '大学期间，我自立自强，乐观进取，积极加入各种学生组织并努力做到最好，参加各种公益活动，克服家庭困难，在各方面提升自我。\n在学生工作上，我不仅担任我们院的院系资助负责人，还曾担任校团委直属报社社长、院系资助委员会会长，小班团支书。平时工作认真负责，资助工作一丝不苟，从大一担任院系助理以来，带领全年级做义工和勤工，资助会议积极参与，资助工作认真落实，连续两年带领院系获得优秀资助助理委员会的称号，自己也获得了校优秀院系资助助理。\n大二大三的课余时间我会通过各种渠道找寻家教来补贴生活费，在繁重的学业以及生活压力下仍然选择修武汉大学经济学双学位来充实自己，在两个看似不不搭界的学科找到平衡，大四进入专业课学习异常辛苦，所以放弃家教而选择将生活费节省下来的部分投入股市，因为了解了经济学的基本原理多以少了一点盲目，多了一点理性，投资并不投机，能稍微补贴生活。\n此外，我还积极参与科研活动，跟随跟着姚平老师做大创，并且跟过公卫吕美霞老师也一段时间，科研的课外学分远超规定要求。\n看过去的成绩或许我并不优秀，但是我相信我正在不断进步。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('364', 'U201313093', '聂秀泉', '公共卫生学院', '我是一个能够坚持的人，举个例子：我从上大学以来，从来都是在7点以前起床，只有大一下学期刚开始一周因为感冒在七点以后起床；我还在大二上学期开始记账，一直坚持到现在；我坚持每个寒暑假健身，每天50个俯卧撑，200个仰卧起坐，10个引体向上，等等。坚持使我受益匪浅，早起使我每天精力充沛，有更多的时间去做更多的事情，毕竟一日之计在于晨，我的学习成绩也名列前茅；坚持锻炼使我有强健的体魄，有充足的体力做我想做的事，我是我们班的体育委员，在院足球队。坚持使我信心倍增，我相信，我想做的事，只要我坚持，就没有什么做不到！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('365', 'U201117275', '牛晓歌', '公共卫生学院', '大学期间，我学习勤奋，自立自强，乐观进取，积极参加各种公益活动，克服家庭困难，取得优秀成绩，并在各方面提升自我。\n我来自农村，父母以种地为生。父亲患有糖尿病，常年吃药。母亲患有心脏病二十余年，几乎没有劳动能力，两年前手术，费用几万元，身体仍未恢复。还有年迈残疾有精神疾病的外婆需要赡养，医药费开销很大，收入微薄，生活拮据。\n课余时间我坚持做各种兼职。大一时申请到公寓值班的勤工助学岗位，之后每学期都会做家教，最多同时兼职三份家教，赚取生活费。加上获得的各种奖学金，生活费已能自足，每年还有3000元剩余来补贴家用。\n学习方面，至大四上结束，总加权89.39，总排名专业第二。获得过三次“国家励志奖学金”，学习优秀奖学金，社会公益奖学金，上海复兴医药奖学金等。并通过了大学英语四六级，计算机四级等。\n我喜欢参加公益活动也积极参与科研活动。希望做一个全面发展的人。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('366', 'U201212684', '杨卫华', '公共卫生学院', '家庭情况：是少数民族，来自山区。爸妈均已60多岁，在家务农，无工作能力。妈妈有高血压，今年正月病倒过一次，不能做体力活。姐姐有三个孩子，也在读书。\n学生工作：从大一开始担任班上的资助委员，组织过很多义工，包括到森林公园种花，整理图书馆等。2014年参加院系毕业晚会“梦飞舞”的筹划并参与演出舞蹈剧“梦”和小人舞，以及负责拳击节目“搏击操”。在同济资助中心担任助理一年，为同学服务，最终获得“优秀中心助理”。加入院系资助委员会，从2014年下学期开始担任会长，和会员一起开创了辛亥革命纪念馆志愿者的义工，并获得“2014年华中科技大学优秀院系资助助理委员会”。\n生活：从大一开始学费是贷款，生活费大部分是自己做兼职赚的钱。与寝室和班上同学相处融洽\n兴趣爱好:在2014年加入街舞社，在街舞社里面学习爵士舞，虽然自己学的很慢，但是我从来没有放弃过，依然为了自己的爱好在努力，目前正在准备2015年“梦飞舞”的开场舞。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('367', 'U201213145', '肖芳', '护理学系', '我是一个来自湖北洪湖的农村姑娘。在学习生涯中，十分感谢能多次获得国家补助继续学业。从小，我就很热爱读书。大学期间，我也靠自己在暑假或有空时做兼职，比如，发传单、做家教，赚取学费和生活费。\n进入大学后，虽被确诊患有骨髓增殖性肿瘤，需要经常去医院就诊，但我依然时刻保持学习的劲头，专业成绩排名第一。因此，先后多次获得学习优秀进步奖、国家励志奖学金、曾宪梓奖学金等等。而且，在学习气氛的带动下，我们寝室所有成员班级排名均在前十。班级成员的挂科率也有所下降。这是我觉得很自豪的事情。\n另外，我还报读了双学位，积极参加各种校内校外的活动。我担任辅导员助理两年，并在第二年成为组长，帮助辅导员处理院系及班级事务。多次积极参加系里“化蝶飞”等重大活动。热爱运动，参加了体育舞蹈队，提升自己的综合素质。也多次跟着老师参加科研，在她们的带领下，了解到科研的重要性与科研的要求。另外，我参加过地铁义工，参加过爱心病房，校外探访过敬老院，与老人们聊天，其乐融融。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('368', 'U201210512', '陈冰鑫', ' 基础医学院', '我的父亲在我初二时患肝癌去世，之后我的母亲便扛起了家庭重担，供我读书。\n现在，我读大三，母亲在老家做保安维持生计。为了减轻母亲的负担，我在业余时间做兼职，比如说家教，学校公寓岗，联通营业厅帮忙等等。通过我兼职所得，我基本上不需要家里负担我的生活费。最让我开心的是，上个学期，我用我家教的工资，带母亲在十一假期去重庆旅游。全程的吃，住，路费，都是我来出。\n对于学业，我一直严格要求自己。我知道，给我们上课的都是特别优秀的老师，只有好好听课才对得起他们的辛勤讲课。上课时，我认真听，仔细想；课后，我认真完成作业，主动去思考老师留下的问题，去查阅资料。我很感谢同济浓厚的学风，鞭策我在知识的海洋里面遨游，享受。\n对于学生工作。大一大二，我在主校区参加了红十字队，不管是爱心募捐还是急救培训，我总是活跃在第一线。大三，我加入了基础医学院学生会，成为了学生会的副主席，准备春华秋实，筹备游园会，我在这些工作中尽情挥洒，满满收获。\n我最喜欢一句话：未来的你一定感谢现在努力自强的自己。所以我相信，现在我在跑，未来我在笑！\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('369', 'U201210534', '胡紫薇', ' 基础医学院', '  我的性格就像我的名字——紫薇一样，自强不息、蓬勃向上。\n   学习方面：有追求、有目标，大二加权90+，获学习优秀奖学金，辅修德语。\n   社会服务方面：乐于奉献，积极参加各类公益活动，爱心病房志愿者、植物园义工、寒假返校宣传活动宣讲人、挪威交换生生活志愿者、万松园社区关爱老人志愿者…\n   学生工作方面：担任八年制医学生协会对外交流部IFMSA-SCOPE负责人，在每年暑假接待外国交换生的同时也送出去一批学长学姐去国外交流；加入艺术团艺美队\n勇于挑战的我积极参加各种活动：作为同济代表参加了在湘雅举办的第四届全国八年制医学生论坛；作为中国代表参加IFMSA在日本东京举办的Sub Regional Training;参加北协和超级课程，参会费都是自己通过办补习班，家教挣来的。\n    在我看来，自强就是在挑战自我的过程中活出人生价值的过程。愿我的自强能给更多的人带来正能量！\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('370', 'U201312907', '金瑾', ' 基础医学院', '“小草也能折射太阳的光辉”一直作为自己的座右铭。不断追求，不断完善，提升自我，在大学让每一天都过得充实而有意义。自己勤奋学习，刻苦努力，大一及大二上学期加权一直在90以上。英语四级和六级一次通过。现阶段正在做校级大创项目的实验。在班上担任学习委员一职。在华科参加了生科院辩论赛获得第一名。在同济也参与了许多学生工作，在社联行政监察部，连同其它社联小伙伴举办社团文化节，在校学生会学术科创中心，举办了万圣节嘉年华，双学位交流会，以及新年游园会的筹备。除了学习与学生工作，自己对生活也充满热情，积极向上，参加了艺术团爵士舞队，每周三次队训，在生命之光中长期义务做家教，以及是青协爱心导医长期义工的一员。周末也会抽出两个半天在外兼职做家教，能够解决自己的生活开销而不给父母增添负担。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('371', 'U201210459', '宋安妮', ' 基础医学院', '我来自湖北省咸宁市的一个农村，一家四口人，有一个妹妹正在读高中，虽然家境并不富裕，入学初就办理了助学贷款并一直接受国家的资助，但我一直保持着一颗乐观积极向上的心，进入大学后，我一直尝试着锻炼自己，申请担任班级团支书，并和同学们在特色团日活动中取得了校20佳的成绩，同时我积极向党组织靠拢，于2014年11月28日成为一名党员，进入医学院后，我担任了基础医学院的资助助理负责人和班级的资助委员，感同身受地为身边有需要的同学服务，大一大二在课余时间我做过多份兼职，家教、推销奶茶，并连续两年暑假打工挣钱，通过自己的实际行动减轻家庭负担，同时我也积极参与课余活动，参加过院系举办的征文比赛，2014年秋季参加了50公里毅走活动，并成功了坚持下来。在学习方面，我也没有放松，去年一年取得了较大进步，加权达到90+，上个学期很幸运地加权取得了班级第一的成绩，并获得过新生自强奖学金、优秀学生干部称号、国家励志奖学金，通过了英语四六级考试，并且六级成绩从第一次的487进步到600，同时现在我也在慢慢接触科研活动，生活虽然忙碌，但是很充实，我一直希望这样的我能够给大家带来正能量，而我也会一直坚持这么做。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('372', 'U201313325', '汤航', ' 基础医学院', '我人生的座右铭是：“选择不了起点，就努力改变终点。”\n因高考失利，我与口腔医学擦肩而过，被调剂至护理专业。但我没有错过转专业的契机，而是独自搜集转专业信息和动态，努力学习。最终以优异成绩通过笔试和面试。\n同时，我学习丝毫不放松，大一是护理班第一名，在口腔班位列第二。获得国家励志奖学金，新生优秀奖学金，新生自强奖学金等奖项。\n义工活动是我最大的爱好。大一，我是义务家教小老师和地铁指路小能手，每周六我都会坐一个小时公车为一个男孩家教两小时，然后再赶去做两个半小时的地铁义工。大二，我是革命博物馆的解说员。因为我的勤勉，我获得了“武汉市优秀地铁义工”，“优秀教员”等荣誉称号。\n纵然父亲每月800元的工资是唯一经济来源，爷爷重病，弟弟与我上高校使我家经济窘迫，我也曾自卑过，但最终还是战胜了自己的心魔，努力朝远方风雨兼程。因为我终于明白:最可怕的不是物质的贫瘠，而是精神的荒凉。\n因此，在我的世界里，逆风也能高高飞翔！\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('373', 'U201313258', '王佩佩', ' 基础医学院', '我是从农村走出来的大学生，也是我们村考得最好来上大学的。我们家有八口人，曾祖母九十高龄。我深知家人供我上大学的艰辛，所以从不敢懈怠。为了减轻家人的负担，大一时我申请了学校的勤工助学岗位，大二一直兼职做家教。知识改变命运对于我这样的农村孩子来说确实是真理，所以我一直努力学习，加权排名专业第二。通过普通话考试及英语四六级考试，在王小川老师的实验室参加科研活动。大二获得校三好和国励奖学金。我坚持做志愿者活动。大一在生命之光做了一年义务家教并被评为优秀教员。大二加入青协导医部，负责同济医院协和医院和第一医院的导医活动。为了锻炼自己，大一暑假到山西石楼的山区里做了题为“教育之殇：贫困山村“撤点并校”之痛——以“山西省吕梁市石楼县”为例”这一暑期社会实践并获得校优。大二参加五十公里毅走活动，寒假参加西安生存大挑战。我一直努力做好每一件事，克服学习和生活上一个个困难，一直期待做最好的自己！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('374', 'U201312937', '王珊珊', ' 基础医学院', '在过去快两个学年里，我一直积极参加学校里各种公益活动，一直以来的坚持不懈换来了我现在工时超过了100个。其中，我一直坚持参加地铁义工活动，已经坚持了一年，在活动中我不仅收获了丰富的工时，也认识了更多品行优良的同学，从他们身上以及我参与的活动中，我学到了很多。另外，我上学期也是校史馆阳光解说员的一员，为八方来客介绍我校的光辉岁月和历史沿革，我自己也在解说过程中越发对自己身为华科以及同济的一员骄傲和自豪。本学期我参加了青协的爱心导医部，希望为广大病患提供自己力所能及的帮助。除上述活动外，我还参加了大学生开放日的接待工作和毕业典礼的志愿者，人车分流的志愿者等等。\n当然，在积极参加公益活动的同时，我也没有忘记学习和专业研究。我的学习成绩一直保持在前列，虽然目前还不算拔尖，但我会一直努力下去的。另外，我这学期还参加了组织学与胚胎学的周琳老师带的科研小组，积极进行科研工作，希望能取得一定成果，为大学添上灿烂的一页。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('375', 'U201313252', '蔡磊', '药学院', '由于家贫学优，上高中时我成为了一名珍珠生，通过浙江新华爱心教育基金会，我接受了来自各界爱心人士的关心和帮助，理事长张爷爷曾多次告诫我们，在自己有能力的时候尽己所能帮助他人。而现在，我正在用行动践行着珍珠生的承诺。\n首先，我积极参加各种校内外义工活动。如图书馆义工、宿舍楼栋义工、爱心导医、爱心病房、献血车服务、“一站到底”火车站志愿服务等，目前总工时69小时。\n其次，我也积极参加社会实践，大一暑假参加了学院“合理用药”社会实践，带领3名组员到武汉八大高校实地调查采访，完成了暑期社会实践。\n另外，作为珍珠生，我们也开展了自己的志愿服务。如汉口江滩环保活动、武汉爱乐音乐学校志愿服务。还有很多珍珠生互助的活动，如新生配对帮扶、杉树计划、导师计划等。课余时间还参加过爱心募捐、无偿献血。\n最后，从大一下学期开始，我就坚持每天推送武汉天气，争取给同学们带来便利。长期的坚持得到了大家的肯定和鼓励，我也会继续下去。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('376', 'U201313224', '崔世豪', '药学院', '我的家乡在农村，家里经济情况很不好，父亲长期在外打工，母亲在家照顾我们兄妹俩。母亲经常告诉我“我们家里穷，你爹妈没本事，在村子里面抬不起头，以后就指望你了。”我从小也就很体谅父母，比同龄的孩子多了份责任心，更早的学会了自强。我从小就立志要考上一个好大学，将来做出一番成就报答父母，回报养育我的家乡。我也不断的为之付出努力。人穷但不能志短是我初中的座右铭，在中学我把学习作为第一任务，把勤俭作为第一要求，凡事都要追求最好。终于天道酬勤我实现了儿时的梦想，考上了一个好大学。然而大学的学费也增加了好多，在上大学之前的那个暑假里我选择了去打工，因为自己只是一个学生，没什么技术，我只能干一些体力活，帮别人装修房子，几天工作下来，手上磨出了好多泡子，我不但没有感觉到痛苦反而感觉自己非常的幸福。因为我这是在为自己努力，为自己的梦想而努力。这么多年来，我切切实实的感觉到了自己通过努力，真的帮到了自己，帮到了这个虽贫困但是很幸福的家庭，经过这些经历，让我相信，不管有什么困难，只要努力就一定能克服，不管梦想多么遥远，只要坚持不懈，就一定能实现。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('377', 'U201313170', '康双清', '药学院', '爸爸在我小时候就去世了，妈妈抚养我们姐妹四个妈妈吃了很多苦但也很勤劳，不过她最后还是因为疾病在2013年离开了我，她走之前一直对我说，要好好读书，她走了，我也确实好伤心，可是我也没多少天就要高考了，就冲着她一直想送我上大学的梦想，我也得好好读书啊，高考过后的三个月，我就留在学校给学校做招生老师，到了大学后，我也做家教和一些兼职，并且2014年暑假，我回家之后和两个同学一起被应聘去做暑假补课的老师，大一的寒假我没有回家就留在学校兼职，大二寒假是回家到县城里做了兼职，而且我的学费也是减免的，所以上大学以来，我基本上也可以自给自足，我的三个姐姐两个都已结婚并有孩子，他们也都是靠务农为生，家里也很拮据，所以我读大学也并没有给他们增加多少负担。并且从这些工作中我学会了很多东西，在学校里的时候我的室友也对我很好，我觉得我的生活虽然没有了一些人的陪伴，但是他也教会了我接受现实，快乐生活，所以我们班上的同学总被我嘻嘻哈哈的表情逗乐，觉得我是一个没有烦心事的小孩，其实正是因为你们，我才觉得快乐。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('378', 'U201313246', '田成', '药学院', '我叫田成，来自河南的一个农村。家里有五口人，爷爷、奶奶、妈妈、弟弟和我。爸爸于农历2014年2月11日去世，让本来就经济状况一般的家庭更加贫困。家里主要靠妈妈一个打工赚钱。爷奶都已年迈，弟弟还在读初中。但是自己并没有因此而消极处世，依然以一种阳光乐观的态度对待生活。生活中总是充满了欢笑。而且积极参加学校和院系组织的活动，如校运动会、十月华章、院运动会、青春颂等。班级的一些活动也积极参与。\n平常有时间也喜欢做义工，在主校区曾坚持过一学期爱心培智、现在做爱心助学的幼儿园的义工以及艾协的爱心病房的义工，爱心病房已坚持一学期。\n现在学费是靠国家贷款，自己也在做兼职，经济上基本实现独立。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('379', 'U201213336', '贺哲', '医药卫生管理', '1） 学习 大三上加权 4/38 。英语四级532，六级485。所在团队在医药卫生管理学院本科生学术论坛上获“最佳选题奖”；参与大创并跟随学院导师做课题，已在论文发表阶段\n2） 学生工作 2014年3月至今为医药卫生管理学院分团委副书记，为本院团干的第一人；2013年9月-2014年3月为院系资助助理，2014年3月至今为班级资助助理；2014年5月至今，为华中科技大学同济医学院就业办助理。\n3） 志愿服务 曾做过爱心病房，汉口火车站，爱心导演，大学开放日，毕业典礼等志愿者，大二至大三上，工时近90个；2013年6月至2014年6月为武汉革命博物馆志愿者，负责解说工作；获“同济医学院十大杰出青年志愿者”称号\n4） 文体活动 第十三届春之约八大院系辩论赛上,获”单场最佳辩手”称号；2014年度同济医学院5.4演讲比赛中,荣获同济医学院第一名；医药卫生管理学院第三届师生赛歌会上，荣获二等奖；文章“梦中夜话，写给母亲”被华中科技大学校报征用；连续两年在学院晚会春之约晚会上出演,在第十二届社团文化节(医科)演出\n5） 社会实践 2013年度暑期社会实践获校级优秀团队；2014年度暑假社会实践获“华中科技大学暑期社会实践优秀个人称号；大二暑假在第四军医大学西京医院人力资源部实习一个半月，并受到老师好评。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('380', 'U201313383', '灵芝', '医药卫生管理', '大一期间我加入了“生命之光”爱心探访队，每周日到“星达敬老院”为孤寡老人送去温暖，为ta们做力所能及的事。我曾两度负责爱心卖报活动，第一次是为患病学姐募捐，活动期间偶遇一位好心人，经过近两周交涉，拉到了20000元善款。生科院大一新生是一个特殊群体，这里的大多数人大二之后便搬到同济校区，所以会有一些非专业书籍，同学们会选择留给学弟学妹。如何才能更好的收集这些书，我们付出了很多脑力和体力劳动，最终募得图书2356本。\n“一站到底”汉口火车站志愿服务团队共有49名长期志愿者，分三组，我们每周末都会到汉口火车站进行志愿服务，工作时间从08:00至16:00，三个小组循环往复，小组长主要负责当天志愿工作，组内自由协调在岗服务时间，有效调动了同学积极性！半年的实验阶段取得了良好的成绩，我的下一步计划是扩招志愿者，让我们的志愿服务覆盖到武汉另外两个火车站，使“一站到底”成为我科特色团队，帮助到更多的人。\n我还参加了“飞航杯”环保创意演讲比赛 “国旗仪仗队”到“石门峰”扫烈士墓 “在路上”人车分流、世界艾滋病日宣传楚天学子 “树”立新“锋”及“hustfound”失物招领平台的创建及宣传等一系列活动。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('381', 'u201212765', ' 黄筱頔', '第一临床学院', '我自幼父母离异，由母亲独自抚养长大，父亲从未提供过任何帮助。母亲原属于河南省豫南监狱工人，于1999年下岗，一直靠打工维持生计。外祖母五年前骨折，加之老年痴呆至今生活不能自理，也要靠母亲赡养。\n我大一全年的加权排名为专业第三，大二全年的加权排名为专业第一。\n我获得过新生社会公益奖学金、国家励志奖学金、校三好以及优秀共青团员称号，英语六级，计算机三级，参加了入党积极分子培训班（24期）并结业，大二被评为2013~2015年度学习特优生并参加了大创项目。我大二在同济青协阳光医学生部门工作一年，校学生会工作一年，大二暑期参加了赴平遥社会实践小组，还担任班级组织委员。\n我大一曾参加勤工俭学，平时空闲时间及寒暑假也会找兼职，努力减轻家庭负担。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('382', 'u201212850', '李舒心', '第一临床学院', '从上大学以来追求音乐艺术至今，大一加入笛箫协会，坚持练习从中级水平到演出10级曲目，进入演出队，后又承担授课任务，被评为优秀指导。参演机械学院“风华竹韵”音乐会节目《灞柳情》，“武汉笛箫峰会晚会“节目《侗乡之夜》，及各种小型演出，路演等。\n大二担任笛箫协会副会长，葫芦丝队队长，财务负责人，从零开始用一年时间带出一支有一定技术水平演出能力的表演队伍，付出很多心血，解决各种人员，资源，技术困难，负责并参演“风华竹韵“葫芦丝节目《多情的巴乌》，“笛箫峰会”节目《情醉》，“新年游园会“节目《瑶族舞曲》。同时加入了艺术团民舞队，并学习钢琴，坚持每周练习，取的还不错的进步。加入学生会文艺中心，为游园会等活动出谋划策并参与负责《凤凰于飞》等节目。负责并表演“爱心病房”演出。被社联评为优秀社团干部。\n    大三参加“春华秋实“表演《民乐合奏》，”社团文化节”表演《玉生烟》，“三月美”表演《咏春》。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('383', 'u201212776', '李天冶', '第一临床学院', '我是华中科技大学同济医学院的一名大三学生，儿时父亲下岗，母亲没有固定工作，不久就因为家庭矛盾而使得这个不幸的家庭解体，而我与母亲相依为命。我的母亲十分的要强，虽然患有严重的心脏病仍然坚持供养我上学。起初来大学，就带着一种强烈的自卑感，但是阴差阳错的一次杨叔子院士的赠书仪式，以及学生报名处的接待老师的热情帮助，更是历任的各个辅导员的理解与帮助，使我认识到这个学校的爱与关怀。于是我立下决心一定要走出低谷，于是每每都在其他人都在休息时，在自习室拼搏，一直都会很努力的学习医学知识。在家乡政府的宣传下，我获得了政协委员们的资助，而且我也在坚持参加不论是学校安排还是自己寻找的社会兼职活动。在大一时虽然通过了中德班的笔试而且在前三十之列，但是面试没有通过，成为我的一个遗憾，所以在大学，我自学了德语，在同学的帮助下，能够达到a1水平以上。而且也顺利的通过了英语四六级考试。我没有什么惊天动地的可歌可泣的优秀事迹。我希望我会更加强大，能够用自己的力量回报掘井之人。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('384', 'u201212830', '彭春锦', '第一临床学院', '本人长期坚持志愿服务，大学期间曾参与多项志愿服务活动，包括图书馆服务、教学楼清洁、爱心卖报、九峰山烈士陵园扫墓、“旧书圆新梦”、爱心导医，武汉血液中心义工、地铁义工、爱心病房等。\n大二坚持中山公园站地铁义工一年，大三开始坚持同济医院爱心病房义工至今。\n大二期间参加广东省东莞市第一届莞曦公益策划大赛，本人作为大学生导师指导高中生团队进行公益项目策划并付诸实施。团队已与台湾新北市二重中学校长取得联系并获得技术支持，并获得了东莞市环保组织的项目资金。\n本人在2014年获得“同济十佳青年志愿者”称号，在coursera学习霍普金斯大学课程《Health for All Through Primary Health Care》并通过考试获得完成证书。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('385', 'u201212764', '王楠', '第一临床学院', ' 有一个女孩，从有了记忆她就明白她要为改变自己的命运而奋斗，她要把自己破碎的家支撑，她要背着她的爸爸妈妈还有弟弟妹妹走出大山的贫苦。她没有别的办法，妈妈告诉她要好好学习，出人头地。于是她就踏上了这条路，但是路程却坎坎坷坷。一间漏雨的土屋，两本教科书，就这样的知识能改变命运吗？她不知道，但她要尝试。和她一起入学的同学们一个个都走了别的路，只有她还在走最开始的路。她靠自己的奋斗把自己送进众人瞩目的名校，靠自己的努力把自己从被抛弃的角落转换到人人称赞，她也支起了一个不幸的家。\n   艰难走进大学，却又一个人与疾病的战斗，可她不得不坚持。如果她倒下了，她的家就要碎了，她也要永远轮到艰苦的命运中。在医院与学校之间奔跑，在教室与寝室之间拼搏，在学习与主席团工作之间焦头烂额，一切都走过了，她要为自己的命运而奋斗，要为维护自己的完整的家而奋斗。\n   大学里的她又顺利走过了三年，三年里成绩名列前茅，积极参加各种大学生的活动，完善自己，闯过学生会，从小小部员直到学生会副主席；担着班干，副班，学委不在话下；干过假期兼职，发传单，扫楼，做推销；做过初中，高中家教，和他们一起进步。。。不是最优秀的生活，但是丰富的成长经历。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('386', 'U201212848', '谢晓红', '第一临床学院', '在舞蹈方面执着追求，从高三暑假开始至今坚持学习拉丁舞，大一开始加入由学校艺术团与学校体育部合办的拉丁舞队，曾在2014-2015年担任一年队长，每周至少有两个晚上的常规队训，队里接到表演任务时甚至每天晚上负责训练，回到寝室自己再继续练习，寒暑假回家或在当地舞蹈机构培训或自己找视频练习；2014-2015年曾参加过2次同济医院的暖心病房活动，参加2014年、2015年共2场新年游园会，受协和口腔科邀请参加2014.11.8第四届湖北省口腔学术会议晚宴表演，和万圣节艺术团与学生会合办的晚会表演以及社团文化节的演出。现在准备2015中国湖北国际体育舞蹈公开赛；\n  大二上学期机缘巧合之下加入校越剧队，刻苦训练，2014年代表学校参加湖北省大学生艺术节，其中一个节目获一等奖，并在之后参加优秀节目汇演，2014.10参加华科金秋音乐节越剧专场演出；\n  和舍友志趣相投，平时会找各类舞蹈视频一起练习，我们报名参加了2015三月美，节目《咏春》获得好评，给领导留下较深刻印象，并希望我们可以在青年节的晚会上再表演一次。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('387', 'u201112806', '熊之勇', '第一临床学院', '医学是我的理想，数十年来为了这一理想我不断奋斗着，终于高考让我的医学之梦成为了现实。大一是充满诱惑的一年，自由的气息使人沉醉，面对这一切我毫不动摇，终取得年级第一的好成绩，并获得国家奖学金以及三好学生和特优生的称号。大二学年，在面对繁重的医学基础课的同时，为了提升自我，自己又参加了基础科研活动，为了做到科研及课程两不误自己常常挑灯夜战到深夜，并通过努力再一次获得了三好学生的称号。大三大四可谓是忙碌的两年，自己真正的进入了临床的学习，深刻的体会到了临床环境的复杂，内外妇儿的课程压力更是把人压得吐不过气，与此同时自己还肩负着大班学委的责任，抱怨过，动摇过，但最终还是坚持着，每天往返同济与协和只为将理论和临床结合的更紧密，自己也曾上台参加了长达七个半小时的手术，与此同时忙碌的同时自己还参加了纸艺协会，为的就是让自己的学医之路变得更精彩。因为爱着临床，所以想不断提升，前不久自己又参加了同济医学院临床技能大赛并取得二等奖的好成绩。我深知自己未来的路还有很长，但我想我会执着的坚持下去。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('388', 'u201112794', '钟绍平', '第一临床学院', '立志科研，砥砺笃行\n我从小对自然科学具有浓厚兴趣，学医期间，我深感我国基础学科还远落后于国外，生物医学领域内几乎所有突破性的发现都是在国外完成的。因此，我有志于从事神经系统疾病的基础研究，希望将来能结合自己的医学背景将基础研究与临床应用更好地衔接起来。从2013年开始，我就在病生系朱铃强教授组随研究生参与Tau蛋白对Dynamin家族调控机制课题，学习Western Blot、PCR等实验技术。2014年5月，我作为负责人，在神经内科副教授徐岩的指导下申报了大创项目“BDNF/TrKB 信号途径在左旋多巴诱导异动症发生中的作用”，尽管面临着克服经费不足、实验条件简陋等种种困难，依然不言放弃，寒假期间也在学校做实验，终于独立地造出了帕金森病异动症大鼠模型，成功完成预实验，目前还在进一步的实验中。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('389', 'U201315153', '郭雪华', '计算机学院', '来自农村的我初进大学时很自卑，因为很多时候我看到自己和别人却有很大差距，自己进入的计算机专业是被调剂的，自己却对计算机专业一窍不通，甚至连打字都不会。面对着那么多的学霸，无处不在的大神，我也一度很失落，对未来很迷茫。但是我不是轻言放弃的人，既然来到了这里，我就要做到最好。明确自己的方向，对未来的一切充满了动力，我开始从大一下自学PHP，更是在大二加入餐谋网。对于基础尚浅的我，无疑压力是很大的，但是我克服困难，成功的完成了任务。大二下我又开始制作另一款智能牙刷APP程序。现在的我不似刚进大学的时候那么羞涩自卑，相反我很开朗活泼。我时常告诉自己，自己想要的东西就应该努力争取，怨天尤人于事无补。怨天尤人于事无补，只有自己看清了和别人的差距，不断地努力才能赶上甚至超过别人。父母为我们做了很多，我们要做到就是减轻父母的负担，成为父母而骄傲。希望我的故事能让大家有些收获。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('390', 'U201315137', '李若愚', '计算机学院', '企业家精神的公益创业项目，使受众在产业链中能真正受益。先后参与了“幸福虫”、“艺纸深情”等公益项目，其中“幸福虫”获得了“创青春”大赛公益赛金奖。目前带领团队运营了“Fitnow”、“落叶工艺坊”等四个项目，其中“Fitnow”通过打造O2O闭环使校内学生得到定制性、志愿性的私人教练服务，努力提高学生身体素质；“落叶工艺坊”致力于再利用华科落叶的价值，打造第一个高校“树文化”工艺坊。目前正负责承办校团委“求是杯”公益创业大赛（创青春校内赛），分管组委会培训组，希望能为校内热爱公益的团队提供比赛的平台，更希望为提升华科校内公益创业的氛围，培养出有社会责任感的新一代青年而努力。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('391', 'U201414950', '李智炜', '计算机学院', '我是一位身残志坚自强标兵。在2014年高考结束的夏天，当我满怀期望准备成为一名华科学子时，不幸遭遇车祸，左膝受到了重创，诊断为前后交叉韧带断裂。我在医院中度过了一段令人煎熬的时光，本该拥抱大学生活美好的我，却只能一动不动地待在床上。然而抱怨终归于事无补，我决定选择笑对一切，赶走消极情绪，不让陪伴的父母担忧，还通过网络了解大学同学的生活并和他们积极交流。当我知道了大一上应该学习的科目后，便拜托同学将课本寄回，希望可以在治疗的闲暇时间了解一下大学科目，发挥自己现有阶段的能力尽量自学一些内容，这样回校后就不会落后太多。刚回校一周后我就面临微积分的期中测验，所幸顺利通过了哈哈，证明了自己当初的努力。恢复走路能力的过程伴随着痛苦与喜悦，虽然艰辛无比，但是心想能够快点来学校咬咬牙还是坚持。现在我仍然没有放弃锻炼，早上坚持慢跑来加快恢复，期望不久后能像其他同学一样奔跑，跳跃，进行正常的体育活动，也希望自己的经历能鼓舞一样有过受创的朋友不要放弃，自强不息。乐观坚强是我的自强精神，化解遭遇带来的痛苦的最好办法就是时刻保持明朗的心情，笑一笑没什么大不了的！生活中不可能永远阳光明媚，当黑暗的日子降临，你要做自己的太阳~', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('392', 'U201414577', '谷永普', '计算机学院', '1.军训期间主动无偿献血，回报社会，以帮助更多的在病痛中需要血液的人恢复健康\n2.参加大学生社会时间中心志愿者服务指导中心，积极参加志愿者活动，服务同学，在外联部中，经常出去拉外联寻找商家赞助，为社会实践中心的志愿服务工作筹集资金，以便中心开展更多有益的志愿活动\n3.参加学院资委会勤工部，经常利用空闲时间和小伙伴们一起去华科附中做家教宣传，向外界推广我们学院的家教信息平台，收集家教信息，为学院想做家教勤工俭学的同学免费提供家教信息，给大家一个安全放心的家教平台\n4. 服务同学，节日送贺卡，生日送祝福，圣诞送苹果\n5.参加机械学院的盲校支教活动，每周末去武汉盲校无偿对盲人孩子周末进行一对一辅导教学，献出自己的一份力量，克服无法直接用文字交流的障碍，探索教学方法，帮助盲校的的孩子积极乐观地面对生活，并帮助他们实现大学梦，并与那些孩子建立了浓厚的友谊\n6.参加思源社，时常做回报社会的志愿服务工作\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('393', 'U201414640', '吾拉木•图尔贡', '计算机学院', '      到了大学，我的想法就是让我的大学生活过得比较有意义，多接触周围的实物，社会环境等。所以我已开始就找一些机会让我去实现这些想法。\n     后来了解到义工的信息后，我就去参加义工，做了一些有意义的志愿服务。\n     第一次参加义工活动“马路天使”时，甚至连自己都会搞错什么时候可以过，什么时候不能过。第一次的时候，总免不了紧张，犯错，受别人误解。但我并没有放弃，一次次的参与，慢慢的变好，不再紧张。我做到了“天使”的职责，它也使我超越了自我。\n     刚来到学校，当听到校外也有类似的志愿服务时，我决定去参加那些服务。\n     去过一次“圣景老年公寓”之后，我才知道那里的人确实需要我们的关心和帮助；哪怕是跟他们聊聊天，打打牌，或者唱唱歌都能给他们带来很多快乐。我以后还会坚持去那里多陪陪他们，给他们多带去一些关心与快乐。\n     在“武汉科技馆”时，给小朋友们解说一些东西，陪他们玩耍，听他们聊天，也使我感到十分的开心。\n     参加义工，不仅可以让我们学到自己在学校学不到的东西，而且更重要的是我们可以帮助别人，给他们带来快乐，也让他们的生活过的同样更有意义、更加精彩！ \n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('394', 'U201414974', '王海瑞', '计算机学院', '     出生于河北的农村家庭，父母以务农为生，无其他收入来源。后来因为长期辛苦劳作，母亲患上了腰椎间盘突出，从此不能做重体力劳动。我深刻地感受到处在中国社会最底层的农民生活的艰辛和钱生活来源的来之不易。所以对于父母，对于我所拥有的一切，我都会格外珍惜。\n初三时候，我被全省重点高中提前录取。高三毕业后顺利进入大学。我在这里学会了坚强乐观，遇到挫折勇往直前，竞争意识与团队意识，严守纪律等品质。\n在班级我积极参加班级活动，融入班级这个大群体。我是班级的义委，帮助同学们解决关于奖助学金等方面的问题。对于同学们不懂的问题，我耐心解答。\n因为一直都得到很多人的帮助，所以我也希望自己可以帮助别人。进入义工部，就是希望自己能够通过做义工来服务于社会，回报社会。当然作为一项义工的负责人，也锻炼了我的管理能力。与每周报名的义工进行沟通，还要与图书馆那里的负责人进行联系。\n积极的充实自我。我加入了学生会的新闻部，负责摄影。曾经拍摄过迎新晚会和校运动会。\n为了减轻父母的负担，我自己通过家教赚取自己的生活费，我所辅导的小朋友在年终考试时成绩取得很大进步，成为班级第二。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('395', 'U201412631', '杨柳', '生命学院', '     她来自农村，家中的开销全靠父亲一个人从土地里一寸寸种出来。母亲病重，身体虚弱，右手行动不便，各种医疗费用再加上两个孩子的学费使家里入不敷出。贫穷给她带来了物质上的匮乏同时也培养了她吃苦耐劳的精神和坚韧不拔的品质。她从小就希望成为一名优秀的医生，能够医治病人医治一个个因疾病而受伤的家庭。\n为了实现这个梦想，她一直奋斗着。中学时，她获得过校学习标兵，校励志标兵等荣誉称号，成绩优异时她得到了全校唯一一个北大自招的校荐名额。可高考失利使她无缘进入理想的大学。亲戚朋友们都劝她放弃读书，像哥哥姐姐们那样南下打工为家里分担。可是她不甘心就这样放弃梦想。父母亲了解她的心思，顶着压力全力支持她选择自己的道路。\n到大学后，学习上，她勤奋刻苦，努力丰富自己的科学文化知识；生活上，勤俭节约，并且做了兼职来减轻家里的负担；她还参加了手语协会和笛萧协会以及各种集体活动，使自己更好地融入团体。在大学的第一个学期里，她成长了很多，向着目标又迈进了一步。虽然明白未来还会有很多艰难险阻，但她一定会坚持到底，永不放弃，始终铭记最初的梦想。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('396', 'U201212546', '李永帅', '生命学院', '    他学习成绩优异，在过去的5个学期中，他有2个学期以加权90+的成绩排名专业第一，曾获得“学习优秀奖学金”、“国家励志奖学金”、“校三好学生”等荣誉。他热爱科研，从大二就进入实验室，将近2年时间内，他周末、假期经常在实验室一泡就是一天，读文章、查资料、做分析，经过不断的积淀，他也取得了科研道路上的第一批成果。现在他参与了一项院级大创——基于FPGA的农业航拍飞行器设计，负责了一项校级大创——基于DSP的非局部FIR数字信号滤波器设计，申请到了一项国家受理专利——一种心电信号滤波方法，并且投中了一篇名为Adaptive nonlocal means method for electrocardiogram signal denoising的论文。此外，他所参与的项目“微伏级”心电信号采集系统设计在第五届“求实杯”上拿到了二等奖，目前在备战“挑战杯”比赛。他还是一个足球迷，担任学院新生杯的教练和足球队队长。从新生杯到生命杯，再到华工杯，足球赛场上总能看到他的身影。训练的汗水，赢球的兴奋，输球的沮丧，他享受着足球运动带来的乐趣。“爱拼才会赢”是他人生的座右铭，希望全面发展的他能够在科研的道路上一直拼搏下去。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('397', 'U201413014', '黄婷', '生命学院', '   她性格开朗，执着专注，成绩优异。她在经济上接受过国家助学金的帮助，感恩的种子就此埋在心底，成长为热爱公益的满满激情。她的身影活跃于各种志愿服务活动中，她希望以自己微薄的力量回馈社会。高中时期的她就曾作为班级学雷锋志愿者队队长，每月开展志愿活动，并取得良好的反响。受助者的笑容是她做志愿活动的无穷动力，而留下的汗水则是发自内心的满足感。大学给了她一个更加自由的平台，在这个平台上她有更大的空间去追逐自己所热爱的事物。别人眼中的轻松玩乐的大学生活并没有腐蚀她内心的追求。也许，你不能理解为什么在周末还要给难以进行顺畅沟通的印度留学生上汉语课，为什么在晚上还去社区做志愿者，为什么带领并不熟识的外国志愿者去华科附中和华师一附中上课……然而，你并不知道的是—一个多学期的磨合让她能够无阻碍地教印度留学生中文并使他在中文上有了长足的进步；社区老人的活力让她感受到志愿活动的意义；和外国志愿者的合作让她意识到自己的不足并努力朝着更好的方向前进。她一直坚信正能量的传递，用爱心播撒阳光，高尚践行平凡，在服务他人的同时深刻感受到“赠人玫瑰，手有余香”的快乐与满足。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('398', 'U201212264', '李想', '生命学院', '“天道酬勤”，这是他常用来激励自己的一句话。生活中，身为班长的他是一个 恪尽职守的班级领导者。为了同学们能在班级中感受到家的温暖，他随时随地都在尽力履行班长的使命。优良学风班和三次优秀学生干部的荣誉无疑是对他工作的最大肯定，也是他沥尽心血的回报。与此同时，他还是一个热爱科研的工作狂。课业的压力、攻关的辛劳都未能成为他追梦的阻碍。两项院级、两项校级和一项国家级大创项目只是他筑梦之路的开始，“求是杯”的二等奖、实验室的“十二五”项目也未能成为他科研道路的终点。\n历经重重磨难终于苦尽甘来，他以第一作者身份投稿了一篇SCI论文和一篇A类期刊Plos One论文，同时申请了一项国家发明专利。他的路，因为梦想而不轻言放弃，因为执着而不害怕明天。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('399', 'U201312725', '李欣', '生命学院', '   她立志成为一名优秀的医生，所以选择医学，在“启明学院”临床中德实验班里她努力学习，重视每一科的学习，早上7点15到教室读书，晚上10点半下自习。大一总加权92.26，大二上加权92.29。德语4级“优秀”（85分以上为“优秀”），英语4级611。获得新生自强奖学金，新生学习优秀奖学金，国家励志奖学金。\n追梦德国医学教育。大一一年，她将市场上德福相关书籍刷遍，以总分18（满分20）成功通过德福考试，有资格申请德国大学。\n   她注重修德。积极参加党校，并顺利获得结业证书，成为入党积极分子。担任班级团支书，认真做好在班上的相关工作，参加“成为有坚定理想的青年”团校学习并顺利结业。参加组织全班同学每个月开展团会，开展特色团日，写成5万字总结书。特团进入校30佳；开展“雷锋月”活动。获得了“优秀共青团员”的称号。\n   她热心义工活动，如关爱拾荒老人，义务发报纸，爱心宿舍等，还定期去东图整理图书，工时达39个。积极带领留学生参观校园。参加生命之光，为其中各种相关活动制作展板，去校外为部门的“爱心家教”活动贴海报，参加“志愿者日”路演 。加入学校资助中心助理委员会。制作部门“阳光解说员”招新海报，“校史馆阳光解说员”文化衫，参加“2014年自强标兵”路演活动。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('400', 'U201413207', '刘柯', '生命学院', ' 她阳光开朗、热爱社会公益，她希望能通过自己的绵薄之力为社会做出自己的贡献。也许是受生活环境的影响，也许是发自内心的本真，在大学伊始，她就始终行走在社会公益的道路上，不论工作有多繁忙，她总能有条不紊的安排好时间，不论风吹日晒始终坚持每周去地铁站疏导交通，坚持每周去给家庭困难的孩子做家教，在工作中积极热情、认真负责，在上一阶段的工作中获得”优秀地铁义工”和”优秀教员”的称号，从创青春志愿者到爱心宿舍志愿者，不论活动的大小总能看见她默默付出的身影，短短一个学期工时就多达40多个，这个暑假她还将踏上支教之路去偏远山区支教。除此之外，从班级到学院再到学校的各种学生工作，总也少不了她忙碌的身影，作为班长以及院系助理更让她懂了什么是责任，尽职尽责、全心全意的为同学服务，与此同时她也荣获了多项荣誉称号。一辆单车，一个背包，一颗爱心，她就这样奔走在武汉的大街小巷，她说只要心中有信念就会有明天，她会在公益的道路上坚定不移地走下去，她要用自己的阳光去温暖身边的每一个人。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('401', 'U201372254', '黄本燊', '船海', ' 进入大学之后，我充分利用这些时间。在大一上学期的时候我自学了Photoshop，那个时候还没有电脑，每天我都会在自习室自习两个小时后去东校区的机房，自学ps技术，那段时间常常我是最后一个离开机房的人。大一的这份努力使我从一个ps的小白，一步一步进阶成为一个熟练的使用者。在大一下的工图课上，老师曾近要求过大家学习AutoCAD，但那只是基础中的基础，仅仅只是直线，圆形的简单组接。这远没有满足我，我在图书自学了一整本AutoCAD教程，并在假期进一步强化。在这半年里我从一个对工程制图一无所知的少年，到了解整个软件的功能和使用方法。并整理出了一本属于自己的笔记。\n    大学期间我加入了船海阳光俱乐部，组织并参与了俱乐部的多项活动。我领头组织了喻家山“阳光密码”定向越野比赛。同时每个月的“爱心宿舍”活动也没有缺席。多次参加汽标社区清洁活动，东九桌面清洁，问候离休职工等活动。义工活动不仅丰富了我的课余生活，更让我知道了自强的另一面。作为一个大学生我们所应该承担的责任。我们不再是小孩子已经步入成年的我们应该为这个社会奉献自己的力量。心中常常有他人，为别人服务，在点滴之中提升自己。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('402', 'U201412016', '冯璐璐', '船海', '我是14级冯璐璐，一个地道的东北姑娘，性格直爽。\n上学期加入了援之缘支教协会，到小梅花艺术学校做志愿者，虽然只做了2周，但收获到很多实践经验。这学期在爱乐音乐学校负责六年级，到现在已经是第5周了，并且效果很好，可发展为长期项目。\n现在在协会做基地助理，也会有路演，招募，培训等工作。目前正协助做“武汉市Yuan来有爱—高校学子暑期志愿家教活动”，会在武汉六所高校进行招募志愿者进行一对一家教。\n曾2次去湖南基地回访，暑期也要到湖南做21天的支教。\n会将支教作为一项事业，并长期做下去。同时也希望有更多的人投入到支教中。\n就像我最喜欢的一句话:路上无名，脚下有路。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('403', 'U201312291', '任仕美', '船海', '     “不经一番彻骨寒，哪得梅花扑鼻香”，这是我一直坚持和捍守的信念，来到大学我一直坚持参加各种志愿活动，爱心病房里我曾多次耐心陪伴患了白血病的孩子们，给他们带去欢乐的同时也带去了暖暖的爱；武汉科技馆里留下了我细心给孩子们解答的身影，“创青春”比赛时我积极接待来自各地参赛的老师和同学，也曾连续几天到机场接待来参加“高新船舶”科技论坛的中科院院士；武汉盲校里我曾给孩子们进行一对一辅导，让他们更好地沐浴在知识的海洋……我热爱志愿者的工作，喜欢志愿者的称号，更享受无私为他人服务的过程。以后我会一直坚持我的志愿者之路，无私为他人服务，回报社会，为这个社会奉献出自己的一点小小力量，让自己的生命变得更有意义。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('404', 'U201412151', '田宇', '船海', '    宝剑锋从磨砺出，梅花香自苦寒来。我是来自船海1404的田宇。从高考结束后，我便深知父母以后的负担会更重，所以从那时起，我便开始兼职，努力赚取自己的一部分生活费，到大学后，也做过许许多多的事情，酒店兼职，快递分拣员。特别是第一次做快递分拣员的时候，尽管只工作一晚拿了一百块，但是我却十分劳累，在一辆辆货车之间跑来跑去，现在做家教，能够赚取自己的大部分生活费，同时也在勤工助学工作。尽管如此，但是大一上加权86.85.\n拮据的生活并没有让我自暴自弃，而是更加努力。为回报学校、社会对我的关怀，我积极参加了创青春志愿服务。面对困难，我选择了不卑不亢，决定用自己的劳动与智慧创造一份天空 。                                                                                              \n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('405', 'U201412158', '易玉坤', '船海', '     我出生还不到八个月，母亲就走了。爸爸很坚强，又当爹又当妈的照顾我和两个姐姐，并靠种地最终把我们送进了大学校园。\n     小学一年级，我们三个都在镇上读书，为了不影响高年级的姐姐们的学习，每次洗衣做饭都是我抢着干，当时我还没有灶台高，垫着椅子煮饭。我炒了几乎六年最便宜的咸菜。\n     初中的时候，三个人学费的突然增长，尽管三人都特别特别省，家里还是入不敷出并且开始负债，甚至一度我差点被逼退学了，是父亲坚持我才有今天。我成了家里的二号劳动力帮父亲干农活，晚上就在煤油灯下面写作业。如果是在农闲时候，我还要采山药、捡废品换一些资料费。\n高中时在学校，我早上买三块钱的小包子或方便面，中饭晚饭就都有了，然后一天除了上厕所就呆在教室学习，可以说最终我能以优异的成绩毕业，不是平白无故的。\n上了大学兼职做的很多，带了三份家教，周末节假日也去酒店做服务生，去商场做促销，去校园发传单。现在我不仅不用向家里要钱，还每月给家里寄钱，希望能回报父亲恩情值万一。在大学我一直致力于志愿者活动，创青春我报名很积极，要准备的事情既多且繁，我和组长一直忙到凌晨，后来几天更是忙的连饭都顾不上吃。我在校外也做公益项目，阳光义卖时晒了一上午才募到30块。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('406', 'U201115012', '张生倩', '机械学院', '我曾经迷茫，看不到未来的希望，患抑郁症休学半年。对梦想的渴望让我走出迷茫，重拾自信。未了不负青春、不负梦想，我选择转专业一切重新开始。设计专业要求具备扎实的美术功底，零基础的我和其他同学有很大的差距，暑假我留在武汉进行专业的绘画学习，为了不给父母经济负担，我一边打工一边学习画画；每天早上六点起床去画室，晚上十点才回到学校。经过两个月的辛苦和努力我的水平有了很大提高，顺利转入产品设计专业。转专业的第一个学期，我同时修完了大一大二两个学期的所有课程，忙碌压力是必然的，困难挫折也在所难免，但梦想的力量让我坚持不懈，并付出了比别人更多的努力。加权成绩90.56，排名年级第一，四分之三的课程在九十分以上，这也让我更加坚信只要付出艰苦的努力，梦想就一定会实现。我团结同学，乐于助人，热心公益，并通过勤工助学和做兼职解决了我经济困难的问题，我的努力得到了老师和同学们的认可，并获得了三一重工奖学金。我的梦想之路才刚刚起航，前方还将会有更多挑战，我将一如既往地全力以赴、坚持不懈。期待着未来，能够在更大的舞台上，为这世界带来多一份温暖，为这时代创造多一份希望。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('407', 'U201210580', '赵叔吉', '机械学院', '首先，在学习方面，专业排名比较靠前，这与我的刻苦学习离不开关系，几乎每天晚上，我都是十点下自习。我不是聪明的人，但我要成为很努力的人。\n其次在科创方面，我大二时参加了全国大学生机械创新设计大赛，克服了重重困难，顶着巨大的心理压力和繁重的工作量，最终取得了全国第一名的成绩，并且和组员之间结下了深厚的友谊。\n在生活方面，我也是一个勤俭节约的人，并且争取做到对人坦诚，热心帮助他人。还喜欢看书，努力提升自己的素养。\n短简介：\n努力成长，自强不息，超越平凡，追求卓越\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('408', 'U201210802', '张斯佳', '机械学院', '大一那年，我在不经意之间接触了校勤工助学工作，成为一名普通协管员，把一份责任放在心里，认真踏实工作；大二那年我成为了校勤工助学部的一名主管，顶着学习压力，默默服务自己的协管员团队，风雨无阻我查班的道路；半年后我荣幸的成为了整个东校区公寓岗位仅此一位的岗位负责人，每月会接手上万的工资表以及处理将近400人的学生管理工作，双学位剥夺了我的周末，越来越繁重的学习压力压垮了我的身躯，即便如此，我从未放弃这份寒暑假仍不歇息的工作。除此之外，学校分配给我们的“爱心传递联盟”工作我们一直积极响应，每月按时资助贫困的中学生们，从未停歇。秉承我工作的宗旨：绝不让任何一位学子因家庭贫困而辍学！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('409', 'U201310644', '马昕', '机械学院', '我是马昕，来自机制1303班。现任班长，成绩在年级前20%，曾任13年飞航杯总裁判，负责13,14年两届赛题的编订工作，曾任笛箫协会表演队笛队队长。科研方面，从大一暑假开始在1022团队做项目，已有一定实践经验。在我看来，自强不仅意味着内心的坚定与对理想的执着追求，更是从逆境中奋起的那放手一搏。我曾经由于家庭的原因沉沦过、苦恼过，有过报复社会的行为，到最后甚至有过轻生的行为。幸运的是，我愚蠢的行为没有成功，在亲人和老师的帮助下，我获得了新生。我希望的只是把我从抑郁症到阳光开朗的心路分享给那些需要帮助的同学，告诉他们身边的重要的人和事是值得我们用真心去对待。\n人生格言：没有无价值的人，只有没有追求的人；没有打不开的锁，只有自己封闭的心门。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('410', 'U201310814', '周建', '机械学院', '自小体弱多病，但是却有一颗对舞蹈热爱的心。显而易见，舞蹈是一门艺术，而在现在，艺术却需要高昂的经济基础，我来自农村，家庭经济基础不好。因此，只能把舞蹈放在心中。到了大学，我了解到了自强自助。于是，我开始去发发传单，挣点外快。趁着假期的漫长时光，做了两个月的销售，虽然天气酷热，需要顶着大太阳去发传单，更要忍受顾客的谩骂与咄咄逼人的态度。但是拿着工资去交舞蹈学习费用的时候，还是毫不犹豫，觉得蛮值得。后来开学了，意外介绍之下，我开启了家教征程。趁着每个周六周末晚上，都会做1个多小时的车跑到户部巷给小朋友补习，晚上9点多又坐车回来。因为这份工作，舞蹈学习才得以继续。日复一日年复一年，前不久，终于拿到了舞蹈的第一份回报，经介绍帮人排了个舞获得了一笔回报。舞蹈需要的是持续，不管多累，我都会持续下去。有一句名言，舞蹈是上帝赐予人最美的苦差事。我坚持，我快乐！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('411', 'U201310924', '杨仕雷', '机械学院', '我来自农村一个比较贫困的家庭，我是我家第一个大学生，所以对于“学习改变命运”这句话有很深的理解，因此我希望能够去帮助那些家庭贫困的孩子，给他们力所能及的帮助。因此我在大一上学期加入了生命学院的“生命之光”团队，给青山区一个家庭贫困的孩子做了一年的义务家教。大二由于课程增多，班级事务也比较多，所以就换成了另外的人。\n我希望能够带动更多的人去帮助上不起学的孩子，或许我们不能给他们很多资金方面的支持，但是我想通过自己的努力，带动更多的爱心人士给那些孩子们送去一点关怀和物质帮助，因此我现在正在做一个针对支教地区贫困学生的帮扶项目，致力于让我们的支教活动更具有实际意义，而不仅仅是支教过后就没有然后了。\n在大二上学期我组织策划并参与了帮助留学生学汉语以及更好适应在中国的生活的win—win项目，这个项目给参与的双方都带来了很大的帮助，让他们从彼此身上学到了很有用的东西，真正实现了合作共赢。。\n在平时我更注重的是带动更多的人来参与公益活动，随手捡起地上的垃圾，在生活中热心帮助他人等等，我从不认为做公益一定要多么的轰轰烈烈，公益就是“不以恶小而为之，不以善小而不为”。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('412', 'U201111220', '聂小佳', '材料科学与工程', '2012年8月至今，三个年头了。寒冬清晨，我身着单衣却大汗淋漓，东西操场、喻家山和森林公园都留下了我的身影，我见证着月亮落下、朝阳升起；酷暑烈日，我们在东湖上桨叶翻飞，划了数不清的桨数，黝黑的皮肤和衣服背后的盐花是我们的印迹；暴雨滂沱，我们风雨无阻，鼓声震天，脸上的汗水和雨水交织在一起；面对冰冷的杠铃片，机械地重复动作。黝黑的皮肤、满手的老茧、强健的身体就是我们龙舟人的标志。艰苦的训练、顽强的拼搏，龙舟之花终绽放。泪水化为力量，当付出在不断地接近目标，原来的痛苦也变成了快乐，从“同城双星”混合组500米冠军到中华龙舟大赛总决赛全国亚军，付出终得回报，激动的泪水在比赛结束的那一刻夺眶而出，终于扛起了身后“华中科技大学龙舟队”这九个字，为校争光，义不容辞。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('413', 'U201216075', '万坦', '材料科学与工程', '我叫万坦，来自武汉市新洲区。两岁那年父母离异，从此踏上了与父亲相依为命的漫长路途。父亲是一名乡村小学教师，靠微薄的收入支撑起整个家庭。12岁那年，母亲因病去世。\n大学以来，我先后参加了福利院爱心家教活动”、“武钢三中励志演讲”等公益活动；同时为减轻家庭负担，我长期坚持在外做家教、辅导员等各种勤工助学活动；学习方面我努力求知，成绩始终稳定在年级前10%，拿过两次国家励志奖学金，并被评为“校三好学生”。\n学习之余我积极参加科技创新活动，2013-2014学年通过努力获得了湖北省机械创新设计大赛一等奖、全国机械创新设计大赛一等奖； 2013-2014学年作课题为“LED灯透明氧化铝陶瓷基片的制备”的研究。因此被评为“校科技创新优秀个人”，并取得了2014-2015材料学院太平洋精锻（科技类）奖学金。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('414', 'U201311146', '魏俊杰', '材料科学与工程', '\n很幸运，刚上大一，我便找到了我的兴趣所在——控制。下面我将以时间轴的方式简介我的自强事迹。\n大一上：我参加了智能车比赛，认识了很多控制上很棒的学长和伙伴，激起了对控制的浓厚的兴趣，一有空闲时间便去图书馆看书，或在寝室敲写代码，使自己在控制上的能力有了很大提高。\n大一下：积累了一定的控制经验，有幸加入了学校的3D打印团队，并担任控制组组长。大一暑假都待在了学校里进行研发，终于在暑假接近尾声时，成功将一台普通打印机改装成了一台3D打印机。\n大二上：在对控制的热爱的带领下，参加了科技光环比赛并有幸荣获二等奖，报了院里的大创项目，并超前完成且比预期的完成得更好。大二寒假，继续留在了学校，专为提高打印机的效率设计了一套控制方案。实现了打印机平均效率提升7倍。并专为该控制方案，正在生产新的3DP设备供团队使用。\n大二下：有幸去广东一3D工厂调试设备，并开始进行熔融沉积型和激光烧结型3D打印设备的优化与智能化研发，团队专利的撰写，及用打印机做实验，研究材料力学性能。\n目标：在本科期间敲出一整套智能好用的3D打印机控制系统。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('415', 'U201311193', '张建明', '材料科学与工程', '  我来自内蒙古的一个农村，2011年春节，适逢高一寒假，父亲出了车祸，当场去世，家中失去了主要动力，经济瞬间濒临崩溃。2012年，母亲改嫁，后离家出走，并带走家中绝大部分积蓄。至今联系不到。\n大学期间经济依靠各种奖学金，助学金，国家贷款和自己做兼职维持。先后做过市场调查员，电话测评员，家教，三早助理，卫生检查员。去年暑假留在学校做兼职，至今所有假期均在打工中度过。\n积极参加社会工作和学校社团，如晴川阁支教，电商协会等。同时参加了工程实训竞赛。\n加权排名年级前25%。\n英语四六级已通过，计算机二级已通过。\n曾获国家励志奖学金，太平洋精锻奖学金，勤奋励志助学金，国家助学金，自强奖学金等。\n曾获2014年度院自强标兵称号。\n曾获“飞航杯”科技节校赛一等奖。\n目前正在申请一项专利，已受审。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('416', 'U201211171', '张财源', '材料科学与工程', '家里经济的困难并没有改变我积极乐观的心态，高考的失利更加坚定了我对梦想的执着追求。幸福不仅仅是吃饱穿暖，而是勇敢地去战胜困难，生活费不够我就省吃俭用，不乱花一分钱。两年半来一直坚持兼职和勤工俭学，为自己挣生活费，虽不能做到完全经济独立，却也为父母省了不少心，虽都是小钱，自己却不曾放弃自立自强的精神，生活中时刻践行着自强的本质，以自己的行为传递着正能量。学习上勤奋努力，在陷入迷茫时能够通过自己的努力、别人的劝说很快走上正轨，做到知错就改。但行善事，莫问前程，常怀感恩之心，积极参与志愿服务和义工活动。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('417', 'U201311036', '李尚仁', '材料科学与工程', '我们每个人的能力有限，但再微弱的力量也有其存在的意义。\n大一时便加入校学生会权益部及学院义工部，多次发起并参与各类义工活动。任义工部副部长期间，作为材料学院旧书圆新梦活动唯一负责人，为材料学院2014级领取生源地贷款本科生募集了约700本书籍；2014年暑假报名加入材院纳雍支教队，前往纳雍县进行为期半个月的支教活动，并在返校之后和队员们一起募捐到约4000元善款；2014年11月成为创青春大赛志愿者，并被评为优秀志愿者；2015年1月，组织高中同学参加母校回访实践活动；目前我担任材料学院社委会兼资助委员会副会长，学生工作处助理服务于学校同学。\n不管是涓涓细流还是汹涌大海总有其存在的意义，而我这股细流正是抱着这样虔诚的态度为志愿服务事业而努力着。一句话：以梦为马，随处可栖。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('418', 'U201315781', '王琛', '土木工程与力学学院', '    大家好。我是交运1301的王琛，也是一枚龙舟队的桨手。龙舟队训练很苦，一般坚持下来很难。去年院龙舟队有7个人，现在就剩俩。我们一周七训，不同的时间、地点。龙舟队从不主动踢人，坚持不下去就主动离开，所谓的自强精神，就是全凭自己的坚持，不息的奋斗。\n     龙舟队队员全部不存在体育生，但我们要竞争的是体育院校或职业的龙舟队，所以，我们把自己当体育生一样每天坚持刻苦训练。今年我们以更大的勇气，报名参加职业组的比赛，我们或许实力没办法问鼎，但我们执着的向更高的水准的比赛进发，向更优秀的对手发起挑战。纵使前途暗淡也要勇敢拼到最后，这或许就是自强精神吧，全靠自己的坚持，不止的追求。\n     而我，作为龙舟队一名普通的一员，入队前1000米跑3分半，现在只要3分07，或许还可以再快一些。我代表学院参加过学校的Nike杯接力赛，取得第三，我也自费去跑过厦门马拉松。我参加过新生篮球队，取得第三名，我们班也是去年追日杯的第四名。在龙舟队这种竞争环境中，都是大神，但我在去年的冬季大比武中综合排名第一.每次去参加比赛都要好几天的时间，这意味着学业的压力，自强精神，意味着牺牲，但也要勇敢的走下去。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('419', 'U201315848', '王凡', '土木工程与力学学院', '    我叫王凡，来自工程管理1301班。我对体育非常执着。刚一入校我就加入了校龙舟队，龙舟训非常辛苦。每周一、三、五的早操，从入队到现在从未间断。每天晚上9点晚训，到勤也做到了9成以上。每周一次，现在有时候是两次的下湖训练。在大冬天寒冷的湖水浸泡下我也坚持了下来。\n    经过了两年的艰苦训练，在各方面有了很大的提升。以前1000米最高记录是3分30秒，现在我的最好成绩是3分06秒。以前400米最好成绩是1分10秒，现在是58秒。以前200米最好成绩是27秒，现在最好成绩是23秒。我参加了中华龙舟大赛，东湖大战，同城双星的比赛，并且取得了不错的成绩\n    同时，校运会中取得了很不错的成绩。200米第四名、1500米第八名、110米栏第八名、4×400米接力第二、第三名。定向越野大赛季军，参赛队伍150支，湖北省第一届大学生跆拳道大赛63Kg级季军。代表学院参加Nike杯高校精英挑战接力赛，取得了学院第三个人成绩第二的好成绩。5月份将代表华科参加在北大举办的高校精英挑战赛。完成了厦门马拉松比赛，木兰湖25Km徒步大赛，阳光晨跑等活动。\n    我会在我的体育道路上继续坚持，继续绽放我的光彩。我将会用我的一生去诠释体育的魅力。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('420', 'U201315525', '胡婧', '土木工程与力学学院', '   我叫胡婧，来自土木学院土木工程1301班。\n   从初中起我就跟着父亲相依住在不足十平方米的租住房里，而母亲于几年后正式与父亲离婚。家里一直没有积蓄，现在我和父亲每月只有一千多元的低保作为家里的主要经济来源。父亲已经57岁了，由于早年公司倒闭早已下岗，因为三年前的手臂重伤无法进行繁重的体力活，在2014年年初又被诊出患有肝硬化，肝衰竭和胃炎等重病。虽然家里条件并不好，但是这并没阻碍我成为一名优秀独立的女孩。即使初中由于经济情况选择了一所并不好的学校，可是我凭借自身的努力，考上了武汉一中，并于重点班学习。为了不离开父亲，我并没有考去外省，我选择了华中科技大学，方便照顾父亲。高中毕业后，我就开始在外做兼职，放假就做长线项目，开学了就周末打短工，同时也加入了学校的勤工俭学岗。2015年年初正值期末，父亲大出血危及生命，我立即对期末的学习任务和考试安排做出调整，最大可能的将精力投向家里。出于实际的需要，我必须向同学家借钱给父亲做手术，并每日去医院照看父亲，在许多好心人帮忙下，我们最终度过了难关。虽然就外人看来对于年轻的我，生活可能十分艰难，可是我相信没有过不去的坎，只要活着就有希望，生活是美好的，毕竟阳光总在风雨后。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('421', 'U201415562', '陈明君', '土木工程与力学学院', '    我是陈明君，虽然目前还是大一，但我的自强之路早已开始！\n        磨砺：一个人的自强\n    初一便假期练泰拳，踢轮胎，跳铁绳等，只有我坚持到最后；初三，高三毕业，分别在餐馆，家教中心找到工作，虽然苦累，但我踏实认真干了下去！\n        公益：一伙人的自强\n    大一上，参加“爱在夕阳”长期义工关爱老人，带领组员无一次缺席或迟到（无论东边涨洪水，或考试周），并且自发准备魔术，歌曲，小礼物以带给老人温暖。\n    参加“爱心崇阳行”关爱贫困生，远赴崇阳一整天，给予孩子指导与温暖！\n一学期工时合计31个。\n    寒假，参加公益组织发起的“寒假励志演讲”，辗转两地为上千高三学子演讲！途中，吃在食堂，两人共张单人床，回家的路费还是自己负担。\n    现已加入该公益组织外联部。\n    暑假会去山区支教，奉献更多的爱！以后必将爱进行到底，我要自强！\n        追求：永不止步的自强\n    大一刚入学参与多个社团组织面试其中三个在最后一面失败、竞选失败、演讲超时、普通话被嘲笑，但我不放弃。\n    参加大创的“市场嘉年华”，摆摊一天，净赚110元。\n    一学期，从只会打字，到Word,Excel,PPT都基本会用，还自学了PS，视频，音乐剪辑。\n    但时间会证明一切，我将永不止步！\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('422', 'U201215564', '余倩雯', '土木工程与力学学院', '    我是土木与工程力学学院的余倩雯，可以叫我蓝胖子或是小叮当。\n    现任华小科团队负责人。正在创业阶段，目前产品【咩咩】已在iOS与安卓市场成功上线。曾先后在腾讯教育（北京）和碧桂园实习。策划的微博话题，转发量达万；微信图文最高达16w。目前已拿到阿里、搜狐、途牛实习生offer。\n    一句话总结自己：爱笑爱吃、敢想敢做的蓝胖子。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('423', 'U201215471', '李志斌', '土木工程与力学学院', '    我是土木1203班的李志斌，来自云南楚雄彝族自治州南华县，通过少数民族预科生计划进入华中科技大学。\n    2012年入学以来在学校认真学习，刻苦努力，积极参与班级活动及院内、校内组织的文体活动，同时也积极投身于学生工作事业，为我院的学生工作贡献了自己的力量。\n课余时间我热爱体育活动，在受伤的情况下坚持体育运动，参加篮球队，并努力坚持，在校内、院内的各项大小赛事中取得了不错的成绩，为班级和学院争得了荣誉。\n    与此同时，我还积极参与校内外的一些与专业相关的比赛，在其中磨练自己，也多次获得了荣誉。\n    曾获校优秀共青团员，“飞航杯”架构模型大赛三等奖，强生商界精英挑战赛二等奖，2012 级华科新生杯篮球赛亚军，连续两年追日杯冠军，连续两年年级赛冠军，2014年华工杯男子甲组季军，土木学院2015年度自强标兵。\n    曾任土木学院团学联副主席，金地华中俱乐部活动中心主任，华中科技大学职业发展研究会（ACDR）主席助理\n    曾在云南冲宇建筑有限公司项目部土建岗实习生，中国建筑国际集团、佳兆业房地产、招商地产校园招聘团队成员，金地集团校园大使。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('424', 'U201316172', '黄晏渲 ', '水电学院', '作为一名来自四川切身经历过汶川地震的孩子，在云南鲁甸发生强震的消息传来的第一时间我义无反顾地选择前往灾区参与人道救援工作。在营地以及重灾区待的十天里我学会了救援帐篷和行军床的搭建，我了解了物资发放的流程及注意事项，体会了大灾面前大家的众志成城。当我穿上人道救援制服负责灾区救灾物资调配和发放工作的时候，我从灾民眼中看出了他们对我的肯定，也许这也是我最值得骄傲的吧！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('425', 'U201316186', '李粮 ', '水电学院', ' 我是来自江西省革命老区——莲花县的一名学生。父亲在我七岁的时候患上胃溃疡住进医院。全家欠下一大笔外债才把父亲从鬼门关拉了回来。此后，父亲的身体便一落千丈，长年在家休养，加上年老体虚，不能从事较重的体力活。我的母亲，在家务农照应着整个家，她用十年的时间还清了所有的债，还供养了我们姐弟俩上学。我十三岁就开始包揽了家里所有的粗活重活。上大学之后，我在课余时间从事了大量兼职，在烈日下发过传单贴过海报；也在零下几度的晚上做过家教；参加学校的勤工助学活动，服务同学的同时，也补贴了家用。我所做的一切，只是为了减轻家里的负担。成绩方面，由于大一刚进来没有找到兼职和学习的平衡点，我成绩很差，但后来逐渐适应，成绩从最初的年纪倒数到现在的年级前20%左右。其他方面，我代表学院打过篮球新生杯，在班里篮球足球队都是主力，我还积极参与院校组织的活动，在13年校运会1500米项目拿过银牌，学生工作方面，我是学院团学联网新部执行部长。分管着学院的微信公众号。如果命运注定让我出身贫寒，那我要感谢这份贫苦，他没有成为我的负担，而是推动我不断前行的发动机。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('426', 'U201415882', '唐国钦 ', '水电学院', '我出生于国家级贫困县重庆市石柱县。从小家庭贫困，父亲身体多处遭受伤害，失业多年。这对于一直贫困的家庭无疑是雪上加霜。从5岁开始我就患上严重的疾病，去了多家医院都没有治好，花了家里大量积蓄。后来病情越来越重。进入大学后，也有过一段颓靡的时光，但逐渐地我明白贫困与残疾只是我逃避生活的一个借口。于是积极参加各种活动，努力学习，变得更加坚强，阳光。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('427', 'U201316128', '许立武 ', '水电学院', '一直坚持把每一门课学透，一年多来获得了校三好学生，国家奖学金，启明学院特优生等荣誉。担任班级学习委员，尽我所能做好自己的本分工作。从爱心卖报到旧书圆新梦，从爱心宿舍到志愿看包，我一直怀揣志愿服务的愿望。积极参与学生工作，担任院团学联科创部副部长。坚持勤工助学和社会实践，做过车棚岗，超市岗和其他社会兼职。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('428', 'U201316618', '王丛聪', '艺术团', '一、学习情况：\n学习上认真，刻苦努力，成绩在前1/3，获得学习优秀奖学金。在2014年12月中行电子银行知识竞赛中获得三等奖。2015年3月作为负责人申请学校创新训练项目，已在院里立项，目前已开展工作。平时的排练，积极主动。在交响队参加了大学生艺术节。连续两年在“金秋音乐季”上进行了演奏。\n二、社会实践、活动情况： \n大一一年任班级中班级资助委员，在 2014年四月校“我是策划人”义工活动中，带领班级参赛，进入前八名；大一成为艺术团编辑部的一员，大二任编辑部副部长，协助部长做好编辑部文稿的撰写，并带领部员推出自己的栏目，对艺术团的演出活动进行及时的报道。\n三、生活情况：\n   平时的生活中，自强自立，面对困难不退缩。集体主义感强烈，愿意为大家服务。生活中节俭，希望能通过自己的努力，追逐梦想。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('429', 'U201216212', '张嘉妮', '艺术团', '1. 在艺术的道路上执着追求。不管身上的伤痛有多少，平日的学习任务有多重，从来都秉着对舞蹈的热爱，坚持日复一日的舞蹈训练。从大一的8月中旬就入校训练，到每年的暑训，再到平日的训练近乎全勤。每台晚会，都倾注着无数的心血和汗水，但都咬牙挺过。\n2. 在学生工作上兢兢业业，努力不断提升自己的能力。从办公室的一员，到资助助理，再到办公室执行部长，舞蹈队团支书，以及今日的艺术团团学联学生会主席。整理材料直至凌晨，开会至深夜，每一件有关艺术团的事我都认真仔细，不敢有一丝懈怠。并且从不无故缺席各种会议，滋滋不断的汲取着来自各方面的优秀力量。\n在学习上坚持对自己的严格要求，因为基础差，所以一直以来很吃力，但我从未萌生过放弃的念头，因为我知道，路是对的，努力就是应该的。在班上的成绩不说十分优秀，但也良好。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('430', 'U201311927', '范雯宇', '艺术团', '    我是一名来自艺术团民乐队的艺术特长生，也是一名电气工程及其自动化1305班的学生。\n　　大一上，我报名参加了“聆听心声音，走进心世界 关爱精神疾病患者志愿者服务行动”，这次志愿者活动持续一个月，每个星期我与其他志愿者一起往返在学校和位于汉口的优抚医院，陪伴患有精神疾病的特殊的朋友。\n    大一下，报名了“创青春”复赛C类“一对一”志愿者，多轮考核后正式成为一名“一对一”志愿者。大一暑假，我参加培训和素质拓展活动。在十月份的决赛志愿者活动中，我接待了来自辽宁省团委的代表团。\n　　从进入大学至今担任艺术团学生会网络部部长、电气学院13级级会宣传部长、校资委会阳光俱乐部外事部副部长、民乐队团支书、班级宣传委员、艺术团办公室部员、电气学院文艺部部员。\n在校资委会阳光俱乐部，成功筹办“阳光励志演讲”“阳光新生演讲”等公益演讲，担任武汉革命博物馆志愿者讲解员负责人。\n    我愿意以自己微小的力量，给他人带去阳光，借用一位学姐的话：“愿，成为一个如向日葵般温暖的人。”\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('431', 'U201313824', '彭浩通', '光学与电子信息学院', '谁要游戏人生？谁不能主宰自己？养成自强性格，命运才会在自己手中！大学是让用来经历和体验的，也是为有想法的人准备的。\n大一时，他决定和室友一起在圣诞节卖苹果。可是生活往往就是这么的出乎意料，接连不断的失败给了他们不小打击。几天的努力，成果又是少之又少。准备也不充分，最后只卖出去一半的苹果，刚刚未亏本。升到大二，临近圣诞节。想着去年的失败经历，并不甘心，找了三个院里的好友。吸取上次的经验，这次提前半个月开备，收集全校所有大一班长的电话，预订了30箱苹果。在距离圣诞节还有一个星期的时候，依次打电话，接到许多订单。进了40箱苹果，找阿姨借了一个房间放苹果l，四个人从晚上七八点包装到早上五点，六点半又起来送货，借了电动车、三轮车，甚至租校车送货，发现苹果不够又去商店买了五箱，送到下午五六点才完全送完，一共卖出三千多个苹果，七千多新生，一半吃到了他们卖的苹果！\n周末对于大多数人来说是轻松的，但对于他来说，周末代表着忙碌，周日一天的三份家教，一天的奔波几乎横穿了整个武汉。发过传单、当过服务员、做过保安、做过电话营销员、做过代理等等，体验过很多不同的职业，他在这些经历中逐渐成长、自强。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('432', 'U201413636', '赵志壮', '光学与电子信息学院', '【逆境使坚韧铸进性格，他自己挣钱上学】\n父母只能靠打工和务农维持家庭。从六岁开始就每天独自走几公里的山路去上学，然而困难并没有阻挡他前行，他以优秀的成绩成为当地第一个来到华中大的人。\n因为来自穷苦家庭，所以更懂得关心帮助其他人。父亲车祸，家里的负担更加沉重，他除了学习，还要做家里的农活。他是大山里走出来的农民的儿子，他也像万千贫困家庭孩子一样，但他不自卑也害怕，逆风的方向更适合飞翔！\n没钱上大学，他便自己挣钱上大学。高考后一直在外面打工，商场、工地、家教，他都做过。去工地最幸苦，工地很累，但他还是坚持了下来。寒假他也一直没回家而在外面做家教。上学期间空闲时间去校外超市收银。经济独立自给自足，困难总可以克服，他清楚地知道自己担负着怎样的责任。\n【灾难面前更加彰显坚强，他身先士卒】\n2014年8月3日，云南昭通发生6.5级地震，家里房屋受到损坏。当时他在城里做家教，得知消息后，就立即赶往震中，不顾余震危险，走了五六个小时才走进去。时间就是生命，他跟着帮忙救人和搬运物资，未满18的他也“强迫”医生让自己献了血……\n那段时间他常常流泪，亲眼见证了生命的脆弱，更加懂得了坚强的意义。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('433', 'U201314368', '陈家田', '光学与电子信息学院', '从小讲话很慢，吐词不清晰。小时候因此被同龄人嘲笑，也因为这个缺陷，变得内向。到了大学，意识到了必须正视这一缺陷，从未担任过学生干部的自己也大胆去竞选班长，最后担任了光电1311班的班长。在各种场合勇于发言，并请同学们教自己普通话，慢慢地自己没有了以前拘束，没有了以前的胆怯，在KTV也敢用着五音不全的音律去唱自己喜欢的歌曲。\n初二下的时候，父亲因车祸不幸离世，无心学习，沉溺于网游不能自拔,最终沦为了一个放学之后通宵打游戏，从不做作业的网瘾少年。没办法上二本的他意识到不能堕落下去，为了理想，为了哺育自己多年的父母，为了在天之灵的父亲。下定决心发奋苦读，一步步往上赶，最后以湘1600名来到了华中大。\n在担任学生工作期间，经验欠缺，工作时不能很好地兼顾学业，大一的加权仅只有79。但自强的王子，从各种方面找出自己的原因，努力去改正，到了大二，适应了自己的工作。在不忘工作和学习的前提下，还参加勤工助学，并用其他时间努力学习，大二上的成绩达到了90+。\n他有着一颗乐观向上的心，在人生的路上，自己从来不会向困难低头，相信再大的困难对于自己只是磨练，目的是锤炼出更强大的自己。始终相信凭着自己的坚持和毅力能够做到一切看似不可能的事。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('434', 'U201313917', '瞿鑫', '光学与电子信息学院', '他来自祖国西部秦巴山间一个风景秀美但经济极不发达的地方。十年寒窗终于来到华中大，本就贫困的家庭由于08年大地震负债累累，求学路艰辛。\n快进入大学时，他便决定在经济上一定要减少对家里的依赖。于是大学伊始，他便在国庆假期选择了兼职，十月烈日炙烤下，他忙碌于街头发单。此后只要他周末一有时间就去做兼职。寒假时每天骑车往返两个半小时去县城做家教。大一暑假以及大二寒假，他也坚持在勤工岗位。回家后，他在一个高铁制梁场找了一个杂活岗位，要在烈日炙烤下铁皮房里搬着令人窒息的水泥灰，他选择坚持。\n贫寒塑造人节俭的品质。在生活上，他严控每一笔花销，无特殊情况每餐平均控制在3元以下。在他看来，学生的第一要务是学习，好的成绩才是对父母的最好回报，才是克服贫困的最好方式。从大一开始他便刻苦学习，他便走向了自习室。大二时他参加了智能车大赛，前后一个月奔波于启明楼和工程实训中心。平时他过着三点一线的生活，早上早早地去到教学楼，晚上十点以后才回宿舍，这些努力让他取得92+的加权。他还致力科学研究，进行着大创项目。\n“宝剑锋自磨砺出，梅花香自苦寒来。哪怕今天是痛苦的，明天也是痛苦的，但我相信只要我坚持不懈，后天一定是幸福的。”', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('435', 'U201314033', '苏畅', '光学与电子信息学院', '高考过后的他，看到爸妈每天辛苦劳累却收入微薄，他知道是该有一定担当了。便许下诺言：大学不向家里要一分钱。高考暑假开始便找了一个家教，凑足了大学的第一笔生活费。大学里做过不计其数的兼职：发传单，卖汉堡，拣快递…大学暑假里，在一个小金属制品厂里做流水线员工，脏乱的寝室环境，惨淡的饮食条件，恶劣的工作环境都没有使他退却！大二上做了一份家教，晚上要骑车经过森林公园，一次回来的时候骑车把脸严重摔伤，但是出于对孩子的责任感，仍然坚持做完了那一个学期的家教。77号公路，武汉到家乡的距离，两个100多公里的旅途，他证明了自己的毅力！\n大学做了很多义工，从最初的义卖报纸活动的参与者，到后来在义工部做着各种义工活动的策划者，童心伴夕阳活动，探访老年公寓活动，我是策划人义工策划大赛一等奖，现在仍在坚持做的地铁义工，以及正准备着的未来爱心支教。在传播爱心之路上，永不止步！\n每周的兼职和义工，没让他忘了学习。大一学年荣获国家励志奖学金，近90的加权，他懂得如何把握好自己想做的事和该做的事，不失生活重心的努力着。\n大学对于每个人来说都是一个自由的象牙塔，他有自己的大学旋律，想给自己一个展示的机会，让别人看到每个人的大学生活都可以按照自己的意愿过的精彩，活出自己的旋律！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('436', 'U201413946', '段昳晖', '光学与电子信息学院', '不知道是否有人注意过，游泳池晚上传来的阵阵鼓声；清晨和夜晚，华科校园里整齐的跑步队伍。你们也许听说过华中科技大学校龙舟队的名号，但是却不知道，那就是我和我的队友们。我不温婉，也不恬静，有的只是一份武汉女孩的泼辣和干练，也许，你会觉得我女汉子，但，事实如此。我并不是一个安静的女孩，心中也涌动着一股倔强的拼劲，流淌着不服输的热血。在龙舟队，这股拼劲和热血，似乎找到了最适合的舞台。\n在训练中，我逐渐爱上了这个队伍：爱上了自己划出的每一桨；爱上晚上力量房里挥洒的汗水；爱上游泳池边激荡的水花；爱上清晨森林公园清新的空气；爱上周末东湖绯红的夕阳。每周超过10小时高强度的训练，让不少女孩退却，大浪淘沙，留下的更为弥足珍贵。四肢酸痛，脚腕扭伤、手指划伤，伤痛并不能阻止坚持的脚步，正相反，面对逆境，更当自强不息，锐意进取；迎难而上，执着前行！守护前人的荣耀，开创新的辉煌，正是我执着追求的目标。\n执着与追求，也让我成长为一名合格的龙舟队队员。当代表华中大踏上全国级别的龙舟大赛的赛场，捧回奖杯的时候，我明白，正是长期的坚持训练，让我有能力去守护荣耀，也在队里收获友谊，挥洒汗水，青春无憾。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('437', 'U201413882', '谢祥芝', '光学与电子信息学院', '“我还年轻，未来会有无限的可能性，我始终相信微笑面对生活，奋斗成就人生。”\n家庭微薄不稳定的收入，爸妈积劳成疾。家就一直这样飘摇搁浅，却一直扬着前进的风帆。从小就学会独立自强。小学时就习惯了早上六点起床制作简易的早餐，步行三公里去上学；初中时习惯了将眼泪埋在心底，对父母始终保持微笑；高中时因不愿意看的父母整日围生计四处奔波的疲态，曾申请退学，但最后又回到了教室，踏入华中大。 \n梦开始的地方，他知道大学的自由不是肆意妄为的放纵。在班级中，担任班长着力于班级凝聚力和学习氛围，组织班级聚餐、班级间联谊……带头并劝勉同学努力学习，自己加权近90。参加校会，锻炼自己，不断成长，逐渐具备独当一面的能力。\n在学习之余，他还利用自己的空闲时间参加勤工助学活动。将一些小任务在碎片化的时间去完成，留出大块的空闲时间供勤工助学的活动安排。每周都会去韵苑公寓岗值班，去光电信息学院社区服务中心做助理。\n“不断努力，让我的肩膀更加坚强，可以勇敢的扛起自己的一份责任。这是这些支持这我，让我在求学的道路上可以走得更远。”自助者，天助之！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('438', 'U201314395', '何恒达', '光学与电子信息学院', '用梦想诠释生命，执着追求的是梦想也是存在的意义。在大学一年半的时间里，他挤出每分每秒奔跑在梦想路上，一点一滴，执着汇聚。\n小学混游戏厅混网吧，初中打游戏，高中成绩差。没有优人的天资，只有更多的付出，上课永远第一排，在光电信息公共项目实验室、DMET国重Focus团队，光弦项目组、国光学习团队课程，自学相关知识，做项目，学习Java、Javascript、Android、51单片机、蓝牙4.0开发、图像处理、地震波模拟、光纤传感、AD电路设计、VTK,每天看80-100篇论文调研，看遍TI论坛关于蓝牙开发的几百个帖子。执着追求的他是专业第六，获国奖，特优生，校三好，校科创优秀个人，全国生物医学电子设计大赛三等奖、中国数字家庭创意与应用大赛决赛优秀入围奖、“求是杯”大学生课外学术科技作品竞赛二等奖、“航空飞豹杯”电子智能大赛二等奖、“东莞工研院杯”创新创业大赛二等奖……他奔波于各个项目之间，作为启德创新创业孵化项目光弦项目组“宝宝守护神”核心组员，获全球创业周武汉站一等奖项目，获300万预融资，3000万估值；公共项目实验室“耦合谐振子”作品参加科学模拟展；作为组长组建One团队，主持光电公共实验室单项目，获得MOOC奖学金；在国家光电实验室国家支持计划子课题中国数字人小组实习，研究图像处理与三维可视化。\n梦想可能很简单，每个人的大学生活，不管是哪条路，一路折腾，一路感受，最后能无悔就好。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('439', 'U201313729', '陈健', '电子信息与通信学院', '大一上学期加入电信系小红帽志愿服务队，并于2014年6月起担任队长职务。 克服种种苦难，参与、组织电器义务维修活动20余次；挤出个人时间，帮助同学老师解决各种电脑、电器故障。\n担任小红帽队长期间加强团队建设，策划改革，为小红帽的发展竭尽全力。\n奉献知识，服务社会，我是光荣的小红帽！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('440', 'U201313635', '陈梦婷', '电子信息与通信学院', '从前，我是一个生活比较简单的人，因为当初的目标只有一个，那就是考一所好大学。所以从步入大学的那一刻起，我就告诉自己，我必须做一个全面发展的大学生。我必须拥有一个丰富的大学生活，这就是我一直以来执着追求的目标。学生工作上，我是班级助理，一直以来管理着班级的各种事务，被班级同学评选为优秀学生干部，还作为班级助理代表在年度资助大会上发言。志愿服务上，我从大一开始就一直随着小红帽这一组织四处进行志愿服务，成为我大学生活中难得的一笔财富。兴趣爱好上，我在辩论队投入了大量的时间和经历，看着辩论队一点一点的成长，是我最开心的事情。在专业学习上，我也非常重视，一旦发现有退步就会尽力赶上。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('441', 'U201313720', '代璐', '电子信息与通信学院', '我是一名来自河南农村的学生，父母工资不高，却既要供用我上大学又要养育年幼的弟弟以及赡养年迈多病的老人。而我为了减轻家里的经济负担，一方面好好学习，并于大二上学期获得了国家奖学金以及作为负责人申请到了大创项目，另一方面利用闲暇时间做一些校内外兼职，比如检查食堂，发传单来补贴自己的生活费。除此之外，我平常还会去做一些志愿服务，比如爱心卖报，清明节扫墓等等。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('442', 'U201313476', '李小雨', '电子信息与通信学院', '自从踏入这菁菁校园之际，我便立志要在这四年荏苒年华中锻造出一个优秀的自己。我坚信天道酬勤，对知识的执着追求是我学习的动力。大二上加权91.12 分，总加权年纪第三是对我汗水的回报。对数学的执着与狂热让我获得了概率论100、微积分上98、线代96……以及全国大学生数学竞赛省三等奖的成绩。然 而这都来之不易，需要辛勤付出、耐住寂寞、抵制诱惑、顶住压力。除了学习，常任班里学委、纸桥比赛、演讲沙龙、校十佳主题团会答辩、义工活动、创青春志愿 活动都有我忙碌的身影以及被认可的成绩。假期的家教以及各类奖助学金已经能让我在经济上独立，不给父母增添负担。而最后我想说生命不死，奋斗不止。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('443', 'U201413492', '汪畅', '电子信息与通信学院', '我热爱生活，我做事认真负责。\n作为学生，我在上学期取得87.64的加权分，专业排名第5；作为志愿者，我积极参加各种志愿服务，目前获得工时46个。\n我关爱•流浪动物——我坚持了一个多学期流浪狗救助活动，给小狗带去温暖，给社会传播爱心\n我参与•文明创建——我在昙华林参加社区卫生服务，两次投身于文明创建宣传工作，为武汉争创文明城市献力\n我助力•骨髓入库——我参加中华骨髓库培训会，普及骨髓库知识，帮助志愿者骨髓入库\n志愿服务虽会劳累奔波，但这些冲淡不了我心中乐于奉献的热情，我勇于承担社会赋予我的责任，也梦想着在志愿者的路上不断前行，成为一名公益达人！\n我奉献！我快乐！\n我热爱生活，我做事认真负责。\n作为学生，我在上学期取得87.64的加权分，专业排名第5；作为志愿者，我积极参加各种志愿服务，目前获得工时46个。\n我关爱•流浪动物——我坚持了一个多学期流浪狗救助活动，给小狗带去温暖，给社会传播爱心\n我参与•文明创建——我在昙华林参加社区卫生服务，两次投身于文明创建宣传工作，为武汉争创文明城市献力\n我助力•骨髓入库——我参加中华骨髓库培训会，普及骨髓库知识，帮助志愿者骨髓入库\n志愿服务虽会劳累奔波，但这些冲淡不了我心中乐于奉献的热情，我勇于承担社会赋予我的责任，也梦想着在志愿者的路上不断前行，成为一名公益达人！\n我奉献！我快乐！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('444', 'U201313614', '王艺帆', '电子信息与通信学院', '我喜欢技术，喜欢钻研，喜欢不断挑战自我。\n首先，作为学生，我的总加权成绩专业第二，英语四级614，六级548。大二上期拿到计算机三级证书。大一积极参加学生工作，协助组织了院十大歌手比赛、迎新晚会等活动。\n学有余力的同时，加入联创团队，与人合作开发了两款应用，一个在中国银 行的比赛中获奖，一个发布在百度应用市场中；另有一个网站正在内测，技术方面由我全权负责。加入校网研中心，目前正在参与学校部分网络系统的构建。掌握Java, Python, C, C++, JavaScript.....\n 生活方面，热爱运动，篮球台球乒乓球，虽不是样样精通，但也并不逊色。院系篮球赛每次必参加，迎新晚会也可以登台高歌。我总是乐于尝试新的体验。\n这就是我，执着追求着的，不仅仅是技术，也不仅仅是挑战本身，而是在挑战中不断成长的自己。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('445', 'U201316341', '阮泽慧', '管理学院', '一个不太成熟但却一直执着追求着的女孩人生，由一个个挑战组成，执着于塑造更优秀自己。希望与大家一同前行！\n学习：保持专业前30%左右的成绩，上学期加权88.11分，班上第2；\n学工：校团委组织部人力资源部主任；营销班副班长，成功争取“优良学风班”等称号；市场营销协会策划部部长；英协“荣誉之星”；大创部长助理；托业校园代理；\n专业：获得强生商业精英挑战赛团队第2名，600多人脱颖而出获得最佳个人；拿到强生5个实习绿色通道之一；\n英语：启明3C团队英文演讲组、模联组；校广播台英文播音组；IDEA英文辩论赛省三等奖等比赛；\n演讲：“院十大演说家”冠军；\n政素：首批入党积极分子结业证书；2014年“优秀共青团员“；“回访母校”团队；\n志愿：“创青春”海南大学志愿者、图书馆义工、启明特教看望自闭症儿童；\n思辨：院辩论队主力，多次成为如校园文化节“喻晓之巅”辩论赛“最佳辩手”、“优秀辩手”；\n艺术：8年舞蹈，精通中国舞；6年小提琴；1年钢琴；1年美声；连续两次“文体奖学金”；校艺术团合唱团；全国第四届大学生艺术展演合唱组一等奖；”校园好声音“省第2；\n主持：院主持人队；艺术团表演队；主持经验达十几场等。\n\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('446', 'U201216298', '王小雪', '管理学院', '为“她”执着——学习：从大一到大二，一年时间，加权上涨十分，大三学期加权升至专业第三；为“她”执着——组织竞赛：从商业公益团队副主席，到互联网团队产品经理；从求是杯创业竞赛，联合利华营销大赛，再到手机APP大赛，微信公众号运营，我都全力为之，力求做到极致。为“她”执着——公益实践：开展多个公益项目，积极参加社会实践，并坚持长期义工；为“她”执着——产品项目：从大学生求职系统，到校园图书馆查询系统，从“HUST奶茶时间”到一个个节日游戏，我都沉溺其中。我热衷书法，十年不曾间断；也喜欢跑步，从不及格，到第一名。但行好事，莫问前程。Dream！ Action！Persistance！是谓自强！我是王小雪 故事未完，精彩待续…', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('447', 'U201316418', '文雅茜', '管理学院', '从来不曾忘记，作为志愿者得到的那份最简单的快乐、最纯粹的感动。也从来不曾放弃，作为志愿者所拥有的那份坚韧、那份执着。中华骨髓库入库志愿者，寄托着延续生命的希冀。地铁义工，是将近一年每两周一次的坚持。中国市场营销国际学术年会志愿者，激发着一个人拼搏的劲头。创青春志愿者，是参赛队伍的指南针，让他们在偌大的华科校园绝不迷路。湖北省图书馆义工，是安静地穿梭于书架间的精灵，让所有书籍变得井井有条。献血志愿者，是对生命的热爱，是满怀一腔热血的注解。这些都是我，在平凡的生活中用一个接一个的志愿者活动延续着属于我自己的精彩人生。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('448', 'U201416071', '周小又', '管理学院', '我是来自一个山区热爱生活，积极向上的女孩。从小，爸妈为了生活外出打工，家里只有我和弟弟以及年迈的爷爷奶奶!才上三年级的我不得不学会自己照顾自己和年幼的弟弟!学着帮爷爷奶奶做家务!后来爸爸因为一个意外成了残疾人，家里的房屋又不幸的在地震中被毁，面对这些，我一边认真学习!力图使家里燃起希望，一边趁着每天放学的时间，回家帮忙背砖重新修建房屋，做一些力所能及的事来减轻家里的负担!面对家里拮据的生活，未住校时，只要一放学，我就去茶园帮忙采茶赚钱，上了高中后又利用假期在爸爸的工地上打工，现在的我积极参加学校的勤工俭学!虽然有点辛苦，但我我从未抱怨，只因为我相信，生活中的坎坷从来不可避免，只因为我相信，人虽然无法绝定自己的出生，但是却可以选择凭借自己的努力，改变命运!', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('449', 'U201415989', '邹兴', '管理学院', '他叫邹兴，一个以周星驰为偶像并对生活充满希望的人。他来自贵州一个偏远贫穷但却十分美丽的地方。从小的经历造就了他直接而又现实的梦想：“成为有钱人，并且帮助那些像他一样需要帮助的人。” \n他从高一时妈妈离家出走的巨大阴影里走了出来。也就是从那时起，他通过做兼职赚取生活费，以减轻爸爸肩上的重担。四年来他做过牛奶促销，影楼促销，在工厂打工，天马驾校校园代理等15多种兼职，虽然很累，但他从没放弃。\n他现在是校团委组织部助理，校资助中心实习助理，管理学院14级年级学生会副主席和工商班的班长。他热衷于公益活动，曾参加“吾爱吴泗行”支教，并且担当创青春志愿者。\n虽然至今家里已欠债5万多元但他一直在坚持。永不放弃，邹兴，雄起！\n他是一个讲故事的人，期待与你一起分享他的故事。\n\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('450', 'U201415673', '白玛曲宗', '环境学院', '她牢牢地记住了父亲的话“知识可以改变命运”。于是，12岁，小小年纪的她便背起行囊，远离故乡西藏，来到内地求学。但漫漫求学路，注定不会是一帆风顺的。在外读书期间，奶奶去世，母亲病重，父亲靠微薄的收入维持着这个家。面对种种打击，她没有一蹶不振，没有自甘堕落，而是选择了坚韧，选择了乐观，选择了正视眼前的困境。在高消费的上海，她只用500元便可维持一个学期的开销，并且偶尔还会寄钱给在北京上大学的哥哥。面对拮据困乏的物质生活，她执着地追求精神世界的富有，慢慢地从一个听不懂普通话的孩子成长为一名高校大学生。\n毁灭，还是生存？选择的权利在我们自己的手中。白玛曲宗，她用自己的选择诠释着什么是自强不息，什么是百折不挠。命运的不公压不垮她，生活的磨难打不倒她。相反，正是这些苦难成就了今日的她，让她的意志更加坚定，目标更加明确。她就是雪原里不畏严寒，傲雪挺立的一枝莲花，幽幽暗香飘来，那样清淡，那样高雅，又那样激励人心。\n\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('451', 'U201415975', '曹智', '环境学院', '家境贫寒并没有让他产生自卑，相反，在人生路上，他是一个勇敢的逐梦者。\n从班级到年级再到校级的各个组织中，都能看到他活跃的身影。作为班级团支书，他精心策划团会活动，团结班级同学。作为年级组织部部长，他尽心组织双旦舞会，并成功为环球争霸篮球赛拉得赞助，解决了资金问题。作为学校社联、大创的一份子，他用心完成每一项任务，获得了优秀个人的称号。\n丰富的阅历让他极具商业头脑。加入了wedo创业团队成为一名精英销售员同时为一家留学机构做代理，周六日还会去一家留学公司做实习生。凭借这些固定的工作，他不再向父母索要一分钱，成为一个真正独立的人。目前，他在为成立一家奶茶店而筹划。这是他的梦想，也是他们一个团队的梦想。他相信只要精心浇注，梦想定会开花。\n一路风雨，披荆斩棘，他如一位骑士，在逐梦之旅上一路向前。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('452', 'U201415696', '何长峰', '环境学院', '生活中总有许多坎坷和不平，但只有勇于搏击的人，才是生命的强者。何长峰，一个阳光般的大男孩，在遭到生活的嘲弄时，依旧向人们展现出乐观与自信。他用自己的实际行动，做出无畏的反击。\n母亲被检测出患有重病，高额的医疗费用让原本拮据的家庭雪上加霜。生活以痛吻我，要我回报以歌。正是这份积极向上的心态，让他的意志更加坚定，奋起读书，以最好的状态生活每一天。他参加实验室勤工助学活动，希望用自己的一份力量，来减轻家中的负担。他坚持武汉育校高中辅导班义务行志愿者活动，希望通过自己不辞辛苦的努力，能帮助更多需要帮助的人。天行健，君子以自强不息，对他来说，苦难不会打到一个人，反而会让人变得更坚强。\n自强者恒强，坚强的他在生命的舞台上演绎出一部雄壮的命运交响曲。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('453', 'U201216033', '李冬丽', '环境学院', '一家六口人挤过一间只有二十多平米的小房间，有时屋顶会漏雨，有时吃不上早饭，更有几次差点因为交不起学费而辍学。生活的贫困，不曾阻拦她追求知识的脚步，不曾浇灭她励志上大学的决心。她把苦难当成人生路上的垫脚石，永不轻言放弃。\n在最深的绝望里，总能遇见最美的风景。每一次险些辍学，都是周围好心人的热情帮助才得以延续十几年的求学梦。人只有经历了，才会晓得机会来之不易，才会懂得要倍加珍惜。同样也是大家的热心帮助让她由一个内向的小姑娘，变得外向，变得活泼，变得开朗，增加了对生活的热爱。从导游到义务解说员，从班长到民族部部长，她积极参加社会活动，尽心做好学生工作。如今的她在用自己的切实行动，回报社会，将爱的暖流传递。\n经过一次次与命运不屈的抗争，她用最美的微笑告诉大家，努力、坚韧、自信、自强，即使逆风飞翔，依旧可以飞的高远。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('454', 'U201316091', '毛鹏', '环境学院', '“没有过人之处，只好出过人之力。”刚刚进入大学时候的毛鹏，看着身边的人一个个如此优秀，而自己甚至连普通话都说不好，这样对自己说。\n为了弥补自身的不足，实现自我的超越，从此，他在学习上毫不懈怠，为自己制定学习规划，认真阅读各种课外书籍拓展自己的视野，网上学习名校公开课、百家讲坛，读书笔记足足做了六个笔记本；从此，他在学生工作上积极参与，加入团学联、资委会，成立华科杉树社，学校里的各种活动似乎都留下了他的身影；从此，他致力于社会实践，参加“青春创业行”、“青年马克思主义培训班”，参加“爱我中国，修我长城”千名学子保护宣传大型志愿者活动，在“创青春”中担任接待组的志愿者，奔赴江夏高中为备考学生做考前经验学习交流，两度回家乡做高中回访交流等等。\n他的努力没有白费，他的汗水收获了成果，国奖、校三好、2014年华中科技大学科创积极分子等等一项项荣誉光彩夺目。对此，他只是淡然一笑，不自傲，不自满，笃行于“心有所愿，行而成立”的逐梦之旅，怡然自乐。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('455', 'U201317341', '蓝婧', '新闻学院', '我是蓝婧，来自新闻与信息传播学院广告1301班。\n我的座右铭是“生如夏花之绚烂，死如秋叶之静美”，这不仅是我的精神追求，也是我为人处事的准则。我善于交际，常在各种活动中调动气氛带去欢乐；我自立自强，能靠自己的双手挣取大学生活的费用；我敢想敢为，会竭尽全力地做着我认为有意义的事情……我还有一颗真挚的爱心，长久以来积极地投入社会公益事业，尤其在关怀弱势群体和特殊人群方面做了不少贡献。\n从小学开始，我就参与了各种形式的志愿服务活动，比如学校迎宾使者、福利院演出等。印象深刻的还有加入我们市里面的“南康义工”组织，常进行园林清扫等活动。上了大学，我对社会公益和志愿服务更加充满热情和能量。我做过创青春活动志愿者、运动会志愿者、武汉创建全国文明城市督察员，也卖过义报等等。最让我感到骄傲的，是从微梦社工协会的会员到会长，矢志不渝地坚持着社工事业。我坚守“助人自助”，且深信要真正地帮助弱势群体和特殊人群，就应该努力让他们自己帮助自己，让他们找回自信和勇气，让他们拥有与正常人一样的生活。我会一直坚持社工和志愿服务，希望更多人加入这个行列，也希望我们的社会变得更加美好！\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('456', 'U201317345', '梁雅文', '新闻学院', '我是来自新闻学院广告1301班的梁雅文，目前是新闻学院资助委员会主任以及院系资助助理。我属于很外向的女生，而且时常不定期犯二，但是做事情还是比较靠谱的。作为一名资助委员，在来到华科的这将近两年里，我几乎组织并且参加过所有的义工活动。也许在很多人看来，这只是资助委员分内的工作。我和很多资委小伙伴一样，也觉得这些都是些小事。但是这一路走来，我真的不觉得有大家想的那么容易。腿摔伤了冒雨带着同学去省图做义工，清早去东大门领取报纸，冒着炎热去收集旧书，我相信这是每个资助委员都体会过的艰辛。这是我的工作，也是我的公益理想，尽管它没有那么的神秘和伟大，但是至少，这两年里，我一直在坚持，而且还将继续坚持下去。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('457', 'U201317347', '刘雅珺', '新闻学院', '我是华科新闻学院广告学专业的同学，来自河南省驻马店市西平县师灵镇的一个小村庄里。自强对于我来说是一件必须所以就自然而然的事情，因为条件不好，所以我热爱生活，渴望自强。从小学一个人步行到别的村子上学，到初中便开始了离家一个人生活，直到今天，从独立生活中收获了很多。家庭无法选择，我就只有自己努力，好好学习，所以我走出了小村子，我为自己骄傲。初中高中的奖助学金给了我很多帮助，来到大学，我为家庭分担的想法有增无减，我做了许多兼职，戴尔课戴表，一年的优秀表现换来了实习证明的肯定，发传单，饮料查核员，在学校超市勤工助学，西瓜帮兼职，做家教，这些带给我的不仅仅是经济上的满足，更多的是一种充实多彩的感觉，丰富的经历，我有能力靠自己。可是兼职并不可以成为大学生活全部，院会宣传部有我的足迹，跆拳道协会有我的表演，做过志愿者，马路义工发报纸昙华林义工都有我的身影，回访母校很成功，同时我的成绩在班里也不错，四六级已经通过但仍然要努力刷分，还报了双学位。所有的这些都是我热爱生活的结晶。我喜欢接受我们不能改变的，改变我们可以掌握的。平凡而不平庸，自强而不息，努力而积极，热爱生活，这就是我。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('458', 'U201317302', '张晓娜', '新闻学院', '从初二开始，就立志成为一名记者，第一年高考没有被自己喜欢的学校录取，顶着各种压力去复习，后来如愿进入了我校新闻专业。当时学新闻，爸妈是不支持的，他们希望我可以学会计或者财务类的，以后就业工作会更合适，但一心想读新闻的我最后还是说服了他们。进入大学后，加入记者团，成为了我目前做的最正确的事情，一年来，累计发稿40多篇，并在楚天都市报，楚天金报等平台多次发稿。\n充分利用寒暑假时间去媒体单位实习。大一暑假在石家庄日报文体部实习一个月，发稿量11篇，其中《铁嘴钢喉为戏狂——访京剧名角康万生》在单位评为了好稿二等奖。得到了指导老师的好评。大二寒假，离校后第二天就去石家庄电视台新闻综合频道实习，为期3周的实习让短暂的假期充实了很多，去地铁工地、爆炸现场等地的采访经历让我对新闻工作的了解更加深入，更加坚定了自己成为一名新闻工作者的决心。\n这个职业固然免不了奔波劳累，但是每天都有新鲜内容，见不同的人，见各种各样的事情。今天所见所闻所写下新闻就是明天的历史，这份神圣感足以使我满足。 ', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('459', 'U201214534', '谭资昌', '自动化学院\n', '我来自湖南株洲茶陵县的一个小乡村，家庭贫困，父母自我两岁的时候便到西藏打工，常年在外，记得最长的一次父母5年才回家一次。父母不在，爷爷奶奶年迈，从小我就成了家里的顶梁柱，自立自强。不到10岁，我就开始下田忙活，种地种菜，上山砍柴。虽然父母常年不在家，但是在学习上，我从小就十分自觉，从小就上进努力。从一个不知名的乡村小学以全乡第一进入县城中学学习，中考时再次以中学年级第一考入县重点中学，不放弃的我一直没有松气，最终以全县第三的成绩考入华中科技大学。由于高中教育水平落后，在大学，经过不懈努力，我将综合成绩由倒数第二变为正数第二。最后拿到了国家奖学金，启明学院特优生，校三好学生等等。数模竞赛零起步，自学MATLAB，lingo，数学模型相关知识，所用数模的资料达到几个G，基本上80%的论文我都看了至少两遍，一个暑假，两次练习赛，一次正式比赛，我和我的队友最后那两天都不会寝室，累了就睡在启明12楼的地板，醒了就继续干活。最后我们队伍拿了全国大学生数学建模竞赛的国家一等奖。我认为自强，是一种自我超越的气质，它来自于你内心想要变得更加优秀的那种强烈的渴望，这种渴望，让你在逆境中从不放弃，在顺境中从不止步，让你不断的超越自我，越变越强！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('460', 'U201214418', '张梦颖', '自动化学院\n', '在大学伊始，我就加入了援之缘支教协会，想要为山里的孩子们做些什么。因为喜欢孩子，我积极参加协会举办的周末课堂活动，利用周五下午的时间，给武汉周边小学的孩子们带去英语趣味课堂的教学。往返的路程比上课的时间还长，但觉得很值得。看着孩子们的天真笑脸，让我觉得放松。在2014年3月，我报名参加了援之缘支教协会暑期志愿者。经过4选1的残酷的两轮面试，再到长达三个月的培训，我来到甘肃古浪酸茨沟村在大山深处，睡在教室的桌子上，吃着半生不熟的饭，每天在烈日下走两个小时送孩子们回家，中暑吐得站都站不起来，没有手机，没有电视，没有网络，我坚持了下来，换来的是孩子们一句“张老师你一定要回来……”；在上学期间，我也一直坚持我们学院的无工时活动——养老院之行，并获得自动化学院“优秀志愿者”称号。每个周日的早上,在别人还在睡梦中的时候,我已经在走在去养老院的路上。印象最深的就是给老人洗脚，老奶奶的脚又干又瘦，因为长时间没有清洗已经有可以看见的污垢，脚趾甲有着厚厚的增生，连看护人员都不愿意为她清洗，在我们为老奶奶洗脚的时候，她一直在说：“好舒服，好舒服，谢谢你们，谢谢你们。”我在“创青春”全国大学生创业大赛中作为会务组志愿者，任第三组组长，起早贪黑活又多，没有固定的时间，工作地点，更需要随叫随到。做志愿者，只因为双眼曾经看见过苦难，就再也不能视而不见，我相信，再微小的职位，也会因为你的用心而出彩。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('461', 'U201214551', '陈东东', '自动化学院\n', '我是一个臭小子，对于一件事，如果我觉得有价值，便会尽全力。工作上，我全力以赴，去年，我和一群\n好朋友一起到汉口小天鹅酒店的社会人聚会现场，去为一个小学的图书角拉赞助，我们和他们素不相识，\n就凭我们做过的事，真诚的心，诚恳的态度，最后获得了4500元的赞助。学习上，我全力以赴，大二上，\n我是班级10多名，加权只有85，大二下一学期，我疯狂努力，加权92.69，提升了将近8个加权，最后才有\n机会参评国奖。生活上，我全力以赴，朋友来找我玩，我白天陪他玩，晚上在电工基地刷夜做课设。我喜\n欢全力以赴的感觉，我喜欢年轻人身上具有的热血与激情，我要实现我的“价值青春”。全力以赴，它是一种态度，更是一种行动，认定了，我就一定全力以赴，否则，我就不叫臭小子。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('462', 'U201314734', '龚桂良', '自动化学院\n', '我出生于农村家庭，四岁母故。现家里还有三姐妹，父亲已入花甲之年，下岗务农。两人读书。为尽量减轻父亲的负担，不负父亲的期望，一直刻苦学习，积极争取奖助学金，并利用课余时间和寒暑假做兼职。\n大一上身兼三份兼职，白天作为学风督察员课间查课，晚上作为楼栋协管员守楼，周末在街道口坐咨询台。大二为学风督查组组长，并参与华科小麦公社物流团队的创建。大学以来靠自己的双手买了手机电脑，交大二的学费和支付大学一切生活费用。与此同时我合理安排好学习时间，大一上获得了加权88.67，专业第三及大二上加权90.5的成绩，通过了CET4和CET6。获得过“新生学习优秀奖学金”、“自强奖学金”、“自强之星”以及“国家励志奖学金”。大学以前对电脑的认识仅限于高一每两周一节的计算机课。甚至于大学刚开始连基本的复制粘贴都不会，找电脑电源键要找半天，更何况下载东西。与电脑有关的课都让我很焦虑。但是我没有自弃，通过认真听讲、自学和实践，不光熟练掌握了基本办公软件的使用，对于AUTOCAD、PCB、PS等都有了一定的应用技能。C课设虽然很难，但是我没有退缩，通过多问常优化，以个人近4000的代码量获得了A的成绩，在C语言课程设计大赛中获得了“三等奖”，通过了国家计算机等级考试二级。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('463', 'U201214415', '周 杰', '自动化学院\n', '我出生在西部的农村里，从小家庭经济就开始走下坡路，小时候因为没钱看病与死神擦肩而过，从小体弱多病，因为没有钱，营养跟不上，缺钙导致了现在的“罗圈腿”，但是贫困的家境不仅没有磨灭我的意志，反而让我更加坚定了奋斗不止，自强不息的信念，后来跟随在浙江务工的爸妈，进入到了当地初中读书，随后以优异的成绩考入省级重点高中，就在对自己的前途充满期待时，被告知无法在浙江当地参加高考，无奈之下只有辗转回到四川，面对教材不同，时间紧迫的双重挑战，最终顶住压力，以优异的成绩考上华科大。上大学后更加严格的要求自己，不断提升自己的综合素质，然后又一次意外来袭，14年末父亲因突发脑溢血去世，家里的重担突然一下子几乎全部落到了我的身上，但是勇敢的去面对了这个事实，一方面要照顾和关心家里的妈妈和爷爷，另一方面是自己的学业，学习之余还会去兼职赚钱，但我相信，唯有勇敢的面对，自强不息得奋斗，才能真正的走过这个坎儿，走向更美好的生活。\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('464', 'U201216746', '刘智浪', '人文学院中文系', '三年来，在大大小小的公益活动中，收获了成长与快乐，公益绝不止那些看的见得行动，更重要的是，一颗奉献的心。在帮助与给予温暖中更加感受到，这所学校，这个城市，甚至这世界，大爱仍然是众生人类的最深层的善意。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('465', 'U201316761', '白  彬', '人文学院中文系', '在经济拮据和病痛的双重压力下，我仍然积极面对，克服贫穷与病痛，通过大一大二兼职和学校的帮助，自上大学以来，从未向家中索要过大学生活费。从大一至今，除了上大学需要的学杂费住宿费及双学位的费用是由父母提供的之外，自己解决了在校期间所有的生活开支，同时又兼顾学习和社团工作，创造出属于自己的骄傲。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('466', 'U201216722', '李永芳', '人文学院中文系', '从大一的迷茫到现在的坚定，我一直很清楚自己究竟走过了怎样的路。策划执行学生活动是我大学四年最执着的追求。大二受vivo公司邀请，作为第一创始人从无到有建立了vivo 俱乐部，传达vivo“乐享极智”的品牌观念，也许你对vivo club尚不熟悉，但你一定对去年秋天的荧光夜跑和摇滚狂欢节记忆犹新。非常荣幸能在大学期间承办一次影响幅度近万人的活动，作为第一负责人在一个月的时间内对我而言意义重大校园活动的经历让我对自己未来的职业发展更有了清晰地定位与规划，璀璨的成绩更是让各种好运接踵而至。我始终相信，梦想之花，须以孤独和寂寞的土壤栽种，须以坚毅和汗水浇灌，终得绽放！苦心人，天不负。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('467', 'U201416732', '古绍英', '人文学院中文系', ' 莫欺少年穷。也许，是出生于贫困的农村家庭，也许，是作为家里的大姐姐（虽然有一个大哥哥），也许是生活的磨砺，也许，是自身先天乐观的心态，铸就了我自强自立的性格，用自己的双手为自己铺一条去往灿烂未来的路。上大学期间，我除了学习之外还去做义工、兼职，想办法自己为自己做点事情，减轻家里的负担。这个学期，我争取到了学校的韵苑党报岗，虽然收入微薄，但是起码可以给我一点点额外的经济来源，暑假打算做暑假工，可以赚点钱。同时，省吃俭用，应该可以度过更好的学期了。\n\n', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('468', 'U201216876', '毛鸿伟', '法学院', '他是执着追求梦想毛鸿伟，脚踏实地，一步一个脚印，在校园各处留下沉思记忆的身影。他的大脑时常如发动机般飞速运转，时常如罗马宫殿般包罗万象，时常如海洋公园般奇谲万千。年仅二十岁，却已是饮誉脑力界的世界记忆大师；自觉资质平平，却能与全球顶尖记忆高手一争短长：赤手空拳，却带领华科记忆团队参加国际比赛并为国家、学校和个人争得荣誉。作为法学院成立以来第一个参加官方国际比赛的学生，他用汗水和荣誉诠释了“敢为人先、追求卓越”的武汉精神。而这一切，皆因挑战人类记忆极限的冲动。现在的他刻苦学习之余，也积极开办讲座用自己的记忆方法回馈老师和同学······乘风踏浪，追逐梦想的赤子之心怎会停歇？', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('469', 'U201316856', '黎立铭', '法学院', '他是孩子们眼里有些严肃的大队长，总是在谈得欢天喜地的时候板着个脸；他是敢爱敢拼，用行动传达对家乡热爱的联合会会长。服务家乡，看上去简单微小，但却不知道凝聚了他多少的汗水和心血。开始总是不易的，不知道熬了多少次夜，放弃了多少喜欢的事情，花费了多少的口舌才组建起这个团队。发展总是艰辛的，不知道经历了多少次部门改革，遭受了多少次学校的拒绝，投入了多少时间和精力才塑造出团队的精魂。但努力也总是有回报的，看着宣讲受众人数一点点的增多，长江日报-最武汉项目公益活动拔得头筹，联合会慢慢地壮大，家乡，公益，这两个词从此紧紧相连，只因那些梦想，曾经也是支撑你我勇敢走下去的力量。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('470', 'U201316842', '杨扬', '法学院', '顺应自己的内心，助人爱人，实现自己生命的价值！善，是受家人影响，更是本心所愿。怀揣志愿者服务之梦，她未曾停歇！她是一个热衷于志愿服务的女孩。从大一起就在各种志愿活动中忙碌穿梭。绿意环保、社区阳光行、守望马吉米……都可以看见她忙碌的身影。一次次志愿服务让她在迷茫的生活之中找到自己存在的意义，也让她明白什么是坚持，什么是合作，什么是感恩……在校园时，为周边社区回收旧物、家电维修，倾力号召社会环保；在守望马吉米时，她到云南的山村里扶贫，考察经济发展情况，为孩子们学习生活提供帮助···很多的行动很多的辛劳，给他人温暖的同时，她的心也变得充实。她说，把志愿活动做下去，将爱传递，这是她的信念，是她不能抛却的责任。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('471', 'U201316901', '张周娟秀', '法学院', '我是法学院1301班的张周娟秀。两年来的学生工作，带给我许多锻炼，收获经验。两年来，我担任了法学院学生会副主席、法学院年级会副主席、法学院资助助理、法志二版负责人、法学院微信公众号负责人等。从一个什么都不懂的小孩成长为一个能够独当一面的干部。法学院公众号的微信娘，感受到新媒体的力量，以及互动的那份快乐。当然我学习也未曾松懈，利用平时时间阅读书籍，以及去法院实习和做法律援助，将理论运用于实践之中。平日里参加一些线上读书会和讲座，和五湖四海的朋友们谈读书，谈人生，收获颇丰。兼职家教、校印通代理，出售试卷，也锻炼了我的沟通能力和自力能力，减轻家庭负担。不忘初心，方得始终，哪怕做的只是很微小的事情，也会产生很大的能量！相信自我，执着追求！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('472', 'U201417269', '欧斌', '软件学院', '我叫欧斌，软件学院软件工程专业14级1405班学生。从小就寄养在农村的姑姑家里，一直到十岁的时候母亲回来建房。十岁的时候母亲带着弟弟回了老家建房，找不到工作，仅靠父亲在广东的微博工资支撑，日子过得非常拮据。为了补贴家用，我就自己每天放学去街上捡废品来买钱，晚上就在家编绳赚钱，后来母亲突发脑溢血，花掉了家里几乎所有积蓄，但我从未被困难击倒，初中和高中都艰难地挺了过来，高考后我打工自筹学费上了大学，在大学里我依然未曾停步。困难和贫穷磨砺了我，我用自己的懂事和坚强追逐着自己的梦想，所有的困难都是我成功路上的垫脚石。学院老师和同学的关心和帮助让我铭记，一定要感恩生活，用拼搏诠释青春，用奋斗激扬梦想。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('473', 'U201417187', '董卓然', '软件学院', '天行健，君子以自强不息，不断向上是我永远的执着追求！自从踏入校园我便立志要在四年的荏苒年华中锻造出一个更加优秀的自己，以实现出国读研的理想。想要出国，不仅要有高的加权，同样要有过人的素质。在校期间，我热心学生工作，加入了学生社团联合会公共关系部及软件学院团学联外联部，这不仅使我更有责任感并且也让我在人际交往和为人处世方面成长了不少；在学习方面，我获得过新生学习优秀奖学金；而社会公益方面，我则积极参加义工、志愿者活动，曾参加“培智”活动义务帮助有智力缺陷的孩子，也曾成为过“创青春”志愿者为比赛选手提供服务。我努力提高自身的素质，不仅仅是为了实现出国留学的理想，更是为了成为一个更加优秀的人，我虽平凡，却不甘平庸，我虽愚笨，却满腔热血。不忘初心，方得始终，这不仅是对自己的激励，更是我对自己的负责，所以我才会在自己忙的没日没夜的时候也会咬牙坚持下去，在挫折将我折磨的遍体鳞伤时也会勇敢前行。我想，坚持与执着早就成为了我的一种习惯，成为了我骨子里的奔腾血液，让我在追求理想的道路上披荆斩棘，最后不论成功或失败，我只求，青春无悔！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('474', 'U201417268', '刘韬', '软件学院', '\"生活就像海洋，只有意志坚强的人，才能达到彼岸。天行健，君子当自强不息；地势坤，君子以厚德载物。或许，是上帝觉得这个世界太过无聊，然后就把他给放了下来。或许，是上帝觉得这个世界缺少生气，然后就把给他放了下来。也许，他改变不了世界，但是他会尽自己的努力去做好自己的事情。如果不去做点什么，那么世界会被那些你所讨厌的人占领，他如是激励自己。虽然被喊作高富帅，但是他知道自己和这些并不沾边，那只是一个理想的自己。我会努力，我是刘韬。\"', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('475', 'U201417199', '龚攀印', '软件学院', '没有比脚更长的路，没有比人更高的山，很小的时候，在其他孩子还在嬉戏玩耍的时候，我就开始干农活、做家务。插秧苗、喂猪、烧火做饭、弄菜，很小的时候就开始承担家庭所赋予我的责任。虽然面对种种困难，但我始终相信阳光总在风雨后。生活中，学习上所遇到的打击只会成为他宝贵的人生财富。看到父母双亲在烈日下辛苦工作，他告诉自己，一定要有出息，一定要让父母过得幸福。刻苦专研，勤奋好学，态度端正，目标明确，我会用一颗坚强而乐观的心去面对未来的挑战与挫折。我感恩学院师生给他的帮助，我也会尽力将这种好的风气传递下去，帮助社会上更多的需要帮助的人。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('476', 'U201417210', '符明韬', '软件学院', '我是符明韬。爱好挺多，唱歌，打乒乓球，轮滑，弹弹吉他。性情挺温和，所以和很多人都挺玩得来的。我是班上的班长，我在处事这一块倒是自认为有点想法。有时候听见别人说什么“你是X长还是我是X长”，“我都没说，你有什么发言权”，等等，这之类的话。我在想，如果别人对我说，还真是接受不了。所以不管我当了什么，不管别人是不是觉得我很有能力，我都一直是相当谨慎、谨于言，因为，语言的杀伤力真是相当大的。一直这样走过来，努力和别人打成一片，不会有什么人讨厌我，大概是大家支持我的原因。我经常想起老师的一句话，“成功的人，往往不是那些才华横溢的人，而是能以最和蔼的态度赢得别人认同的人。”“男人，要对自己狠一点。”我觉得这话挺犀利的，尤其是现在，没人逼你，自己如不狠点，估计周末都要在被窝度过了。我热爱生活。我的生活总是充满了音乐（话说最近有两场唱歌比赛，我都报名了，祝我好运），洗澡，洗衣……嘴上从来没有停过。有人说：“人总是忍不得身边的人优越。”而当我看到别人好时，会真的从内心感到高兴。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('477', 'U201316918', '田丹盟', '社会学系', '我来自农村，原籍陕西省丹凤县，现住河南省尉氏县。是一名中国共产党党员。在学习上，我力求出类拔萃！因为原籍和现居地口音的不一致，导致我的普通话和英语发音都不标准!为了克服这些，我苦练英语和普通话。最终以89.7分取得普通话二级甲等的成绩，并顺利通过了英语四级和六级。 专业成绩更是不容小觑！加权成绩从大一时的86＋到现在的90＋，终于获得国家励志奖学金。在工作上，我也丝毫不敢懈怠！从“部门之星”到“优秀部长”再到现在的团学联副主席，从科创基地干事到现在总负责人，在学生工作上我也在尽心竭力地付出着，同时我也收获了纯真的友谊和感人的经历。在实践上，我多次承接校级的调查项目，获得经费和物力支持，并取得了优异成绩。在公益上，我力求不懈努力，勇于奉献。多次参加义工活动，一年半来工时达61小时。同时，我在寒暑假期间也多次参加家乡的公益活动，获得“尉氏县十大杰出青年”提名。在兴趣上，我多次参加辩论比赛并取得“飞航杯”季军的成绩。为了有朝一日能在大学执教，改变自己和家庭的命运，并通过知识为他人提供帮助，我必须不断充实自己，执着追求，不懈奋斗！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('478', 'U201416675', '殷佳', '社会学系', '我是殷佳，出生于安徽农村一个贫困的家庭，母亲体弱多病，却为了生计不得不去做零工，父亲常年在外打工，一年难回一次家，我和母亲将弟弟抚养长大。但贫苦更坚定了我摆脱命运枷锁的信念，母亲也从未放弃对我的栽培。从农村到乡镇再到县城、省城，从幼儿园到小学、中学，每一步的跨越浸透了血水、汗水与泪水。大一上学期，加入团学联办公室、院系资委会、校会外联部 、广播台多个部门，培养锻炼自己的能力，工作认真负责，表现优秀，获得部门之星称号；学习上，病痛反复发作，不能行走，依旧坚持上下课，成绩良好；参加多种公益活动，获优秀志愿者称号；暑假通过网络平台做了三份兼职，导购员，发单员、信息采集员，寒假在家煮饭做家务，照料弟弟。大一下学期，成为院系主席团助理和勤工部部长，获得新生自强奖学金、新生社会公益奖学金，在五四演讲初赛中取得第一名成绩。同时在校医院医保办做助理，负责材料收集，数据录入。大学以来，我并没有做过校外兼职，因为身体和年龄的原因，我更希望通过学校的勤工岗位和自己学习所获得的奖学金帮助父母减轻负担。平时生活中也勤俭节约，不攀比，积极乐观，阳光友善，不因贫困而自卑，坚强勇敢，努力让自己更优秀。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('479', 'U201416694', '孙玉磊', '社会学系', '我来自农村，初中以前我的学习一塌糊涂，从来没想过大学。但是初二时我逐渐明白我不能再像父辈那样活着，我需要的是另外一种生活，我知道有一个更精彩的世界等着我去追寻。因此我以全校第一的成绩考入我们区的高中，并在高中连续三年获得“三好学生”，区“十星优秀学生”然后又以全校文科第二的成绩考到这里。进了华科，我知道我的高考成绩是最低的，仅仅正好是华科在山东录取的最低的分数。因此学习上我不敢懈怠，我会经常上自习，并比别人提前一个月进入复习状态。最后，期末考试也取得年级12的成绩。我希望能够学好社会学，尽自己所能成为一个未来的社会学家，因为中国社会仍然存在着许多社会问题。仍有很多人的思想比较落后。我希望尽自己所能改变现状。我加入了社会学系团学联。主动培养自己的工作和人际交往能力。我也坚持做紫松公寓岗和校园宣传两个兼职，希望能尽可能的少花父母的钱，逐渐独立。作为一个大学生已经成人，不能总花着父母的钱在大学自己享乐。我希望我能尽自己所能成为一个，积极上进，拼搏努力，有独立思想，勇于承担社会责任的优秀当代大学生。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('480', 'U201416662', '杨常', '社会学系', '我是杨常。我加入了龙舟队，经过一个半月左右的刻苦训练，在新队员中脱颖而出，有幸与老队员成为赴海南参加中华龙舟大赛的一员。我在龙舟队一直刻苦训练。晚训在韵苑体育馆那，晚上则需要东西往返跑，大冬天也能骑出汗来，经常是带着一身汗在熄灯前回到寝室。遇到晚上去游泳馆划桨的时候，我的背包总是比别人鼓好多，因为里面塞着我需要换的衣物，为了练出成绩不湿身不舍身取义那是不可能的。夏天大汗淋漓，而大冬天的时候经常是冻得瑟瑟发抖。每周周末下午骑东湖下湖训练，比赛要集训，不管是曝露在烈日下还是经受着风雨的敲打，我都咬牙坚持下来了。去年冬季与今年开学3月份天气还比较冷，为在中华龙舟大赛中取得好成绩为校争光，我们一船人无论晴天还是下雨都泡在冰水中，顽强拼搏，上岸后手脚麻木。我擅长长跑，在校运动会上取得了800米与1500米第一，两次代校参加中华龙舟大赛分别取得了第二、第三名的成绩，还获得了2015年华中科技大学冬季越野跑接力赛女子自由组第二名，取得代校去北大参加比赛的资格。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('481', 'U201416802', '吕晓丹', '公共管理学院', '穷身不能穷心。唯有乐观、坚强、毅力、爱心、自力自强才可以助我走得更高更远。吕晓丹来自广东的一个大家庭，家中五位兄弟姐妹，每年的学费、生活费成了家里的重大负担。懂事的她从六年级的暑假开始假期兼职，知道现在六年过去，她仍在坚持，她说：“别人的假期是我的另一个工作日。”十二年的读书生涯，她一直坚守在班长的岗位上，她在管理班级事物的过程中提升自己，用她的坚毅，乐观感染着周围的人。入大学一学期，她多次参加志愿服务活动：看望流浪小动物、无偿献血、义务守楼、捐献骨髓、看望敬老院老人。她不断用她的方式在传递爱心。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('482', 'U201416792', '郑博豫', '公共管理学院', '郑博豫来自河南省桐柏县的山村里，家中还有念书的弟弟妹妹和年过七旬的爷爷奶奶，父母都是农民，收入微薄，家庭经济负担大。郑博豫从小刻苦学习，努力奋斗，从乡村小学走进华科大。从小学四年级开始，她利用假期割艾蒿补贴家用；初中时，她用双手扣稀泥、捡冬虫帮父母分担重任；中考后，她在烈日曝晒下发传单争取生活费；来到华科，她早出晚归，刻苦学习，积极参加义工活动。她一直用严谨的态度自律，不断进步，并尝试做兼职来充实自己的生活，减轻父母的负担。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('483', 'U201317063', '李婉瑜', '公共管理学院', '李婉瑜是公管学院资委义工部部长，她有一颗热爱公益的心，入学两年，她参加了多次义工活动。2013年：国庆节，她在武昌火车站做了三天的义工；11月份，她参加学院组织的长期义工——红绳结义，一直坚持到现在；12月份，她参加中国结义卖活动，为山区孩子筹款。2014年：3月份，她参加了敬老院义工；5月至6月，她完成“旧书圆新梦”的三轮收书；7月份，她赴秭归周平小学支教。2015年：国庆节，她参与义务守楼栋的志愿者活动；校运会期间，她担任两天的志愿者工作。义工活动培养了她乐于奉献的精神，教会她如何坚强勇敢，在爱与奉献中，她渐渐走向自强。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('484', 'U201216995', '邓洪波', '公共管理学院', '邓洪波一直执着向前，追求卓越，在学习成绩、学生工作方面都表现优秀。他在学习上认真刻苦，曾获得2013年学优奖学金、单项奖学金，2014年文体奖学金；他负责和参加的多个课题多次获奖。他在学生工作方面尽职尽责，2013年当选为团学联主席团助理，2014年当选为团学联副主席、行政班班长；他先后荣获校优秀共青团员、校优秀共青团干的称号。此外，他积极参加义工活动，曾赴云南江城、湖北十堰等地参加社会实践，多次被评为优秀个人。他追求全面发展，积极主动的参与各项活动和课题研究，同时，不断进取，2014年成为预备党员。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('485', 'U201216515', '龚雅键', '经济学院', '让中国因为知识而改变，这是他立下的志向。在他人眼里，他是大神；在队友眼里，他追求卓越、始终如一。他率队夺取美国（国际）数学建模大赛特等奖提名奖，成为全校本年度最高奖项，而这背后是他没有基础、闭关一个月翻阅34本书的经历。他埋头于经济学新兴的量化投资领域，博采自然科学之长，完成的成果已有部分应用于行业内。勤奋和高效使得他在完成三组科研项目的同时，始终保持着专业第一的成绩。他先后获得两次国家奖学金，被评为启明学院特优生、获得全国曾宪梓奖学金。他家境贫困，禽流感对市场造成的不景气使得家里的养鸡场负债累累，社会各界的帮助让他也怀揣对志愿服务的热心：在校外，他是中国下一代教育基金会和北京天堂河戒毒的所志愿者；在校内，他是班级的资助委员。两年的资委任上，他踏遍了学院所有的义工基地，图书馆、市郊小学、养老院、地铁站、社区，每一次服务都收获满满。勤奋好学、视野广阔，他的经历曾使他获得中国银行的认可，获得全额资助参加赴美游学，他说：美国是世界的骄傲，中国则是世界的未来。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('486', 'U201216522', '郭子琪', '经济学院', '她是经常被东十二的阿姨扫地出门的本科生，也是研究生学术圈里被称为的菜鸟；但她有一颗担起中国青年责任的大心脏，担任“青年中国行”全国指导团队全程志愿服务，为的只是唤醒更多青年的社会责任。她是华中科技大学“三下乡”的优秀实践个人，也是麻省理工学院赴华交流的优秀志愿者。热血和执著使得她身影一直活跃在地铁站、特殊学校、社区等武汉大大小小的各个角落，责任与专业让她亲赴大山深处走访各类大小企业的工厂。不断的尝试和摸索，她意识到“经世济民”不能只是一句口号，她从新的视角出发研究和解读中国的贫富差距问题，为使政策走向社会最广大的人群发出更有力的声音。其实她是一个小女生，疼痛和虚弱曾长期困扰着她的身体。因为手指多次注射，有很长一段时间写字对她都是一种奢侈，然而她在实践中仍然勇于担当，在学习上仍然勤奋努力，她的加权成绩都始终保持在专业前三；同时也是两项SRTP的负责人，研究领域从国内跨到了香港、从市场资金跨到了市场投资者；即使是在握笔都很痛苦的四级考场上，她仍然坚持完成、并且取得599分的成绩。她说：我不知未来有多远，但我一直在路上。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('487', 'U201316571', '李云帆', '经济学院', '我从一个走路永远低着头，遇人从不打招呼的灰暗女孩一步步走来成为学生创业公司的营销公关总监，从一个因讨厌自己夜夜躲在被子里流泪的脆弱丫头一点点蜕变成为大家公认的爱笑的坚强女孩。这一切仅因为一颗永远执着追求的心......在专业课上，我一直位列学霸云集的金融学专业前5/70，并荣获多项奖学金。撰写论文《中国P2P网络小额贷款模式研究--基于红岭创投的案例分析》，得到导师高评，已投递至全国研究生案例大赛。在意志磨练上，眼睛曾两次手术，整整半年，用眼不到10分钟眼睛便隐隐作痛，但我用顽强的毅力克服了长达半年的眼疾。在团队协作上，我带领六个女生克服重重难以想象的困难在武汉市大学生营销大赛上，取得了第八名的好成绩。另外，我加入优秀的学生创业公司，敢闯敢干，用信心与实力挑起营销公关的大梁。逼自己参加演讲大赛，主持人大赛，ACDR明日职场之星大赛。另外参加大学生证券投资大赛，金融知识竞赛，北大汇丰金融电子产品大赛，求是杯数模大赛等一系列金融相关大赛。并已经过自己的努力做过实习，得到了其农行行长的赞扬与嘉奖。目前得到第二份实习机会，并被选为学生代表参加湖北消费金融公司的开幕式。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('488', 'U201116283', '薛克兢', '经济学院', '在学习方面，我获得了国家奖学金，校三好学生，启明学院特优生，优秀共青团员等荣誉，并参评校三好学生标兵，并于大四赴美加州大学圣地亚哥分校交换。在班级建设方面，本人于大一大二担任班级团支书，管理班级日常事务，带领全班积极筹备特色团日等一系列活动。在文艺活动方面，大一时我加入了华中科技大学摄影协会。同年我也成功加入了华中科技大学记者团。大二上我成功担任华中科技大学摄影协会副会长兼宣传部长。在大二一年，我担任导演兼摄像拍摄过校庆微电影，参加过蓝天剧社话剧并出任男一号，参加经济学院十大歌手大赛并成功获得院十大歌手称号。并于大二下学期加入我校冰岩作坊，并于大三担任冰岩作坊产品组组长。而在大三下学期，我参加了华中科技大学校十大歌手比赛并成功获得校十大歌手称号，并参演了经济学院院庆活动。在竞赛创新方面，本人于2013年暑假参加了“百度开放云编程马拉松大赛”并以总分第一的成绩获得了“绿色创新应用大奖”，同年9月，本人又参加了“搜狐云引擎编程马拉松互联网应用开发大赛”并获得优秀奖。在科研创新方面，本人作为项目负责人的“外联帮云平台建设与发展”项目入选启明学院创新创业学科交叉项目，并获得国家经费0.5万元。', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('489', 'U201316587', '杨奎柳', '经济学院', '我是杨奎柳。我来自广西的一个单亲家庭，从小只和妈妈相依为命。日子清贫幸福的同时，伴随的是难忘的经历：自闭症、车祸、骨折以及他人的轻视。索性的是，这一路上都有最亲爱的妈妈在陪伴着我，支持着我。但上天对我似是不公的，在自己最难熬的高三时期妈妈却病倒了。“淋巴癌晚期”，面对这突如其来的打击，是我虚弱却坚强的妈妈鼓励了我，发奋读书，最终进入大学。大学，在那么青春美好的时期里，我努力的充实自己，改变自己。身边有朋友，远方有亲人，这一切，都像梦一般那么美好。可是，梦始终有破碎的一天，唯一陪伴着我的亲人走了，我的妈妈，再也回不来了。那段日子里，思念妈妈的我时常莫名流泪，脾气阴晴不定，自己甚至有了去看心理医生的念头，最终，自己在朋友们的帮助下走出了阴影，开始新的生活。“英语四六级”、“计算机二级”、“党校学习”“发展经济学论坛志愿者”“接触零距离义工”。这些，都是我这一路上沉甸甸的果实啊。一路走来，我感慨生活的艰辛，抱怨命运的不公，但却从未向命运屈服，我想，只要以乐观向上的心态去面对一切，生活中的喜怒哀乐都会变成人生中最宝贵的财富。对面命运，我要笑对人生，扬帆起航，走向未来！', '2015-04-19 19:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('490', 'U201411949', '陈雪梅', '电气与电子工程学院', '出生普通农民之家，清贫的成长环境造就了自己自力更生的本领。在校挣奖学金缓解家庭压力，高考后的暑假和大学期间利用兼职和家教等多重手段挣取部分学费和生活费，减轻父母的负担，虽出身平凡，但已经选择积极乐观的生活，热爱并勤于学习，真诚帮助他人，与人为善。用自己的努力谱写风雨历程，迎接阳光雨露。', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('491', 'U201311861', '程思远', '电气与电子工程学院', '生活是面镜子，我选择，让镜子里的我笑如桃花。任何人，任何事，纵有瑕疵，却总有它可爱的一面，于是，请相信，我对他们的微笑是认真的。人的一生，白驹过隙，我始终相信，人生短有它短的理由，我们注定要在这有限的时间里做出有意义的东西来，于是，固执地探索这意义，花的意义，树的意义，生命的意义，无生命的意义。笑对生活，对这个世界的人与事，满怀感恩与善意，不停的思索那不知为何会去思索的东西\n——这就是我，一个爱笑，爱想很多的女孩子，人如其名，我是程思远。', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('492', 'U201312081', '廖鹏毅', '电气与电子工程学院', '自立自强，他是搏击命运的斗士！执着追求，他是挑战自我的强者！\n贫寒的出身、高考的两度失利都不曾将他打倒！勤奋学习、申请助学贷款、参加勤工助学、考入实验班，他用坚韧的意志打破生活的桎梏！服务他人、奉献自己，他将自己的赤子之心融入每一个集体。在班里担任心理委员、副班长，帮同学排忧解难，参加迎新晚会、足球赛、篮球赛，带队参加“电峰对决”并获得冠军。在校会新闻部收获“最佳文字记者”的称号！他始终坚信优秀的个人离不开优秀的集体。\n饮水思源，热心公益。关爱老人、关注聋哑儿童、志愿献血、爱心义卖，参加国际中文项目并和交流生成为好朋友，带队进行“暑期留校学生调查”的社会实践获得“社会实践优秀个人”。他的内心始终澄明！', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('493', 'U201311995', '高国桢', '电气与电子工程学院', '进入大学以来，我一直秉持“明德厚学 求是创新”的校训，全身心投入到学习中，向同学、师兄请教、讨论、学习，取得了一个令自己满意的成绩，这些成绩的取得，离不开班主任常常教导我的那句话“不知道去哪的时候就去自习室”。同时积极参与各类活动，使自己全面发展。为提高自己的实践能力，自己在学院学生会的工作中积累了不少外联经验，在大一，通过自己的努力，在电气学院学生会换届晚会、电气学院院十大歌手比赛中，成功拉到了施耐德电气（中国）公司和菲尼克斯电气（中国）公司的赞助，在学生工作中踏实肯干，取得良好的口碑，成为电气学院学生会主席团助理。通过这些经历，使自己更好的接触社会，了解社会，并得到锻炼，增加实践经验。在思想方面，作为一名入党积极分子，我积极向党组织靠拢，不忘党训，以共产党员的要求严格要求自己。在生活中，朴素节俭、性格开朗，严以律己，宽以待人，乐于帮助同学。经常参与一些社会活动，形成了较好的组织管理理念和加强了自身的团队合作精神与社交能力。在科研实践方面，暑假在国家电网陕西省电力科学研究院实习，并参与电气强电磁工程与新技术国家重点实验室腾云博士的科研项目“弥散放电”，在科研实践中积累自己的经验。现在希望通过申请自强标兵来激励自己，像电气学院的老前辈一样吃苦耐劳，勇往直前，在将来的日子里继续奋发图强，为社会发展做出应有的贡献。', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('494', 'U201211707', '秦钰杰', '电气与电子工程学院', '1、自立自强，克服贫困。大学以做家教、办培训班、销售图书等方式挣取生活学习费用，还获得国家励志奖学金、优秀学生干部奖学金等，得以稳定学业的同时，还定期资助贫困山区的小学生。\n2、投身公益，富有爱心。作为队长创建“守望马吉米”公益项目，获得“省优”荣誉。在“湖北省大学生人道公益创意大赛”中以最年轻队伍的身份荣获“优胜奖”。\n3、耐心，细心，乐于服务。学院义工部部长、资委会主任，负责学院每年120多万社会奖学金的颁奖典礼和发放工作，组织同学开展各种志愿服务，学年平均工时达60多个。\n4、决心投身基层，为民服务。是华科4个通过湖北省首届“青年马克思主义者培养工程”选拔的同学之一，毕业志愿到基层乡镇工作。', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('495', 'U201211930', '叶剑宇', '电气与电子工程学院', '我相信阅读的力量，于是我从大一开始坚持阅读，到目前为止阅读课外书近百本配有详细的读书笔记；我相信优秀是一种习惯，坚持早睡早起，大学至今，8点前起床占到九成以上；我相信只要努力，就有收获，前两年加权78+，大三上加权89.2，计算机四级92分通过；我相信坚持可以击败命运，半年间，从170斤最低减至128斤，并维持至今。', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('496', 'U201212019', '易江', '电气与电子工程学院', '我是来自电气12级的易江，申报的是执着追求类自强标兵，站在舞台上歌唱是我从小的梦想。在我看来，音乐可以让人忘记烦恼，沉浸在我的小天地里；音乐可以让我放声歌唱，自信地屹立于舞台之上；音乐可以给我以鼓励，使生活更加富有激情。总之，音乐带给人的愉悦是做其他任何事情都无法替代的，为了这份愉悦我也一直坚持不懈地努力着，使自己的歌声被更多听到，让自己站上更大的舞台。我没有接受过任何专业的声乐培训，一开始只是模仿各种歌星的唱法，到后来慢慢地掌握了发声技巧，于是通过每天的刻苦练习使自己的演唱技巧逐渐提升，在这个过程中收获了快乐和感动，也取得了荣誉。2012年入校以来依次取得以下荣誉：进入华科达人秀决赛，入选大学生艺术团声乐队2013年：获得电气学院十大歌手冠军，获得新航道“唱响英文”大赛华科赛区季军，随队登上“同歌同行”毕业生晚会。2014年：获得华中科技大学校十大歌手称号。因为热爱所以执着追求，将歌唱进行到底就是我的宣言。', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('497', 'U201411648', '成纪昌', '能源与动力工程学院', '我叫成纪昌，来自核工1401班。在湖南的一个小县城长大，性格积极乐观，阳光开朗，自立自强。\n生活上，从小父母为我付出了很多，我十分希望能为他们分担。因此在寒暑假，我会抽空做一些临时工。去年暑假，在深圳的一个建筑工地上打工。这次经历让我体会到了父母工作的艰辛，也锻炼了自己。我知道自己做的和父母的付出相比是如此的微不足道，所以在以后的生活中更加会严格要求自己，勤俭节约。\n学习上，我一直用努力学习来激励自己。虽然学习并非一切，但却一定是十分重要的一部分。因此，在学习上我一直不敢懈怠。尽管在进入大学后，在学习之外多了许多事情，但我坚持在学好的基础上去完成其他的事情。上个学期，加权在本专业排名第三。在未来的学习上，我会更加刻苦，积极进取。\n志愿服务上，我组织参与了许多社会公益活动。在“听见你声音，艺萌听障儿童康复中心支教活动”中，帮助听障儿童练习发音，增加他们与外界的交流，打开心扉，还和他们一起度过了圣诞节。在“碧水社区义工”活动中，帮助社区居民清理社区，还协助碧水社区居委会宣传法制知识；在”爱心卖报“活动中，我们为患白血病的同学募捐，为云南鲁甸地震筹款。在”公德长征“活动中，我们为师生修理小电器。在这些活动，服务了社会，也进一步了解到社会需要每个人的付出。\n', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('498', 'U201411508', '乐倩利', '能源与动力工程学院', '我的家乡是一个将军县，也是一个国家贫困县--大悟。在红色而贫瘠的土地上长大的我，始终相信自强的力量，相信日复一日的努力才是促成人生的圆满的力量。小学四年级，年幼的我，看到了整个家庭在父亲下岗后的凋零与混乱，母亲告诉年幼的我两个字：“立志”。在并不富裕的日子里，我知道我不能选择我的初中，但是，我可以决定自己的高中。我用初中三年的时间实现了人生的第一个转折，以全县第一的中考成绩考入了孝感市最好的高中。在这样一所省重点高中，我凭借自己的努力成功的站上了“校长奖学金”的领奖台。然后，我来到了华科。对于出生乡村的我来说，大学是一个全新的挑战。刚刚过去的大一上学期，我的加权成绩班级排名第二。我加入了能源女篮，并在“新生杯”篮球赛中获得亚军，体育赛事是激烈而残酷的，自强的精神让我在艰苦的训练中一直没有放弃。我是校团委组织部的助理，团学联女生部的成员，也是班级的生活委员和组织委员，学生工作让我的生活忙碌而充实。我参加了Tpis志愿者项目，现在是一名来自乌干达的外国留学生的中文tutor.未来，继续做一个自强的女孩。不沉迷于过去，亦不狂热地期待未来，我知道，我所能做好的，只有现在。将来的你，一定会感激现在拼命的自己。', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('499', 'U201311499', '莫唐明', '能源与动力工程学院', '莫唐明，能源与动力工程学院13级，一个敢做敢拼的广西男孩，现任能源学院大学生科学技术协会副主席。\n从小酷爱机器人的我，有一个与众不同的梦想，渴望做出一台属于自己的高达。为了实现这个梦想，高中就利用业余时间参加机器人篮球比赛，并获广西赛区第二名 。大学刚入学之初，得知华中科技大学足球机器人团队招新，我就毫不犹豫的加入了这个充满激情并包含热血的团队 。从此，我将自己大部分周末和寒暑假时间贡献给了启明学院503，先后我学习了Creo， Matlab，C++等知识。每个寒假和暑假回家时间都不到2个星期，记得去年农历28才回家的我，楼管阿姨常常问我:孩子，你不想家吗？当是心中一把辛酸，但为了梦想，还是要坚持下去。我功夫不负有心人，经过万般努力，我们团队终于进入啦2015年Robocup国际公开赛，现在我们正全力以赴准备着这次比赛，为此，我们常调机器人经常到深夜 。过去一年，我还参加过节能减排大赛，智能车大赛，能源学院毕业选题网站，华中科技大学足球机器人团队主页等 …\n我还有一颗公益之心，大一一整年，利用周末时间到光谷参加地铁义工活动，风雨无阻。\n天行健君子以自强不息，我就是这么一个自强的男孩。\n', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('500', 'U201311401', '林轩毅', '能源与动力工程学院', '本人林轩毅，能源与动力工程学院热动1301班学生，来自广东汕头，热爱班集体，热爱学生工作，热爱公益事业，长期坚持各类志愿服务活动。\n    高考后，为帮助更多努力学习的贫困学生实现大学梦，与朋友租借场地进行义务培训，累计受益学生约50人。大一进入院团学联社会实践部，同时进入校学生会科技创新部，后科创撤部，进入国际交流部。2013年11月通过严格筛选成为晴川阁义务讲解员，并在2014年11月，作为团队唯一代表参加武汉电视台晴川阁专题节目录制。2014年7月至2014年8月，在埃及从事志愿服务6个星期，主要工作为在贫民窟教小孩英语。回国后，被校、院两级记者团和武大广播台采访，并被TED邀请作为演讲嘉宾分享相关经历。2014年9月，通过严格筛选成为校TPIS项目成员，辅导来自卢旺达的留学生Chris讲中文。2014年10月，加入华科创行团队，开发项目并担任项目经理，项目从环保酵素的研究入手，着力解决环保问题，并提高低收入群体生活水平。2015年4月，通过公开竞聘，被任命为校科协创新项目管理部副部长，希望未来通过挖掘更多优秀项目，为社会带来更多的积极影响！我自幼心地善良，热爱公益事业，高考后利用各种机会，坚持志愿服务，只为实现自己的社会价值，给社会带来更多的积极影响。\n', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('501', 'U201411605', '姚剑', '能源与动力工程学院', '我叫姚剑，是一名性格开朗，做事认真负责的人，有很强的上进心。在去年我顺利从党校结业并成为一名入党积极分子。我同时也是院科协技术部的一份子，在上学期组建了新能车队，参加了校智能车大赛并以初赛第三名的成绩晋级复赛。之后我便参加了电工电子科创基地的招新，做了一些小作品。 而在这学期我正着手策划一次Prezi讲座。抱着服务于能源学院14级同学们的心态，我成为了学生会学术部副部长，并参与策划了学科调查，单词竞赛，四六级模拟考等活动。除了一些学生工作外，我还热心参加义工活动。在上学期，我参加了爱心卖报，楼栋值班等活动，并在这学期创建了“一角公益会”团队参加了校义工部“我是策划人”义工活动策划大赛。之后我还竞选了第八届学生代表大会代表，提出了关于改革学科竞赛队伍组成和新生团队扶持计划的提案。我的最后一个身份是新能源1401班的团支书，而我们班级得到了校二十佳，并在积极准备校十佳，而我也获得了优秀团干的称号。之后，我作为总负责人向学校申请了社区之家文化活动，并得到了审批，而我们班级也被很荣幸地评选为“活力”团支部。再来说说成绩方面，我上学期加权88.79，位列年级第20名，并获得新生自强奖学金。而且就在最近的答辩中获得院自强标兵称号。', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('502', 'U201411608', '易磊', '能源与动力工程学院', '我是来自能源与动力工程学院新能源1401班的易磊，目前在班级中担任科创委员。生活中，我是一个比较务实，乐观的人，对于自己决定的事，总是会尽力把它做好，精益求精。因为家里条件不是很好，父母挣钱也很不易，我从小就学着为家里分担一些事，这也使我更加自立自强。\n从初中到高中，我一直很努力地学习，期间每学期都获得了学校的奖学金，获得过“市三好学生”，“省优秀学生”等荣誉称号，高三时参加全国高中生物理竞赛，获得了省二等奖。来到大学后，我依然没有懈怠，不断努力，期末加权成绩为年级第二。学习之外，我还参加了能源学院大学生科协会，研究生科学精神与实践讲座协会等组织，希望能在集体中奉献自己的力量，学习到更多。怀着对科学与技术的热爱，大一上学期我和同学组队参加了智能车大赛，获得了小组第三名的成绩。此后又参加了启明学院电工电子创新基地的招新，最终成功通过考核。这个学期，我申请了学校的勤工助学岗位，希望通过自己的劳动来赚取一些生活费，此外，还参与策划了特色团日，学院讲座等活动。\n我认为一个人的品质是通过外在磨练和内在要求实现的，两者缺一不可。虽然现在的我还有很多的地方需要提高，但是我想说的是，我会一直以自强要求自己，不断前行。\n', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('503', 'U201210205', '王光强', '物理学院', '我家住农村，家里特别贫困，尤其是上个学期，家里给的生活费已经是最大能力了，为了给家里减轻负担，我在学校担任兼职，在校外担任某培训机构的兼职老师，除此之外，我还是公司的校园大使，发过传单，贴过海报，办过宣讲会等等等等，还会给周围的同学介绍兼职，虽然特别累特别辛苦，但是我可以减轻家里的负担，我觉得跟高兴很自豪，并资助过一名青海高中生；\n我在上学期时参加了创青春大赛的演出志愿者，无论是开幕式还是闭幕式的所有舞蹈节目都有我的身影，志愿服务数百小时，虽然特别辛苦，但是向全国高校展现了我们华科的风采，我觉得很值得；\n作为院科协主席，负责了上过新闻联播的午餐交流会等大大小小很多活动，成立了院里的读书会，尽心竭力的服务同学；\n作为华科校队队长带队参加全国大学生物理学术竞赛，大学期间拿过的各种奖项达数十个。\n', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('504', 'U201310256', '方毓鸿', '物理学院', '本人来自一个偏僻落后的农村家庭，自小家境贫困。父母年事已高，接近60岁。父亲在家务农，母亲因病丧失劳动能力。家庭人口多，四个大学生，其中二个在读，二个刚毕业不久。家庭经济压力极大。\n本人从小就比较懂事，认真学习，成绩优异，获得学校奖励资助，并通过努力取得全免生资格，自己独立完成学业。\n大一时，家里同时有三个人上大学，家庭负担很重。自己便通过假期、周末进行家教，大一开始学费生活费都是由自己独立支付，从没向家里要过一分钱。不仅如此，大一下还向家里寄钱。\n我在自立自强的同时，依旧坚持物理梦想，努力学习，没有因做兼职而耽误。上学期加权93.46， 年级排名第二。同时，自己通过努力进入了学院天体物理团队雷老师课题组，还申请了一个高能天体物理的大创项目。\n我坚持着自己的梦想直到现在，从没有因为贫困而放弃过。我相信，贫困绝对不是放弃自我的理由，而是鞭笞自己积极进取的动力。\n', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('505', 'U201310217', '姜葛星', '物理学院', '我热爱探险、热心公益，积极参加学生工作。\n在大一暑假独行西藏，负重40来斤，经历26天，露宿野外、广场，借宿寺庙、藏民家、青旅，搭过警车、军车，共徒步了300多公里，遇到过塌方、暴雨，和各式各样的人组过队，承受着高反的冲击，在全然陌生的环境下旅行。\n曾反穿过墨脱（世界级的、中国第一的徒步线路）。脚陷泥沼，被蚂蟥咬伤，溯溪，攀岩，过冰川，过雪山。在穿越时脑膜炎前后复发6次，险死于海拔4000雪山上，依靠队友才挺过去。最后从海拔600的起点反穿到海拔4400的终点。\n担任户外运动课助教、担任利川古河床探险压队，负责全队的安全；八分山野营、九峰山野营、参加数次8公里长跑。\n我在大一、大二都组织了院内非盈利性教材团购，总计参与人数214人次；高二获得了红十字会初级急救员证，曾在火车上进行过协助治疗；数次参加无偿献血；数次参加美丽中国华科站的献爱心活动；大一曾任物理学院学生会主席助理、院联络部副部，并活跃于社联，数次策划活动，拉赞助，搞外联；社团节策划大赛任组长获5/21；大二在物理实验创新基地策划两次CUPT物理竞赛。\n愿我等自强不息，阖棺而止。\n', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('506', 'U201410206', '王斌', '物理学院', '我是物理学实验班1401班的王斌，来自山东省的沂蒙山区，家里经济条件十分困难，还有一个弟弟在上二年级，但只有父亲一个劳动力，靠做建筑工的微薄收入养活着全家人。我的母亲患心脏病多年，不幸在我读高一时去世了。所以我我习惯了独立地完成自己的事情，像整理东西、洗衣服、规划开支，还有自己一人从山东来到武汉等。高中毕业后我因为高考成绩优异，家庭条件差，得到了县里和市里多方资助，另外还通过做家教赚了一些钱。利用这些钱还有在华科得到的助学金，我解决了大一以来的所有费用，为家里减轻了很大负担。在大学的半年多时间里，我作为院学生会的一员积极参与了许多活动的组织，另外还参加了学院足球队、辩论队等社团，以及一些义工工作，像爱心宿舍、爱心卖报等。大一下学期，我申请了勤工岗位，希望利用自己赚的工资，减轻家里的负担，同时也做一些自己想做的事。既然自己选择了未来的路，就要努力地自己走下去！', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('507', 'U201410487', '彭菲', '化学与化工学院', '我是笨小孩彭菲，来自临八1402班，我的兴趣是吃，爱好是睡，人生格言是人是铁，饭是钢，一顿不吃饿得慌。\n任何没有打到你的事情都会让你更强大。我有一段催泪的过去，那段岁月没有打到我，它不仅让我更强大，更让我懂得了苍天无情，人间有爱。\n小学时，父亲患有尿毒症，漫长的透析生活后，进行了肾移植手术，父亲的隔离期还没有结束，母亲患上淋巴肿瘤，母亲术后三年，因手术后遗症，突犯心脏病晕倒。又进行了第二次手术。\n我带着弟弟，在亲人、邻居、社会的帮助下生活，一边照顾父母，一边认真学习。我从小便励志做一名医生，即使家中唯一的房产都被抵押，我也没有放弃我与弟弟的学业。\n因家中突遭变故，高考严重失利，为了医学梦，我执意选择了复习。为了有更多的时间学习，以为了省下路费，一年中，我只在过年的时候回过一次家。天道酬勤，我成为了一名医学生。\n那颠簸的一路上，我一直用乐观的心态在面对，相信雨后便是彩虹，我做过家教，办过补习班，摆过地摊，做过小时工，当过服务员，我不仅没有用家里面的钱，还承担了弟弟的生活费。高考后，组织慈善七夕节，用这个象征着爱的节日来回报社会上那些陌生人对我们的爱。\n笨小孩也有梦，以努力做双翼，以关爱作动力，以梦想为方向，带着爱飞翔，再难再险不放弃。\n', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('508', 'U201410301', '黄路', '化学与化工学院', '生活在一个偏僻的大山里，8岁时就失去了幸福美满的家庭，之后一直跟随年迈的爷爷奶奶和大伯一起生活。爷爷患有残疾，手脚不方便。奶奶患有骨质增生，常需药物治疗。大伯单身，没有文化，也没有稳定工作，每天帮别人装车卸货挣点生活费，一边供我读书，一边维持家庭生计。家庭是农村低保户。我从小就自己洗衣服，自己做饭，在家帮爷爷奶奶做家务，和大伯一起上山捡柴。经历5.12地震，家庭因重建负债累累，我的初中是在一位爱心人士的资助下度过的。正因为这样，我更加努力，以优异的成绩考入本地高中，并免去三年的学费。高中毕业，又以学校理科生文考成绩第一名了获得18000元的奖助学金。暑假进厂打过工，并申请了国家生源地贷款，在大学，发过传单，现在正在做家教和代理，以此来减轻家庭负担。学习认真刻苦，积极参加各项活动，上学期参加院系乒乓球比赛、校运动会。在班上担任宣传委员，积极负责班级事务，组织班级活动， 在大一上学期被评为入党积极分子。此外，我也参加了许多公益活动，像“马路天使”活动、爱心社区活动、关注艾滋病活动以及植物园义工活动。生活中勤俭节约，乐于助人，积极乐观，拼搏努力，并始终坚信：三分天注定，七分靠打拼，爱拼才会赢！', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('509', 'U201310387', '郭志亮', '化学与化工学院', '在上大学后，热爱上以前从没有参加过的志愿服务。爱心买报，去爱心病房，2014届毕业典礼志愿者，迎新志愿者，大学开放日志愿者，创青春志愿者，地铁义工。其中在坚持做地铁义工一年后，因为表现优秀评为优秀义工称号。也多次参加义务献血，一次成分献血，五次成分献血，共计1400毫升。\n在班级内担任班长，去年我们雷锋月活动作为总负责人和我们班同学共同努力获得校第三的成绩，时至今日，我们仍然和帮助过的老人时常联系。暑假和队友一起前往宜昌做关于三峡移民问题调查的社会实践，并担任队长，在此次社会实践之后，我开始关注法律，并选择了法学双学位。在担任班长期间，通过全班同学的共同努力，我们班获得优良学风班称号。在学生工作中作为总负责人举办过我们学院的五四演讲比赛。参加过我们学院举办的为期一学期的精英训练营活动，其中担任队长并获得最佳组织奖。\n今年寒假时间，自行设计问卷调查表，独自在我们村（甘肃）做了一个关于农村基本情况的调查，以增强对自己家乡基本情况的认识，并希望能有所改变我们村相比旁边的其他村比较落后的面貌。\n在参加各种志愿服务和做学生工作之时并没有放松自己的学习，学习成绩从上一个学期的专业18名提升到现在的12名（本专业总共63人）\n自强宣言：宠辱不惊，去留无意。\n', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('510', 'U201410573', '谢悌', '化学与化工学院', '我来自农村，家境本就贫寒，数年前父亲双目失明，整日在家，生活需人照料。母亲没读过书只能靠务农撑起整个家庭，由于常年劳累积劳成疾。哥哥被迫中途退学把唯一的学习机会留给了我！去了外地打工。\n虽然家境贫寒，但是我性格外向乐观，活泼开朗，对生活充满了热情。\n俗话说穷人的孩子早当家，我从小就很懂事，在家里干各种家务，放学后回来做饭，扫地。学校里也表现优秀，学习刻苦成绩优秀，从小就一直担任班长。高中时一个人在另一个城市读书，很少回家。\n高三时班里转来一位双腿截肢的女生，那时我们教师在四楼，我帮她抬轮椅，每天上下六次，还帮她补习功课，坚持了一年。\n高考后为了给家里缓解经济压力，我去工地提过灰桶，复印自己的笔记拿去卖，摆过地摊卖旧书，做家教，两个月的奔波里我赚得了大学第一年的报名费和上学期的生活费。\n到了大学，我更是严格要求自己，担任了班长，积极参与学生工作，我加入了两个校级组织，社联和咨委会，在部门工作里均表现优秀。被评为优秀团员，成为入党积极分子。上学期献过血，这学期担任地铁义工的负责人。并一直勤工俭学，在外做家教兼职，加入了学校的we do创业团队。\n我一直坚信是变得优秀的强烈愿望使得我精力充沛，希望通过自己的努力变得自立自强自信！\n', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('511', 'U201310285', '刘俊杰', '化学与化工学院', '家庭一系列的变故没有让我放弃对理想的坚持，生活的困难没有折断我梦想的翅膀，没有那波澜起伏，又怎会有白浪滔天。\n要想壮志凌云，须先脚踏实地！\n学习上面执着追求，大一学年专业排名前10%，获得了包括学习优秀奖学金、国家励志奖学金在内的四项奖学金。\n在科研上坚持了一年，大一下开始准备电化学，大一暑假在实验室做钙铁包芯线中钙单质的定量测定，实验上探索新方法，从理论上优化了由理想气体状态方程计算而产生读数误差大的问题！改善了部分条件；目前做PAEs（塑化剂）在功能化TiO2纳米管上的光电催化降解研究（获批院级项目，任项目负责人），已完成纳米管的制备，目前正着手解决DEHP溶解度极小的难题（国内外研究者通常利用高档仪器来弥补溶解度小的缺陷），已查阅论文三十余篇，尝试助溶十余次，虽未解决，但我们仍在坚持！（该项目前后准备时间超过5个月）\n生活上我能做到自强自立，从高三毕业开始共做了五份家教，一份兼职，再加上一些奖助学金，基本能解决生活问题，生活上面能够自理，上大学以来已经做到了经济和生活上面俺的独立！\n', '0000-00-00 00:00:00', '0');
INSERT INTO `zqbb_candidate_2015` VALUES ('512', 'U201210012', '胡建宇', '应用数学', '出生在贫困家庭的孩子总是渴望自己快点长大，多承担一些责任，为家里分担一些负担。记得刚上大学时，就对自己承诺，我的大学不应该再花父母一分钱，于是我开始了艰难的经济独立之路。一上大一，我就迅速找了两份家教，每周末去给别人补课，除了家教之外，我还做过勤工助学，也卖过饮料，学期末拿到的奖学金也用作我的生活费。此外，我还保持简朴的生活作风，养成良好的生活习惯，平时不胡乱花钱，就这样，我一路走到了现在。“生活独立”简单的四个字，背后却是坚定的信念和辛苦的汗水。\n虽然兼职占用了我很多时间，但在学习上我也没丝毫松懈，而是勤奋刻苦，有效利用自己时间，在大一大二获过自强奖学金和国励奖学金，平时也积极参与公益活动，做过校外辅导员，给武汉一些较为贫困的中小学讲过课，也参加过热血小分队，义务帮助别人献血，等等。此外我还参加了很多比赛，获得过大学生数学建模国赛二等奖，华中赛二等奖，ACM编程比赛三等奖，科技创新优秀个人等荣誉，荣誉只是对我能力的肯定，更多的是，我懂得了团队合作，学会了坚持，变得更加坚韧，不论再辛苦的事，自己一定能够坚持下去。现在我跟着老师在做项目，钻研了一些文献，很多都艰涩难懂，但我没有畏惧，一点一点地克服，坚持看了下来，希望能够做出一点成绩。\n', '0000-00-00 00:00:00', '0');
